INSERT INTO `schools` (`schoolId`, `fax_no`, `gifted_ind`, `mothertongue3_code`, `fifth_vp_name`, `postal_code`, `type_code`, `second_vp_name`, `first_vp_name`, `mainlevel_code`, `email_address`, `sap_ind`, `cluster_code`, `telephone_no_2`, `philosophy_culture_ethos`, `mrt_desc`, `bus_desc`, `third_vp_name`, `telephone_no`, `ip_ind`, `special_sdp_offered`, `principal_name`, `mothertongue1_code`, `nature_code`, `visionstatement_desc`, `fourth_vp_name`, `missionstatement_desc`, `autonomous_ind`, `session_code`, `school_name`, `dgp_code`, `address`, `mothertongue2_code`, `fax_no_2`, `zone_code`, `_id`, `url_address`) VALUES
(1, '64684535', 'No', 'Tamil', 'na', '288913', 'GOVERNMENT SCHOOL', 'MR LIM WEE JAMES', 'MR LIONG HUAI YU', 'MIXED LEVEL', 'NJC@MOE.EDU.SG', 'No', 'SOUTH 3', 'na', 'We seek to create a joyful and lively learning community for students and staff. Every NJCian will leave with a distinctive and memorable experience. They will learn to serve with honour, to be loyal to family and Singapore, to be leaders sensitive to the needs of others, and to be creative in their approach to solving problems. They would have imbibed the values of civility, altruism, resilience and enterprise.', 'BOTANIC GARDENS MRT, TAN KAH KEE MRT, SIXTH AVENUE MRT', '151, 154, 156, 157, 170, 170X, 171, 174, 66, 67, 67A, 67W, 74, 852, 961, 961C', 'MR ZAINAL ABIDIN BIN MAHMOOD', '64661144', 'Yes', 'For the Integrated Programme (Junior High), we offer Language Arts (English & Literature), Chemistry, Physics, Biology, Governance & Society, Mathematics (both E and A Maths), History, Geography, Higher Mother Tongue and Mother Tongue for the first 4 years, as well as Integrated Sciences, Thinking, and General Arts Programme (Art and Music) for the first 2 years. Advanced Language Arts, Advanced Humanities and Man & Ideas are also offered to capable students at JH3 & JH4. The College offers a wide range of special programmes in various domains. They are: SPIRE (Special Programme in Inquiry and Research), Research@NJC, Accelerated Mathematics, Advanced Sciences, Art Elective Programme (AEP), NJC Music Programme, Enhanced Boarding Programme, Cultural Mapping-On-The-Move, Leadership,  Values In Action and Guidance Programmes, Humanities Scholarship Programme, Sapphire Scholars Programme and International Programmes.  Students may also offer a Third Language outside of College. Junior High 1 students undergo a special CCA programme known as CAFE. CCAs offered for Junior High are basketball, canoeing, shooting, softball, squash, track and field, Chinese orchestra, Chinese dance, choir, guitar ensemble, Indian dance, Malay dance, string orchestra, symphonic band and Western dance. Students may also join any CCA under the Talent Management Scheme.  Note that H1, H2 and H3 subjects listed are only offered at Senior High (JC years).', 'MR ANG POW CHEW', 'Chinese', 'CO-ED SCHOOL', 'NJCian\'s demonstrate Loyalty with Integrity; Scholarship with Creativity; Leadership with Sensitivit', 'na', 'College of the Nation: Home of Scholars and Leaders who Serve with Honour', 'No', 'FULL DAY', 'NATIONAL JUNIOR COLLEGE', 'BUKIT TIMAH', '37 HILLCREST ROAD', 'Malay', 'na', 'SOUTH', '1', 'www.nationaljc.moe.edu.sg'),
(2, '64428762', 'No', 'Tamil', 'na', '469278', 'GOVERNMENT SCHOOL', 'MR FOO JUNG HIN SIMON', 'MDM TAN KIA HUAN', 'MIXED LEVEL', 'TEMASEK_JC@MOE.EDU.SG', 'No', 'EAST 2', 'na', 'Set in sprawling grounds recalling a gracious time past, at TJC our feet are firmly planted on the ground but our arms stretch to the sky. Every TJCian is nurtured to be a trailblazer with a heart for we believe that with sound values, we can steer steadfastly and stay true to our course. Mindful of tradition, roused by imagination and fuelled by ambition, TJCians strive to be active learners, caring and committed citizens and ethical leaders. Our motto we proudly serve is, For College, For Nation.', 'BEDOK MRT', '12, 16, 31, 38, 47, 196, 197, 229', 'MR MARK CHAN', '64428066', 'Yes', 'The Temasek Junior College 6-Year Integrated Programme provides a seamless progression of learning, empowering students beyond the basics by exposing them to both breadth and depth, leading up to the GCE A-Level Examination in Year 6. The design of the 6-year IP curriculum supports integrative and interdisciplinary learning, extending \'Beyond Basics\' through the core curriculum, \'Beyond Boundaries\' through extended learning and \'Beyond Self\' through student development. It aims at \'Temasek Excellence\', engendering in students greatness in intellect, character and leadership. At TJC IP, students have a plethora of programmes to whet their appetites on. There are signature IP programmes crafted by our school such as Temasek Academy Unbound (Stretch Programme for Science and Humanities students), Wonder.Observe.Weave! attachment, World without Borders, Temasek Stewardship Programme, and Temasek Student Leadership Congress. In addition, there are MOE Elective Programmes - Music Elective Programme (Year 1 to 6), Chinese Language Elective Programme (Year 3 to 6) and Humanities Programme (Year 5 and 6). All TJC IP students will be holistically developed, going forth to green the world. (Please refer to our website for information on Scholarships and Financial Assistance.)', 'MDM SIM AY NAR', 'Chinese', 'CO-ED SCHOOL', 'An Institute of Distinction, A Dynamic Learning Culture,  A Caring TJC Family', 'na', 'Broaden Minds, Touch Hearts, Enrich Lives', 'No', 'FULL DAY', 'TEMASEK JUNIOR COLLEGE', 'BEDOK', '22 BEDOK SOUTH ROAD', 'Malay', 'na', 'EAST', '2', 'http://temasekjc.moe.edu.sg/'),
(3, '65624505', 'No', 'Tamil', 'na', '649809', 'GOVERNMENT SCHOOL', 'MDM LIM WAI PING PATRICIA', 'MR WONG TIEN CHIEH, GLENN', 'JUNIOR COLLEGE', 'jjc@moe.edu.sg', 'No', 'WEST 6', 'na', 'na', 'Lakeside, Boon Lay', '99, 157, 185, 198, 507, NR5, 502, 625, 174, 174M', 'MR CHUA KAH SHENG', '65624611', 'No', '1. Experiential Learning Programmes (ELP) 2. Entrepreneurship 3. Interest Development Programme', 'DR HANG KIM HOO', 'Chinese', 'CO-ED SCHOOL', 'College of Choice, Education of Value', 'MISS THIEN KIEN SAN SHARON', 'Nurturing confident leaders with a global outlook, developing leaders of character with a heart to s', 'No', 'FULL DAY', 'JURONG JUNIOR COLLEGE', 'JURONG WEST', '800 CORPORATION ROAD', 'Malay', 'na', 'WEST', '3', 'http://www.jurongjc.moe.edu.sg'),
