(27, '64831102', 'Yes', 'Tamil', 'na', '555855', 'GOVERNMENT SCHOOL', 'MR CHAN WENG YEW MARVIN', 'MISS HO HWEE MEIN, STELLA', 'PRIMARY', 'rosyth_sch@moe.edu.sg', 'No', 'NORTH 1', 'na', 'Rosythians are grounded in the I-CARE values as we develop our strengths and competencies to be \'Ready to Serve\'.   We aspire to Learn with Passion, Serve with Compassion and Lead with Vision.', 'Ang Mo Kio, Serangoon', '73, 315, 116', 'MR LOH YUH POR', '64812273', 'No', 'The school offers distinctive programmes in the areas of Science and the Aesthetics.  Under the auspices of the Applied Learning Programme (ALP) and Learning for Life Programme (LLP), students go through level-wide activities to broaden their learning in the two focused areas.  Those with the aptitude or interest may also progress to our customized activities for more in-depth learning.  In the area of Science, for instance, students go through a range of activities from life-sciences, use of customized gadgets to investigate scientific concepts, to the application of theories in the design of toys.  Platforms have also been provided for students to apply their learning in the creation of toys/artefacts using science concepts, which are subsequently sold to raise funds for selected beneficiaries.    With regard to the development of Aesthetics, students are exposed to voice-training, dance, playing of musical instruments, to the use of ICT for manga art and 2D animations.  Through the programme, students are exposed to an array of alternative platforms to express their thoughts and ideas.  It is hoped that through the wide range of offerings and the strong foundation that is laid, Rosythians will acquire a broad and deep foundation for a lifelong and life-deep learning.', 'MDM ELIS TAN LEE CHING', 'Chinese', 'CO-ED SCHOOL', 'The School of Tomorrow, Today', 'na', 'Maximizing potential through the development of mind, body and soul', 'No', 'SINGLE SESSION', 'ROSYTH SCHOOL', 'SERANGOON', '21 SERANGOON NORTH AVENUE 4', 'Malay', 'na', 'NORTH', '26', 'http://www.rosyth.moe.edu.sg'),
