(41, '63675516', 'No', 'Tamil', 'na', '739067', 'GOVERNMENT SCHOOL', 'MDM TAN AI CHOO', 'MISS KUCK LI LIAN LILLIAN', 'PRIMARY', 'SLPS@MOE.EDU.SG', 'No', 'NORTH 7', 'na', 'Our schools name in Chinese, depicts a garden where scholars bloom. We strive to provide a unique and rigorous education to maximise the potential of each pupil, so that each of them will become a scholar in their own right. Besides the cognitive domain, the school embraces the arts, music, sports, and other pursuits so that pupils can broaden their interests and develop their talents. The schools strength in environment education enables pupils to build critical thinking and problem solving skills, at the same time develop an awareness and appreciation for the environment. The school also places strong emphasis on values education, as well as leadership development. We have developed comprehensive Values Education and Leadership Development Programmes which inculcate the values and competencies desired of our pupils, so that they become concerned citizens who make a positive difference to the community.  With the nurturing leadership and guidance of our School Leaders and teachers, th', 'Woodlands', '912 from Woodlands Interchange', 'na', '62698832', 'No', 'Our Applied Learning Programme (ALP), Environmental Science Programme (ESP), provides pupils with opportunities to apply science knowledge, processes and attitudes acquired from science lessons in real-life environmental issues, allowing their learning to be relevant, meaningful and enjoyable. Stakeholders are roped in to enhance pupils# learning experiences, as well as provide opportunities for pupils to gain more exposure.  The ESP adopts the 3H approach which covers 3 key developmental domains # HEAD (knowledge & skills acquisition), HEART (values acquisition) and HANDS (participation & contribution). The programme aims to develop pupils to continuously use concepts, skills and processes to inquire into phenomena related to the environment, think creatively and critically in solving environmental problems, and have strong conviction in bettering the environment. Pupils with greater aptitude and interest are given opportunities to lead their peers in community involvement activities, as well as conduct sharing to create awareness on environment conservation. This is in line with the Schools Vision to develop every Si Ling Pupil into a Scholar who Leads and Serves.', 'MR LIM CHEW HIONG RICHARD', 'Chinese', 'CO-ED SCHOOL', 'Every Si Ling Pupil a Scholar who Leads and Serves', 'na', 'We, in partnership with all our stakeholders, are committed to nurture our pupils to be thinking lea', 'No', 'DOUBLE SESSION', 'SI LING PRIMARY SCHOOL', 'WOODLANDS', '61 WOODLANDS AVENUE 1', 'Malay', 'na', 'NORTH', '40', 'http://www.silingpri.moe.edu.sg'),
