(96, '67945084', 'No', 'na', 'na', '649188', 'GOVERNMENT SCHOOL', 'MR CHIN HONG FAI HUMPHREY', 'MISS TRACY TAN I- LIAN', 'PRIMARY', 'westwood_ps@moe.edu.sg', 'No', 'WEST 8', 'na', 'Westwood Primary was founded in 2013, premised on the core philosophy of Positive Education.  Our overarching goal is for our staff and pupils to strive for both excellence and wellbeing, and for our school community to thrive and flourish.  Learning is delivered with positive engagement so as to invite every pupil on a journey of discovery and holistic development.  Discipline is promoted in a respectful way to engender self-reflection and growth.  By emphasising positive motivation and affirmative attitudes, we nurture an awareness of greatness and potential in each and every staff and pupil, as they set personalised goals and ultimately demonstrate creative expression, problem-solving, and meaningful achievement.    In keeping with the philosophy of Positive Education, Westwood Primary\'s Staff Belief is that Every One is a Talented and Unique Individual with Potential for Success. Our Westwood School Culture is one of care, love and drive, and we aspire in going the extra mile in ev', 'Boon Lay MRT Station', '181, 502 & 243', 'na', '64121690', 'No', 'Aligned with positive education, our student development programmes serve to develop our pupils\' resilience and  promote an understanding of his or her own strengths.  We also focus on optimism and on the importance of doing social good.  Accordingly, our signature school programmes are as follows:   Applied Learning Programme (Positive Design & Innovation):  With inter-disciplinary project work as a platform, pupils learn about the principles of positive design and thinking protocols, and explore how their ideas and observations can be turned into useful designs and solutions that benefit their peers and their community.   Learning for Life Programme (Student Leadership & Community Service): Throughout their time in Westwood Primary, every child is given an opportunity for leadership, and comprehensive training and mentoring is provided to support each child is their leadership journey. Westwoodians are also given many opportunities to give back to their community via class-wide and level-wide programmes.   Holistic Learning, Assessment and Reporting: Westwood Primary has adopted a whole-school approach towards holistic assessment, aligning PERI-HA practices with its founding philosophy of Positive Education. Formative Assessment (FA) practices are adopted in all classrooms, so as to promote learner engagement and ensure every child has a voice. Positive questioning and process praise help children to focus on the process of learning.  Westwood Primary also engages parents in Holistic Assessment, via the annual Teacher-Parent-Pupil Conference, where pupils share what and how they have learnt with their parents, prompting authentic discussions that involve each child in personalised learning.   Programme for Active Learning (PAL) for Lower Primary Pupils:  Our PAL Framework is guided by VIP principles, with the programme being Values-Driven, Incorporating Innovative Learning and being Positive-Education-focused.', 'MR NG YEOW LING', 'Chinese', 'CO-ED SCHOOL', 'A positive institution in Jurong West that inspires the community to lead meaningful and engaged liv', 'na', 'To provide positive education that nurtures thriving teachers and flourishing pupils', 'No', 'SINGLE SESSION', 'WESTWOOD PRIMARY SCHOOL', 'JURONG WEST', '1 JURONG WEST STREET 73', 'Malay', 'na', 'WEST', '95', 'http://www.westwoodpri.moe.edu.sg'),
