(101, '+65 63153351', 'No', 'Tamil', 'na', '544799', 'GOVERNMENT SCHOOL', 'MR CHAN SOON HUA', 'MDM JAYANTHI D/O RETNAM', 'PRIMARY', 'springdale_ps@moe.edu.sg', 'No', 'EAST 3', 'na', 'The school programmes are guided by our education philosophy of Play.Passion.Purpose (3Ps). Every child is encouraged to explore and discover new knowledge through experiential and authentic learning. Through such creative Play, students make sense of the things around them, discover the joy of learning and develop a spirit of inquiry and intellectual curiosity. The drive to go deeper into the discipline evolves naturally as students develop a Passion for what they are learning. Appreciating and applying what they have learnt, this would kindle within them a sense of Purpose and over time, spur them on to make a difference in their future pursuits.  Our GREAT ethos of Growth, Radiance, Empathy, Abundance and Truth guides the school in its culture-building process.', 'Nearest MRT station: - Sengkang MRT (NE16) *10-15 mins walk from MRT station', 'Nearest Bus Stop Opposite Blk 317B: - Bus 85 (from Punggol Temp Int) - Bus 372 (from Sengkang Int) *', 'na', '+65 63157600', 'No', 'The school is embarking on the Applied Learning Programme (ALP) from 2015. The emphasis of the programme is dual-prong; with teaching and learning using integrated curriculum (across and/or within disciplines) and within authentic and meaningful contexts. Opportunities are given to all students to engage in out-of-door learning experiences throughout their primary school years. The programme will revolve around 3 recurring strands of the Eco-Trail, Outdoor Education and Learning Journey.', 'MDM KOH SIEW CHENG', 'Chinese', 'CO-ED SCHOOL', 'Every Springdalite is a Secure Individual, a Leader of Self-worth and a Significant Citizen.', 'na', 'To engage young minds, mould their character and equip them for the future.', 'No', 'SINGLE SESSION', 'SPRINGDALE PRIMARY SCHOOL', 'SENG KANG', '71 ANCHORVALE LINK', 'Malay', 'na', 'EAST', '99', 'http://www.springdalepri.moe.edu.sg/');
