(105, '62485409', 'No', 'Tamil', 'na', '159016', 'GOVERNMENT SCHOOL', 'MDM NORAINI BTE MANSOOR', 'MISS CHAN YAN HOON', 'PRIMARY', 'alexandra_ps@moe.edu.sg', 'No', 'SOUTH 4', 'na', 'Every child matters, is unique, and has the potential to make a difference.   Every staff member is an asset, has different strengths, and wants to contribute. Every parent and community partner is a valuable contributor in nurturing the child to G.L.O.W.', 'Redhill Station  Tiong Bahru Station', '51, 139, 186, 970.', 'na', '62485400', 'No', 'Cultural Intelligence (CQ) Environmental Education', 'MDM CHEW BEE LAY', 'Chinese', 'CO-ED SCHOOL', 'Reflective Learner, Empathic Designer and Inspiring Leader.', 'na', 'We create a caring, safe and stimulating school environment where each child can grow and glow.  We ', 'No', 'SINGLE SESSION', 'ALEXANDRA PRIMARY SCHOOL', 'BUKIT MERAH', '2A PRINCE CHARLES CRESCENT', 'Malay', 'na', 'SOUTH', '103', 'http://alexandrapri.moe.edu.sg'),
