(107, '67845293', 'No', 'Tamil', 'na', '529366', 'GOVERNMENT SCHOOL', 'MR BHIMBAHADUR GURUNG', 'MRS SELINA LEE', 'PRIMARY', 'angsana_pri@moe.edu.sg', 'No', 'EAST 3', 'na', 'Angsana Primary School provides a safe, nurturing environment for our pupils.  Our school delivers a comprehensive curriculum that prepares our pupils for future challenges with a strong foundation in literacy and numeracy.  We guide our pupils to express themselves through language, visual and performing arts, and physical activities that are challenging and engaging.    We take pride in running a comprehensive Character Education programme.  Through fun and innovative lessons, pupils learn good moral values and develop positive traits that will empower them to make sound decisions in life, and to be nurtured into responsible and upright citizens.  Here we set the stage for lifelong learning. Our staff will give emphasis to the development of competencies that will be essential for the pupils to thrive and succeed.  Angsana Primary School focuses not only on how well our teachers are teaching but also on how well our pupils are learning.  We seek to ignite our pupils\' passion for lear', 'Tampines and Simei Stations', 'Bus Service 8, 17, 18, 28, 34, 39, 59, 518, Feeder Bus Service 292', 'na', '67830427', 'No', 'Arts Alive at Angsana, Beyond Boundaries, Character Counts, Programme for Active Learning (PAL), Learning Support Programme for English and Mathematics, Reading Remediation Programme (RRP), School-based Dyslexia Programme (SDR),', 'MISS FOONG YIN WEI', 'Chinese', 'CO-ED SCHOOL', 'Confident Leaders, Active Citizens', 'na', 'To Engage and Empower all pupils to be future-ready and to go above and beyond to care, learn and se', 'No', 'SINGLE SESSION', 'ANGSANA PRIMARY SCHOOL', 'TAMPINES', '3 TAMPINES STREET 22', 'Malay', 'na', 'EAST', '105', 'www.angsanapri.moe.edu.sg'),
(108, '63857261', 'No', 'Tamil', 'na', '828674', 'GOVERNMENT SCHOOL', 'na', 'MISS THIA HWEI LING SHARON', 'PRIMARY', 'punggolcove_ps@moe.edu.sg', 'No', 'EAST 1', 'na', 'Motto: To Serve To Lead', 'Nibong LRT Station', 'na', 'na', '63857339', 'No', 'na', 'MR YAP SWEE BENG, DENNIS', 'Chinese', 'CO-ED SCHOOL', 'Every student an educated child and contributing citizen, ready to serve and lead.', 'na', 'Nurturing the Whole Child, Growing Future Leaders', 'No', 'SINGLE SESSION', 'PUNGGOL COVE PRIMARY SCHOOL', 'PUNGGOL', '52 SUMANG WALK', 'Malay', 'na', 'EAST', '106', 'http://www.punggolcovepri.moe.edu.sg/'),
(109, '6320 9856', 'No', 'na', 'na', '828716', 'GOVERNMENT SCHOOL', 'na', 'MR NG BUCK CHWEE', 'PRIMARY', 'oasis_ps@moe.edu.sg', 'No', 'EAST 3', 'na', 'SHINE@OASIS Like the northern star, our staff and students are strongly grounded on R3ICH values. Guided by their internal compass, they lead themselves confidently, both in words and actions. In a fast-changing world, our people relentlessly stay true to their purpose, just like the cosmic compass. That is to: Serve with a Heart and INspire Everyone', 'Damai LRT Station', '50, 386', 'na', '6320 9855', 'No', '1) The Leader in Me Programme The school is adopting a two-pronged approach in the teaching of 7 habits namely through explicit teaching and integration of the 7 habits into the curriculum. For explicit teaching, teachers who are trained will engage the students through thoughtfully designed activities. To ensure pervasiveness in the school, the habits are reinforced through curriculum integration with different focus at different levels. With pervasive implementation of -The Leader in Me, every child will be able to manage and lead self, as well as others confidently. This arises from strong self and social awareness, the ability to manage relationship and make responsible decisions - all of which are important attributes of a Confident Person.  2) Golf Exposure,Jump Rope Skipping and Fusion of ARt and Music (FARM) Students develop an awareness of golf etiquette and the value of sportsmanship, respect & perseverance by: - Learning the fundamentals of golf swings, functions of various clubs & understanding its rules. - Learning to play in personal and social spaces responsibly & fulfilling obligations of a team player. Students develop fine psychomotor skills & the confidence to perform individually & in teams by: - Learning the fundamentals of rope skipping - Learning to skip in personal & social spaces responsibly Like a farm where animals are cultivated and bred, FARM provides an inviting learning environment where opportunities abound for students: - to grow in their  capacities through deepening their understanding and appreciation of music and art. - to immerse in opportunities to exude their creativity and expression.', 'MRS ONG-CHEW LU SEE', 'Chinese', 'CO-ED SCHOOL', 'Passionate Learners, Caring Leaders', 'na', 'To build a community of learners - inspiring self and others to lead with a heart', 'No', 'SINGLE SESSION', 'OASIS PRIMARY SCHOOL', 'PUNGGOL', '71 EDGEFIELD PLAINS', 'Malay', 'na', 'EAST', '107', 'http://www.oasispri.moe.edu.sg/'),
(110, '6315 3451', 'No', 'na', 'na', '828802', 'GOVERNMENT SCHOOL', 'na', 'MR HOY KIN CHUNG EDWIN', 'PRIMARY', 'waterway_ps@moe.edu.sg', 'No', 'EAST 3', 'na', 'We believe that education must prepare a child for life and work in the future.  We want to develop in our pupils the passion, the skills and the aptitude for learning so that they will be self-directed to learn, know how to learn and be always ready to acquire new knowledge and skills.   We want to build character in our pupils so that they will grow up with sound values, be confident persons doing what is good and right, taking care of their family, working well with others and contributing to society.    We believe in working in partnership with parents so that together we provide the best education possible for children to grow and develop right attitudes, beliefs, values and behaviour.', 'Kadaloor LRT Station', '50', 'na', '6636 6880', 'No', 'We provide a holistic education for our pupils to prepare them for life and work in the future. We want learning to be fun and meaningful. Some of our key programmes include:  Toastmasters: Toastmasters is a six-year programme to nurture pupils to be gracious persons, engaging communicators and confident leaders.   Approach - Experiential learning, peer learning, role-modelling and coaching from mentors. Lessons include dramatisation, storytelling, topical sharing, news writing, literature appreciation, programme hosting, persuasive speaking, debating and interview skills.  Pre-Assembly Morning Sharing: Sharing every morning before the start of school on a wide range of subjects such as current affairs, world events, science, art and music to expose pupils to the world outside their classroom and Singapore.     Programme for Active Learning (PAL): PAL is conducted within curriculum time and consists of a series of activities under the two broad domains of Sports & Outdoor Education and Performing (Music & Dance) and Visual Arts.   Through fun and experience with the arts, PAL aims to develop pupils\' confidence, curiosity and skills of working with others.  Some of the modules include Sports & Games, Creative Dance, Outdoor Experiential Learning & Discovery and Music.  Chinese Language Enrichment Course: A fun-filled and activity-based programme for pupils to develop an interest and appreciation of the Chinese Language and culture. Values are taught through classics (Di Zi Gui) --- Standards for Being a Good Pupil and Child.  Flip Classroom: The Flipped Classroom inverts traditional teaching methods, delivering instructions through Info-communication Technology platforms outside of the classroom. With this, concept engagement and application is done in class with teacher facilitation.', 'MRS WEE KWAN LIAM', 'Chinese', 'CO-ED SCHOOL', 'A Life-long Learner, A Gracious Citizen', 'na', 'To build a vibrant environment that nurtures young minds and builds upright character', 'No', 'SINGLE SESSION', 'WATERWAY PRIMARY SCHOOL', 'PUNGGOL', '70 PUNGGOL DRIVE', 'Malay', 'na', 'EAST', '108', 'www.waterwaypri.moe.edu.sg'),
