(116, '62699050', 'No', 'Tamil', 'na', '738927', 'GOVERNMENT SCHOOL', 'MDM FOO HUEY YING', 'MISS ESTHER ONG CHIN CHIN', 'PRIMARY', 'MARSILING_PS@MOE.EDU.SG', 'No', 'NORTH 5', 'na', 'OUR PHILOSOPHY In Marsiling Primary, we believe that developing the 21st century competencies and the focus on meaningful student engagement will enhance our students# cognitive and affective development, and eventual success in life. We will continue to inculcate the right values in our students and equip them with knowledge and skills so as to prepare them to face the challenges of the future. Through comprehensive academic and co-curricular programmes, anchored on student centric and values-driven learning, we hope to nurture the students to achieve their potential. At the end of their 6 years in MPS, we want to see our students grow to become Responsible Learners and Compassionate Leaders ready to serve community and nation as active young citizens.  OUR SCHOOL VALUES The school values are encapsulated in the acronym #R#IC#E# (Respect, Responsibility, Integrity, Commitment, Care and Esprit de Corps). Like a staple diet, R#IC#E is infused into both the formal and informal curriculum', 'Marsiling MRT Station', '856, 911, 912', 'na', '62696193', 'No', 'COMMUNITY SERVICE & STUDENT LEADERSHIP LEAD (Learn, Engage, Absorb, Demonstrate) to Serve @ MPS  In MPS, we share a common belief in nurturing responsible learners and compassionate leaders who can learn, lead and serve. We strive to instil in every Marsilian our core values of R#IC#E (Respect, Responsibility, Integrity, Commitment, Care and Esprit de Corps) and nurture responsible active citizenship through service leadership. This is espoused in our Citizenship and Character Education or CCE#s vision of #Every Marsilian a Service Leader and Green Citizen#.   To foster a student-centric, values-driven learning environment, CCE in Marsiling Primary is anchored on two core programmes # Values in Action (VIA) and student leadership vis-#-vis Green Citizenship & LEAD to SERVE respectively. VIA is practised through our Green Citizenship programme which engages students in initiating collective actions among peers in doing simple acts of taking care of the school and environment.  The school#s student leadership programme #LEAD to Serve@MPS# focuses on developing the individual capacity to lead and influence others with respect, responsibility, care and appreciation.', 'MISS CHEE CHUERN HWEI CHERYL', 'Chinese', 'CO-ED SCHOOL', 'Every Marsilian can Learn, Lead and Serve', 'na', 'Nurturing Responsible Learners and Compassionate Leaders', 'No', 'SINGLE SESSION', 'MARSILING PRIMARY SCHOOL', 'WOODLANDS', '31 WOODLANDS CENTRE ROAD', 'Malay', 'na', 'NORTH', '113', 'http://www.marsilingpri.moe.edu.sg'),
