(152, '67632452', 'No', 'Tamil', 'na', '689814', 'GOVERNMENT SCHOOL', 'MR WANG TAI WEE', 'MISS LIM KAR WAE FIONA', 'PRIMARY', 'CONCORD_PS@MOE.EDU.SG', 'No', 'WEST 2', 'na', 'The school believes that Every Concordian is An Engaged Learner and has provided platforms to enable our students to contribute, excel and to showcase their talents as Every Individual Matters.   Through the programmes and efforts, the school strives to nurture our students with the essential 21st century competencies. The school builds a network of quality partnerships as we are firm believers of the adage that it takes a village to raise a child.  We want them to enjoy their schooling experiences, build strong foundations in knowledge, values and character and discover their passion in life.  We  aspire to develop Concordians who are upright and resilient and who possess the ability to boldly take on the challenges in life and contribute selflessly to the school and society.    The school has a unique iGIVE culture, which centres itself on building the character of its students. In iGIVE: # Graciousness is to have the respect, harmony, care and abundance mentality to be able to work ', 'Choa Chu Kang MRT Station', 'Bus 300', 'na', '67632139', 'No', 'na', 'MDM LEE YEW KOON TONNINE', 'Chinese', 'CO-ED SCHOOL', 'Caring Hearts, Enriched Minds, Determined Spirits', 'na', 'To nurture Concordians with Character and Passion for learning to face life\'s challenges.', 'No', 'SINGLE SESSION', 'CONCORD PRIMARY SCHOOL', 'CHOA CHU KANG', '3 CHOA CHU KANG AVE 4', 'Malay', 'na', 'WEST', '150', 'http://www.concordpri.moe.edu.sg/'),
