(158, '67533765', 'No', 'Tamil', 'na', '757702', 'GOVERNMENT SCHOOL', 'na', 'MRS NUR FATIMAH FRAUDER', 'PRIMARY', 'WELLINGTONPS@MOE.EDU.SG', 'No', 'NORTH 7', 'na', 'We believe in developing a Gem in every Wellingtonian. Each Gem has unique qualities that can sparkle under any light source.  Hence we dedicate ourselves to provide a global stage for our Gems so that they can practise what we call \"Learning by doing, doing until we become\". We believe that each unique Gem can be shaped and nurture to excel in character through the experiential approach to learning. Character is shaped through habitual practices of right values.  As a Wellington Gem, we aspire our children to take initiative to act and be solutions to needs of the world around them. This is why we define leadership as #taking the initiative to make a difference to the people around us!# Our aim is that by the time each Gem leaves Wellington Primary, they would have left their positive mark somewhere in the community here in Sembawang, in Singapore or the world.', 'Sembawang MRT', '980, 856, 859', 'na', '67533319', 'No', 'Student Leadership Programmes (including Student Ambassador Programme & Student Council);Programme for School-based Excellence (PSE) in Dance; Advanced Programmes for Excellence (APEX) in Languages & Math+Sciences; ALP in New Media & Technology including eGame Making', 'MR TSU CHIN SUN GARY', 'Chinese', 'CO-ED SCHOOL', 'Becoming a global STAGE to grow World-ready Talents & People.', 'na', 'To empower every individual, nurture talents and groom leaders.', 'No', 'SINGLE SESSION', 'WELLINGTON PRIMARY SCHOOL', 'SEMBAWANG', '10 WELLINGTON CIRCLE', 'Malay', 'na', 'NORTH', '157', 'http://www.wellingtonpri.moe.edu.sg'),
