(163, '63445370', 'No', 'Tamil', 'na', '437259', 'GOVERNMENT SCHOOL', 'MDM HOO WAI LING', 'MRS ELIZA YEONG', 'PRIMARY', 'TKPS@MOE.EDU.SG', 'No', 'EAST 5', 'na', 'na', 'From Kallang MRT Station: Bus 31 From Paya Lebar MRT station: Bus 76 & Bus 135', 'East Coast Road:10,12,14,32,40,608,NR12  Dunman Road:16,33  Amber Road:196,197,31,36,76,135', 'na', '63444728', 'No', 'Sports Class, Talent Identification Programme,Interdisciplinary Project Work for all levels,Science Booster,Green Day,Literature Programme,Talent Corner,EL and MT Speech & Drama (P1 & P2), Value Inculcation Programme and Leadership Programme.', 'MRS CAROLINE WU', 'Chinese', 'CO-ED SCHOOL', 'To nurture pupils so that they can excel in their pursuits and contribute to the society, through pr', 'na', 'Passionate Learners,Caring Leaders, Global Citizens', 'No', 'DOUBLE SESSION', 'TANJONG KATONG PRIMARY SCHOOL', 'MARINE PARADE', '10 SERAYA ROAD', 'Malay', 'na', 'EAST', '162', 'http://www.tanjongkatongpri.moe.edu.sg/'),
(164, '64586104', 'No', 'Tamil', 'na', '569206', 'GOVERNMENT SCHOOL', 'MDM LOW CHIA YEE', 'MDM DOREEN TAN MUI HIANG', 'SECONDARY', 'anderson_ss@moe.edu.sg', 'No', 'NORTH 3', 'na', 'As a mainstream autonomous secondary school offering both the GCE \'O\' and \'N\' Level tracks, we provide a stimulating and vibrant environment that nurtures the whole child. By creating a quality difference in our students\' development and experiences in Anderson, our students develop an inquiring and innovative mind, strong moral grounding, cultural awareness and self-efficacy to succeed in the 21st century.  This distinctive Anderson brand of quality education produces achievers with high integrity and robust character who are passionate about life, inspiring and of service to others. A \'Culture of Care and Excellence\' pervades our school - we build pride in everyone through recognising success and inspiring excellence; we nurture a strong sense of belonging amongst our people through forging bonds and building community; we imbue in all our students the ANDE Values through our 3-prong approach of \'Educating the Head\', \'Encouraging the Heart\' and \'Empowering the Hands\'. All these are m', 'ANG MO KIO MRT, YIO CHU KANG MRT', '265, 548, 45, 50, 72', 'na', '64598303', 'No', 'With the aim to nurture Andersonians to be intellectually curious, innovative, creative and culturally versatile leaders, the school takes pride in its niche and signature programmes that provide the platforms to imbue these qualities and facilitate diverse learning experiences. We have established a comprehensive Science Research Programme that provides opportunities for students to pursue their interests, develop their competencies and hone their talents in this area.  The Drama Programme seeks to develop students into confident communicators and reflective thinkers who are able to challenge common perceptions and stereotypical perspectives. The Malay Elective Programme in Malay Language for Secondary Schools (EMAS) provides opportunities for students to develop a deeper appreciation of the Malay Language and culture. The Cultural Flexibility Programme seeks to develop students who are culturally astute, attuned to the socio-political and economic pulse of the region, yet committed to Singapore. At the same time, the Service and Student Leadership Programme integrates leadership development with community outreach and action, so that students imbibe the qualities and attitudes of a servant leader. In this way, we hope to nurture citizens who are socially aware, informed about local and international issues, and able and ready to make a difference to the community and people around them. The annual Anderson Sabbatical provides opportunities for students from all levels to step out of their comfort zone to challenge themselves by building resilience, working in teams, and developing initiative and self-reliance. All in all, there is a strong focus on experiential learning in our academic and non-academic curriculum as we seek to actively engage our students in constructing, integrating and deepening their learning experiences.', 'MDM THONG MAY TENG', 'Chinese', 'CO-ED SCHOOL', 'A Caring Community of Thinkers, Innovators and Leaders who Inspire and Serve.', 'na', 'Developing and Inspiring in all Andersonians a sense of purpose, and constancy to reach their full p', 'Yes', 'SINGLE SESSION', 'ANDERSON SECONDARY SCHOOL', 'ANG MO KIO', '10 ANG MO KIO STREET 53', 'Malay', 'na', 'NORTH', '163', 'http://www.andersonsec.moe.edu.sg'),
(165, '62805595', 'No', 'Tamil', 'na', '538403', 'GOVERNMENT SCHOOL', 'MDM LAEU SIEW FUNG', 'MRS TAN CHYE NA', 'SECONDARY', 'bartley_ss@moe.edu.sg', 'No', 'SOUTH 6', 'na', 'The school believes that every student has the potential to be developed and that they can and will learn and succeed. Hence, the school provides academic rigour and a robust character development programme that is grounded on our school values (Courage, Optimism, Respect, Excellence), and the principles of the 7 Habits of Highly Effective Youths (7 HEY). This will ensure that Bartleyans graduate with a distinctive character and the skills to navigate the intricacies of life successfully.', 'BARTLEY MRT', '22, 24, 28, 43, 58, 62, 70, 70M, 76, 80, 80A, 93, 158', 'na', '62889013', 'No', 'The school\'s Learning for Life Programme (LLP) is on Community Youth Leadership. As part of the LLP, all Bartleyans undergo the Student Leadership Development Programme, coupled with Outdoor Experiential Learning, to nurture them to be courageous, optimistic and responsible leaders of self and for others. The 7 Habits of Highly Effective Youths (7 HEY) programme underpins the school\'s character development effort. Through this programme, students learn to live out the school\'s motto of Facta Non Verba (Deeds not Words).   The school\'s Applied Learning Programme (ALP) is Chemical and Life Sciences (Perfumery). Bartley is the first and only secondary school in Singapore to offer this programme which is an area of study that provides direct application of Science concepts into the creation of a product. It is a conglomeration of chemical, life sciences, engineering and business which excites students to explore STEM (Science, Technology, Engineering, Mathematics) as their future area of specialisation.  The school collaborates with Singapore Science Centre in running the programme.  The Bartley Scholars Programme (BSP) is targeted at higher ability students to stretch and accelerate their learning. Students are exposed to a variety of learning experiences to develop their passion for learning.   The SMILE@Bartley Programme is a mentoring programme for all our graduating students. Students are not only supported emotionally in their journey towards the national examination, but are also guided to make decisions that would have an impact on their next phase of development in institutes of higher learning.', 'MR MOHD AZHAR B TERIMO', 'Chinese', 'CO-ED SCHOOL', 'Leaders for Others, Learners for Life', 'na', 'Empowering every Bartleyan to lead with wisdom, serve with humility and learn with passion.', 'No', 'SINGLE SESSION', 'BARTLEY SECONDARY SCHOOL', 'TOA PAYOH', '10 JALAN BUNGA RAMPAI', 'Malay', 'na', 'SOUTH', '164', 'http://www.bartleysec.moe.edu.sg'),
(166, '62542284', 'No', 'Tamil', 'na', '318990', 'GOVERNMENT SCHOOL', 'MR LIM SOON WAI', 'MR SZE GUAN KIAT', 'SECONDARY', 'BEATTY_SS@MOE.EDU.SG', 'No', 'SOUTH 3', 'na', 'Established in 1953, Beatty Secondary has nurtured many illustrious Beattyians. Its Alumni boasts of prominent members from the civil service, academia, business and the arts. Beatty Secondary believes in the unique worth of every student and aims to nurture resilient, team-spirited and morally upright individuals with a sense of purpose and passion for life. The broad-based academic and character development programmes offered at Beatty are specially tailored to ignite students\' passion and interest in learning. They are also designed to develop and stretch student abilities and talents to the fullest. In all, education in Beatty Secondary seeks to nurture good thinkers and self-directed learners who will become contributing members of society. Underlying these programmes is the care the school provides for the physical, intellectual, social and emotional well-being of each of its charges. Beatty\'s team of committed and caring staff take pride in their innovative approaches in creatin', 'Braddell MRT, Toa Payoh MRT', '28,  56,  73,  88,  93,  105,  153,  155,  159,  163,  157,  231,  232', 'na', '62569108', 'No', 'In Beatty Secondary, we nurture students to be Thinkers, Learners and Contributors. The school seeks to engage its learners through a varied and effective instructional curriculum and co-curriculum to help them develop the skills and disposition to navigate through life. Beatty\'s Applied Learning Programme (ALP), Beattyians Think. Create. Innovate Programme provides an excellent integrated platform for students to learn 21st century competencies for eg. in Critical and Inventive Thinking, Information Literacy and Communication and to apply these in real life contexts. To develop Beattyians of Character with a sense of Purpose and Passion for life, the school makes the Character development of students a key focus. Beatty\'s wide-ranging co-curricular programmes include outdoor adventure camps, the Values in Action programme, cultural exchange programmes with overseas partner schools eg Japan. These programmes serve to imbibe sound values, develop strength of character and socio-emotional competencies in students. Beatty\'s Learning For Life Programme (LLP), Leaders for Life Programme nurtures every Beattyian with leadership skills and disposition through a structured system of training, mentoring and opportunities at leading. Beatty\'s Key Programmes: MOE Higher Chinese Centre, Beatty Character & Citizenship Education, Overseas Twinning Programme, ICT Training Programme, Drama-in-curriculum, Subject-based Talent Development Programme, Elective & Advanced Elective Modules, Life Science Programme, Environmental Education.', 'MR LING KHOON CHOW', 'Chinese', 'CO-ED SCHOOL', 'A Distinguished Institution of Thinkers, Learners and Contributors', 'na', 'To nurture Beattyians of Character with a Sense of Purpose and Passion for Life', 'No', 'SINGLE SESSION', 'BEATTY SECONDARY SCHOOL', 'TOA PAYOH', '1 TOA PAYOH NORTH', 'Malay', 'na', 'SOUTH', '165', 'http://www.beattysec.moe.edu.sg'),
(167, '62820244', 'No', 'Tamil', 'na', '349692', 'GOVERNMENT SCHOOL', 'MDM JUSTINE TAN', 'MISS SIM SOO LENG AILEEN', 'SECONDARY', 'cedargirlss@moe.edu.sg', 'No', 'EAST 7', 'na', 'With the belief that every Cedarian can become a confident and active citizen, Cedar Girls is committed to providing a high quality all-round education. Beside a well-established 4-year O-Level programme, Cedar Girls also offers the Integrated Programme (IP) under the Victoria-Cedar Alliance (VCA). Our IP students will complete 4 years of secondary education in Cedar Girls before advancing to Victoria Junior College for the A-level curriculum. The VCA IP offers a seamless 6-year programme to students who enjoy independent study and exploratory work. They will have the opportunities to heighten their interest and passion through a challenging and enriched curriculum. In our mission to develop Leaders of Character, we have a comprehensive Character, Citizenship and Leadership Development Programme which inculcates the values, attributes and competencies desired of Cedarians in their journey through life. Cedar Girls has received recognition in both the academic and co-curricular domains ', 'WOODLEIGH MRT, POTONG PASIR MRT', '8, 61, 64, 65, 66, 90, 100, 135, 151, 154, 155', 'na', '62884909', 'Yes', 'Through the Leaders of Character Programme, all Cedarians are given opportunities to put their values into action via student-initiated community projects so as to nurture and develop them into leaders of character. The Social Innovation Programme is the school\'s signature programme which aims to nurture Cedarians into social innovators. Through this programme, students\' innovative capacity is developed and honed to provide them with the vital skills they need to create breakthrough solutions to address authentic issues faced by the community. With the aim to broaden Cedarians\' perspectives, the Beyond Borders Programme provides Cedarians the opportunity to explore learning beyond the shores of Singapore, see the world differently and learn to work collaboratively with local and international partners. Cedarians with special talents are given the opportunity to pursue their passions and interests through the Talent Development Programme. This programme aims to stimulate the students intellectually and cognitively to create new knowledge and stretch their potential. We also have a Sports Class which is tailored to the learning needs of our sports talents. To help these students balance their achievements in sports and the academic domain, our team of teachers and coaches work together synergistically to plan and strategize their learning and training needs.', 'MDM CHENG HWEE YEANG', 'Chinese', 'GIRLS\' SCHOOL', 'Bringing out the Best in our People: Social Innovators, Passionate Learners', 'na', 'Nurturing Leaders of Character', 'Yes', 'SINGLE SESSION', 'CEDAR GIRLS\' SECONDARY SCHOOL', 'TOA PAYOH', '1 CEDAR AVENUE', 'Malay', 'na', 'EAST', '166', 'http://www.cedargirlssec.moe.edu.sg'),
(168, '64741248', 'No', 'Tamil', 'na', '247961', 'GOVERNMENT SCHOOL', 'MISS LOW SHIOK CHENG CINDY', 'MDM V PRIYA RAJAN', 'SECONDARY', 'CRESCENTGIRL@MOE.EDU.SG', 'No', 'SOUTH 2', 'na', 'Crescent Girls\' School provides a nurturing and innovative environment with a distinctive brand of education that empowers generations of students to grow into gracious, confident ladies and caring visionary leaders. The school focuses on transforming the learning experiences of students through pervasive and purposeful use of technology. As one of the pioneer FutureSchools@Singapore, we continually harness technology to develop a passion for learning and for life in our students so that they are well-prepared for the challenges of the 21st century. Beyond academic excellence, the school is committed to inculcate sound values in our students to be able to contribute to the community. There is a pervasive culture of care in the school, and a strong emphasis on development of strength of character, a mindset of excellence, and commitment to teamwork to nurture our students to be responsible members of society and gracious citizens of the world. The school has done well in many aspects ov', 'REDHILL MRT', '32, 111, 122, 132, 51, 139, 186, 970', 'MISS CHUANG SIEW CHIN', '64758711', 'No', 'The school\'s Student Development Programmes are offered within our Student-centric Holistic Curriculum. In our Instructional Programmes, students are exposed to a myriad of learner-centric teaching approaches that extend learning beyond the classroom and empower our students with 21st century competencies like collaboration, global awareness, skilled communication and real-world problem solving. Our 4-year Character & Leadership Development Programme provides all students with opportunities to develop their leadership potential. Our Values-In-Action Programme equips students with problem solving skills and provides platforms to engage with the community, with the aim of inspiring and empowering our students to make a difference in society. All students have opportunities to travel overseas in our Internationalisation Programme, which aims to develop a sense of empathy, civic responsibility and cross-cultural skills in our students. Our Talent Development Programme aims to stretch our able, committed and creative students further. The school also offers the Music Elective Programme for students passionate about music.', 'MRS HELEN CHONG', 'Chinese', 'GIRLS\' SCHOOL', 'Our vision is to be a premier school with a nurturing and innovative environment that prepares stude', 'na', 'Our mission is to develop and inspire in each Crescentian a sense of her own potential as \"An excell', 'Yes', 'SINGLE SESSION', 'CRESCENT GIRLS\' SCHOOL', 'BUKIT MERAH', '357 TANGLIN ROAD', 'Malay', 'na', 'SOUTH', '167', 'http://www.crescent.edu.sg/'),
(169, '64732479', 'No', 'Tamil', 'na', '159561', 'GOVERNMENT SCHOOL', 'MR CHUNG KWOK LEONG DANIEL', 'MR LEE KAH WAI', 'SECONDARY', 'GESS@MOE.EDU.SG', 'No', 'SOUTH 4', 'na', 'The school strongly believes in providing a Quality Student Experience provided by a Quality School Team, which is committed to building quality relationships with our Partners. It believes that education in the 21st century is about nurturing the whole person, in which his/ her actions are guided by the school mission of nurturing the best in each to strive ever ONWARD. The school nurtures an environment where every student and staff member is valued, encouraged and empowered to excel, learn and care for others, and where their accomplishments are celebrated. The school designs a wide range of academic and student development programmes to provide students with both formal and informal learning opportunities. Through its distinctive programmes, the school builds students\' confidence, nurtures in them 21st century competencies, and prepares them for the future. The school\'s CCE curriculum engages the students\' heads, hearts and hands; every student will go through programmes such as le', 'REDHILL MRT, TIONG BAHRU MRT', '14,16,32,33,51,63,64,120,122,145,139,186,851,970', 'na', '64745594', 'No', 'The GESS LIFE programme seeks to develop students to be confident and effective student leaders who positively impact their community through the 3D approach - Discovering myself, Developing good habits, and Designing our world. Students discover themselves and develop a better appreciation of one another\'s uniqueness using the Myers-Briggs Type Indicator assessment. They will learn effective strategies to leverage their strengths and build competencies in other areas, and collaborate with others. The LIFE programme will provide school-wide, cohort and personal opportunities for every student to purposefully apply their knowledge and skills to impact their school and community. The GESS Applied Learning Programme, GESS Probes*, serves to prepare students for their future workplace. It aims to develop future workskills 2020 such as transdisciplinarity, design thinking, and novel and adaptive thinking in students. The programme focuses on STEAM (Science, Technology, Engineering, Aesthetics and Mathematics) as well as the design thinking process. Probes* refers to the underwater probe that students will be tasked to design as part of their learning process. There are two tiers for the programme catering to different needs of the students. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MDM TAN MEI MEI JENNY', 'Chinese', 'CO-ED SCHOOL', 'Gessians of Excellence, Standing and Significance.', 'na', 'Our school is a community that nurtures the best in each and strives ever ONWARD.', 'No', 'SINGLE SESSION', 'GAN ENG SENG SCHOOL', 'BUKIT MERAH', '1 HENDERSON ROAD', 'Malay', 'na', 'SOUTH', '168', 'http://www.ganengsengsch.moe.edu.sg/'),
(170, '64741302', 'No', 'Tamil', 'na', '149295', 'GOVERNMENT SCHOOL', 'MISS PAULINE CHIA HUI MIEN', 'MDM LOK YIN YIN', 'SECONDARY', 'QSS@moe.edu.sg', 'No', 'SOUTH 2', 'na', 'We believe that every child is unique, valuable and can achieve success. Every staff makes a difference as we develop students according to their abilities. We inculcate values, good habits and 21st century skills to nurture lifelong learners and caring citizens and work with key stakeholders to build a learning community.', 'COMMONWEALTH MRT, QUEENSTOWN MRT', '32,51,93,100,105,111,122,123,145,147,153,186,195,196,198,855,961,970', 'MR YONG WEI LEONG', '64741421', 'No', 'The QSS Experience provides varied programmes and opportunities to nurture every Queenswayan to become a caring, responsible citizen and confident, life-long learner. We harness differentiated approaches to stretch our students\' cognitive ability through our academic programmes. Our customised English Ingenium Programme stretches high-ability students in the English Language. The school\'s Applied Learning Programme in Science, Technology, Engineering and Math (STEM) develops critical and innovative thinking through inquiry-based, experiential and co-operative learning approaches.  It is structured and integrated in our Sciences and Humanities academic curriculum. The comprehensive Character and Citizenship Education programme nurtures desired social-emotional attributes and inculcates values and life-long skills. Our extensive CCA, Student Leadership Development and Values-in-Action programmes provide varied authentic experiential learning opportunities to develop students to be caring, responsible citizens and confident, life-long learners. QSS Lifelong Learning Programme in Sports for Life & Outdoor Education inculcates interest, skills and attitudes for active, life-long participation in sports, physical and outdoor activities. Our Student Development Team structure enhances the quality of school experience with emphasis and attention to values education and students\' social emotional needs and development. Students at each level are cared for and mentored by their Form Teachers, together with their Year Heads who oversee the holistic development of the students and work closely with the school management team to ensure effective delivery of student-centric, values-driven education to our students. Other special programmes include Advanced Elective & Elective Modules, ICT & Mobile Apps, Digital Art, Aesthetics & Performing Arts, Internationalisation Programme and Outdoor Education camps and modules.', 'MR LUI SENG CHEONG', 'Chinese', 'CO-ED SCHOOL', 'Caring Citizens and Life-long Learners in a School of Excellence', 'na', 'Providing a holistic education to nurture caring, responsible citizens and confident, life-long lear', 'No', 'SINGLE SESSION', 'QUEENSWAY SECONDARY SCHOOL', 'QUEENSTOWN', '2A MARGARET DRIVE', 'Malay', 'na', 'SOUTH', '169', 'http://www.queenswaysec.moe.edu.sg'),
(171, '62353731', 'Yes', 'Tamil', 'na', '259978', 'INDEPENDENT SCHOOL', 'na', 'na', 'SECONDARY', 'RGSS@MOE.EDU.SG', 'No', 'SOUTH 7', 'na', 'At RGS, every student is nurtured and developed to her fullest potential. Our students journey beyond traditional boundaries in their pursuit of knowledge in a supportive environment that caters especially to their needs, so that they can live a fulfilling life and contribute back to society.', 'ORCHARD MRT, STEVENS MRT', '105, 132, 190, 972', 'na', '67371845', 'Yes', 'Providing a holistic education, our six-year Raffles Programme (Y1-4 in RGS and Y5-6 in RI) that bypasses the GCE O Level Examinations, features an enriched and accelerated curriculum that nurtures high-ability learners. At the end of Y6, RGS girls graduate not only with the GCE A Level Examination certificate, but also with the Raffles Diploma - designed to recognise the peaks of excellence in five domains: Cognitive, Character & Leadership, Community & Citizenship, Sports & Health, and Arts & Aesthetics.   Student Development develops the personal capacity of RGS girls and nurtures them to be individuals who are conscious of their responsibility to family, community and nation. Their disposition is developed through the inculcation of knowledge, competencies and values through the Character and Leadership Education (CLE) programme. The CLE Programme empowers our girls to be: good stewards of their lives by heightening their self-awareness through reflection and equipping them with self-management and interpersonal skills; active and socially responsible citizens by promoting school and community involvement; reflective and visionary leaders by equipping them with a habit for introspection, decision-making with foresight and a spirit of teamwork.   Special programmes offered include: Third Languages (Arabic, French, German, Japanese, Spanish, Chinese/Malay Special Programmes); Music Elective Programme; Special Art Programme; Regional Studies Programme; Research Studies Programme (featuring Odyssey of the Mind and Future Problem Solving Programme - Community Problem Solving Programme); Raffles Academy (Literature, History, Geography, Mathematics, Chemistry, Biology, Physics, Higher Chinese Language) catering to girls with special talents; Mentorship Programmes in Science, Mathematics, Humanities and Creative Writing; Language Immersion Programme; Values-in-Action Programme; Student Leadership Development Programme; Work Experience Programme.', 'MDM THAM MUN SEE', 'Chinese', 'GIRLS\' SCHOOL', 'To aspire, strive and dare to be active creators of a better age for all.', 'na', 'Nurturing the high ability girl to be a leader who will realise her talents in service of nation and', 'No', 'SINGLE SESSION', 'RAFFLES GIRLS\' SCHOOL (SECONDARY)', 'CENTRAL', '20 ANDERSON ROAD', 'Malay', 'na', 'SOUTH', '170', 'http://www.rgs.edu.sg/'),
(172, '63538357 Year 1-4', 'Yes', 'Tamil', 'MR EDWARD NG', '575954', 'INDEPENDENT SCHOOL', 'MDM THOR POH SIN THERESA', 'MR MAGENDIRAN K SINATHURAI', 'MIXED LEVEL', 'comms@ri.edu.sg', 'No', 'SOUTH 7', '64199888 Year 5-6', 'Founded in 1823, Raffles Institution (RI) aims to provide all students with an all-round education that enables them to excel in their many passions and pursuits. Our six-year Raffles Programme (RP) culminates in the GCE A-Level examinations. Graduating students also receive the Raffles Diploma (RD), a criterion-referenced certification which honours student participation and achievements in five key domains: Cognitive, Character and Leadership, Community and Citizenship, Sports and Health, and Arts and Aesthetics. It encourages Rafflesians to develop their particular strengths, talents and needs, as they prepare for life ahead. RI\'s special focus is on character and leadership development, particularly in giving back to the community. Student and CCA groups are actively involved in Values in Action activities. RI has committed to nurturing leaders who will contribute to the community by having its students explore social issues, exchange ideas, and generate solutions for a more sustai', 'BISHAN MRT, MARYMOUNT MRT', '410, 13,52,53,54,55,56,57,58,59,88,128,156, 93,157,163,54,74,851,852, 130,132,162,165,166,167,855,98', 'MRS REAVLEY MUNN YE', '63538830 Year 1-4', 'Yes', 'Character & Leadership Education Programme, Regional Studies Programme (RSP), Raffles Academy (for students with an exceptional aptitude in specific subjects), Gap Semester (a self-directed curriculum where students receive structured mentoring and gain knowledge of both local issues and global solutions), Raffles Leadership Programme, Raffles Science Institute (e.g. in-house research electives, external research attachments), E W Barker Institute of Sports (Sports Science Programme), RI Lecture Series (a Cabinet Minister is invited to speak to students) and RI Ambassador Series (an ambassador is invited to speak to students).', 'MR CHAN POH MENG', 'Chinese', 'CO-ED SCHOOL', 'To be the \'Hope of a Better Age\', as encapsulated in the school\'s Latin motto, Auspicium Melioris Ae', 'MR ANG PENG SIONG BRIAN LAGMAN', 'Nurturing Thinkers, Leaders and Pioneers of character who serve by leading and lead in serving.', 'No', 'SINGLE SESSION', 'RAFFLES INSTITUTION', 'BISHAN', '1 RAFFLES INSTITUTION LANE', 'Malay', '64199898 Year 5-6', 'SOUTH', '171', 'http://www.ri.edu.sg/'),
(173, '63851635', 'No', 'Tamil', 'na', '534237', 'GOVERNMENT SCHOOL', 'MRS CHAN TIOW LIANG GARY', 'MR CHIA CHEE WENG RICHARD CHRIS', 'SECONDARY', 'SERANGOON_SS@MOE.EDU.SG', 'No', 'NORTH 3', 'na', 'SSS provides Possibilities for students. We practise a culture of Care for our students. With an 88-year history, Serangoon Secondary School has produced many illustrious alumni. Serangoon students are StaRs, developed holistically through comprehensive programmes designed to nurture each child\'s talents and aspirations and enable each child to excel holistically. Students\' learning is guided by innovative teaching methodologies such as the Inquiry-based approach in Science and the Integrated Coursework approach in the Aesthetics. Our students are also provided with rich and diverse learning experiences both locally and overseas. Student Recognition is an integral part of our culture. In partnership with the School Advisory Committee and Serangoon Alumni, the school offers the SSS Scholarships to graduating students who are all-round achievers. Upper Secondary students can also strive for the Serangoon StaR awards for overall excellence in various areas. More than 90% of students gradu', 'HOUGANG MRT, KANGKAR LRT', '62, 74, 102, 113, 119, 136, 147, 324', 'na', '63851589', 'No', '1. \'O\' Level Computing is offered as an Elective Subject 2. Mobile Robotics is offered as an Elective Subject. 3.  English Excellence to develop Confident Persons - Sec 1 Storytelling, Sec 2 Drama, Sec 3 Debate. 4. Global Students\' Programme. 5. Serangoon Student Leadership Development (SSLeaD) incorporating NYAA. 6. Aesthetics Exposure and Enrichment for all students. 7. Character Development. 8. Values in Action, with emphasis on student-initiated activities. 9. LLP Project Ablaze: Harnessing Student Leadership in the Service of Community. 10. ALP: Real-world explorations in ICT. 11. Sports Education Programme. 12. Elective Modules for Normal stream students & Advanced Elective Modules for Express and Normal Academic stream students.', 'MDM TAY SIOK HWA', 'Chinese', 'CO-ED SCHOOL', 'Moulding Character, Igniting Passion, Building Community', 'na', 'We will nurture our StaRs to become active, purposeful and upright citizens, with the passion to lea', 'No', 'SINGLE SESSION', 'SERANGOON SECONDARY SCHOOL', 'HOUGANG', '11 UPPER SERANGOON VIEW', 'Malay', 'na', 'NORTH', '172', 'http://www.serangoonsec.moe.edu.sg'),
(174, '65645204', 'No', 'Tamil', 'na', '608784', 'GOVERNMENT SCHOOL', 'MR TAN BOON PIANG', 'MR TAN TAI HUAT', 'SECONDARY', 'cwss@moe.edu.sg', 'No', 'WEST 7', 'na', 'Commonwealth Secondary School (CWSS) believes that students learn best and are most fulfilled when the school nurtures every aspect of their person, and provides rich and authentic learning environments. As such, CWSS offers students our unique \"C3\" Curriculum. This comprises an innovative Character Education programme which emphasises Servant Leadership and Growth Mindset to instill strong values and productive habits, grounded in the school\'s WEALTH values (Warmth, Enterprise, Adventurousness, Loyalty, Tenacity and Honour). The school also offers a well-established programme of academic Content, which applies principles of Differentiated Instruction to support students of differing needs to master key skills and concepts for each subject, and provides them with opportunities to apply their knowledge in authentic ways. In addition, the school has also implemented a school-wide approach to encouraging Creativity which aims to give every student hands-on opportunities to express and nur', 'JURONG EAST MRT, CLEMENTI MRT', '30,51,78,79,143,143M,176,201', 'MDM SHABNAM LENA', '65606866', 'No', '1.Design Thinking programme to develop human-centred problem-solvers with valuable skills and mindsets including need-finding, ideation, empathy and prototyping. 2. Environmental Education programme which nurtures advocates and activists for a sustainable future. 3. Maker Education programme which develops 21st Century Skills by encouraging students to tinker, create artefacts using a wide range of fabrication technology, and share their creations with others. 4. Cohort Camps for all students to foster leadership skills, e.g. confidence, collaboration and resilience. 5. Student Leadership Development programme providing opportunities for students of different strengths to grow as Servant Leaders. 6. The school offers Computing as an \"O\" Level subject starting from 2017.', 'MR LOH HONG OON, AARON', 'Chinese', 'CO-ED SCHOOL', 'A community of passionate learners who spark imagination, illuminate new frontiers and inspire chang', 'na', 'Nurturing Commonwealthians as Champions of Today and Leaders of Tomorrow.', 'Yes', 'SINGLE SESSION', 'COMMONWEALTH SECONDARY SCHOOL', 'JURONG EAST', '698 WEST COAST ROAD', 'Malay', 'na', 'WEST', '173', 'http://www.commonwealthsec.moe.edu.sg'),
(175, '63451487', 'No', 'Tamil', 'na', '439272', 'GOVERNMENT SCHOOL', 'MDM KOH SEOK LEE SHIRLEY', 'MDM NEW YI CHEEN', 'SECONDARY', 'tkgs@moe.edu.sg', 'No', 'EAST 5', '66441593 (from 2017)', 'TKGS is dedicated to nurturing high achievers, leaders of character and women of grace. We are committed to nurturing leaders in the academic, character and arts domains. In doing so, we believe in students learning the value of stewardship,where the best and the brightest TKGians must  lead through \'noble service\' and to \'serve with honour\', as inspired by the school song penned by the first principal Ms Maude Scott in 1953. Our aspiration for being a school of distinction must start from within, with the girls who come through our portals understand how special it is to be TKGian, to understand the obligations and responsibilities in upholding that tradition of excellence which we have built over 60 years.', 'Paya Lebar MRT Station Dakota MRT Station', 'Dunman Road : SBS 16,33 Tanjong Katong Road : SBS 10,31,32,40,43,134,135,197', 'na', '63441593', 'No', 'The TKGS Curriculum aims to develop 3 distinct characteristics:(a)Leaders of Character, who lead from within in service of others: The TKGS leadership philosophy is founded on the belief that leadership is not about rank, position or title, but service in and through leadership of others. Character & Citizenship Education is implemented through our LEGACY curriculum, CCA and VIA programs, enabling girls to use the Community Problem Solving method to tackle community issues. The TKGS Truly! Programme instils TKGian identity and school pride, while the OBS Experience, Global Perspectives and Work Attachment Programmes complement our integrated approach to CCE. (b)High Achievers who are self-directed learners, demonstrating deep disciplinary understanding: Learning in the academic curriculum is anchored in a robust and progressive approach. TKGS+ is Programme for Leadership, Understanding and Stewardship, challenging TKGians to confront and tackle deeper concepts in authentic experiences beyond the classroom. There are 3 strands to TKGS+: Mathematics & Science, Languages & Humanities, and Music. TKGians offer Core and Elective Modules where they focus their learning on 21st century competencies, made possible through study trips and mentorship by professionals. TKGS is also the East Zone Centre of Excellence for English Language. (c)Women of Grace who are critical and inventive thinkers in their appreciation and pursuit of the arts: We tap into Lincoln Center\'s Capacities of Imaginative Learning and Visible Thinking for the study of Art, Music and Drama, leading to the O Level Examinations. In the tradition of excellence, all performing arts CCAs achieved Certificates of Distinction in the SYF 2013 and 2015.', 'MDM WONG YEE MIN MARY', 'Chinese', 'GIRLS\' SCHOOL', 'Accomplished young women of character and grace', 'na', 'To nurture every TKGian to be a leader', 'Yes', 'SINGLE SESSION', 'TANJONG KATONG GIRLS\' SCHOOL', 'MARINE PARADE', '20 DUNMAN LANE', 'Malay', '64409187(from 2017)', 'EAST', '174', 'http://www.tkgs.moe.edu.sg'),
(176, '64452609', 'Yes', 'Tamil', 'na', '448880', 'GOVERNMENT SCHOOL', 'MR VINCENT LEE WEI YEE', 'MR LOONG CHIEH YUNG (LONG JIRONG)', 'SECONDARY', 'VICTORIA_SCH@MOE.EDU.SG', 'No', 'EAST 7', 'na', 'Established in 1876, Victoria School (VS) is an all-boys school that is strong in spirit, rich in tradition and provides a broad-based holistic education. Our staff and students are guided by our school motto Nil Sine Labore (Nothing Without Labour) in the pursuit of performance excellence. The Victorian Spirit, the sense of pride and belonging to the school, encapsulates the camaraderie, fighting spirit and desire by every Victorian to be the best that he can be. VS is a dual-track school offering the 4-year \'O\' level Programme and the 6-year Victoria-Cedar Alliance Integrated Programme (VCA IP) jointly with Cedar Girls\' Secondary School (CGSS) and our affiliated college, Victoria Junior College (VJC). Every Victorian will be developed in character and leadership, in the cognitive, physical and aesthetics domains, and in service to the community. Through a broad-based rigorous curriculum and an inviting school environment that fosters thinking, creativity and teamwork, our Victorians ', 'BEDOK MRT, PAYA LEBAR MRT', '31, 36, 43, 48, 55, 76, 135, 155, 196, 197', 'MDM CHAM SZU MAY SYLVIA', '62912965', 'Yes', 'Recognised as an institution with a strong tradition in sports, the uniformed groups and the aesthetics, VS leverages on its student development curriculum to develop students holistically. Guided by the school-based EDGE (Experience, Develop, Grow, Excel) Framework, the programmes are designed to ensure age-appropriateness. CCAs provide the platform for students to develop friendship, teamwork and commitment to the school, community and nation. Signature programmes include the following: Character and Leadership Programme helps our students chart their leadership development; Beyond Borders Programme (including local and overseas learning experiences) develops our students\' perspectives and cross-cultural skills, Social Innovation Programme develops community-centredness and passion to serve the community; Electives Programme provides for breadth of learning; and Talent Development Programme challenges our students intellectually.', 'MR LIM BOON KONG ANDREW', 'Chinese', 'BOYS\' SCHOOL', 'Every Victorian is a Gentleman, Professional and Sportsman who makes tangible contributions to his f', 'na', 'To groom upright and balanced individuals with leadership qualities.', 'Yes', 'SINGLE SESSION', 'VICTORIA SCHOOL', 'BEDOK', '2 SIGLAP LINK', 'Malay', 'na', 'EAST', '175', 'http://www.victoria.moe.edu.sg');
INSERT INTO `schools` (`schoolId`, `fax_no`, `gifted_ind`, `mothertongue3_code`, `fifth_vp_name`, `postal_code`, `type_code`, `second_vp_name`, `first_vp_name`, `mainlevel_code`, `email_address`, `sap_ind`, `cluster_code`, `telephone_no_2`, `philosophy_culture_ethos`, `mrt_desc`, `bus_desc`, `third_vp_name`, `telephone_no`, `ip_ind`, `special_sdp_offered`, `principal_name`, `mothertongue1_code`, `nature_code`, `visionstatement_desc`, `fourth_vp_name`, `missionstatement_desc`, `autonomous_ind`, `session_code`, `school_name`, `dgp_code`, `address`, `mothertongue2_code`, `fax_no_2`, `zone_code`, `_id`, `url_address`) VALUES
(177, '64591330', 'No', 'Tamil', 'na', '579747', 'GOVERNMENT SCHOOL', 'MR TYEBALLY AZIZ', 'MR KEITH TAN', 'SECONDARY', 'WHITLEY_SS@MOE.EDU.SG', 'No', 'SOUTH 7', 'na', 'Whitley Secondary School believes that education is a journey of self-discovery and hence we seek to provide a holistic education with opportunities for students to discover and develop their strengths, interests and talents. In building a learning community, we develop Whitleyans to be self-directed learners and confident persons, grounded in the pursuit of Knowledge and values of Responsibility and Discipline. In role-modelling the values of Respect, Integrity and Sportsmanship, we nurture active contributors and concerned citizens who serve and care for their family, school and community. They are rooted to the nation, yet global in perspectives.', 'BISHAN MRT; MARYMOUNT MRT', '13, 52, 54, 74, 74E, 88, 162, 162M,  588, 410, 851, 852', 'na', '64561336', 'No', 'We are committed to creating the Whitley Experience which is focused on building a strong foundation for academic success and developing students\' interests and strengths through core academic and student development programmes.  The school\'s Learning for Life Programme, \"Active Citizenship for Social Change\", seeks to nurture active concerned citizens. Focussed on building empathy and ownership of societal issues, it provides opportunities for every Whitleyan to hone his skills in design thinking to better understand the needs of the community, co-construct solutions or advocate for social causes.  The school\'s Applied Learning Programme, \"Speech Communication Arts\", nurtures students to be confident and self-directed learners with a curriculum that enhances communication skills through speech and art forms such as public speaking and drama. We have a Talent Development Programme to nurture students\' academic strengths, providing training opportunities such as Author-in-Residence, debating and Olympiad trainings, and challenging students to excel through participation in competitions and projects. Another key element of our school programmes is our focus on leadership development and building of qualities such as resilience, team work, empathy, sound planning, among others. This is done through our cohort camps, student leaders programme and Overseas Service Learning. We are implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MDM TAN YANG FERN', 'Chinese', 'CO-ED SCHOOL', 'A Caring and Learning Community', 'na', 'To nurture Whitleyans to their fullest potential, so that they are able and willing to contribute to', 'No', 'SINGLE SESSION', 'WHITLEY SECONDARY SCHOOL', 'BISHAN', '30 BISHAN STREET 24', 'Malay', 'na', 'SOUTH', '176', 'http://www.whitleysec.moe.edu.sg/'),
(178, '65696689', 'No', 'Tamil', 'na', '649406', 'GOVERNMENT SCHOOL', 'MRS KOMATHI SUPPIAH', 'MISS YUEN CHAI LIN', 'SECONDARY', 'YUHUA_SS@MOE.EDU.SG', 'No', 'WEST 7', 'na', 'We firmly believe that education must be forward-looking and robust, recognising that the future, for which Yuhuans are being prepared for, is dynamic, unpredictable and difficult to imagine. Leveraging on the culture of care, learning and excellence, we envision our school to be a learning organisation that empowers staff and nurtures students holistically by equipping them with the competencies and dispositions to thrive in the future. Our school philosophy, \"Every Student, Our Responsibility\" undergirds our commitment to honour learning by instilling in Yuhuans the responsibility and commitment to life-long learning so as to adapt to changes and new situations; strengthen character by inculcating the values of graciousness and integrity, awaken talents by harnessing their strengths to strive towards attaining purposeful goals with passion and resilience, inspire dreams by stretching Yuhuans potential to lead new frontiers and innovate in pursuit of excellence.', 'LAKESIDE MRT', '49, 98, 99, 157, 185, 187, 198, 335, 502', 'na', '65661985', 'No', 'In tandem with providing multiple pathways and inspiring Yuhuans to pursue their interests in applied areas of learning, two applied subjects, Smart Electrical Technology and Electronics, will be introduced in 2017. Yuhuans will acquire skills and knowledge in the fields of automation technology and fundamentals of electronics through experiential and practice-based learning. Using an integrative and progressive approach in curricular design, our Flagship Programmes such as Literacy Enhancement Through Timed English Reading, Math Cube, Interdisciplinary Scientific Exploratory and Experiential Learning and the ApT Reader (Mother Tongue Languages) aim to make learning visible that engenders a greater level of engagement among Yuhuans. Complementing the curriculum is our Applied Learning Programme (ALP) in Integrated Project and Events Management (I-PRESENT) which helps Yuhuans develop thinking skills, stretch their imagination and apply knowledge in authentic settings. Yuhuans are exposed to higher learning through the offering of events and projects management-related Advanced Elective Modules (AEMs) by polytechnics and through collaboration with community and industry partners. Our Learning-for-Life Programme (LLP), MELODY (Music-Empowered Learners, Our Dynamic Yuhuans) harnesses our long-standing tradition of musical excellence to nurture the attributes of creativity, precision, teamwork, discipline and confidence in every Yuhuan. The music curriculum allows Yuhuans to experience diverse genres, styles and rhythms of music and showcase their talents at various platforms. Musically talented Yuhuans can offer Music at O levels under the Enhanced Music Programme. Our yCARE module, an integration of CCE, VIA, ICT and Project Work, the Cohort Leadership programmes and Life Skills modules further imbue in Yuhuans values and equip them with the 21 century competencies and skills.', 'MISS NG SOOK KIT', 'Chinese', 'CO-ED SCHOOL', 'A Future-Ready School That Inspires Excellence', 'na', 'Honour Learning, Strengthen Character, Awaken Talents, Inspire Dreams', 'No', 'SINGLE SESSION', 'YUHUA SECONDARY SCHOOL', 'JURONG WEST', '35 JURONG WEST STREET 41', 'Malay', 'na', 'WEST', '177', 'http://www.yuhuasec.moe.edu.sg'),
(179, '67557748', 'No', 'Tamil', 'na', '768516', 'GOVERNMENT SCHOOL', 'MDM KUEK YEN YEN SHEREE', 'MR TAN HOCK CHUAN MICHAEL', 'SECONDARY', 'YISHUN_SS@MOE.EDU.SG', 'No', 'NORTH 2', 'na', 'Yishun Secondary School is committed to developing our students holistically. We take pride in offering a values-driven education that develops the strengths of each child. Through the years, Yishun Secondary has produced many successful students, whose achievements are made possible by a team of dedicated educators who believe that \'every child can succeed\'. The school\'s motto, \'We Seek, We Strive, We Soar\', describes its continuous effort in striving for excellence to soar to greater heights.', 'YISHUN MRT, KHATIB MRT', '167,  169,  171,  800,  811, 812,  856,  858,  859,  969,  980', 'na', '68767129', 'No', '1) Applied Learning Programme (ALP): The school leverages on the new media through ALP in Sonic Arts, \'Music, Media & Technology\' to provide students with a strong foundation and exposure to established and emerging disciplines such as Music Technology and Recording Arts (Music & Media).  2) Learning for Life Programme (LLP): The school\'s LLP on Community Youth Leadership (CYL) focuses on providing students with opportunities to lead in serving the community. The programme forms an extension to Values-In-Action (VIA) experiences and provides opportunities for Yishunites to broaden their understanding of the needs and aspirations of the community through authentic experiences and deepen the development of leadership skills and attitudes. 3) Curricular Innovations: Each department embarks on curricular innovations to develop students\' passion for learning through school programmes such as Sports and ArTz Carnival. Pedagogical approaches such as the use of a constructivist approach to learning geometry, interdisciplinary approaches in English Drama, Project Work, Elective Modules (EMs) and Advanced EMs, and learning based on \"Enduring Understandings\", form an integral part of the school\'s authentic learning experience.  4) Character and Citizenship Education Programme: Key programmes that build students\' character include Enterprise Day, Citizenship Education Learning Journeys, Sec 2 Adventure Camp and Sec 3 Internationalisation Trips. The school leverages on its strong partnerships with various community groups for our student leadership and citizenship education programmes to develop \"caring hearts\" in all Yishunites. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MDM NG SHOK YAN', 'Chinese', 'CO-ED SCHOOL', 'Quality Mind, Caring Heart', 'na', 'To provide a well-balanced education to our pupils; develop their potential to the fullest intellect', 'No', 'SINGLE SESSION', 'YISHUN SECONDARY SCHOOL', 'YISHUN', '4 YISHUN STREET 71', 'Malay', 'na', 'NORTH', '178', 'http://www.yishunsec.moe.edu.sg'),
(180, '67751956', 'No', 'na', 'na', '129956', 'GOVERNMENT SCHOOL', 'MDM LINDA YEO SOCK KHOON', 'MRS THAI MOK JEE', 'SECONDARY', 'nhhs@moe.edu.sg', 'Yes', 'WEST 1', 'na', 'Nan Hua High School is founded on the Confucian values Li Yi Lian Chi Zhong Xiao Ren Ai. We take pride in our school heritage and believe in providing a student-centric, values-driven holistic education anchored on the four tenets of school culture -\'Ren\',Excellence,Learning and Collegiality. Our learning environment nurtures each child\'s talents and interests especially through our niche programmes, namely the SAP (Special Assistance Plan) & Biculture Programme, Performing Arts, and Environment Education. Our values education emphasises the development of each Nanhuarian as \"junzi\" or scholar in the Confucian context.', 'CLEMENTI MRT', '14,33,52,78,96,97,105,106,147,151,154,165,166,183,185,188,189,196,197,198,282,285,963', 'MR NGUANG HOCK SOON BERNARD', '67788303', 'No', 'The school\'s SAP and Biculture Programme emphasises the inculcation of school values and culture. In line with our school vision of developing bicultural scholars, our Biculture Programme nurtures our students to have bicultural perspectives; to understand the western and eastern ways of thinking and distil the best of both. In the curriculum, Secondary 1 students learn to appreciate Chinese culture and traditions. Translation and Interpretation as well as learning about Contemporary China enable Secondary 2 and 3 students to learn techniques of translation and the issues and trends in modern China respectively. The Biculture Week activities, Confucian Camp and celebration of the Mid-Autumn Festival are examples of opportunities for students to learn and live out values beyond the classroom. Our Character Education Programme is centred on the eight Confucian values of providing the focus for students to learn and understand Confucian values in the context of ancient times and its application to the 21st century world. These values are taught through narratives and stories allowing students to discuss and internalise the values. To complement what is taught in the classroom, the Values Portal is prepared specially for parents to engage their child in further conversations at home. Other activities include Camp Achiever, a school-wide camp, and the Ceremonial Walk through the Values Gateway, which serves to enable students to imbibe school values and symbolises Nanhuarians embracing the school values respectively. CnME is a school-developed curriculum where our students develop 21st century competencies as they explore areas of interest. Anchored in the guiding principle POTENTIAL (Providing Opportunities To Engage and Nurture Talent In Academic areas of Learning), the curriculum has elements of collaborative work, research and ICT skills and a focus on creativity.', 'MRS TAN JONG LEK', 'Chinese', 'CO-ED SCHOOL', 'A school of excellence that nurtures world-ready Bicultural Scholars who embrace tradition and are c', 'na', 'To nurture confident, creative and cultured students with a passion for learning.', 'Yes', 'SINGLE SESSION', 'NAN HUA HIGH SCHOOL', 'CLEMENTI', '41 CLEMENTI AVENUE 1', 'na', 'na', 'WEST', '194', 'http://www.nanhuahigh.moe.edu.sg'),
(181, '62932594', 'No', 'Tamil', 'na', '327919', 'GOVERNMENT SCHOOL', 'MR LAWRENCE POON YEW LEE', 'MISS USHA JEYARAJAH', 'SECONDARY', 'BENDEMEER_SS@MOE.EDU.SG', 'No', 'SOUTH 5', 'na', 'At Bendemeer Secondary School, we believe that all students are unique individuals and we provide exceptional educational experiences that help them discover their strengths and talents. With our school values of Integrity, Care, Respect, Responsibility and Resilience, we nurture our students to be self-aware, self-directed and to take ownership of their own learning. We nurture morally upright students who persevere in the face of challenges. We provide them with leadership opportunities and allow them to demonstrate their creativity and initiative. Through research-based practice and innovation, as well as a strong culture of care, our dedicated and professional staff supports each child\'s learning and social-emotional needs. In doing so, we nurture Bendemeer graduates who are confident youths equipped with the values, skills and knowledge to succeed, and who collaborate with others to contribute to the betterment of the community and country.', 'BOON KENG MRT', '13,  23,  31,  64,  65,  66, 125, 133, 140, 147, 857, 985', 'na', '62927616', 'No', 'The school\'s Applied Learning Programme (ALP), \'Making Science Alive through Authentic Problem Based Learning\', helps students develop an appreciation of concepts and principles related to Health Science. Our Learning for Life Programme (LLP) focusses on Developing Student Leadership through Service Learning, where students are given opportunities to collaborate and lead their peers in level Values-in-Action (VIA) projects.  The school\'s collaboration with the Kolam Ayer Youth Executive Committee in the \'Dialogue with Minister\' Series gives Bendemeerians the opportunity to voice their views on issues affecting their community. The school\'s internationalisation programme gives every student the opportunity to travel abroad. The Sequoia and NTcipate Life programmes are specially customised to engage N(A) and N(T) students through experiential learning experiences to discover their aspirations and fulfil their potential. Learning is engaging in and out of the classroom as teachers adopt research-based teaching methodologies, such as inquiry-based, problem-based, and cooperative and collaborative learning, to deepen and enrich students\' understanding and equip them with 21st century competencies. Innovative programmes include our Dramaworkz programme which uses drama to develop confident and expressive speakers, and BackPackLIVE!, a project which uses a web-based integrated learning and assessment system to enhance students\' competencies in comprehension and critical thinking skills in the learning of the Mother Tongue language. Students\' interests and talents are further developed through programmes like the Mathematics Learning Trail, the Maths Olympiad and the Design Skills Enrichment for D&T students. Co-curricular experiences such as the Career Guidance Programme, complements the curriculum in providing a holistic education. Through this programme, students are able to visit various industries in the aviation, health science, and service industries.', 'MR CHEN FOOK PANG', 'Chinese', 'CO-ED SCHOOL', 'Active Learners, Responsible Citizens', 'na', 'A School that Builds Character, Nurtures Learners and Serves the Community', 'No', 'SINGLE SESSION', 'BENDEMEER SECONDARY SCHOOL', 'KALLANG', '1 ST WILFRED ROAD', 'Malay', 'na', 'SOUTH', '179', 'http://www.bendemeersec.moe.edu.sg'),
(182, '63670180', 'No', 'Tamil', 'na', '739062', 'GOVERNMENT SCHOOL', 'MDM ONG LAY YEN', 'MR JIN SEBASTIAN', 'SECONDARY', 'fcss@moe.edu.sg', 'No', 'NORTH 7', 'na', 'Every child matters in Fuchun. Our dedicated team of teachers exercise discipline with care because we believe in preparing our students not just for examinations, but for life. We are proud of our culture of care and emphasis is placed on building the school values of Integrity, Camaraderie, Adaptability, Responsibility and a keen pursuit for Excellence (ICARE) through our teaching and co-curriculum. Our students develop resilience through the high standards we expect of them in everything that they do. Every student is teachable and can excel. We ensure that the needs of learners of various abilities are catered for through our customised teaching and learning programmes, including the use of information and communication technologies. Our academic framework ACE3 allows this through various modes of Assessment, including formative assessments, enabling our students in collaboration, engaging our learners through a rich curriculum, delving in Experimentation and learning through Exper', 'MARSILING MRT', '187, 856, 912, 925, 926, 950, 960, 961, 963, 966', 'na', '63681984', 'No', 'Your child is unique, blessed with talents and fired with passion in his or her interests which is why, within our framework of holistic development, we provide a host of exciting opportunities to maximise the potential of your child through various Talent Identification Programmes. We offer two distinctive programmes - the Applied Learning Programme (ALP), \'Innovations in Science and Technology for SustainAbility\', which we partner STEM Inc to engage students in simulation, modelling and mBot, and the Learning for Life Programme (LLP), \'Values Through Dance\', which students develop character through dance and other performing arts in school. To nurture life-long LEARNERS, we introduce interdisciplinary project work at Lower Secondary and Values-In-Action projects at Upper Secondary to imbue life skills and 21st Century skills.  The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects. Our student LEADERS are active contributors to community work. Fuchun Secondary offers all students opportunities to develop their leadership skills and confidence building workshops. Believers in the green cause can participate in our environmental programme that has earned various accolades including the SEC\'s highest achievement, the Lotus Award, and the NEA\'s 3R Gold Award. Aligned to our vision of every student an EXPLORER, our students enjoy opportunities to learn beyond the classroom and participate in overseas trips in their 4-5 years in Fuchun Secondary.', 'MDM ONG BEE LIAN DORIS', 'Chinese', 'CO-ED SCHOOL', 'A Learner, A Leader, An Explorer', 'na', 'Nurturing Life-long Learners, Empowering Them to Lead, Inspiring Them to Explore', 'No', 'SINGLE SESSION', 'FUCHUN SECONDARY SCHOOL', 'WOODLANDS', '21 WOODLANDS AVENUE 1', 'Malay', 'na', 'NORTH', '180', 'http://www.fuchunsec.moe.edu.sg'),
(183, '64582425', 'No', 'Tamil', 'na', '569362', 'GOVERNMENT SCHOOL', 'MISS ONG HUI CHEE', 'MDM TONG WAI HAN', 'SECONDARY', 'AMKSS@MOE.EDU.SG', 'No', 'SOUTH 1', 'na', 'With a strong conviction that \'Every Child Matters\', the school believes that every student is unique and capable of learning. The school focuses on identifying students\' talents and interests to develop them to their full potential through its curricular and co-curricular programmes. The school has put in place multiple pathways and learning processes that cater to the individual needs of its students. Its mission is to nurture students to become independent learners who take full responsibility for their own learning. The highly committed staff endeavours to develop diverse talents amongst the students by creating a positive and collaborative learning culture. The school sets high expectations to realise its vision, \'Mindset for Excellence\'.', 'ANG MO KIO MRT', '13, 74, 76, 88, 130, 132, 133, 136, 165, 169, 265, 268, 269, 851, 852', 'MR TEO CHEE KEONG, JASON', '64548605', 'No', 'Unique to the school is the lower secondary Learning for Life Programme (LLP), a curriculum designed to expose every student to drama, visual arts, dance and music. Opportunities are provided for students to hone their talents through performances such as Lunchtime Performances, school concerts and the biennial Night of Music, Arts and Dance (NOMAD). In \'Developing 21st Century Learners\', the school has embarked on Alternative Modes of Assessment  (AMA) as a whole-school approach to engage students in Assessment for Learning and Assessment as Learning, so as to cultivate self-directed and independent learners. The school\'s Applied Learning Programme (ALP), \'Environment Science & Sustainable Living\', equips students with 21st century competencies by developing them in scientific inquiry skills. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR CHAN KOK TUNG TOM', 'Chinese', 'CO-ED SCHOOL', 'A school of choice with a Culture of Learning, a Mindset for Excellence and a Spirit of Service.', 'na', 'To provide a holistic education that nurtures lifelong learners, responsible citizens and resilient ', 'No', 'SINGLE SESSION', 'ANG MO KIO SECONDARY SCHOOL', 'ANG MO KIO', '6 ANG MO KIO STREET 22', 'Malay', 'na', 'SOUTH', '181', 'http://www.angmokiosec.moe.edu.sg/'),
(184, '64491314', 'No', 'Tamil', 'na', '468585', 'GOVERNMENT SCHOOL', 'MR CHEN BING HONG', 'MR KANG YONG SOON ANDREW', 'SECONDARY', 'bsss@moe.edu.sg', 'No', 'EAST 2', 'na', 'Bedok South Secondary School\'s motto is Success through Endeavour. We are a value-added, quality school that is committed to engaging and nurturing the whole child through student-centric approaches. The school strives to develop all BDSians to become active members of the society imbued with 21st century competencies and skills. We believe in inculcating the ICARE values (Integrity, Courage, Accountability, Respect,Excellence and Care) in our students to prepare them for life. The value of caring for themselves, their families, friends and the community is a very important part of BDS education and culture.', 'TANAH MERAH MRT', '10, 14, 45', 'na', '64414479', 'No', 'The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects. ALP Project S.H.I.N.E. aims to bring about active student learning through the progressive development of 21st CC and skills such as critical thinking, creativity, innovation and collaborating learning. It is an interdisciplinary(Sci, EL, FCE & D&T) programme. The curriculum design involves the use of experiential and inquiry learning through the Design Thinking approach. The integration with subjects such as Science, English, FCE and Design and Technology allows students to see the relevance of what they are learning and apply them in the Design Challenge given. This curriculum is further enhanced with partnerships with tertiary institutions and enhanced elective modules to allow students to be aware of possible career opportunities. LLP Shape@BDS aims to develop students into healthy and physically educated enthusiasts for life through Sports and Outdoor Education. Students are nurtured through structured programme from Sec 1 to Sec 5. Each level takes on a thematic Sports for life programme: Sec 1 - Swimmers for Life, Sec 2 - Outdoors for Life, Sec 3 - Active Movers for Life and Sec 4/5 - Fitness Enthusiasts for Life.', 'MISS PAULINE FUN KAR WHYE', 'Chinese', 'CO-ED SCHOOL', 'A Value-Added, Quality School', 'na', 'Build Character, Develop Leaders of Tomorrow (who will) Serve with Conviction', 'No', 'SINGLE SESSION', 'BEDOK SOUTH SECONDARY SCHOOL', 'BEDOK', '1 JALAN LANGGAR BEDOK', 'Malay', 'na', 'EAST', '182', 'http://www.bedoksouthsec.moe.edu.sg'),
(185, '67789543', 'No', 'Tamil', 'na', '129904', 'GOVERNMENT SCHOOL', 'MR KEVIN ANG', 'MISS AW ZHU JUN LEAH', 'SECONDARY', 'ctss@moe.edu.sg', 'No', 'WEST 1', 'na', 'In our CTSS journey towards excellence, we believe that every Clementeen can aspire and grow in character, citizenship and academic ability. We constantly strive to imbue the ABC (ACTIVE, BRIGHT and CARING) traits in all Clementeens. We partner parents and the community to inculcate the core values of the school, \'Adaptability, Self-Discipline, Perseverance, Integrity and Respect\' (ASPIRE) in every Clementeen. In the development of our staff, we focus on building Professional Learning Communities within the school to promote innovation and collegiality among staff. We believe that teachers hold the key to unlock the hearts and minds of our students, while leaders are the catalysts of change. The school thus strives for a high standard of professionalism, hones professional practice and enhances staff engagement to help our staff stay connected to our shared purpose.', 'CLEMENTI MRT', '14, 105, 106, 147, 156, 165, 166, 173, 175, 184, 196, 282, 284, 285, 7, 96, 99', 'MDM ONG POH CHOO DORIS', '67777362', 'No', 'CTSS places a strong emphasis on character education and firmly believes in providing a holistic education to every student. With our strong foundation in Uniformed Groups (UGs), CTSS seeks to achieve the vision \'Every Cadet, A Leader\' through our Learning for Life Programme (LLP), which develops leadership qualities in Clementeens through a structured UG experience. Acclaimed character development programmes such as 7 Habits for Highly Effective Youths (featured in Stephen Covey\'s book \'The Leader in Me\'), Normal Technical REAL (Reflective, Experiential, Authentic and Leadership) Curriculum, Student Leadership and National Education Programmes and Service-Learning nurture 21st Century Competencies and resilience in our students. The school\'s Teaching and Learning framework guides teachers in the design, delivery and development of our teaching practices which would shape our students\' learning experiences. The emphasis on Rigour, Relevance and Relationship guide a segmentised approach to deliver the core curriculum to all, give support to weaker students, and develop those with unique talents. Special programmes, such as Drama-in-Curriculum, Science and Maths Talent Development Programes and LOTM (Learning on the Move) using technology, are put in place to foster authentic experiential learning.  The school\'s Applied Learning Programme (ALP), C.O.D.E. (Computing to Discover and Empower), helps our students thrive in the digital age by equipping them with computational thinking and programming skills.  The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MDM LEE CHING GUAN HELEN', 'Chinese', 'CO-ED SCHOOL', 'To be a vibrant community of learners that values every individual and nurtures the spirit of excell', 'na', 'To develop in every Clementeen the passion to learn, the confidence to lead, and the humility to ser', 'No', 'SINGLE SESSION', 'CLEMENTI TOWN SECONDARY SCHOOL', 'CLEMENTI', '10 CLEMENTI AVE 3', 'Malay', 'na', 'WEST', '183', 'http://www.clementitownsec.moe.edu.sg/'),
(186, '64491450', 'No', 'Tamil', 'na', '465561', 'GOVERNMENT SCHOOL', 'MR VIKNESVARAN S/O VEERAMUTHU', 'MDM CHEW SIANG JIUN', 'SECONDARY', 'temasek_ss@moe.edu.sg', 'No', 'EAST 2', 'na', 'In Temasek Secondary School, we are firmly guided by our Motto, \"We Care\". It underpins our teachers\' belief and directs their approach in caring for and knowing each individual Temasekian well so that the students can be developed to the best of their abilities. In caring for our students, we ensure that they receive an education that empowers them to master their own learning and excel academically. More fundamentally, we care to systematically provide for the development of Temasekians\' moral character and vital life-skills such as critical thinking, problem-solving, communication and leadership skills that enable them to adapt flexibly and rise to challenges in the future. We also design and implement with care, purposeful and engaging experiences for students to learn about various cultural, social and global issues, while guiding them to empathise with others, so that they will act on what is good and right for the family, school, community and nation.', 'BEDOK MRT, TANAH MERAH MRT', '10, 10e, 13, 14, 43, 46, 229, 506, 531, 853', 'na', '64495020', 'No', 'With our school\'s Student Development Vision of \"Every Temasekian, A Caring Leader\", all students undergo a journey of growth in personal mastery and leadership through a structured 4-year leadership course. This course empowers them with the know-how to care for, take charge and succeed in their academic pursuits and character development. Students who demonstrate potential and interest, are further developed to lead in various school-level and community-based activities as CCA leaders and/or leaders in one of the five student leadership groups. These experiences allow them to apply their leadership skills and life-skills as well as develop empathy and care for others. Students with strong academic and leadership inclinations can also participate in the 4-year Talent Development@Temasek programme. Recognising that our students need to be ready to navigate and thrive in a culturally-diverse 21st century workplace and world, all Temasekians are developed in Cross-Cultural Awareness (C2A) through a specially designed and integrated school-based curriculum. Students are first introduced to C2A in Secondary 1 via Project Culture which piques their curiosity to learn about various components of culture. Through the Secondary 2 Camp Culture as well as a range of other academic and co-curriculum platforms, students also progressively learn to observe, appreciate and interpret different cultural practices and behaviours. These learning culminate in experiential opportunities such as overseas learning trips, collaborations with local international schools and work attachments where students apply their knowledge and skills to work with people from other cultures. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MRS CHIA MINN DAYNA', 'Chinese', 'CO-ED SCHOOL', 'A school known for nurturing leaders of character and intellect.', 'na', 'To provide a nurturing, challenging and inclusive environment for every Temasekian to be developed i', 'Yes', 'SINGLE SESSION', 'TEMASEK SECONDARY SCHOOL', 'BEDOK', '600 UPPER EAST COAST ROAD', 'Malay', 'na', 'EAST', '184', 'http://www.temaseksec.moe.edu.sg'),
(187, '64583284', 'No', 'Tamil', 'na', '569384', 'GOVERNMENT SCHOOL', 'MDM NORHAYATI BTE AWANG', 'MR TOH KIM YONG VINCENT', 'SECONDARY', 'MAYFLOWER_SS@MOE.EDU.SG', 'No', 'SOUTH 1', 'na', 'Mayflower Secondary School believes that every student that comes to us is a child with a unique blend of gifts and strengths. The Mayflower Promise enshrines what the school, through its programmes, activities and culture, seeks to develop in every student a zest for life, a curious mind and a generous spirit. In the quest for a life of purpose and service, Mayflowerians are constantly encouraged to be mighty in thought and deed, and to overcome their self-imposed limitations to expand their capacity. Through innovative customised programmes, the staff seeks to provide learning experiences that develop knowledge, skills and values that enable Mayflowerians to thrive in the future.', 'ANG MO KIO MRT', '76,132,165,166,169,200,000,000', 'MR LAI CHYH JAU', '64577783', 'No', 'Zest for Life: Every aspect of the Mayflower experience is designed to help students develop a strong sense of purpose and a deep love for learning, to attain their personal bests.  Being a school that offers Learning for Life Programme (LLP) in Aesthetics, students enjoy a rich performing arts experience.  The Applied Learning Programme (ALP) in Effective Communication helps our students grow in confidence as bilingual communicators, able to adapt their message to purpose, audience and context.  Curious Mind: We want our students to be discerning learners who are well-equipped for life. Besides academic rigour, students develop 21st Century competencies and life skills through customised programmes such as exciting overseas immersion programmes in Hong Kong and Indonesia. Through the Mayflower Youth Environmental Guardian (YEG) programme, students apply what they have learnt about the environment in authentic contexts, contributing meaningfully to environmental protection.  Generous Spirit: Character is shaped through rigorous academic and CCA experiences where values such as integrity and commitment are emphasised. We promote a positive peer culture where excellence is attained through mutual help and encouragement.  In CCA, our students learn the importance of giving of their best and take joy in celebrating one another\'s success.  In VIA, students contribute by serving their peers and in helping local and overseas communities.  The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR LOO MING YAW', 'Chinese', 'CO-ED SCHOOL', 'Every Mayflowerian has a zest for life, a curious mind and a generous spirit', 'na', 'Every Mayflowerian - Mighty in Thought and Deed', 'No', 'SINGLE SESSION', 'MAYFLOWER SECONDARY SCHOOL', 'ANG MO KIO', '2 ANG MO KIO STREET 21', 'Malay', 'na', 'SOUTH', '185', 'http://www.mayflowersec.moe.edu.sg/'),
(188, '68422563', 'No', 'Tamil', 'na', '419612', 'GOVERNMENT SCHOOL', 'MRS OH WEE MING', 'MDM AINI BINTI MOHD SHARIFF', 'SECONDARY', 'BNSS@MOE.EDU.SG', 'No', 'EAST 4', 'na', 'Our School Philosophy is \'All can Learn, All can Achieve, All can Serve\' which describes our belief for life-long learning and learning for life; our attitude to strive for excellence in whatever we do as well as our caring heart and responsibility to give back to the society. We seek to inculcate in our students the six school values: Resilience, Respect, Responsibility, Integrity, Care and Harmony to achieve the five BNSS desired outcomes of \'Strive for Excellence; Encourage Experimentation; Rejoice in Doing Good; Value Diversity; Embrace Lifelong Learning\' (SERVE) in our students. Over the years, our students have achieved value-added outcomes in both academic and non-academic domains. All these are attributed to a team of dedicated teachers, committed non-teaching staff as well as our supportive parents.', 'BEDOK MRT, EUNOS MRT, KAKI BUKIT MRT', '2N, 5, 8, 15, 21, 22, 58, 59, 60, 65, 66, 87, 506, 585, CT18, NR7', 'na', '68420631', 'No', 'The school\'s Applied Learning Programme (ALP) in Environmental Studies and Sustainable Living aims to enhance students\' awareness and understanding of environmental issues and knowledge of sustainable living. In the water sensing module, students learn about programming using Arduino and making use of sensors to measure water quality. In the clean energy module, they design prototypes that harness solar energy to power solar cars. Students are also given opportunities to understand how other country creates a sustainable environment through the ALP Overseas Trip. They are thus better equipped to understand concepts relating to environmental science, and local and global environmental issues. Students are also equipped with ICT and research skills to complete their projects and coursework. The Learning for Life Programme (LLP) provides opportunities for students to develop an appreciation for the arts and maximize their potential in their different areas of talents. Through the learning and training processes in the arts, students develop good character and 21st century competencies. These learning experiences in Arts Education not only deepen students\' awareness and interest in the various aesthetics areas, but also teach them ways to transfer their learning to serve the community. In line with the school\'s vision of preparing students to be leaders for the future, the school develops in students self-awareness for personal leadership and effectiveness. Workshops and Leadership camps are organised for student leaders (class leaders, CCA leaders and Student Councillors) to enable them to lead with competence and confidence. The school provides opportunities for students to participate in sports; and mounts life-skills programmes (such as the Biennial Fiesta and Musical, Motivational and Study Skills Workshops, subject-based learning journeys, VIA, overseas cultural exchanges and Cohort Overseas Trip) for the holistic development of students.', 'MR CHUA LEK HONG', 'Chinese', 'CO-ED SCHOOL', 'Leaders for the Future; Creative Lifelong Learners, Morally Upright, Caring and Loyal', 'na', 'To develop our students holistically through quality programmes within a nurturing environment.', 'No', 'SINGLE SESSION', 'BEDOK NORTH SECONDARY SCHOOL', 'BEDOK', '20 JALAN DAMAI', 'Malay', 'na', 'EAST', '186', 'http://www.bedoknorthsec.moe.edu.sg'),
(189, '67843059', 'No', 'Tamil', 'na', '529427', 'GOVERNMENT SCHOOL', 'MDM SO MUN YEE', 'MRS ROSE CHEN', 'SECONDARY', 'TPSS@MOE.EDU.SG', 'No', 'EAST 6', 'na', 'Tampines Secondary School aims to develop every Tampinesian into a self-directed and motivated learner who embodies the school values of Teamwork, Perseverance, Service and Success. In an environment of care and excellence, students are equipped with the skills and competencies required to thrive in the future. Towards this endeavour, the school offers customised cohort anchor programmes such as Modern Day Science, Media Literacy, Mathepulative, and Authentic Problem Solving through Design Thinking, to ignite students\' curiosity and extend their learning beyond the standard curriculum. The school\'s co-curriculum provides opportunities for students to develop character, acquire leadership and life skills, as well as prepares them for their next phase of learning. Quality school experiences are provided through level camps, cohort bonding activities, service learning projects, education and career guidance programmes and leadership training adapted from Ron Edmonson\'s 3C Leadership Model', 'TAMPINES MRT', '3,  8,  15,  17,  18,   21,   27,  28,  34,  39,  59,  168,  292,  518,  553', 'na', '67835423', 'No', 'The school offers a Learning for Life Programme in \'Creative Expressions: Expressing Creatively Through Visual and Performing Arts\'.  Creative Expressions aid in developing students\' ability to acquire new skills; collaborate with one another; communicate effectively; be innovative and flexible; and to strive for excellence.  These competencies are nurtured through the Arts and Aesthetics Programme where students are offered various electives in the genre: drama, music and dance, based on their interest.  Apart from picking up new skills, students go through various stages of critique and peer evaluation, which reinforces empathy, communication and collaboration.  To promote applied learning in the academic domain, the school has an Applied Learning Programme in \'Creative Engineering: Inter-disciplinary Authentic Problem Solving\'.  Using the Design Thinking framework, the school aims to integrate problem solving into the disciplines of Mathematics and the Sciences (Physics). The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR SHANE KWOK POH KEONG', 'Chinese', 'CO-ED SCHOOL', 'Bringing out the Best in Every Individual', 'na', 'Providing a well-rounded education within a challenging, caring and supportive environment.', 'No', 'SINGLE SESSION', 'TAMPINES SECONDARY SCHOOL', 'TAMPINES', '252 TAMPINES ST 12', 'Malay', 'na', 'EAST', '187', 'http://www.tpss.moe.edu.sg/'),
(190, '65630945', 'No', 'Tamil', 'na', '659633', 'GOVERNMENT SCHOOL', 'MISS WONG KAH WAI SHIRLEY', 'MR WONG WOEN LONG', 'SECONDARY', 'BUKITVIEW_SS@MOE.EDU.SG', 'No', 'WEST 4', 'na', 'Every student matters. BVSS focuses on providing every student with a quality and meaningful school experience through a school-based total curriculum. Students enjoy learning in a positive, enriching and stimulating environment and teachers care for, grow and nurture students into wholesome, contributing and thinking individuals. Strong teacher-student relations establish an ethos of care and provide the environment to imbue students in strong moral values so that they grow and mature into confident persons, concerned citizens and active contributors - individuals with robust character and a quest for knowledge and learning.', 'BUKIT BATOK MRT', '173', 'na', '65661990', 'No', 'BVSS leverages its niche on Environmental Science and Sustainable Living to develop the Applied Learning Programme (ALP) on \'Clean Energy and Environmental Technology\'. This ALP is part of the BVSS-designed Junior OUtstanding Leaders in Energy for Sustainability (JOULES) Programme where it aims to inculcate students with the knowledge and experience in the area of environment and sustainable energy as well as emphasizing the development of environmental student leadership. All students are part of the JOULES programme where they will undergo tier 1 programme in lower secondary and selected students in tier 2 programme in their upper secondary.    As part of STEM (Science, Technology, Engineering and Mathematics) education, BVSS also focusses on developing students through the Coding and Computational Thinking Infused (CACTUS) Curriculum. This is the school\'s deliberate approach to integrate coding programmes into different subjects through multiple platforms. This allows students to transfer the CACTUS skills learnt to other disciplines subjects ranging from Computing, Math, Science, ALP and Citizenship and Character Education.  BVSS delivers its Learning for Life (LLP) - \'Learning the Arts, Living the Values - Character Education through Drama\' via Literature and Social Studies lessons for lower secondary students.  This complements the robust school-wide and developmental CCE Programme which includes cohort and modular leadership training, life-skills training and Education Career Guidance.   Learning at BVSS is centred on providing and designing engaging experiences through authentic and meaningful learning tasks. Our 5E Curriculum Approach coupled with WRAITEC Thinking tool as well as harnessing ICT affordances provides students with an enriching and engaging learning environment.', 'MR VASUTHEVAN S/O K RAMAMURTHY', 'Chinese', 'CO-ED SCHOOL', 'A Dynamic Institution That Adds Value To All', 'na', 'To nurture Bukit Viewans to be creative, passionate and resilient learners who possess moral integri', 'No', 'SINGLE SESSION', 'BUKIT VIEW SECONDARY SCHOOL', 'BUKIT BATOK', '16 BUKIT BATOK STREET 21', 'Malay', 'na', 'WEST', '188', 'http://www.bukitviewsec.moe.edu.sg'),
(191, '62691774', 'No', 'Tamil', 'na', '739111', 'GOVERNMENT SCHOOL', 'MDM MASAYU BINTE MAHMUD', 'MDM LOH SOI HONG MICHELLE', 'SECONDARY', 'wdl_ss@moe.edu.sg', 'No', 'NORTH 5', 'na', 'A School Distinction Award and Singapore Quality Class school, the school is committed to achieving its mission, \'Nurturing caring, confident and creative individuals equipped to face life\'s challenges\'. Through the school motto \'Wisdom and Truth\', the school seeks to imbue in each student the school values, represented in the acronym WISDOM, which stands for: Working with others, Integrity, PerSeverance, Dedication, LOyalty and Mindset of excellence. The school strongly believes that quality staff, and strong partnerships with alumni, parents, community and educational partners are the foundation for organisational excellence. The students\' many achievements in the Academics, Sports, Performing Arts and Uniform Groups are a testament to the impact of our programmes and commitment in equipping them with the values, skills and knowledge to excel even when students may or may not have the background or prerequisites. We groom our students to be confident and ready for the ever changing e', 'MARSILING MRT', '913, 913E, 178, 856, 903', 'na', '68494400', 'No', 'The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.  The school runs two distinctive school programmes in the Applied Learning Programme entitled \"Real Food, Real Science\" and the Learning for Life Programme entitled \"Active Glocal Citizens\". The Real Food, Real Science Programme is customised for different courses and allows our students to apply the skills they learnt in investigative experiences in Food Science to create healthier food and/or provide services in the Food and Beverage Industry. Two signature modules in Basic Science Research and Hub Cafe@WDL nurture our students to become creative problem solvers. The Active Glocal Citizens Programme provides training in social innovation and entrepreneurship at lower secondary level with local Values-in-Action as the context for application. It culminates in Secondary 3 when our students apply the skills in the cohort overseas Values-in-Action expeditions to ASEAN countries. The programme aspires to prepare our students to be future contributors in the form of community youth leaders. Follow us on our Facebook page (https://www.facebook.com/woodlandssecondarysch) or our Instagram account @woodlandssec for up-to-date information on the learning experiences of our students.', 'MISS TAN KE XIN', 'Chinese', 'CO-ED SCHOOL', 'Weave - quality teaching, learning & values Dream - the best Lead - to inspire', 'na', 'Nurturing Caring, Confident and Creative individuals equipped to face life\'s challenges.', 'No', 'SINGLE SESSION', 'WOODLANDS SECONDARY SCHOOL', 'WOODLANDS', '11 MARSILING ROAD', 'Malay', 'na', 'NORTH', '189', 'http://www.woodlandssec.moe.edu.sg/');
INSERT INTO `schools` (`schoolId`, `fax_no`, `gifted_ind`, `mothertongue3_code`, `fifth_vp_name`, `postal_code`, `type_code`, `second_vp_name`, `first_vp_name`, `mainlevel_code`, `email_address`, `sap_ind`, `cluster_code`, `telephone_no_2`, `philosophy_culture_ethos`, `mrt_desc`, `bus_desc`, `third_vp_name`, `telephone_no`, `ip_ind`, `special_sdp_offered`, `principal_name`, `mothertongue1_code`, `nature_code`, `visionstatement_desc`, `fourth_vp_name`, `missionstatement_desc`, `autonomous_ind`, `session_code`, `school_name`, `dgp_code`, `address`, `mothertongue2_code`, `fax_no_2`, `zone_code`, `_id`, `url_address`) VALUES
(192, '63856559', 'No', 'Tamil', 'na', '547529', 'GOVERNMENT SCHOOL', 'MISS LIM GUIHAO', 'MR INDERJIT SINGH', 'SECONDARY', 'BOWEN_SS@MOE.EDU.SG', 'No', 'NORTH 1', 'na', 'In Bowen Secondary School we are committed to cultivating a mind-set of life-long learning, strength of character and service to others in our students. We also aspire for Bowenians to uphold the school values of, \'Respect, Responsibility, Compassion, Resilience, Teamwork and Excellence\'. There is a culture of care in Bowen where teachers not only teach but also guide every Bowenian to reach for excellence. Bowen\'s school motto, \'I Believe, Therefore I Am\' exemplifies our belief that our students will fulfil their aspirations when they believe in their own abilities and are determined to strive for excellence.', 'HOUGANG MRT, SERANGOON MRT, SENG KANG MRT', '70,73,103,109,156,854,25,74,74E,76,112,132,147,165,55', 'na', '63859466', 'No', 'Students benefit from the school\'s holistic education which is designed to provide a rigorous and engaging academic curriculum as well as develop students\' character through the various CCAs and the Service Learning programme. Bowen challenges students to do well academically, while providing opportunities for them to be fully engaged in learning through creative programmes such as LifeLit, a drama-infused language arts programme for Lower Secondary students. The school\'s strong CCA culture provides a well-balanced and comprehensive co-curricular programme that helps the students to grow into well-rounded individuals. Under the school\'s Community Youth Leaders (CYL) programme, community service is offered as a platform for students to inspire, and be inspired, by engaging in service to others. The school was accorded the Community Youth Leadership pilot school status by the National Youth Council, as well as the Learning for Life Programme (LLP) status by MOE in 2014. The school\'s Social Entrepreneurship Programme (SEP) seeks to nurture creativity, encourage a spirit of enterprise and build empathy, thus preparing students to be entrepreneurs and intrapreneurs in the future. The SEP teaches students to use the tools of Design Thinking to approach challenges and opportunities to create suitable solutions. The school was accorded the Applied Learning Programme (ALP) status in 2016. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR LIU EARNLER', 'Chinese', 'CO-ED SCHOOL', 'Every Bowenian a Passionate Learner, Leader and Champion.', 'na', 'Nurturing Learning. Developing Character. Inspiring Service.', 'No', 'SINGLE SESSION', 'BOWEN SECONDARY SCHOOL', 'HOUGANG', '2 LORONG NAPIRI', 'Malay', 'na', 'NORTH', '190', 'http://www.bowensec.moe.edu.sg'),
(193, '65607006', 'No', 'Tamil', 'na', '658962', 'GOVERNMENT SCHOOL', 'MR LOI GUANG YOU', 'MR MAK YEW CHONG', 'SECONDARY', 'bbss@moe.edu.sg', 'No', 'WEST 7', 'na', 'We believe every child is unique and has innate abilities to be developed.  Our school values - RESPECT (Reflection, Enterprise, Self-discipline, Perseverance, Empathy, Creativity, Teamwork), mission and vision, represent our collective passion, dreams and aspirations, and guide us in how we work with our parents, community and partners to realise the full potential of our students.  We endeavour to build a culture of care, self-directedness and compassion amongst staff and students.  At BBSS, children are firmly at the heart of our work and we seek to develop the whole child by providing meaningful and connected learning experiences that will allow every BBSSian to develop the right values, competencies and skills to do well in the 21st century.', 'BUKIT BATOK MRT', '941, 66, 157, 174, 174E, 178, 188, 506', 'na', '65663121', 'No', 'As our foundational programme, we adopted Arthur L. Costa\'s the Habits of Mind (HOM) to inculcate in BBSSians good learning habits and thinking dispositions so that they can become self-directed, life-long learners.  BBSSians systematically learn the 16 habits through hands-on experiences and then practise these habits daily.  Our LLP is the Community Youth Leadership Programme which aims to nurture RESPECTful Leaders who are confident and self-directed in serving the community with abundance mentality. This programme encompasses the twin pillars of Leadership Development and Values-In-Action (VIA) and provides BBSSians with leadership training experiences like Outward Bound courses and overseas expeditions and opportunities to organise school-wide events like Project Mi and Project Heartwork.  Our ALP is in the area of embedded electronics.  It builds upon the fundamentals of Science, Technology, Engineering and Mathematics (STEM) and aims to develop BBSSians as proactive problem-solvers who care for the world.  This programme focuses on application of sensing technologies in our everyday life.', 'MR PHUA HUAT CHUAN', 'Chinese', 'CO-ED SCHOOL', 'A premier school which provides quality holistic education to every BBSSian.', 'na', 'To nurture BBSSians to be self-directed learners with abundance mentality.', 'No', 'SINGLE SESSION', 'BUKIT BATOK SECONDARY SCHOOL', 'BUKIT BATOK', '50 BUKIT BATOK WEST AVE 8', 'Malay', 'na', 'WEST', '191', 'http://www.bukitbatoksec.moe.edu.sg/'),
(194, '67559112', 'No', 'Tamil', 'na', '768610', 'GOVERNMENT SCHOOL', 'MR CHEW CHEE YONG', 'MR OW WENG KEONG', 'SECONDARY', 'YTSS@MOE.EDU.SG', 'No', 'NORTH 2', 'na', 'YTSS is guided by its vision, \'A School of Distinction, A Community of Leaders\', and is committed to developing every YTzen to be a Confident Leader, Active Citizen and a Global Thinker. It holds firmly to the belief that every student can and wants to learn, and this translates into a commitment to unlock the potential of every child. The school also places a strong emphasis on cultivating self-discipline and imbuing the core values of Integrity, Respect, Resilience and Gratitude in our students. This student-centric approach in educating our students can also be seen in our curriculum. It is designed and implemented by our caring and professional team of teachers who embrace the core belief of \'leave no child behind\'. The curriculum is crafted with the learners in mind and seeks to deepen our students\' understanding of the various disciplines, making learning engaging and meaningful for them. Working closely with supportive parents and alumni, as well as the community and other partn', 'YISHUN MRT', '39, 85, 171, 800, 803, 804, 806, 811, 812, 851, 852, 853, 853C, 854, 854E, 855, 856, 857, 859, 860', 'na', '67587219', 'No', 'Students participate in programmes aligned to the YTzen profile that are designed for their holistic development. These programmes teach character education while challenging our students cognitively and physically. Confident Leader: All students participate in the NYAA (Silver) Programme, learning different skill sets and nurturing attributes that ensure holistic development. They also undergo leadership training through the Student Leadership Development Programmes that involve level camps, expeditions and service learning projects. Selected Student Leaders have the opportunities to take part in the Aspiring and Empowering Leaders Programmes to further develop their leadership competencies. NT students develop life skills and vocational skills in the MY LIFE Programme. Active Citizens: Social-emotional competencies are taught through Process Drama and Values@Heart lessons. Classes also plan and carry out Service Learning projects and reflect on our nation\'s history as they participate in Heritage Trails designed by our teachers. Global Thinkers: The YTSS Cross-Cultural Learning Programmes expand our students\' global outlook while developing their intercultural competencies through local and overseas exchange programmes and learning journey. The STAR Programmes also challenges our students cognitively through interesting research projects in collaboration with Institutes of Higher Learning, both local and overseas.', 'MDM SHARON YEO EU-LIN', 'Chinese', 'CO-ED SCHOOL', 'A School of Distinction. A Community of Leaders.  School motto : We Will Excel.   School Values : In', 'na', 'Nurturing Confident Leaders, Active Citizens and Global Thinkers - YTzens for the Future', 'Yes', 'SINGLE SESSION', 'YISHUN TOWN SECONDARY SCHOOL', 'YISHUN', '6 YISHUN STREET 21', 'Malay', 'na', 'NORTH', '192', 'http://www.yishuntownsec.moe.edu.sg'),
(195, '63852015', 'No', 'Tamil', 'na', '534256', 'GOVERNMENT SCHOOL', 'MDM JESMINE CHUNG KAH MIN', 'MRS YOONG JIN ING', 'SECONDARY', 'HOUGANG_SS@MOE.EDU.SG', 'No', 'NORTH 3', 'na', 'Founded in 2001, Hougang Secondary School (HS) provides an all-round education for Hougeans to pursue their strengths and passions. As a school of distinction, HS is recognised for having best practices in Student All-Round Development, Character and Citizenship Education (CCE), and Teaching & Learning. With a strong belief that \"Every Student Counts\", HS places strong emphasis on character and values education. The school is committed to nurture every Hougean into a Grateful Child, Respectful Pupil and Compassionate Citizen (GRC) who will make the difference in their life journey even after they have left the gates of HS. There are opportunities for our students to be imbued with GRC values through values-driven CCAs that cater to the different needs and interests of the students. Gratitude - HS teaches every Hougean to show acts of appreciation as their successes are the joint effort of their parents, teachers and the community. Respect - HS teaches every Hougean the value of respect', 'HOUGANG MRT, BUANGKOK MRT', '43, 88, 101, 109, 156, 159, 161, 325', 'na', '63851990', 'No', 'HS has a strong conviction in character excellence as the school believes that strong values will provide students the impetus towards academic excellence. Therefore, the school\'s Learning for Life Programme - Community Youth Leadership programme, \"GRC in Action, A Hougean Way of Life\", provides a sustained and enhanced values education progressively over 4/5 years. Leveraging the 3Es approach to VIA (Enrich Minds, Encourage Hearts, Engage Hands), students take ownership of their involvement by understanding the needs of the community, co-constructing with and mentoring their peers to bring about awareness, action and advocacy in a community need. One signature event is the Secondary 3 Overseas Service Learning where students plan and serve in countries in the region. In order to nurture our Hougeans to be confident speakers, the school has embarked on an exciting journey in our Applied Learning Programme, \"English Communication Skills through Authentic Learning\" to promote communication skills using real life learning platforms. By furnishing our students with authentic settings and problems, they will be able to acquire useful and portable communication skills. The programme includes broadcasting, public speaking, debates, drama and journalism. HS provides a robust Teaching & Learning curriculum that focuses on experiential learning. Programmes include ICT-based multimedia project work: blogs, audio and video podcasts, learning journeys, learning experiences through critical reading, creative writing and strategic oral communication workshops, Sec 1 Math Trail, Sec 2 Maths Magic, HS Math Talent Programme, ELEMENTZ Science Research Conference and Exhibition, Funtasia (Science Fun Day), IHL Outreach Programme to University and Polytechnics, Humanities Inquiry Learning (Social Studies, Elective Geography/History), Earth Week, Life Run Carnival, Sec 2 Adventure Camp, Sports Education Programme, Inter-class Games, Interdisciplinary Project Work and SciTechHuMatics.', 'MR ARIVAZHAGAN MANICKAM', 'Chinese', 'CO-ED SCHOOL', 'Grateful Children. Respectful Pupils. Compassionate Citizens', 'na', 'Care. Lead. Inspire. Partner', 'No', 'SINGLE SESSION', 'HOUGANG SECONDARY SCHOOL', 'HOUGANG', '2 HOUGANG STREET 93', 'Malay', 'na', 'NORTH', '193', 'http://www.hougangsec.moe.edu.sg/'),
(196, '67488980', 'No', 'Tamil', 'na', '389706', 'GOVERNMENT-AIDED SCH', 'MDM SEAH BEE HUI', 'MR YAK BENG WEI', 'PRIMARY', 'GMPS@moe.edu.sg', 'No', 'EAST 5', 'na', 'na', 'Aljunied', '80, 155', 'MISS NG BEE KENG', '67486746', 'No', 'Learning for Life Programme (Env Science) LEAD@ICT Programme SMART Reading Programme Rainbow Programme Reading Assistance Programme CINUX Programme for Chinese Language', 'MDM JENNIFER HAN ENG JUAN', 'Chinese', 'CO-ED SCHOOL', 'To develop every pupil into Self-Directed Learner, Compassionate Leader and Responsible and Useful C', 'na', 'A school of excellence where pupils and staff can grow in wisdom, stature and in favour with God and', 'No', 'DOUBLE SESSION', 'GEYLANG METHODIST SCHOOL (PRIMARY)', 'GEYLANG', '4 GEYLANG EAST CENTRAL', 'Malay', 'na', 'EAST', '291', 'www.gmsp.edu.sg'),
(197, '65630920', 'No', 'Tamil', 'na', '659250', 'GOVERNMENT SCHOOL', 'MISS CHOW WAI HOONG', 'MR V HARINDRANATH', 'SECONDARY', 'HILLGROVE_SS@MOE.EDU.SG', 'No', 'WEST 2', 'na', 'The school\'s philosophy is \'Potential + Character = Success\'. It means that the school believes in each student and builds his/her character in order to help him/her to succeed. Staff and students are also guided by the school values of Integrity, Care, Responsibility, Respect and Resilience.', 'BUKIT BATOK MRT,BUKIT GOMBAK MRT', '176, 985, 945', 'MR LYE DELI', '65603726', 'No', 'Hillgrove\'s Flight & Aerospace (F&A) ALP aims to raise students\' understanding of and appreciation for Science, Technology, Engineering and Mathematics (STEM) in the field of aerospace. Through our programme design and strong partnerships with the aerospace industry, we aspire to do our part in nurturing future aerospace professionals in support of Singapore\'s goal to be Asia\'s Aviation Hub.  Our F&A ALP is a four-year programme which builds real-life knowledge and skills and raises awareness of the different types of careers within the aerospace industry. Adding to the rigor in the Academics, CCA programmes and F&A ALP, we also have our Arts LLP for the holistic development of Hillgrovians. Through the Arts LLP, students will be able to articulate and communicate their ideas and talents effectively. As a school, we also want to ignite the students\' interest and passion towards the Arts and for them to consider careers in the Arts.', 'MDM ONG HUI MIIN ANGELINE', 'Chinese', 'CO-ED SCHOOL', 'Learn, Care and Make a Difference', 'na', 'To nurture Confident and Passionate Hillgrovians who continually Learn with a spirit to do one\'s bes', 'No', 'SINGLE SESSION', 'HILLGROVE SECONDARY SCHOOL', 'BUKIT BATOK', '10 BUKIT BATOK STREET 52', 'Malay', 'na', 'WEST', '195', 'http://www.hillgrovesec.moe.edu.sg'),
(198, '65810557', 'No', 'Tamil', 'na', '519073', 'GOVERNMENT SCHOOL', 'MR HO SENG FATT', 'MDM NG BEE LING', 'SECONDARY', 'LOYANG_SS@MOE.EDU.SG', 'No', 'EAST 1', 'na', 'At Loyang Secondary School (LYSS), every child is unique and important. We do everything with love, constantly and purposefully doing whatever it takes to pursue quality service, thus impacting the lives of students in our care with passion.  The school focuses on holistic student development programmes, emphasising on academic value-addedness and character development and a rewarding school experience.  From 2014, the school has initiated the Loyang Experience for all students, with the intent of strengthening student-centricity and accentuating the distinctiveness of LYSS. The Loyang Experience integrates key programmes (such as Teaching and Learning, Character and Citizenship Education and Applied Learning) through common student outcomes and is aimed at strengthening the holistic development of students.', 'PASIR RIS MRT', '12, 21, 39, 53, 81, 359, 351', 'na', '65821727', 'No', 'One signature programme in The Loyang Experience is our Applied Learning Programme (ALP), Effective Communication. The hallmark of a confident person is his/her ability to communicate effectively. LYSS has adopted a whole-school approach to the development of students\' oral communication skills through promoting the use of good spoken English in daily interaction within and beyond curriculum time. In addition, we believe in creating opportunities for all students to express themselves in the classroom by using pedagogical approaches that promote oral communication as well as providing platforms beyond the classroom for students who show talent in this area. Some of these platforms include Public Speaking, Debates and Drama. With the emphasis on developing 21st Century Competencies in our students and to create an internationalisation experience for our students, all Sec 3 students will have the opportunity to participate in Overseas Education Programme. The school\'s Uniformed Groups and Performance Arts groups excel in the area of student development. Through a wide array of activities, students of different backgrounds have ample opportunities to interact with each other and build closer bonds. These programmes also contribute significantly to developing individuals of sound character imbued with the school values of Integrity, Resilience, Respect, and Compassion. Other Programmes Offered Include: Elective and Advanced Elective Modules, Conversational Chinese and Malay, Educational and Career Guidance Programme, National Youth Achievement Award Programme, Overseas Education Programme, Public Speaking Programme, Reading Programme, Sports Education Programme, Student Leadership Programme and Swimming Programme. Enrichment Activities Include: Guitar, Guzheng, Ukulele, Tchoukball and Finger Painting.', 'MR LEE HAK BOON', 'Chinese', 'CO-ED SCHOOL', 'Loyang Secondary School is a happy and caring school where students achieve their potential, are of ', 'na', 'To build a team of competent and dedicated staff, working closely with our stakeholders in deliverin', 'No', 'SINGLE SESSION', 'LOYANG SECONDARY SCHOOL', 'PASIR RIS', '12 PASIR RIS STREET 11', 'Malay', 'na', 'EAST', '196', 'http://www.loyangsec.moe.edu.sg/'),
(199, '63851068', 'No', 'Tamil', 'na', '538789', 'GOVERNMENT SCHOOL', 'MR YONG YIK YEN BENJAMIN', 'MISS GOH BEE LIM MABEL', 'SECONDARY', 'xinmin_ss@moe.edu.sg', 'No', 'NORTH 1', 'na', 'Xinmin strives to maintain its rich heritage and tradition of providing the very best learning environment for its students. In this school, staff and stakeholders inculcate good personal, moral, and social values in our students, as well as discipline and a focus on learning for life to shape the whole person. This is done through a range of activities and programmes. Our students excel in sports and outdoor activities, arts, service to school and community, as well as in their academic studies. The school community is strongly supported by a committed and dedicated team of alumni and the School Advisory Committee, who believe in providing a holistic and enriching school experience for our students. Facilities in the school are constantly upgraded and leading programmes are developed to stretch the cognitive, physical, aesthetics, and social-moral domains of development of our students. Student learning is also enabled through a capable team of teachers who demonstrate the highest lev', 'HOUGANG MRT', '25, 55, 70, 72, 73, 74, 88, 101, 103, 112, 132, 147, 156, 159, 161, 165, 315, 854', 'MR FONG KIM WAH', '62889382', 'No', 'In Xinmin, the development of 21st century skills is integrated into our curriculum and our tiered approach provides varying developmental opportunities to students according to their interests and abilities. In addition, all our students look forward to our school-based curriculum, comprising Analytical Thinking Skills, a games-based approach to learning thinking skills; Applied Science Programme which allows students to apply their Science knowledge in research and problem solving; ICT and Enterprise programmes which allow students to exercise creative and inventive thinking; Drama at Sec 2 level which allows students to express their thoughts and ideas through performance; as well as an enjoyable and challenging PE programme that allows students to develop psychomotor skills, learn new games, acquire soft skills and mindsets of resilience and teamwork. Our Flipped Classroom pedagogy at the lower secondary levels emphasises collaborative and self-directed learning, and allows students to acquire lifelong skills for future learning. Leadership training is provided to all students and student leaders are given many opportunities for further development in skills and exposure to real-world learning.', 'MDM LIM HONG PENG', 'Chinese', 'CO-ED SCHOOL', 'Leading Hearts, Leading Minds', 'na', 'To develop Xinmin students to their full potential, to inculcate in them sound values, as well as a ', 'Yes', 'SINGLE SESSION', 'XINMIN SECONDARY SCHOOL', 'HOUGANG', '11 HOUGANG AVENUE 8', 'Malay', 'na', 'NORTH', '197', 'http://www.xinminss.edu.sg'),
(200, '67628334', 'No', 'Tamil', 'na', '679938', 'GOVERNMENT SCHOOL', 'na', 'MR NG HAN MING', 'SECONDARY', 'gss@moe.edu.sg', 'No', 'WEST 6', 'na', 'In Greenridge Secondary School, we believe that every child matters and everyone can \"Learn, Improve and Excel\".  As one learning community with a strong culture of excellence, care, collaboration and reflection, we aim to develop every Greenridgean to be a dynamic thinker, an inspiring leader and a contributing citizen. Our Greenridgeans will develop the capacity for good thinking, the ability to manage self and others well and the resolve to lead their life with a clear sense of purpose and a strong desire to contribute to the larger good of the community and nation.', 'BANGKIT LRT', '722, 920, 922, 971E, 972', 'na', '67601052', 'No', 'In providing quality holistic education for all Greenridgeans, Greenridge Secondary School emphasizes academic excellence and character excellence. Our key programmes include an integrated Character and Citizenship Education programme which aims to inculcate in our students moral values, tenacity, socio-emotional awareness, social and national responsibility. The school\'s Learning for Life Programme through Arts Education is a 3-year progressive programme that caters to all students. Through the programme, students learn about the different art forms in Music, Performing Arts, Visual Art and Drama so as to nurture their aesthetic talents and creativity. To develop communication and thinking skills, all students undergo the school\'s Applied Learning Programme through CLAP (Camera, Lights, and Action Programme), a 3-year Media Literacy Programme infused in the English and Chinese Language Curriculum.  Other programmes include Esprit d\' Excellence, Leadership Training, Overseas Learning Journeys, Modular Science Education, Advanced Elective Modules for Express and Normal(Academic) students, Elective Modules for Normal(Academic) & Normal(Technical) students and Sports Education.  The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible (NA) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on thier PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MDM NG CHYI HUERN VERONICA', 'Chinese', 'CO-ED SCHOOL', 'Dynamic Thinkers. Inspiring Leaders. Contributing Citizens. One Learning Community.', 'na', 'Building Character, Nurturing Talents', 'No', 'SINGLE SESSION', 'GREENRIDGE SECONDARY SCHOOL', 'BUKIT PANJANG', '32 BUKIT PANJANG RING ROAD', 'Malay', 'na', 'WEST', '198', 'http://www.greenridgesec.moe.edu.sg/'),
(201, '63183050', 'No', 'na', 'na', '529593', 'GOVERNMENT SCHOOL', 'MR BAMBANG PURNAMA PUTRA SHAKNI', 'MR CHAN WENG ONN MARTIN', 'SECONDARY', 'SPRINGFIELDS@MOE.EDU.SG', 'No', 'EAST 3', 'na', 'At Springfield Secondary School, we inspire our students to develop a passion for learning by offering a broad-based curriculum which caters to a wide spectrum of student abilities and interest. Through our enriching academic and character development programmes, we seek to develop our students to be leaders grounded in our school\'s core values of graciousness, responsibility, resilience, integrity and diligence, who will serve the school and community with pride.', 'TAMPINES MRT', '8, 15, 23, 69, 118, 291, 293, 513, 518', 'na', '63183053', 'No', 'The school\'s Applied Learning Programme (ALP), \'Exploring Health Sciences through SP2A\' focuses on four areas of health sciences - Sports Science, Physiology, Pharmacology and Alternative Medicine. The ALP aims to develop students to be self-directed learners equipped with necessary skills and knowledge that will enable them to take on challenges of the future. During the ALP lessons, students learn to design prototypes such as heartbeat sensors which are used by healthcare and sports science professionals. Students also embark on learning journeys and attachments to health science related companies and institutions to experience and understand the challenges, needs and expectations of healthcare professionals. The school\'s Learning for Life Programme (LLP), \'GEARing Springfielders for Success\', seeks to nurture students to be socially responsible and develop in them a spirit of volunteerism to make a difference to the community. Through the school\'s LLP which focuses on Community and Youth Leadership (CYL), the school designs learning experiences for students to acquire a critical set of skills and knowledge related to CYL. This is done through purposeful partnerships with the community partners to provide opportunities for students to transfer their learning and put into practice the skills learned. To equip our students with the 21st century competencies, the school conducts programmes such as the Code for Fun Programme and the Learning Festival. The Lower Secondary students undergo a 2-year Code for Fun programme to enhance their coding, logical thinking and problem solving skills. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MDM LOONG CHOO JUAN, JENNY', 'Chinese', 'CO-ED SCHOOL', 'Lifelong Learners, Exemplary Leaders', 'na', 'To nurture youth with a passion for learning, shape leaders of character and develop useful citizens', 'No', 'SINGLE SESSION', 'SPRINGFIELD SECONDARY SCHOOL', 'TAMPINES', '30 TAMPINES AVENUE 8', 'Malay', 'na', 'EAST', '199', 'http://www.springfieldsec.moe.edu.sg'),
(202, '62588012', 'No', 'Tamil', 'na', '579793', 'GOVERNMENT-AIDED SCH', 'MR LIM FONG HIM', 'MISS CHEW MAY', 'PRIMARY', 'KCPPS@MOE.EDU.SG', 'No', 'SOUTH 7', 'na', 'na', 'Bishan MRT Station', '76, 132, 165, 166, 169, 265, 268, 269', 'na', '62595396', 'No', 'ENABLE, SEED, Learning Support Programme EL, Learning Support Math, Gymnastics Prog. for P1 & P2, Pastoral Care Programme, Post-PSLE Programme,  E-Learning for P2 to P6 pupils, Parent Support Volunteer Group actively involved in school activities.', 'MDM TEO CHING LING', 'Chinese', 'CO-ED SCHOOL', 'Ever Learning, Ever Glowing, Ever Abiding by the Truth of God.', 'na', 'To nurture a community of lifelong learners with Christian values to overcome challenges.', 'No', 'SINGLE SESSION', 'KUO CHUAN PRESBYTERIAN PRIMARY SCHOOL', 'BISHAN', '8 BISHAN STREET 13', 'Malay', 'na', 'SOUTH', '292', 'http://www.kuochuanpresbyterianpri.moe.edu.sg'),
(203, '64588773', 'No', 'Tamil', 'na', '575565', 'GOVERNMENT SCHOOL', 'MDM LEE CHUI ENG', 'MR SIM KOK HIAN, KENNETH', 'SECONDARY', 'BPSS@MOE.EDU.SG', 'No', 'SOUTH 7', 'na', 'The school strives to nurture students of fine character and to provide all students with a holistic education that prepares them well for the future. To prepare students for the 21st century workforce, inquiry and inventive thinking are promoted through team learning, collaboration and the use of Information Technology. While striving for excellence, students are also nurtured in a caring and safe environment where learning is fun. Students are inculcated with values such as integrity, respect and responsibility so that when they graduate, they are not only equipped with the skills and talents to lead productive lives, but are also imbued with good moral values and contribute back to society. This is what defines Bishan Park Secondary School (BPSS).', 'BISHAN MRT', '52,162,410', 'na', '64588772', 'No', 'The school\'s Learning for Life Programme (LLP), the Holistic ARTs (HART) Programme, provides all lower secondary students with a variety of learning experiences beyond the formal Art curriculum. A rich repertoire comprising six arts modules (ceramics, sculpture, digital art, music composition, instrument playing and dance) deepens appreciation and enhances knowledge and skills in the Arts. Students who demonstrate talent are provided platforms and opportunities to further hone their talents through the Visual Arts Talent Development Programme. The school was presented with the National Arts Education Glow Award (2013) by the National Arts Council in recognition of its holistic approach to Arts Education. The school\'s Applied Learning Programme (ALP), the iCAST Programme, allows students to apply English Language skills from various genres in an authentic setting. All lower secondary students go through the Media Studies Programme where they further hone their language skills as they engage in scripting, video-casting and storyboarding. Students also acquire related ICT skills progressively.  The iCast Programme not only facilitates the use of the English Language to communicate ideas and values and to educate the community, but also allows students to deepen their learning. Students are also offered a glimpse of the possible careers in the fields of media and broadcasting.', 'MDM GOH MIEN HUI VALERIE', 'Chinese', 'CO-ED SCHOOL', 'Learning School, Caring Community, Contributing Citizens', 'na', 'To nurture individuals to succeed with values and purpose', 'No', 'SINGLE SESSION', 'BISHAN PARK SECONDARY SCHOOL', 'BISHAN', '2 SIN MING WALK', 'Malay', 'na', 'SOUTH', '200', 'http://www.bishanparksec.moe.edu.sg'),
(204, '67636807', 'No', 'Tamil', 'na', '688845', 'GOVERNMENT SCHOOL', 'MR STEVEN ANG', 'MRS SHAIMA ANSHAD', 'SECONDARY', 'CCKSS@MOE.EDU.SG', 'No', 'WEST 5', '67664425', 'Character development is a top priority in Chua Chu Kang Sec School. The school believes that a sound and strong character must come first, for it lays the very foundation for success in every endeavour. The school will continue to improve its heart-ware to enable all students to imbibe and demonstrate the school values of Managing Self, Putting Others before Self, and Striving to Excel. Students are nurtured to have a passion for learning and the requisite skills to be self-directed and collaborative learners in order to realise their full potential. Students are developed into compassionate leaders to serve the school, community and nation. Through service, they grow and excel. A strong, caring and collaborative culture amongst staff and students uniquely holds the school together.', 'CHOA CHU KANG MRT', '190, 307, 975, 985', 'na', '67655228', 'No', 'The Applied Learning Programme (ALP), Robotics and Automation for a Better Tomorrow, aims to instill better appreciation of technologies, practical understanding and application of learning as well as 21st century competencies and interest in STEM-related careers. The Learning for Life Programme (LLP) is in the area of Community and Youth Leadership in alignment with the school vision of compassionate leaders with the underlying belief that everyone can lead and will need to lead others at different points of their lives. The LLP takes a two-pronged approach of explicit teaching and experiential learning to develop leadership qualities and skills such as initiative and developing others. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR TAN KENG JOO', 'Chinese', 'CO-ED SCHOOL', 'A Community of Passionate Learners and Compassionate Leaders. As a school, we are a caring community', 'na', 'To nurture students holistically and develop them to be active citizens.', 'No', 'SINGLE SESSION', 'CHUA CHU KANG SECONDARY SCHOOL', 'CHOA CHU KANG', '3 TECK WHYE CRESCENT', 'Malay', 'na', 'WEST', '201', 'http://www.chuachukangsec.moe.edu.sg'),
(205, '64425629', 'No', 'Tamil', 'na', '479229', 'GOVERNMENT SCHOOL', 'MR MUHAMMAD FARIZAL BIN UMAR EFFE', 'MS SANTHA SUKUMARAN', 'SECONDARY', 'damai_ss@moe.edu.sg', 'No', 'EAST 4', 'na', 'In Damai, we believe every child has the capacity to learn with the encouragement, motivation and guidance we give them. In addition to providing students with an academic curriculum to develop cognitive skills, knowledge and attitudes, we also focus on character and leadership development. Our LLP builds students\' character, leadership and life-skills like resilience and a collaborative spirit to navigate life\'s challenges. The school\'s unique Values-in-Action (VIA) programme provides excellent opportunities to translate values and leadership skills into action and nurture concerned citizens, active contributors and confident leaders of the 21st century. The LLP-infused Waterways Clean-up is a rare opportunity to use kayaking skills to care for the environment and appreciate water as a precious resource. STEM-ALP infused VIA initiatives such as visits to NKF and old folks\' homes provide yet another platform to further develop empathy as we nurture them to become compassionate leaders.', 'BEDOK MRT, TAMPINES MRT', '5, 21, 22, 59, 65, 66, 228, 506, CT18', 'na', '64436848', 'No', 'The school has 2 distinctive programmes. To embrace the challenges of the 21st century, Damai seeks to anchor students on sound values and develop them as leaders of good character with a sense of belonging to school and nation. Our Learning for Life Programme (LLP) - Character, Citizenship and Leadership Development through Water Sports, develops students to become Committed, Competent and Compassionate Leaders with an appreciation for life-long fitness. Through a tiered experience Damaians are introduced to water sports like swimming, kayaking, dragon boating, wakeboarding and sailing. Through this they also learn to appreciate \'water\' not just as a precious resource, but also understand its qualities and value. Our STEM-Applied Learning Programme (ALP) in Health Sciences and Healthcare Technology aims to provide authentic learning experiences for students to apply learning in real-world contexts, acquire complex problem solving skills and widen perspectives on healthcare and health sciences industries. The learning environment also fosters team work and open-ended tinkering to enable students to develop 21st Century Competencies and an innovative spirit. STEM-ALP also aims to create awareness and deepen learning on health-related issues, such as nutritional sciences, infectious diseases, healthcare technologies and palliative care for the disabled and elderly. Our extensive partnership with external partners exposes students to the developments in the healthcare sector and allows them to gain deeper insights into healthcare and health sciences related careers. The school will also offer Retail Operations, an Applied ITE subject, as an optional elective to S3NT students from 2017 to better meet their aspirations.', 'MR CHOW WEISI', 'Chinese', 'CO-ED SCHOOL', 'Learning in Damai Today, Growing to be Leaders of Tomorrow.', 'na', 'We Nurture Our Students to be Committed, Competent and Compassionate Leaders.', 'No', 'SINGLE SESSION', 'DAMAI SECONDARY SCHOOL', 'BEDOK', '4800 BEDOK RESERVOIR ROAD', 'Malay', 'na', 'EAST', '202', 'http://www.damaisec.moe.edu.sg'),
(206, '65531284', 'No', 'Tamil', 'na', '569250', 'GOVERNMENT SCHOOL', 'MR TOO MENG NGEE', 'MR LIM HOCK CHYE KEVIN', 'SECONDARY', 'CBSS@MOE.EDU.SG', 'No', 'SOUTH 1', 'na', 'We believe that every child can thrive in a responsive and nurturing environment to become contributing members of society. We take care of students by guiding their mind, shaping their character, and nurturing their talents. At the end of the day, we would like our students to reach their fullest potential and be the best they can be.', 'ANG MO KIO MRT, BISHAN MRT', '25, 45, 55, 73, 74, 76, 88, 132, 165, 261, 268', 'na', '65531263', 'No', 'The school offers the Applied Learning Programme (ALP), \'Nurturing Critical Thinkers Through the Learning of Sustainable Technology\', in which students apply their learning of Science, Technology, Engineering and Mathematics (STEM) in authentic settings. Students are taught to use the Design Thinking methodology to design, build and prototype devices which run on clean energy. Through this programme, students acquire 21st century competencies such as critical thinking and problem-solving skills that will put them in good stead in any STEM-related course of study that they wish to pursue in future. The school\'s Learning for Life Programme (LLP) focuses on \'Growing Socially Responsible Citizens Through the Chong Boon Student Leaders Programme\'. The LLP is integrated with various curricular and co-curricular programmes to equip students with key knowledge, skills and attitudes of a leader. The leadership training is based on Sean Covey\'s \'7 Habits of Highly Effective Teens\' and focuses on the development of self and peer leadership. The Chong Boon Growth Camp is a four- or five-year Character Development Programme through which students learn important life skills such as leadership, collaboration, communication, and develop social-emotional and cross-cultural competencies. Other innovative programmes that prepare our students for the future include the Life-Science Programme which adds value to the students\' classroom learning as they acquire essential biology skills practiced in research laboratories, such as extraction of DNA and growing of bacteria. The school also partners the polytechnics to offer Advanced Elective Modules to provide greater diversity in learning experiences and expose students to applied topics such as Creative Product Design that will prepare them well for further education.', 'MR YEO KUERK HENG', 'Chinese', 'CO-ED SCHOOL', 'Every Student A Thinking and Gracious Citizen', 'na', 'To develop the potential of every child and to nurture him into an individual with a sense of self-w', 'No', 'SINGLE SESSION', 'CHONG BOON SECONDARY SCHOOL', 'ANG MO KIO', '2 ANG MO KIO STREET 44', 'Malay', 'na', 'SOUTH', '203', 'http://www.chongboonsec.moe.edu.sg'),
(207, '62573634', 'No', 'Tamil', 'na', '768578', 'GOVERNMENT SCHOOL', 'MDM HOO WEI CHE, DELIA', 'MR YIP KOK HOONG (YE GUOXIONG)', 'SECONDARY', 'NORTHLAND_SS@MOE.EDU.SG', 'No', 'NORTH 2', 'na', 'Northland is a vibrant school, demonstrating dynamic progress and great promise in recent years. Focusing on both academic outcomes and character development, the school is set to advance steadily forward, producing students who are both motivated learners and assets to the community. It endeavours to make every student who walks through its gates a NORTHSTAR - someone who is a guiding light to others in the community, with the attributes of a Concerned Citizen, Creative Artiste, Servant Leader, Caring Friend, Active Sportsman and Critical Thinker. The school believes in engaging all students through strong teacher-student relationships, thus cultivating a culture of care.', 'Yishun', '811, 804, 800', 'na', '62576781', 'No', 'The school\'s Applied Learning Programme aims to nurture critical thinkers & self-directed learners in health sciences & healthcare technology. Through project work, students monitor their health in novel ways, gather data to analyse, propose and present plans to improve their well-being. Students conduct research and design ways to aid the elderly so that they are empowered to live more fulfilling lives. \'Game for Life\', the school\'s Learning for Life Programme, leverages sports and physical activities to empower students with passion, knowledge and skills to lead a healthy life. Students with sporting talent are progressively developed through exposure to competitive sports within and beyond the school. The school has a proud sporting tradition, especially in Hockey and Floorball, with several of its alumni players representing Singapore in international competitions and many others representing sports clubs in local leagues. The King\'s Pipe Band which consists of Scottish bagpipes and drums performers, is a part of the Boys\' Brigade contingent, and has been highly regarded in South East Asia. For an all-round educational experience, the school also offers level camps, Science Research Programme and Internationalisation Programme to Asian countries where students can gain cross-cultural insights.', 'MDM TAN SIEW WOON', 'Chinese', 'CO-ED SCHOOL', 'Motivated Learners, Assets to Community', 'na', 'Nurturing Minds, Shaping Character, Strengthening Vigour', 'No', 'SINGLE SESSION', 'NORTHLAND SECONDARY SCHOOL', 'YISHUN', '3 YISHUN STREET 22', 'Malay', 'na', 'NORTH', '204', 'http://www.northlandsec.moe.edu.sg'),
(208, '65634505', 'No', 'Tamil', 'na', '649371', 'GOVERNMENT SCHOOL', 'MR JUSTIN TAN', 'MDM MANDY CHENG MUN YI', 'SECONDARY', 'HYSS@MOE.EDU.SG', 'No', 'WEST 4', 'na', 'We believe that every student is a gift, with untapped potential. We want our students to realise this potential in a learning environment that is not only nurturing and full of care, but will also stretch them and help them to grow. The school motto, Together We Care and Grow, embodies four main virtues which are also the school values, namely: Benevolence, Justice, Wisdom, and Togetherness.', 'LAKESIDE MRT, CHINESE GARDEN MRT', '98,98A,99,157,187,198,334,335,502', 'MR CHAN KAI SUM', '65634568', 'No', 'Our programmes are designed to achieve student outcomes through integrated and holistic platforms. These range from Level Learning Programmes which blend camps, workshops and Learning Journeys, to cultural immersion with Xi An and Bogor, and signature events such as our Learning Fiesta. Each semester, post-exam activities combine visits to exhibitions, talent competitions, sport electives, department learning days and subject-related workshops into dynamic experiences. These allow students to apply their learning in authentic contexts while developing their 21st Century Competencies. Since 2013, an Applied Learning Programme (ALP) has used Design Thinking (DT) to develop students empathy, design and prototyping skills in the Health Sciences. The school accepts DSA students linked to our ALP and helps them apply DT in creative and aesthetic fields. From 2016, the school has embarked on a Learning for Life Programme in Community and Youth Leadership to develop leaders using the Leadership Challenge model and community service. This goes beyond our VIA and National Youth Achievement Award (NYAA) programmes which see all students attain NYAA Silver. In 2016, Hua Yi has innovated with an enhanced Sports Carnival, opening of an ALP Learning Hub and a Live@Hua Yi broadcast studio which develops oracy and listening skills. We have strengthened environmental education through inculcation of cleanliness habits through Operation Cleanup and explored new learning journeys to NSL Oil. Each year, Elective Modules (EMs) and Advanced EMs enrich our students learning and awareness of career pathways. The school closely monitors student development and uses time-out and experiential programmes to ensure that no Hua Yian is left behind. We continue to leverage support from stakeholders and partners to align programmes with future demands on students as they enter the workforce, and lead exciting new lives in a future Singapore and global context.', 'MISS GWEE SU PIN SANDRA', 'Chinese', 'CO-ED SCHOOL', 'Where Learning Is Vibrant And Teaching Is Dynamic.', 'na', 'To Nurture Our Students To Be Creative, Independent, Life-Long Learners Who are Confident, Gracious,', 'No', 'SINGLE SESSION', 'HUA YI SECONDARY SCHOOL', 'JURONG WEST', '60 JURONG WEST ST 42', 'Malay', 'na', 'WEST', '236', 'http://www.huayisec.moe.edu.sg'),
(209, '65836034', 'No', 'Tamil', 'na', '518969', 'GOVERNMENT SCHOOL', 'na', 'MISS TAN CHOR HIANG', 'SECONDARY', 'GVSS@MOE.EDU.SG', 'No', 'EAST 1', 'na', 'Guided by our philosophy that \'Every Child is Unique and can Learn\', we aim to cultivate moral character in our students, and inspire them to discover their strengths and strive for success. Through our school values of respect, responsibility, resourcefulness and resilience, we develop a growth mindset and caring culture in students, emphasizing self-directedness at leading self and others, in pursuit of excellence for the community. Greenview has a strong tradition in enlisting the support of successful alumni whose sense of loyalty and belonging to the school is evident in their involvement in school committees or planning and execution of activities for current students. At the heart of our students\' success is our Greenview family of nurturing teachers and supportive parents who have worked together to engage our students in their learning and make things possible for them.', 'PASIR RIS MRT', '3, 6, 12, 17, 21, 39, 53, 81, 89, 109, 359, 518', 'na', '65836033', 'No', 'Our Highly Effective Youth programme aims to develop the 7 Habits of Highly Effective Teens in our students, in tandem with the Highly Effective Community Leaders programme which empowers them to render useful service to those in need.  All our students participate in the National Youth Achievement Award programme to develop self-reliance, perseverance and a sense of responsibility to themselves, society and nation.  To support this, the Social-Emotional Learning Festival provides avenues (e.g. creative arts, dragon boating, kayaking, rock-climbing, abseiling, trekking, camps and overseas adventure and community service) for students to further hone their interpersonal skills and our Learn to Play Sports programme encourages participation in physical recreation. Our Design and Engineering programme enables students to integrate scientific innovations with human desirability and economic viability and the STAR programme challenges students to stretch themselves in their areas of strengths (e.g. Maths Olympiad, Innovation Programme, Art Elective, Debates, and Humanities and Sciences explorations).  The T3 programme builds teacher-student relationships through weekly discussions and sharing over tea.', 'MR NG BOON KIAT', 'Chinese', 'CO-ED SCHOOL', 'Every Greenviewan a Passionate Learner, Confident Leader, and Caring Citizen', 'na', 'Engaging Hearts, Enriching Minds, Developing Character', 'No', 'SINGLE SESSION', 'GREENVIEW SECONDARY SCHOOL', 'PASIR RIS', '15 PASIR RIS STREET 21', 'Malay', 'na', 'EAST', '205', 'http://www.greenviewsec.moe.edu.sg');
INSERT INTO `schools` (`schoolId`, `fax_no`, `gifted_ind`, `mothertongue3_code`, `fifth_vp_name`, `postal_code`, `type_code`, `second_vp_name`, `first_vp_name`, `mainlevel_code`, `email_address`, `sap_ind`, `cluster_code`, `telephone_no_2`, `philosophy_culture_ethos`, `mrt_desc`, `bus_desc`, `third_vp_name`, `telephone_no`, `ip_ind`, `special_sdp_offered`, `principal_name`, `mothertongue1_code`, `nature_code`, `visionstatement_desc`, `fourth_vp_name`, `missionstatement_desc`, `autonomous_ind`, `session_code`, `school_name`, `dgp_code`, `address`, `mothertongue2_code`, `fax_no_2`, `zone_code`, `_id`, `url_address`) VALUES
(210, '65679665', 'No', 'Tamil', 'na', '649370', 'GOVERNMENT SCHOOL', 'MR YONG MUN CHONG', 'MISS VALERIE CHEONG SIEW LEE', 'SECONDARY', 'hkss@moe.edu.sg', 'No', 'WEST 4', 'na', 'We believe in nurturing students to be world-ready youths by providing a student-centric, values-driven education that enhances students\' academic, social-emotional, aesthetic and physical development. We offer a balance of curricular and co-curricular programmes to support students\' acquisition of competencies and skills relevant to the 21st century. Our dedicated and caring teachers plan and create with the help of our partners, opportunities that allow students to experience and strive for success in every area of their lives. We believe that the holistic education we provide will prepare our students to be ready for work and life in the future.', 'JURONG EAST MRT, CHINESE GARDEN MRT, LAKESIDE MRT', '49, 98, 98A, 99, 157, 185, 187, 198, 334, 502', 'na', '65679655', 'No', 'Through our Applied Learning Programme, \'Real World Learning Through Electronics\', we provide opportunities for our students to engage in authentic tasks and to acquire 21st Century Competencies.  Students will learn and understand concepts and issues related to electronics, and work in teams to apply concepts learnt to solve electronic-related tasks.   The infusion of Electronics Education into the curriculum is designed to achieve synergistic learning outcomes for students.  The school\'s Sports A.Li.V.E! programme seeks to engage all students in sports and physical activities while equipping them with the knowledge, skills and competencies to enjoy and promote a healthy lifestyle. Students who show keen interest and talent in sports are further developed through its sports leadership and talent development programmes.  The Whole School Approach to Effective Communication (WSA-EC) aims to nurture World-Ready Youths who are life-long readers, critical thinkers and confident communicators through exposure, experience and reflection. Students can look forward to a vibrant learning environment filled with novels, poetry, drama, theme-based reading, oral presentations and writing programmes designed to equip them with the competencies to communicate well and excel in a globalised world.', 'MDM SUNG MEE HAR', 'Chinese', 'CO-ED SCHOOL', 'An organisation of STARS who are Strong in Character, Thinking and Caring, Aspiring for Excellence, ', 'na', 'Nurturing World-Ready Youths', 'No', 'SINGLE SESSION', 'HONG KAH SECONDARY SCHOOL', 'JURONG WEST', '931 JURONG WEST STREET 42', 'Malay', 'na', 'WEST', '206', 'http://www.hongkahsec.moe.edu.sg'),
(211, '64576448', 'No', 'Tamil', 'na', '575566', 'GOVERNMENT SCHOOL', 'MDM KRISHNAN MALATHI', 'MRS NG MONG KHENG', 'SECONDARY', 'PEIRCE_SS@MOE.EDU.SG', 'No', 'SOUTH 7', 'na', 'Our School Motto \"Fax Mentis Incendium Gloriae\" signifies that the school is the spark that ignites the minds of our students and encourages them to strive for excellence and the good of their community. Our students are Disciplined Learners with a strong sense of purpose & ownership of their learning; Adaptable Leaders with the ability to persevere to rise above challenges; Enterprising Thinkers with the ability to innovate and exercise initiative; Global Citizens with good knowledge of local and world affairs. Our teachers are committed to nurturing the whole child. We strive to develop in our students the school values of Passion to Excel, Integrity, Respect and Care & Empathy for others. Our parents and community are our key partners in forging strong collaboration and partnerships to enable the school to achieve our Vision of developing our students to be resilient achievers and responsible citizens.', 'ANG MO KIO MRT, BISHAN MRT, MARYMOUNT MRT', '52, 132, 162, 163, 165, 166, 167, 410, 855, 980', 'na', '64576454', 'No', 'The school offers the Applied Learning Programme (ALP) and Learning for Life Programme (LLP) with the aim of nurturing students to be entrepreneurs and community leaders with the heart to serve. This is in alignment with the school vision of developing \'Resilient Achievers and Responsible Citizens\'. The ALP focusses on equipping students with essential skills and knowledge of business and entrepreneurship including ICT and Design Thinking tools and marketing and presentation skills through level wide programmes such as Elective Modules, Advance Elective Modules and Values in Action. The LLP aims to develop leadership skills progressively in all students; beginning with personal and community leadership and culminating in executive leadership. All students will acquire basic leadership competencies, social emotional skills and values to become community leaders.  The programme utilises carefully selected tools including 7 Habits of Effective Teens, National Youth Achievement Award, experiential outdoor learning and leadership profiling tools.  It will also leverage the current strength of the school in Uniformed Groups (UGs) to provide UG experiences for non-UG students.  In all, the school is committed to nurturing learners with skills and values to innovate and gracious citizens with the heart to serve.', 'MDM LEE EET FONG', 'Chinese', 'CO-ED SCHOOL', 'Resilient Achievers, Responsible Citizens.  Peirceans will rise above challenges to stretch their po', 'na', 'Our Mission is to build a learning community whose hallmark is the Passion to Excel with Integrity, ', 'No', 'SINGLE SESSION', 'PEIRCE SECONDARY SCHOOL', 'BISHAN', '10 SIN MING WALK', 'Malay', 'na', 'SOUTH', '207', 'http://www.peircesec.moe.edu.sg'),
(212, '65662137', 'No', 'Tamil', 'na', '609790', 'GOVERNMENT SCHOOL', 'MR KOH YONG HWEE', 'MDM TAN PEI LEE ELAINE', 'SECONDARY', 'JURONGVILLE@MOE.EDU.SG', 'No', 'WEST 4', 'na', 'We are guided by our philosophy \'Everyone can Learn, Everyone can Achieve and Everyone can Contribute\' in our efforts to nurture our students to be empowered and enlightened. We offer a student-centric, values-driven education that helps our students to enjoy their school experience as well as to pursue their passion and interests for life-long learning. Over the years, our students have done well in both the academic and non-academic domains. Our school community strongly believes in the school motto \'Beyond Self\' in leading the school towards achieving our vision. Our students\' success is due to the hard work of a nurturing team of dedicated teachers, supportive parents, alumni and community.', 'JURONG EAST MRT, CHINESE GARDEN MRT', '98, 99, 157, 185, 187, 198, 334, 502', 'na', '65638704', 'No', 'The school\'s two distinctive programmes are its \"Sports for Life\" and \"In Health We Thrive\" programmes.  \"Sports for Life\" is the school\'s Learning for Life programme.  It exposes students to a variety of sports electives, empowers them to be leaders and enables those with talent to excel in a particular sport. The programme builds on the school\'s active sporting culture to allow all students to learn a wide range of sports and games, so that they develop positive attitudes towards a healthy lifestyle and are ready for active sports participation even beyond schooling years.  Through the programme, students also learn to organise sports events and acquire useful skills, both in sports and in more generic domains.  The school has also formed networks with many sporting associations and clubs to provide opportunities for students who demonstrate talent in these areas to train with these clubs. Values and life skills are taught explicitly through the school\'s \"Sports for Life\". This unique character development approach in complemented by a strong service learning and empowerment orientation of the school, where programmes like Values-in-Action (local & overseas), Level Camps, and the JVS Leadership Development Programme serve as authentic platforms for character building in all its students. \"In Health We Thrive\" is the school\'s Applied Learning Programme in Health and Wellness.  It provides students with authentic learning of food and sports sciences, and helps students connect the science and skills behind health and wellness.', 'MDM ONG FEI MIN', 'Chinese', 'CO-ED SCHOOL', 'Everyone Empowered and Enlightened', 'na', 'To nurture our students to be dynamic learners, gracious and concerned citizens, empowered to lead a', 'No', 'SINGLE SESSION', 'JURONGVILLE SECONDARY SCHOOL', 'JURONG EAST', '202 JURONG EAST AVENUE 1', 'Malay', 'na', 'WEST', '208', 'http://www.jurongvillesec.moe.edu.sg'),
(213, '67633025', 'No', 'Tamil', 'na', '679301', 'GOVERNMENT SCHOOL', 'MDM GUINIEVE YEO LI-LYN', 'MRS ROSIE LAU @ MDM ROSIE LIM', 'SECONDARY', 'FAJAR_SS@MOE.EDU.SG', 'No', 'WEST 8', 'na', 'We strive to develop all our students to be learning leaders firmly anchored in sound moral values through a student-centric, values-driven education within a holistic learning environment.  These values are infused into the academic curriculum, the Applied Learning Programme (ALP), the Learning for Life Programme (LLP) and the Character and Citizenship Education (CCE) curriculum. We develop character by building strong teacher-student relationships and trust. Our team of committed staff focus on nurturing students to give of their best to realize their dreams with courage, to succeed in life and contribute to the school, nation and beyond.', 'CASHEW MRT, HILLVIEW MRT', '67, 75, 170, 171, 176, 178, 184, 598, 961, 961C, 963, 970', 'na', '67691491', 'No', 'The school is committed to equipping our students with the necessary 21st century competencies for the future via our CCE curriculum, Values In Action programmes including Service Learning, a vibrant CCA programme, Creative Arts Programme, Leadership opportunities, Applied Learning (ALP) and Learning for Life (LLP) Programmes. In partnership with the Singapore Science Centre and the Curriculum Planning and Development Division of MOE, our ALP on \'Sustainability\' seeks to enable our students to attain the relevant knowledge, 21st century competencies, in particular, Applied Critical and Inventive Thinking Skills (ACIT), values and attitudes to enable them to be effective workers and persons who positively contribute to a sustainable 21st century world. Our ALP makes relevant the knowledge in our classrooms to our students\' daily life experiences via authentic learning tasks, and enables our students to learn the process skills of design thinking, problem-based learning, and inquiry-based learning. The school is committed to bringing out the leadership potential in every student through our Student Leadership Programme (our LLP). This programme aims to build in our students the necessary 21st century skills, core values, and social and emotional competencies to face the challenges of the future. Our \'Educate-Encourage-Empower\' framework and whole-staff involvement ensure an integrated and systematic student leadership development effort. Every student is \'educated\' with an enhanced awareness of leading self and others, as well as relevant life-skills, and student leaders are given additional training to perform their roles and responsibilities well. Recognition structures are in place to \'encourage\' personal mastery and development of leadership skills. Our students are also \'empowered\' to undertake self- as well as class-initiated projects, to organise student-led programmes, and to give feedback and suggestions and take follow-up action for school improvement.', 'MISS HO SOOK FUN DORIS', 'Chinese', 'CO-ED SCHOOL', 'A Vibrant Community of Learners who Lead and Contribute to Family, Nation and Beyond.', 'na', 'To Grow a Vibrant Community of Leader-Learners of Character who Contribute to Family, Nation and Bey', 'No', 'SINGLE SESSION', 'FAJAR SECONDARY SCHOOL', 'BUKIT PANJANG', '58 CHESTNUT DRIVE', 'Malay', 'na', 'WEST', '209', 'http://www.fajarsec.moe.edu.sg/'),
(214, '67662095', 'No', 'Tamil', 'na', '689333', 'GOVERNMENT SCHOOL', 'MR LEE HAN HWA', 'MR GOH SOON HOE', 'SECONDARY', 'kranji_ss@moe.edu.sg', 'No', 'WEST 8', 'na', 'Guided by the school philosophy - teaching with passion and conviction, every child can learn, developing each child holistically, and preparing students for future challenges, Kranji Secondary builds a shared vision that is values-driven and student-centric. The school believes that, through fostering a culture of learning, innovation and excellence, students will be confident learners with the passion to excel and active citizens with a heart to serve.', 'CHUA CHU KANG MRT', '190,985,975', 'MRS PUNITHA RAMANAN', '67662464', 'No', 'In Kranji Secondary School, we see innovation as a way of life to support our vision of developing \'Confident Learners with the Passion to Excel\'. Our belief in delivering a holistic education has led the school to develop a well-rounded secondary school curriculum. This includes a vibrant Aesthetics Development Programme, comprehensive Sports Development and CCE Programmes to develop Kranjians with character and graciousness. All lower secondary students are exposed to a range of music skills and dances so that they develop an appreciation for the arts and culture. To inculcate a spirit of active citizenry, the school initiates and collaborates extensively with external partners in Values-In-Action projects. The school has two distinctive programmes. Through our Applied Learning Programme (ALP), Thinking Curriculum, Kranji Secondary nurtures communities of reflective and independent learners.  The learning of Thinking Routines through the Thinking Curriculum, allows students to learn tools to make their thinking visible, thus enriching and enhancing their learning. With the Thinking Routines integrated into the various curricular and non-curricular subjects, students develop dispositions to think both critically and inventively, and analyse situations from different perspectives, increasing the level of engagement in their learning. Students also have the opportunity to apply these routines in an authentic learning environment through collaboration with the polytechnics. Secondly, the school has been accorded the Learning for Life Programme (LLP) in Student Leadership. The objective of the programme is to develop A Leader in Every Kranjian. The vision for student leadership in the school is closely linked to the school vision - \'Confident Learners with the Passion to Excel, Active Citizens with a Heart to Serve\'. The school adopts the Kouzes and Posner Leadership Challenge Model to create platforms to help fulfil the leadership potential of every student.', 'MISS TAN HWEE PIN', 'Chinese', 'CO-ED SCHOOL', 'Confident learners with the passion to excel . Active citizens with a heart to serve', 'na', 'Serving with heart, values and purpose to bring out the best in every child', 'No', 'SINGLE SESSION', 'KRANJI SECONDARY SCHOOL', 'CHOA CHU KANG', '61 CHOA CHU KANG STREET 51', 'Malay', 'na', 'WEST', '210', 'http://www.kranjisec.moe.edu.sg'),
(215, '67932835', 'No', 'Tamil', 'na', '649038', 'GOVERNMENT SCHOOL', 'MR PETER QUAH SOO HOE', 'MISS WONG WEE LING', 'SECONDARY', 'JUYING_SS@MOE.EDU.SG', 'No', 'WEST 3', 'na', 'We are guided by our school philosophy, OYSTER, in achieving our vision. We are a nurturing family for students of all abilities and backgrounds, as we believe that every student is unique and every student can learn. We aspire to enhance and amplify the individual talents of all students, and develop them to be persons with strength of character, such that they may, like pearls, shine and illuminate any organisation that they may join in the future. Underpinning our philosophy are our school values, R3IGHT (Respect, Resilience, Responsibility, Integrity, Graciousness, Humility and Teamwork). Our culture of care and learning is achieved through our H.E.A.R.T.S. ethos - setting High expectations and standards; placing strong Emphasis on learning; having the Autonomy to innovate and explore; building quality Relationships; Trust and Teamwork; having a Shared purpose. Through our holistic approach in developing our students, our students have achieved value-added results in the national e', 'BOON LAY MRT, PIONEER MRT, JOO KOON MRT', '99, 241', 'na', '63089898', 'No', 'Applied Learning Programme (ALP): The school\'s ALP aims to develop students to be competent and confident communicators. Students undergo a series of oracy programmes from Sec 1 to Sec 3 such as storytelling (Sec 1), drama (Sec 2) and debate (Sec 3). A Speaker\'s Corner, set up in the canteen, provides an additional platform to encourage students to confidently address their fellow schoolmates during recess on issues they are concerned about. Learning for Life Programme (LLP): The school\'s LLP, iACE@Juying (I Appreciate, I Create, I Exhibit @ Juying), which is part of the school\'s Aesthetics Programme, aims to provide students with opportunities to experience and explore different dance genres and play different musical instruments such as the ukulele and guzheng. Through these learning experiences which promote positive attitudes and self-expression, students develop character and values, and strengthen their people skills. Sec 3 Overseas Values-in-Action: As part of the school\'s approach in developing our students to be gracious and useful citizens, all Sec 3 students are given the opportunity to carry out service learning projects in a country of their choice (e.g. China, Cambodia, Indonesia, Thailand, Vietnam). This learning platform provides them with a rich learning experience and inculcates the school\'s values, R3IGHT.', 'MR SEET TIAT HEE', 'Chinese', 'CO-ED SCHOOL', 'A Gracious Community of Life-long Learners with Strength of Character', 'na', 'Inspiring Learning . Inculcating Values . Impacting Lives . To prepare JYians to be future-ready and', 'No', 'SINGLE SESSION', 'JUYING SECONDARY SCHOOL', 'JURONG WEST', '33 JURONG WEST STREET 91', 'Malay', 'na', 'WEST', '211', 'http://www.juyingss.moe.edu.sg'),
(216, '68929468', 'No', 'Tamil', 'na', '677737', 'GOVERNMENT SCHOOL', 'MR V SIVA KUMAR', 'MR LIM HAN SENG ANDREW', 'SECONDARY', 'westspringss@moe.edu.sg', 'No', 'WEST 5', 'na', 'The school is guided by Our West Spring Way, \'I want to, I can and I will be the best that I can be\'. It believes all are winners; all will achieve and its culture of care nurtures students to embrace a broad definition of success. A conducive learning environment that integrates respect with responsibility and integrity is provided for the students. All students are addressed as ladies and gentlemen. There are high expectations of student behavior and students are guided to set goals and persevere towards their achievement. The school\'s brand of student-centric, values-driven and holistic education has served it well with good outcomes in both the academic and non-academic domains.', 'JELAPANG LRT, SENJA LRT', '920, 972', 'MDM SIM BEE LIAN (SHEN MEILIAN)', '68920369', 'No', 'The school is implementing greater flexibility in subject offering at lower secondary levels.  Eligible N(A)and N(T)  students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results.  Beyond the start of Secondary 1, students can also do so if they do well in those subjects. The school offers \'Critical Thinking and Effective Communication Through Media Literacy\' (MeLIT) as its Applied Learning Programme and \'Finding, Optimising, Communicating and Understanding Sports\' (FOCUS) as its Learning for Life Programme. MeLIT is a three-year programme which incorporates various elements of the Humanities Instructional Programme to develop students\' skills of evaluating sources, and creating media products to deliver specific messages. FOCUS emphasises broad-based development for students in terms of core values, fundamental skills and physical competencies which provide a strong foundation for the learning, participation and enjoyment of a wide variety of physical activities and sports. To nurture students into Global Citizens of Character and Learning, all Sec 1 students attend a Character Development Camp, all Sec 2 students participate in an Adventure Camp and all Sec 3 students carry out Overseas Values-in-Action (VIA) projects. There are opportunities for Student Leaders to take part in student exchange programmes with schools in Cambodia, India, Taiwan and Australia. In addition, students take part in Integrated Humanities and CCE Learning Journeys, CCE Lectures, Harmony@Senja (Integrated VIA/CCE Programme) and Leadership Development Programmes. Co-curricular programmes include a 2-year ICT Programme, Swimming, Advanced Elective Modules for Sec 3 students, Elective Modules for Sec 2, 3 and 4 NT students, as well as work experience/attachment.', 'MDM BETTY CHANG', 'Chinese', 'CO-ED SCHOOL', 'Global Citizens of Character and Learning', 'na', 'Nurturing Ladies and Gentlemen in Pursuit of Excellence.    \"Shaping Character, Engaging Learners, T', 'No', 'SINGLE SESSION', 'WEST SPRING SECONDARY SCHOOL', 'BUKIT PANJANG', '61 SENJA  ROAD', 'Malay', 'na', 'WEST', '212', 'http://www.westspringsec.moe.edu.sg/'),
(217, '62623587', 'No', 'Tamil', 'na', '648348', 'GOVERNMENT SCHOOL', 'MR NGOH SING KIEN ARTHUR', 'MDM LIM LAY HOON', 'SECONDARY', 'JWSS@MOE.EDU.SG', 'No', 'WEST 3', 'na', 'In our school, we place a premium on the holistic development of students. This is anchored in our strong belief that both academic excellence and character development are pillars of a holistic education. As we develop our students\' character, we nurture values and dispositions necessary for excellence in academic pursuits. Whilst we equip our students with knowledge and skills in the academic subjects, we also develop in them the competencies and attitudes to navigate the future. The Jurong West Experience, grounded in Student-Centricity, is premised in our belief that when students have an interest and find enjoyment in what they do, they will do well and find greater motivation to pursue those interests beyond secondary school. The school\'s value add academic results and strong CCA achievements, particularly in the Uniformed Groups, are testimony to the school\'s commitment to enable each student to reach his/her full potential. The school has a strong emphasis on Higher Education a', 'BOON LAY MRT, PIONEER MRT', '30,154,157,180,187,100,000', 'na', '62623593', 'No', 'Enhanced Art Programme(EAP)-Provides opportunities for talented Art students to develop their talent at higher levels; Learning for Life Programme(LLP)-Community and Youth Leadership that focuses on equipping students with values and life skills by initiating and leading community projects; Applied Learning Programme(ALP)-Equips students with ICT, communication and design skills to solve real life issues; Student Work Attachment Programme(SWAP)-Provides greater exposure to the world of work and an understanding of the type of knowledge and skills needed for industries; Student Leadership Programme; Talent Development Programme(English,Mathematics,Science)-To deepen students\' learning and stretch thinking in the disciplines; Shanghai-Singapore Overseas Student Exchange Programme; Eligible N(A) and N(T) students are given the flexibility to take some subjects at a higher level starting from Sec 1, based on their PSLE results. Beyond the start of Sec 1, students can also do so if they do well in those subjects.', 'MR MICHAEL MUHUNTHAN S/O SUBRAMANIAM', 'Chinese', 'CO-ED SCHOOL', 'A Values-Centred Community where Learning is ignited by Passion, Thinking driven by Innovation and L', 'na', 'To engage the hearts and minds of students to develop them to their full potential enabling them to ', 'No', 'SINGLE SESSION', 'JURONG WEST SECONDARY SCHOOL', 'JURONG WEST', '61 JURONG WEST STREET 65', 'Malay', 'na', 'WEST', '213', 'http://www.jurongwestsec.moe.edu.sg'),
(218, '64465969', 'No', 'Tamil', 'na', '469722', 'GOVERNMENT SCHOOL', 'MR ERIC LEE WEI TAT', 'MR LIM HOCK SEONG KELVIN', 'SECONDARY', 'BGSS@MOE.EDU.SG', 'No', 'EAST 2', 'na', 'With our motto \"Believe and Grow\" and philosophy \"Every Child Matters\", our teachers lay a strong foundation in all domains of student development so as to develop every student into a Reflective and Collaborative Learner, Ethical and Innovative Leader, Cultured and Confident Citizen. Supported by a Culture of Care, we create a nurturing environment in which students are imbued with sound values of Resilience, Integrity, Compassion and Humility. We inculcate in our students a spirit of High Expectations and Excellence so that they can soar when they graduate with outstanding academic and co-curricular achievements. More importantly, we ensure that they have the disposition for continuous Improvement and Innovation so that they are equipped with the competencies to be Future-Ready. To achieve this, we work towards developing a culture of Collaborative Learning amongst staff and students.', 'BEDOK MRT', '506, 228, 222, 168, 66, 67, 69, 28, 14, 17', 'MR CHIA TUCK MAN', '64463301', 'No', 'We offer a wide range of programmes to cater to students with varied profiles, needs and abilities. Key in developing 21st Century Competencies is our Applied Learning Programme (ALP) in Science, Technology, Engineering and Mathematics (STEM). It aims to develop scientific thinking and inquiry skills through real-life applications, and rides upon our Integrated Project Work (IPW) where students solve authentic problems and learn important skills like programming, electronics and product design. Student projects are showcased at the BGSS Learning Festival. Our Learning for Life Programme (LLP) build students\' characters and values through a whole-school Performing Arts programme. All lower secondary students attend a modular Aesthetics Programme in Music, Dance and Drama, and exhibit their learning at the Aesthetics Showcase. The school promotes a strong culture in Sports and Outdoor Activities to develop resilience and ruggedness. Every student goes through Outdoor Education modules in PE, enrichment such as abseiling, as well as the Sec 2 Adventure Camp. We also organise many sporting activities such as Sports Fiesta, and offers PE as a GCE O-Level subject. The Values-in-Action (VIA) Programme promotes Service Learning to cultivate compassion and leadership in our students. It includes the Sec 3 Overseas VIA to orphanages in Indonesia, as well as student-initiated projects in collaboration with community partners such as PAYM. To ensure student well-being and development, we provide individualised support through our Year Head System, the STAR mentoring programme for graduating students, and many others. We also implement greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR LIM YU KEE', 'Chinese', 'CO-ED SCHOOL', 'A School of Choice and a Community of Life-Long Learners.', 'na', 'To provide a nurturing environment where pupils are imbued with sound values, a passion for learning', 'No', 'SINGLE SESSION', 'BEDOK GREEN SECONDARY SCHOOL', 'BEDOK', '360 BEDOK NORTH AVE 3', 'Malay', 'na', 'EAST', '214', 'http://www.bedokgreensec.moe.edu.sg'),
(219, '64897859', 'No', 'Tamil', 'na', '828870', 'GOVERNMENT SCHOOL', 'MR ANITH KUMAR S/O NADESAN', 'MDM CHING LEE HOE', 'SECONDARY', 'PUNGGOL_SS@MOE.EDU.SG', 'No', 'NORTH 4', 'na', 'At Punggol Secondary, we believe that education is a Journey of Self-Discovery where our students discover their strengths, weaknesses and talents and form their moral compass. Our committed teachers help to unleash the potential of our students, develop their talents and work with them to close learning gaps. We create a conducive environment to motivate our students to collaborate with one another and to be self-directed in their learning. We anchor our students deeply in our school values and aim to mould them into 21st Century gentlemen and ladies through a holistic education via the 5 domains - Cognitive, Moral, Physical, Social and Aesthetics. Our envisioned 21st Century student should be a scholar who is passionate in learning, active in physical activities and compassionate towards others, and a refined person capable of appreciating beauty and the Arts.', 'PUNGGOL MRT, COVE LRT', '3, 34, 62, 82, 83, 85, 136, 965, 386', 'na', '64897851', 'No', 'We believe in inculcating a love for reading across different disciplines through our school-wide morning Reading Programme to enhance exposure and interest in the different subject domains. 1-to-1 Computing with Google Chromebooks was rolled out in 2014 to equip students with 21st Century skills and to promote self-directed learning and collaborative learning. In 2016, the school embarked on our Applied Learning Programme  on Environmental Education. This distinctive programme helps our students connect academic knowledge with the real world. Our structured Aesthetics Programme aims to develop our students into refined young men and women capable of appreciating the Arts or participating in a performance. We have structured our Values-In-Action programmes to provide platforms for our students to demonstrate the school values of Propriety, Righteousness, Integrity, and Self-Respect. Sec 1 students would draw up proposals to improve the school environment; Sec 2 students spread environmental conservation messages as HDB Heartland Ambassadors and connect with the community by leading in learning journeys to Lor Halus and Punggol Ecotown; Sec 3 students conduct service learning activities locally as well as in Malaysia, and the Sec 4/5 students mentor their juniors in fund raising for Teen Challenge and Boy\'s Town flag day. \'Building Character and School Pride through Volleyball\' is a special programme in our school that aims to develop resilience, tenacity, and leadership in our students.  With our specialised and customised training, many of our school team players have qualified to be in school teams in polytechnics and junior colleges.', 'MR KEH CHIN CHUAN BENEDICT', 'Chinese', 'CO-ED SCHOOL', 'Achievers with Character, 21st Century jun zi.', 'na', 'To provide students with a value-added education and opportunities to acquire knowledge, skills and ', 'No', 'SINGLE SESSION', 'PUNGGOL SECONDARY SCHOOL', 'PUNGGOL', '51 EDGEFIELD PLAINS', 'Malay', 'na', 'NORTH', '215', 'http://www.punggolsec.moe.edu.sg'),
(220, '68793931', 'No', 'Tamil', 'na', '545081', 'GOVERNMENT SCHOOL', 'MR MOHAMED NASIM S/O ABDUL RAHIM', 'MDM WONG FUI CHIN', 'SECONDARY', 'northvistass@moe.edu.sg', 'No', 'NORTH 1', 'na', 'The Vistarian Experience! includes programmes from both the Academic and Affective wings. A World of Possibilities realizes the governing philosophy of the Affective and Academic Wings which is to Engage, Excite and Enrich (3Es) each Vistarian during the years spent in the school. The Academic programme includes the core and elective subjects while the Affective programme includes values and character education through CCE lessons, student leadership and the various CCAs that the school has to offer. Differentiated Instruction has been adopted as the core pedagogical approach in the school as departments aim to cater to the different interests, abilities and needs of our students.', 'SENGKANG MRT, BUANGKOK MRT, RANGGUNG LRT', '80, 82, 87, 88, 89, 119', 'na', '68793930', 'No', 'Academic and Affective programmes nurture Vistarians to be confident and competent individuals; ready to love, learn and serve with passion in a globalised world.  The Academic Programme ensures that all students receive an all-round education which is Exciting, Enriching and Engaging. To meet this objective, the learning environment in the school is challenging, diverse, interactive and supportive with dedicated staff that work for the betterment of each student. Through its Affective Programmes such as the Leadership Programme, the NV Goes Global Programme and Character Education Programmes, students are offered a broad range of experiences and encourage their interest in and outside of the academic domain both within and beyond our shores.  The school\'s Applied Learning Programme (ALP) entitled Investigative Science in Health and Sports, develops students\' interest in learning through investigative science. It provides students with platforms to learn and apply their knowledge in the area of forensics. Students are taught the skills of research and use the techniques of molecular gastronomy to prepare nutrition bars for athletes.  The Learning for Life Programme (LLP) - Nurturing Creative Problem Solvers through the Arts and Design - aims to develop active citizens who are able to empathize with, and respond creatively to, the needs of the community. Students gain authentic and experiential learning experiences through Vista Week which provides them with a week of culture, adventure and reflection. Terrific Thursdays and Fabulous Fridays also offer students a myriad of learning opportunities beyond the classroom. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MRS REGINA LEE', 'Chinese', 'CO-ED SCHOOL', 'A School of Choice for Citizens of the Future', 'na', 'We are committed to providing Vistarians with a holistic education that will equip them with the nec', 'No', 'SINGLE SESSION', 'NORTH VISTA SECONDARY SCHOOL', 'SENG KANG', '11 RIVERVALE LINK', 'Malay', 'na', 'NORTH', '216', 'http://www.northvistasec.moe.edu.sg'),
(221, '63652774', 'No', 'Tamil', 'na', '737916', 'GOVERNMENT SCHOOL', 'MR CHONG JACK SHENG', 'MR NG SONG LIM STEVEN', 'SECONDARY', 'Admiralty_SS@moe.edu.sg', 'No', 'NORTH 7', '63654596', 'Guided by our philosophy of \'Every Child Can Learn, Want to Learn and Can Achieve\', we are committed to nurture every student into a confident, concerned, self-directed and contributing Admiral. We offer a student-centric, values-driven education to nurture our students in the cognitive, physical, aesthetics, social, moral and leadership domains so that our students can succeed in life and contribute to society. We believe that it takes a village to raise a child. Our dedicated team of caring educators is committed to partnering parents and the community to bring out the best in every child.', 'ADMIRALTY MRT', '904', 'na', '63651733', 'No', 'Design Thinking is used as an anchor pedagogical approach to inculcate in our students the ability to create and innovate using various technologies. Through the Design Thinking process, we seek to stretch the imagination of our students, empowering them to appreciate the relevance and value of what they are learning in the academic curriculum. To further augment students\' motivation and purpose in learning new knowledge and skills, Admirals are put through a leadership programme with involvement in community outreach projects. Overseas learning experiences are organised to raise students\' cross-cultural skills and to deepen their commitment and rootedness to Singapore. These include cohort trips which are organised to complement existing cultural exchange, twinning and immersion programmes.', 'MR TOH THIAM CHYE', 'Chinese', 'CO-ED SCHOOL', 'Values-Centric, Thinking School', 'na', 'Empowering Admirals to Actualise Their Aspirations', 'No', 'SINGLE SESSION', 'ADMIRALTY SECONDARY SCHOOL', 'WOODLANDS', '31 WOODLANDS CRESCENT', 'Malay', 'na', 'NORTH', '217', 'http://www.admiraltysec.moe.edu.sg/'),
(222, '63438326', 'No', 'Tamil', 'na', '797702', 'GOVERNMENT SCHOOL', 'MR TAN CHER HUI PHILIP', 'MDM RADHA D/O G SUBRAMANIAM', 'SECONDARY', 'peihwasec@moe.edu.sg', 'No', 'NORTH 3', 'na', 'At Pei Hwa, students are developed to be \'A Leader, A Scholar and An Altruist\', our desired Pei Hwa student outcomes. Pei Hwa adopts a holistic approach in developing talents. We leverage on the Experiential Education approach to make learning relevant and authentic, within and outside the school. We also place a strong emphasis on grooming our students to be the PRIDE of the Community through active involvement in community service and contributions within and beyond the school. This is reinforced through the PRIDE values: Passion for Learning, Resilience, Integrity, Diligence, Excellence for Self & Others. This is only made possible with a strong team of dedicated teachers who care deeply for our students and the strong support from their parents.', 'SENGKANG MRT, LAYAR LRT', '50, 70, 86, 103, 163, 854', 'na', '65009580', 'No', 'Pei Hwa, with its long history in serving the community, pride ourselves in providing our students with a STEM (Science, Technology, Engineering and Mathematics) focused education through our signature Applied Learning Programme (ALP) in Robotics & Programming, which includes LEGO EV3 technology training, Co-Space Robotics Competitions (collaboration with Singapore Polytechnic), Science and Engineering Electives and Advanced Elective Modules (with other Polytechnics) and Internship with Newcastle University International. This emphasis on developing the 21st Century Competencies could also be seen in our \"Learning For Life Programme: Community Youth Leadership\" (LLP: CYL), which commits our students to Values-In-Action (VIA) activities to develop their spirit of altruism through learning about community issues, initiating actions to make a difference and reflecting on the values and life-skills learnt. Pei Hwa\'s curriculum is also anchored upon the Experiential Education (EE) Framework, which focuses on making learning an engaging and enriching experience for every student, even beyond the classrooms. For example, through the school\'s School-Based Curriculum Innovation (SCI), students conducted inter-disciplinary research projects in diverse Singapore\'s contexts such as Sengkang West Estate, Tiong Bahru\'s heritage sites, Army Museum. Through our Special Learning Spaces such as the Solar Learning Centre and Mobile Planetarium, students also get to discover the application of scientific theories in authentic and real settings. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MDM YONG LI LING BELINDA', 'Chinese', 'CO-ED SCHOOL', 'Pride of the community.', 'na', 'To develop responsible and resilient citizens with a passion for learning.', 'No', 'SINGLE SESSION', 'PEI HWA SECONDARY SCHOOL', 'SENG KANG', '21 FERNVALE LINK', 'Malay', 'na', 'NORTH', '218', 'http://www.peihwasec.moe.edu.sg'),
(223, '63158420', 'No', 'Tamil', 'na', '828866', 'GOVERNMENT SCHOOL', 'MR DEREK LEE KWANG BOON', 'MR LEONARD TAN SOON TECK', 'SECONDARY', 'greendale_ss@moe.edu.sg', 'No', 'NORTH 4', 'na', 'The school believes in providing an enriching and holistic educational experience for all students. In this respect, we have designed vibrant and engaging Instructional Programmes and Co-curricular Programmes that are aligned to the school\'s TEACH and LEARN Protocols, incorporating active and innovative learning strategies, as well as leveraging the Environment as the 3rd Teacher. We are resolute in forging a culture of care, learning and excellence that will develop our students to be learners, thinkers and leaders. In recent years, the school has achieved outstanding results in both the academic and co-curricular areas. The stellar growth of the school has been made possible by the single-minded commitment and dedicated care of the staff, and the efforts of the School Advisory Committee, Parent Support Group and Alumni. Through the many exciting experiences in Greendale, we are confident that students will learn to embrace our school motto: Serve the community; Lead by example; and E', 'PUNGGOL MRT, MERIDIAN LRT', '3, 62, 83, 85, 136, 386', 'na', '63158616', 'No', 'Through the school\'s Applied Learning Programme (ALP) in \'Design, Technology and Engineering\' (DTE), students develop in-depth specialised knowledge in engineering and technology, and acquire critical and inventive thinking skills. From the DTE programme, students will learn how to Design, Code and Build. They will be exposed to Computer Aided Design (CAD) software, Arduino programming language and will get the opportunity to rapid prototype their ideas through the use of 3D printers and laser cutters. They will acquire critical 21st century skills such as design thinking, problem-solving strategies as well as creative and critical thinking techniques to solve real-world problems. For 2017, the school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects. \'Outdoor and Adventure Education\' (OAE), the school\'s Learning for Life Programme (LLP), nurtures character attributes and specific skillsets through concrete experiences. Students step out of their comfort zones to develop personal qualities of resilience, initiative and self-reliance, and competencies in leadership and teamwork. They also acquire a range of skills in outdoor activities (e.g. kayaking, rock-climbing, orienteering). All students participate in a level camp every year to develop their physical, social, leadership and personal skills through integrated outdoor and adventure activities.', 'MISS NG AMY', 'Chinese', 'CO-ED SCHOOL', 'Learners. Thinkers. Leaders', 'na', 'Nurturing Talents. Developing Character. Inspiring Lives', 'No', 'SINGLE SESSION', 'GREENDALE SECONDARY SCHOOL', 'PUNGGOL', '51 EDGEDALE PLAINS', 'Malay', 'na', 'NORTH', '219', 'http://www.greendalesec.moe.edu.sg'),
(224, '63153120', 'No', 'Tamil', 'na', '828814', 'GOVERNMENT SCHOOL', 'MDM LIM PUAY KHENG', 'MR TAN CHAI HOK', 'SECONDARY', 'edgefield_ss@moe.edu.sg', 'No', 'NORTH 3', 'na', 'Guided by the school motto Sincerity and Honour and our core values Moral Courage and Compassion, a dedicated core team of experienced educators has worked to build the school into a premier institution for teaching and learning that is anchored in values and culture. Equipped with the newest facilities and the latest technologies, coupled with curriculum innovation, we are committed to provide the ideal learning environment and experiences for our students as we nurture them into becoming Resolute and Compassionate Role Models at home, in school and in the community. \"A journey of a thousand miles begins with a single step\" - Lao Tzu. Edgefield Secondary and staff look forward to this educational partnership with you and your child in 2017.', 'PUNGGOL MRT', '3,34,62,82,83,136', 'MR NG BOON TIEN', '68839511', 'No', 'Applied Learning Programme (ALP) - The school\'s ALP is a distinctive programme entitled \"Growing the Entrepreneurial Mindset (GEM)\".  Through the programme, students will hone their skills and competencies in finance, business management, marketing and advanced problem solving.  Learning for Life Programme (LLP) - The school\'s LLP is \"Character Education through Sports anchored on Taekwondo\".  Besides developing healthy bodies, students will imbibe positive values such as benevolence, resilience, courage, self-reliance, quick thinking and respect for others which will also enable them to contribute more effectively to society and have the additional edge to succeed in the competitive globalised world. Compulsory school programmes for all students: Analytical Thinking Skills; ICT via Apple Education Programme; Self Defence via Taekwondo; Speech and Drama Enrichment Programme; Story Telling, Film Appreciation,Creative Writing,  Bicultural Immersion Programme; Innovative Project Work; Challenge Based Learning, National Youth Achievement Award (NYAA); Robotics LEGO Mindstorm, Journalism and Broadcasting Programme, Outward Bound Singapore, Golf Education Programme and Third Language Classes. Other Specific Programmes: Edgefield Scholar / Talent Development Programme; Life Science Enrichment Programme; Mathematics Olympiad Enrichment; Basic Leadership Development Programme; Advanced Leadership Development Programme (to prepare students for higher responsibilities); Calligraphy, Painting & Music Programme; Tan Kah Kee Young Inventors\' Programme.', 'MR LEE PECK PING', 'Chinese', 'CO-ED SCHOOL', 'Nurturing Resolute and Compassionate Role Models', 'na', 'Growing Minds, Glowing Hearts', 'No', 'SINGLE SESSION', 'EDGEFIELD SECONDARY SCHOOL', 'PUNGGOL', '36 PUNGGOL FIELD', 'Malay', 'na', 'NORTH', '220', 'http://edgefieldsec.moe.edu.sg'),
(225, '65836467', 'No', 'Tamil', 'na', '518901', 'GOVERNMENT SCHOOL', 'MR MOHD AZMAN B MOHD SIDEK', 'MDM LOY WEE MENG', 'SECONDARY', 'na', 'No', 'EAST 1', 'na', 'We believe that every child is a unique and precious individual who can learn and be moulded holistically. We nurture talents and shape the character of students through a range of student-centric and values-driven programmes and experiences. We provide a nurturing and conducive environment for learning so that students can grow, build confidence and strive for success. Students learn best when they collaborate with and are well supported by their teachers, peers and parents. Our team of unwavering, caring and competent staff lead, care and inspire to bring out the best in students and enable them to discover their passion and fulfil their aspirations. Anchored in sound values, and imbued with a strong sense of integrity and accountability, the staff are committed to serve, innovate and make a positive impact on the community. Our dedicated school partners provide further support through opportunities to enrich the students\' learning. Together, we equip students with sound values and t', 'PASIR RIS MRT', '81, 53, 359, 518', 'MDM TER MEI LI', '65831387', 'No', 'Our Growing Leaders programme in the area of student leadership is our Learning for Life Programme (LLP).We believe that every student has the potential to become a confident leader of sound character through the structured, differentiated, and meaningful experiences provided in the student leadership programme. OurApplied Learning Programme (ALP) in Visual Communication offers a spread of enriched Arts-related programmes that equip students with the skills and knowledge of how visual images, texts and contexts can be used creatively to communicate powerful messages to their intended audience through programmes such as photo journalism and video-making. The Enhanced Art Programme, a special Art curriculum for selected students who demonstrate a high level of interest in visual art, provides them with opportunities to learn a wide variety of art-making techniques from master artists and overseas immersion programmes. Developing Innovative Learners through Design Thinking (DT) is another signature programme where students actively seek to understand problems faced by users and develop innovative solutions using the DT approach. TheValues In Action programme for Sec 3 students allows them to initiate, lead and work in groups to carry out a year-long service learning project to serve the community. The Co-curricular Activities programme nurtures talents and shapes character by providing opportunities for students to hone leadership skills, build team and school spirit, and cultivate an appreciation for the outdoors and the aesthetics. The teaching and learning programme caters to the diverse talents and abilities of students with programmes to stretch or support students\' learning such as the Maths and Science Olympiad and Humanities Scholars\' programme. The Internationalisation Programme enables students to develop a global outlook and be culturally savvy.', 'MDM TAN HWEE TSIAN HILDA', 'Chinese', 'CO-ED SCHOOL', 'Joyful Learners, Creative Thinkers, Compassionate Leaders', 'na', 'To nurture in Meridians inquiring minds and caring hearts for their pursuit of excellence', 'No', 'SINGLE SESSION', 'MERIDIAN SECONDARY SCHOOL', 'PASIR RIS', '31 PASIR RIS STREET 51', 'Malay', 'na', 'EAST', '221', 'www.meridiansec.moe.edu.sg');
INSERT INTO `schools` (`schoolId`, `fax_no`, `gifted_ind`, `mothertongue3_code`, `fifth_vp_name`, `postal_code`, `type_code`, `second_vp_name`, `first_vp_name`, `mainlevel_code`, `email_address`, `sap_ind`, `cluster_code`, `telephone_no_2`, `philosophy_culture_ethos`, `mrt_desc`, `bus_desc`, `third_vp_name`, `telephone_no`, `ip_ind`, `special_sdp_offered`, `principal_name`, `mothertongue1_code`, `nature_code`, `visionstatement_desc`, `fourth_vp_name`, `missionstatement_desc`, `autonomous_ind`, `session_code`, `school_name`, `dgp_code`, `address`, `mothertongue2_code`, `fax_no_2`, `zone_code`, `_id`, `url_address`) VALUES
(226, '63442316', 'Yes', 'na', 'na', '436895', 'GOVERNMENT SCHOOL', 'MDM TEY KAH HWEE', 'MR LENNIE CHUA', 'MIXED LEVEL', 'DHS@MOE.EDU.SG', 'Yes', 'EAST 4', 'na', 'In Dunman High School, we view the twin pillars of a rigorous curriculum and character development as fundamental to the education of our students. This educational ethos is influenced by Confucian philosophy, where the Head, Heart and Hands are important in developing all-rounded individuals and Leaders of Honour who are knowledgeable, with a heart to care and serve others within and beyond the school community.', 'ALJUNIED MRT, KALLANG MRT, MOUNTBATTEN MRT', '12, 14, 30, 158, 196', 'MISS SEE PEI LOO', '63450533', 'Yes', 'Integrated Programme, School-based Gifted Education, Music Elective Program, Bicultural Studies Programme, Chinese Language Elective Programme, Dunman High Research Programme, Malay Special Programme, Thinking & Research Skills Programme, Overseas Immersion, Student Leadership Development Programme', 'MR LOW TECK ENG TONY', 'Chinese', 'CO-ED SCHOOL', 'The premier school of Leaders of Honour', 'na', 'To nurture our students to Care, to Serve, and to Lead', 'Yes', 'SINGLE SESSION', 'DUNMAN HIGH SCHOOL', 'KALLANG', '10 TANJONG RHU ROAD', 'na', 'na', 'EAST', '222', 'http://www.dunmanhigh.moe.edu.sg'),
(227, '65677351', 'No', 'na', 'na', '649961', 'GOVERNMENT SCHOOL', 'MR TAY HONG JOO STEVEN', 'MR LAU WAI CHI ALVIN', 'MIXED LEVEL', 'RVHS@MOE.EDU.SG', 'Yes', 'WEST 7', 'na', 'Founded in 1956, RVHS has grown from a humble background to becoming a Special Assistance Plan (SAP) school (1979) with Autonomous Status (1994) offering a single-track 6-year Integrated Programme (2006). Guided by our school motto, we imbue in our students the values \'Pursuit of Excellence, Perseverance, People-centricity and Proactive-ness\'. We equip our students with attitudes, skills and knowledge to realise their fullest potential to serve as future leaders and contribute to society.', 'BOON LAY MRT', '99,157,172,174,174E,198,502,502A,SS4,NR5', 'MR GAY CHOON LIN', '65678115', 'Yes', 'The RV Integrated Programme (RV IP) offers a balanced education that seeks to develop every student\'s interests and talents to their fullest potential across areas of the academics, CCA and leadership. Our Leadership - Character Development Curriculum aims to inculcate sound values and nurture character and leadership in our students through programmes such as the Personal Leadership Programme, Overseas Experiential Learning Programme, Education and Career Guidance Week, National Education and Values in Action as well as our annual leadership seminar. Through our academic Cognitive Interest Development Curriculum, we empower students to be innovative and critical thinkers and prepare them to thrive in higher education. Our signature programmes include the Bicultural Studies Programme and Bicultural Academy, the Science Leaders Academy, the Mathematics Leaders Academy, the Humanities and Social Studies Academy and the Construct, Integrate, Differentiate (CID) Programme. Our Co-Curriculum Activities nurture 21st century competencies and develop  interests and talents of students in a full range of sports, performing arts, uniformed groups, clubs and societies.', 'MRS TEO KHIN HIANG NEE LEE WAI TAI', 'Chinese', 'CO-ED SCHOOL', 'A world-class institution that develops leaders of distinction for Singapore.', 'na', 'To nurture in students bicultural acumen and moral integrity; to empower students to be thinkers, le', 'Yes', 'SINGLE SESSION', 'RIVER VALLEY HIGH SCHOOL', 'JURONG WEST', '6 BOON LAY AVENUE', 'na', 'na', 'WEST', '223', 'http://www.rvhs.moe.edu.sg'),
(228, '67557778', 'No', 'Tamil', 'na', '768928', 'GOVERNMENT SCHOOL', 'MR AU YONG PO LUNG', 'DR CHUA PUAY HUAT', 'SECONDARY', 'aiss@moe.edu.sg', 'No', 'NORTH 8', 'na', 'Ahmad Ibrahim Secondary School believes in building strong academic foundations and instilling academic resilience to prepare students well for their post-secondary education.  We seek to build up towards a culture of excellence and strong purpose to foster a positive school identity.  Our teachers work as a team to nurture every AI student to be a young gentleman or lady who cares, learns and excels for AI and for nation.  The school is committed to preparing our students to be life, work and world ready.  Our character education focuses on inculcation of the core values of AI RISE (Resilience, Integrity, Steadfastness, Excellence) with Care, Courage and Gratitude.  Students are provided with various opportunities to discover, explore and develop their interests and leadership skill.  The school takes pride in its academic and co-curricular programmes that provide quality learning experience to support the holistic development of every student.', 'YISHUN MRT', '980, 167, 169, 800, 811, 812, 965, 969, 858, 856, 859', 'na', '67585384', 'No', 'Character Development through Outdoor Learning Experience (OLE): Our Learning for Life Programme (LLP) is a broad-based developmental programme that spans from Sec 1 to 3, with extended opportunities for students with special interest in outdoor activities to be trained as OLE ambassadors.  It provides students with authentic, real world experiences to learn to work as a team and build their mental and emotional strength, self and collective leadership through taking on physical challenges.  OLE also promotes environmental appreciation through outdoor activities. Critical Social Inquiry (CSI) and Media Literacy: Our Applied Learning Programme (ALP) takes a multi-disciplinary approach where students extend their learning from existing curriculum subjects such as Languages, Humanities, Sciences and CCE using a critical media literacy lens. Students explore key issues that are related to the society e.g. social, ethical and environmental issues, and present their perspectives through various media forms.  The programme is guided by the 3Es approach-EXPLICATE for heightened awareness, EXPERIENCE for all and ENGAGEMENT for students anchored on values and reflection. Enhanced Music Programme (EMP):  EMP allows students to develop their passion and interest in music.  It is a two-year programme in upper secondary with visits to music performances and music master classes, culminating in the pursuit of O-Level Music or Higher Music.  There is also an accompanying two-year Music Preparatory Course (MPC) for lower sec students with music interest and talent. Student-initiated Service Learning Programme: To inspire courage to lead and serve, every class takes part in a structured 10-week programme to identify the need of a community to serve, plan and implement a service learning project.  Outstanding students are identified and nominated for A*STAR Award cum Research Exposure Programme, NAC Talent Development Programme so as to further develop and stretch their potential.', 'MISS CHEW ING LIM', 'Chinese', 'CO-ED SCHOOL', 'Every AI student, a young lady or gentleman who cares, learns and excels for AI and for nation', 'na', 'To grow students with strength of character, nurture inquiring and disciplined minds, inspire courag', 'No', 'SINGLE SESSION', 'AHMAD IBRAHIM SECONDARY SCHOOL', 'YISHUN', '751 YISHUN AVENUE 7', 'Malay', 'na', 'NORTH', '224', 'http://www.ahmadibrahimsec.moe.edu.sg'),
(229, '64471427', 'No', 'Tamil', 'na', '399935', 'GOVERNMENT SCHOOL', 'MDM SUTINAH BINTE TAIB', 'MR CHRISTOPHER THOMAS', 'SECONDARY', 'BROADRICK_SS@MOE.EDU.SG', 'No', 'EAST 5', 'na', 'Broadrick\'s vision is to become a vibrant learning community where Broadricians will be equipped with life skills and knowledge to meet the challenges of a complex and changing environment.  Our educational programmes provide opportunities for every Broadrician to be all-rounded and have the zest to lead a purposeful life.  Broadrick aspires to provide educational programmes to discover and maximise every Broadrician\'s potential.  In Broadrick, we believe in acknowledging the different peaks of excellence in our students.  We focus on developing self-directed Broadricians who are rooted in values.  We also want to educate Broadricians to embrace the spirit of innovation and enterprise so that they are empowered to take calculated risks and develop the resilience to face future challenges.  Broadricians have a sense of responsibility to contribute to the family, school, community, nation and world with the purpose of making a difference.  They learn to serve and serve to learn from othe', 'Dakota (Circle Line)', '10,16,30,31,32,33', 'MR LEK CHUN GUAN', '63445025', 'No', 'In broadening and deepening students\' learning, Broadrick Secondary School has made significant progress in its journey to develop two distinctive programmes.  In 2014, we are recognised by MOE for our Applied Learning Programme (Entrepreneurship and Innovation) and Learning for Life Programme (Service Learning). Our Entrepreneurship and Innovation Programme is closely aligned to the school\'s vision of nurturing achievers with strength of character. It also aims to help our students to become inquisitive leaders, and critical and creative thinkers who embrace the spirit of creativity and enterprise. The programme also supports the school\'s effort to inculcate one of our school values - Enterprise. Through workshops and specific curriculum lessons, our students learn about innovation, design thinking, marketing and examine commercial viability in product designs. Service Learning is our adopted methodology for experiential learning to develop character and 21st century competencies in our students. Our comprehensive Service Learning programme is structured to be part of the school curriculum and every student is given an opportunity to be exposed to rich, authentic learning experiences as they work with others and with the community at large. Through these platforms, we aim to progressively develop important life skills in students, such as critical thinking, communication, leadership and active citizenry.', 'MDM TAN LAY HONG', 'Chinese', 'CO-ED SCHOOL', 'A Dynamic School providing Holistic Education', 'na', 'To Nurture Achievers with Strength of Character', 'No', 'SINGLE SESSION', 'BROADRICK SECONDARY SCHOOL', 'GEYLANG', '61 DAKOTA CRESCENT', 'Malay', 'na', 'EAST', '225', 'http://www.broadricksec.moe.edu.sg'),
(230, '64744122', 'No', 'Tamil', 'na', '159050', 'GOVERNMENT SCHOOL', 'MDM HO GEOK LAN', 'MR APOLLOS INDUCHOODAN S/O R A P', 'SECONDARY', 'bmss@moe.edu.sg', 'No', 'SOUTH 4', 'na', 'Bukit Merah Secondary School (BMSS) prides itself on cultivating a caring environment and establishing positive expectations to bring out the best in our students.  We are committed to fostering respectful relationships and providing opportunities for active participation so as to imbue students with the school values, \'Wisdom in making sound decisions, Integrity in word and deed, Self-discipline in conduct, Empathy for others; and Respect for self and others\'. The school offers a balanced curriculum that emphasises academic rigour and value-addedness, character development and citizenship education. We had previously been conferred the NAC National Arts Education Glow Award as well as MOE awards for Character Development, and Sustained Achievement in both Sports and Uniformed Groups for our efforts in providing an all-round educational experience.', 'Redhill MRT Station', '14, 32, 33, 63, 64, 120, 132, 139, 145, 147, 196, 197, 855, 961', 'na', '64748934', 'No', 'I. Curriculum Enhancement: BMSS students have performed well in Mathematics and Science.  This has been the result of teachers exploring new pedagogy and stretching student capacity through curricular enrichment activities. Examples of these include the use of 3D Media for the teaching of Science and Interactive SMART boards in Mathematics. Our students participate annually in University of New South Wales International Competition for Mathematics & Science, Singapore Mathematics Olympiads, workshops at Singapore Science Centre and Advanced Elective Modules (Clean Energy, Polymer Science) at local polytechnics.  The school also champions reading literacy. In collaboration with the National Library Board, we have embarked on a whole-school effort to promote reading as a habit among students. II. Co-Curricular Initiatives: To develop 21st century competencies, we have distinctive programmes including (1) Applied Learning through use of Digital Media to tackle authentic real-life problems; (2) Merahan Leadership Challenge: a student-led event to plan and execute a one-day out-of-school curriculum with a national education thematic focus for their respective classes; (3) Experiential Learning Programme: leveraging outdoor education to build peer relationships and inculcate values; (4) Aesthetics Education: series of visual and performing arts workshops conducted for one level of students that culminates in an end-of-term performance; (5) Character Development through Sports (e.g. Floorball).  This serves as a key platform to develop life-skills by promoting teamwork, self-discipline and the pursuit of excellence.  All students will be taught team sports during PE lessons and their skills are developed progressively at the different levels.', 'MR CHENG GHEE HOCK TIMOTHY', 'Chinese', 'CO-ED SCHOOL', 'A Caring and Vibrant Institute that Inspires Learning for Growth and Excellence.', 'na', 'To nurture Resilient Merahans with Character and Heart.', 'No', 'SINGLE SESSION', 'BUKIT MERAH SECONDARY SCHOOL', 'BUKIT MERAH', '10 LENGKOK BAHRU', 'Malay', 'na', 'SOUTH', '226', 'http://www.bukitmerahsec.moe.edu.sg/'),
(231, '67626576', 'No', 'Tamil', 'na', '689809', 'GOVERNMENT SCHOOL', 'MR WONG LIH JIA', 'MR DARREN CHONG WAI KI', 'SECONDARY', 'BPGHS@MOE.EDU.SG', 'No', 'WEST 5', 'na', 'BPGHS offers a student-focussed environment that is responsive to the needs and expectations of BPians, providing opportunities for each to develop his/ her talent and passion as well as to stretch his/ her potential.  The school expects all BPians to uphold school values and sets high expectations for them in terms of academic performance and character education.  Through an engaging curriculum, BPians are equipped with the confidence to be self-directed learners who are determined to excel by pursuing learning passionately.  Through an enriching co-curriculum, BPians are equipped with the qualities and competencies to inspire and lead others to serve the school and the community.', 'CHOA CHU KANG MRT', '300, 983', 'na', '67691031', 'No', 'The school offers a comprehensive range of distinctive programmes that complement our curriculum to provide BPians with a holistic learning experience. The Computer Coding Programme is offered to all BPians to enhance their information and communication technology (ICT) skills so they will be able to navigate the changing digital landscape. The Science Technology Engineering and Mathematics (STEM) Programme covering areas like circuit design and programming, Traditional Chinese Medicine and food science provide hands-on and authentic learning opportunities to encourage BPians to pursue their passion in Science. Under the Elective Programme in Malay Language for Secondary Schools (EMAS), BPians undergo a structured curriculum and local and overseas enrichment programmes to develop a deeper appreciation of the Malay Language and culture. Through the Art Elective Programme, BPians hone and develop their aesthetic skills in various art forms including painting, ceramics, sculpturing, design, digital art and mixed media. Other special programmes to develop the desired qualities and competencies among BPians include the Leadership Development Programme, Cross-cultural Programme and Internship Programme.', 'MDM CHAN WAN SIONG', 'Chinese', 'CO-ED SCHOOL', 'Every BPian a passionate learner, an inspiring leader', 'na', 'To ignite the joy of learning through a holistic education and develop leaders with a heart to serve', 'Yes', 'SINGLE SESSION', 'BUKIT PANJANG GOVT. HIGH SCHOOL', 'CHOA CHU KANG', '7 CHOA CHU KANG AVE 4', 'Malay', 'na', 'WEST', '227', 'http://www.bpghs.moe.edu.sg/'),
(232, '67842164', 'No', 'Tamil', 'na', '529093', 'GOVERNMENT SCHOOL', 'MDM NURAZIAN BINTE BAJURI', 'MR HO KOK SUN KEVIN', 'SECONDARY', 'DUNMAN_SS@MOE.EDU.SG', 'No', 'EAST 3', 'na', 'As a high-performing Autonomous School, our value proposition is Dunman Aspires, Builds and Cares.  We Aspire to be better than we ever imagined we could be. We believe in each child\'s different abilities and his potential to become an inquiring and independent learner who owns his learning outcomes.  We Build people as we are one community. We provide a rigorous and holistic education which nurtures students to excel in lifelong learning. We dare to be innovative and challenge our students and staff to do things differently. We place a premium on character development and positive teacher-student relationships. Together with the strong partnerships forged with parents and stakeholders, we believe that our high-care, high-expectations approach to nurturing the child will develop the necessary skills.  We Care by giving back to others, through instilling in students values and character that will essentially shape them into well-rounded and contributing members of society.', 'TAMPINES MRT', '28, 29, 293', 'MRS CLAIRE CHO', '67862668', 'No', 'As the East Zone Centre of Excellence for Innovations in Science, the school has a high-end Life Sciences Research Centre and an exciting Life Science Programme.  Students who are talented in Mathematics, Sciences and Design have the opportunity to join the Talent Development Programme, and to participate in international Olympiads. We provide a vibrant school-based curriculum such as MEDAL, which integrates Music, English and Literature. Students also undergo an ICT-driven Science Project Work where they work collaboratively and independently to create Mathematics and Science-themed Apps. Some of these Apps have been featured in the iTunes store. Our robust Character and Citizenship Education Programme provides students with leadership opportunities, and overseas immersion experiences to develop global perspectives. Our vibrant Values-in-Action programme enables students to serve the community and society at large. The school is one of the five pilot schools selected by MOE to implement a total curriculum infusing the teaching of 21st century competencies. The Dunman All-Round Excellence (DARE) Framework undergirds our focus on holistic education to nurture ethical change-makers.', 'MR SURESH S/O BALAKRISHNAN', 'Chinese', 'CO-ED SCHOOL', 'An institution of excellence which nurtures ethical change-makers.', 'na', 'We are committed to instilling in our students the Five Fundamental Values of:  Discernment in our c', 'Yes', 'SINGLE SESSION', 'DUNMAN SECONDARY SCHOOL', 'TAMPINES', '21 TAMPINES STREET 45', 'Malay', 'na', 'EAST', '228', 'http://www.dunmansec.moe.edu.sg'),
(233, '62686414', 'No', 'Tamil', 'na', '618652', 'GOVERNMENT SCHOOL', 'MISS KOH MUI GEK', 'MR SHEIK ALAUDIN B MOHD ISMAIL', 'SECONDARY', 'JURONG_SS@MOE.EDU.SG', 'No', 'WEST 6', 'na', 'Jurong Secondary School (JSS) was founded in 1963 at the request of community leaders to our Founding Prime Minister, Mr Lee Kuan Yew, when he made his first visit to the Jurong Constituency. Originally named Jurong Integrated Secondary School, the school offered both the English and Chinese streams. That JSS became widely known for its rich Chinese heritage and strong community partnerships stemmed from this unique history. Since its founding, JSS honours its commitment to the community by offering an all-round education for our students. Innovative programmes guided by our school values of Loyalty, Industry, Sincerity, and Love were introduced to nurture our students\' character and cultivate thinking and independent learning, enabling them to pursue excellence in all that they do and grow as concerned citizens with a heart for and who contribute meaningfully back to the community. As a pioneer of the FutureSchool@Singapore project, our school leverages ICT to design a student-centric', 'LAKESIDE MRT', '30, 49, 98, 98A, 154, 240, 246', 'na', '62655980', 'No', 'In JSS, we value every student, believing that they can contribute meaningfully to the society in all that they do. Our Special Programmes are designed to nurture their hearts and minds, in order for them to become contributing members of the society.   In the area of character development, building on our heritage of sporting excellence, sports was identified as the driver for our Learning for Life Programme (LLP). It leverages participation in sports to build students\' physical fitness and nurture strong character and desired values. Project [COM]passion, which seeks to grow in our students an appreciation of the needs of the less fortunate in the community, is a platform for them to take initiative to plan and implement meaningful improvement projects to benefit the school and community. And to encourage our students to discover and explore interest areas beyond the core curriculum yet offer them insights on possible post-secondary and career options, the taught modules under our InSPire Programme takes into account emerging trends in different industries.  To complement our students\' academic development, we offer our Environmental Studies Applied Learning Program (ALP) and 4-year talent based Research Scholarship Programme. While the former promotes critical thinking through exploration of environmental issues and study of environmental sustainability, the latter provides opportunities for our students to broaden their perspectives about social issues and cultivate good team dynamics and skills necessary to positively impact the community in future.   The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MDM TAN YOK CHING RUBY', 'Chinese', 'CO-ED SCHOOL', 'Learn with Purpose Serve with Passion Lead with Heart', 'na', 'Nurturing Hearts, Enriching Minds -  With the Community, For the Community.', 'No', 'SINGLE SESSION', 'JURONG SECONDARY SCHOOL', 'JURONG WEST', '31 YUAN CHING ROAD', 'Malay', 'na', 'WEST', '229', 'http://www.jurongsec.moe.edu.sg/'),
(234, '67557706', 'No', 'Tamil', 'na', '768689', 'GOVERNMENT SCHOOL', 'MR ISAAC NEO TENG SING', 'MDM KOH HUI HUI', 'SECONDARY', 'NBSS@MOE.EDU.SG', 'No', 'NORTH 2', 'na', 'The school places strong emphasis on both performance and moral character for staff and students, with excellence being a key attitude trait. In NBSS, both staff and the students embrace the core values (ExC2ITe); Excellence, Care, Courage, Integrity and Teamwork, which anchor the way all will behave. This is also reflected in the school\'s motto: Enitamur in Alitora (Be Our Best - aim to achieve as high as possible, be at one\'s best and inspire others). The school thus sees excellence both as a value and an attitude while success is the outcome of exhibiting excellence.', 'KHATIB MRT', '39, 811, 812, 851, 852, 853, 854, 855, 858, 965, 969', 'na', '62571996', 'No', 'NBSS actively applies questioning techniques as a key pedagogical approach to get students to reflect and acquire knowledge. The school offers Talent Development Programme (TDP) for students who show keen interest and potential in cognitive development. As part of the programme, students hone their communication and presentation skills, and gain increased exposure through participation in local and international academic competitions. Students also develop creative academic games and organise competitions for primary school students in the area of English Language, Mathematics and Science. The school uses the Pyramid of Success (PoS) as a key frame for character formation, anchored on the development of moral and performance character traits in every student. Aligned to this, the school\'s Learning for Life Programme (LLP) is \"Character Education through Sports\" where students learn to play a variety of sports, are given exposure to varied roles in different sports and exercise character traits of PoS. The school offers both Applied Learning Programme (ALP) in Art and Enhanced Art Programme (EAP). Through these, students acquire both breadth and depth of art learning in media such as drawing and painting, character and fashion design, visual communications, ceramic art and digital media. Signature programmes include the annual art exhibition and overseas study trip, an Art CCA and the Art Talent Development Programme (ATDP). Students regularly interact and work with practitioners through artist talks, student-practitioner collaborative projects and the unprecedented Learn to Curate Programme developed in collaboration with the National Gallery Singapore. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR SULAIMAN B MOHAMAD YUSOF', 'Chinese', 'CO-ED SCHOOL', 'Leaders of Character, School of Excellence', 'na', 'Every Navalite to achieve personal mastery and impact others positively.', 'No', 'SINGLE SESSION', 'NAVAL BASE SECONDARY SCHOOL', 'YISHUN', '901 YISHUN RING ROAD', 'Malay', 'na', 'NORTH', '230', 'http://www.navalbasesec.moe.edu.sg'),
(235, '62352337', 'No', 'Tamil', 'na', '168622', 'GOVERNMENT SCHOOL', 'MR KOH CHUAN SENG', 'MISS TAN EE LING ELLEN', 'SECONDARY', 'OSS@MOE.EDU.SG', 'No', 'SOUTH 4', 'na', 'The school sets out to accomplish the mission of nurturing every individual with a true Outramian SPIRIT. It is committed to the provision of an education that is strongly anchored in developing values and character. For each child that joins Outram, we seek to inculcate in them the school values, \'Sense of belonging - to the school, society and nation, Perseverance, Integrity, Responsibility, Industriousness and Teamwork (SPIRIT)\'  The school motto, \'Labor Omnia Vincit\', signifies the importance of \'Labour Conquers All\'. The motto highlights the school\'s belief that through hard work, one can overcome difficulties encountered in life. Success in any area requires our students to exercise self-discipline and diligence as well as make necessary sacrifices so as to accomplish tasks set before them.', 'OUTRAM MRT', '174 , 123, 16, 175, 195, 33, 5, 63, 75, 851, 970, 123, 186, 51, 64', 'na', '67334077', 'No', 'In line with the vision of a \'Good School\', we believe in providing our students with rich, rigorous and diverse learning experiences. Besides motivating them with interesting, hands-on activities during instructional programmes, emphasis is also placed on Character and Citizenship Education via CCAs, Social Emotional Learning (SEL), National Education (NE), Assembly and Enrichment Programmes. The formal and informal curriculum offered to all students includes Character for Life (C4L), Arts for Life (A4L) and Sports for Life programmes, and OPEL, an interdisciplinary project which sets out to develop all students in values, aesthetics, and thinking skills. As OSS has a long, reputable history in the area of commerce and accounting, our Applied Learning Programme (ALP) is Excellence through Business and Enterprise (B&E). We offer a wide range of business-related courses such as Business Studies, Principles of Accounting, Retail Operations and Advanced Elective Modules (AEMs) in areas such as Marketing in Action, Essentials of Marketing, Theme Park and Attractions, and Introduction to Tourism and Hospitality.  The School has a Learning for Life (LLP) programme delivered through the Sports for Life framework which comprises three domains, namely Mass Participation, Sports Engagement, and Talent Development. Students are nurtured holistically through the values inculcated through Sports to become well-developed youths of the 21st century. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR BOO HIAN KOK', 'Chinese', 'CO-ED SCHOOL', 'Outram - A Hallmark of Distinction', 'na', 'To nurture individuals with a true Outramian SPIRIT', 'No', 'SINGLE SESSION', 'OUTRAM SECONDARY SCHOOL', 'CENTRAL', '3 YORK HILL', 'Malay', 'na', 'SOUTH', '231', 'http://www.outramsec.moe.edu.sg'),
(236, '65522927', 'No', 'Tamil', 'na', '569868', 'GOVERNMENT SCHOOL', 'MISS S G SARAH ABDULLAH', 'MISS LIM MUI MUI ADELINE', 'SECONDARY', 'yckss@moe.edu.sg', 'No', 'NORTH 6', 'na', 'The school believes that every member of the school community must strive to be an engaged learner, an inspiring leader and an ethical innovator in order to be work-ready and world-ready in the future. The school values, Teamwork, Respect, Responsibility, Integrity and Pride, are the cornerstones that nurture a strong culture of care, excellence and innovation that are critical to the attainment of the school vision. The school programmes are designed to ensure that students are developed holistically in both academics and character, and they are closely aligned to the school motto, \'Pursuit of Knowledge, Service to All\'.', 'YIO CHU KANG MRT', '13, 45, 86, 138, 162, 269, 851, 852, 853', 'MR DALBIR SINGH S/O SURAT SINGH', '64560669', 'No', 'The Learning for Life Programme (LLP-Character Development through Arts, Media & Design) provides: (i) Arts Foundation classes including Drama, Choir, Band and Dance and (ii) Enrichment classes including Drama, Hip Hop, 3D Animation, Film Video, Robotics, Interior Design and Mechatronics. The Applied Learning Programme (ALP-Developing Inquiring Minds and Creative Learners through Arduino) provides students with opportunities to see connections between academic knowledge and skills in the real world. Through ALP, students learn to develop innovative ideas and solutions for real-life problems. Other programmes include After-School Engagement Programme, Assertiveness Training Programme, Family Matters@School Programme, National Youth Achievement Award Programme, Philosophy for Children (P4C), Service Learning and Student Leadership. The school\'s curricular innovations include Bicultural Twinning and Immersion Exchange Programmes, Inquiry-based Learning, Normal (Technical) Learning Journeys and Work Attachment Programme.', 'MDM HENG SUE LIN, JANICE', 'Chinese', 'CO-ED SCHOOL', 'A Community of Learners, Leaders and Innovators.', 'na', 'Growing Today for where the World is Going Tomorrow.', 'No', 'SINGLE SESSION', 'YIO CHU KANG SECONDARY SCHOOL', 'ANG MO KIO', '3063 ANG MO KIO AVENUE 5', 'Malay', 'na', 'NORTH', '232', 'http://www.yiochukangsec.moe.edu.sg/'),
(237, '62616275', 'No', 'Tamil', 'na', '618654', 'GOVERNMENT SCHOOL', 'MR CASEY MUI CHEE YIN', 'MDM NG BEE ENG, CINDY', 'SECONDARY', 'YCSS@MOE.EDU.SG', 'No', 'WEST 4', 'na', 'The school believes that every student can be developed into fine citizens with a passion for learning, and aims to spur every student to strive for excellence and achieve success beyond expectations. Through a holistic and challenging curriculum that develops 21st Century Competencies, we give our students opportunities to pursue their interests and talents so as to realise their full potential and achieve peaks of excellence. Our teachers are caring and dedicated in their efforts to nurture the whole child through strong teacher-student rapport. Through a range of instructional and co-curriculum programmes, we shape our students\' character and build a culture of affirmation, collaboration and excellence. We believe that our students should contribute to the society in line with our core values of IExCEL (Integrity, Excellence, Compassion, Enterprise and Loyalty). The vibrancy of the school culture develops our students\' life skills and empowers them to make a positive difference to o', 'LAKESIDE MRT', '154, 240, 246, 98, 154, 180, 182, 187, 240, 246', 'na', '62612489', 'No', 'The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects. Learning for Life Programme (LLP): Dragon Boat gRowing Values instils the school values in students and enables their acquisition of skills in dragon boating, swimming and life-saving. Applied Learning Programme: Maritime Architecture & Engineering enthuses learners by connecting their knowledge and skills learnt in classrooms to maritime-related context. Students will acquire Scientific Process and Design Thinking skills and apply these skills in the Marine Robotic (SeaPerch) programme. They will also acquire 21st Century Competencies as they collaborate to design and build marine vehicles. Student Leadership Development: The Leadership Challenge Model enhances students\' inter-personal and communication skills, develops leadership competencies and builds teamwork. Overseas Cultural Exchange Programmes and Outdoor Learning Programmes expose students to authentic learning experiences that nurture character and values. Environmental Education deepens understanding and develops active citizenry in students who will care for the environment. Aesthetics Programme uses a  multi-faceted approach to develop in students an appreciation for the aesthetics and to discover their interests and strengths. Student-led Programmes: Student Voice and Values of the Month reinforce values and promote critical thinking and sound decision-making.', 'MRS CHUAH-KOH ENG NGOH', 'Chinese', 'CO-ED SCHOOL', 'Every Individual a Thinker, an Achiever, a Concerned Citizen', 'na', 'Enriching Minds, Unleashing Potential, Impacting Lives', 'No', 'SINGLE SESSION', 'YUAN CHING SECONDARY SCHOOL', 'JURONG WEST', '103 YUAN CHING ROAD', 'Malay', 'na', 'WEST', '233', 'http://www.yuanchingsec.moe.edu.sg'),
(238, '67941324', 'No', 'Tamil', 'na', '648354', 'GOVERNMENT SCHOOL', 'MDM RINA D/O BHASI', 'MR ABDULATTIF S/O ABDULLAH', 'SECONDARY', 'BLSS@MOE.EDU.SG', 'No', 'WEST 3', 'na', 'Guided by our philosophy, \'Every student has the potential to learn, to achieve and to excel\', we have adopted a student-centric, values-driven education approach. Through this approach, all students regardless of stream and ability, are assured of a strong foundation in knowledge, skills and values required to progress on the educational pathways to achieve success in life.  Our culture of care as embodied in our school motto \'To Love and To Forgive\' is evident in our school-wide emphasis on pastoral care for our students\' well-being.  With a team of nurturing and dedicated teachers and staff, and strong support from the parents, School Advisory Committee, alumnus and industry partners, we strive to realise the school\'s vision of developing every Boonlayian into an Individual of Wisdom (with independent and critical thinking, and a strong sense of right and wrong), Purpose (with clear goals and always striving for excellence) and Compassion (with a strong sense of civic responsibility', 'Boon Lay', '99,181,192,193,243,192,193,242,243,257, 502,502A', 'MR PHUA CHENG PENG', '67940161', 'No', 'The school\'s Learning for Life Programme (LLP) - \'Leaders with Character, Leaders in Character\', is part of the student leadership development programme, where students attend leadership camps during their Secondary 1 to Secondary 3 years. The Secondary 3 camp comprises an overseas adventure trip. The LLP aims to equip our students with the skills and values of a community leader strongly anchored in character to play a leading role at various social settings.  We offer Direct School Admission (DSA) to students with strong leadership qualities and especially in areas of service to the larger community. The school\'s Learning Beyond Boundaries Programme provides our students with immersion opportunities with students from Japan, Thailand and China.  This programme allows our students to push their learning frontiers, provides opportunities for active citizenry, self-discovery and increases multi-cultural literacy through purposeful partnership arrangements with schools. The school runs a Badminton Development Programme for the school badminton team which includes a structured local training regime throughout the year and overseas training opportunities during the school holidays.  The school badminton teams benefited from this programme in terms of skills and competencies, character and leadership development and thus, the boy\'s teams have sustained their position among the top 4 (West Zone) in the National Schools Games.', 'MR TAN CHOR PANG', 'Chinese', 'CO-ED SCHOOL', 'Every Boonlayian an individual of wisdom, purpose and compassion.', 'na', 'To provide a caring and orderly school environment which promotes moral, academic, physical, social ', 'No', 'SINGLE SESSION', 'BOON LAY SECONDARY SCHOOL', 'JURONG WEST', '11 JURONG WEST STREET 65', 'Malay', 'na', 'WEST', '234', 'http://www.boonlaysec.moe.edu.sg'),
(239, '64494286', 'No', 'Tamil', 'na', '469293', 'GOVERNMENT SCHOOL', 'MDM CH\'NG YUEN PING', 'MDM NAZIMAH BTE ABDULLAH', 'SECONDARY', 'BEDOKVIEW_SS@MOE.EDU.SG', 'No', 'EAST 2', 'na', 'Bedok View Secondary is a choice school in the East with a successful 37-year history with a high level of academic achievement. Our vision expresses commitment to nurturing students through holistic learning. We set the highest standards for all our students in their academic learning and we also offer a rich array of co-curricular and other learning experiences for our students to develop important 21st century competencies that will enable them to succeed in their lives. Our illustrious alumni include leaders in government and industry, professionals like doctors, lawyers and teachers and other respected members of society who have achieved success in diverse fields like sports, the arts and business. Our students have moved on to Junior Colleges, Polytechnics and ITE and have excelled in their further education, winning accolades for their achievements in these institutions. We also have a strong school-parent partnership.', 'TANAH MERAH MRT', '2, 9, 12, 14, 24, 31, 35, 38, 45, 46, 47, 48 & 506', 'na', '64430563', 'No', 'The school offers a distinctive Learning for Life Programme: \'Good Values@BV\'. Our emphasis is on developing character traits in all our students, as we believe they are critical success factors for the future. On a daily basis, we uphold school rules, regulations, routines and habits, as they help students to develop Integrity, Respect, Responsibility, Service and Excellence. Character development programmes like the \'Values in Action\' programme and Student Leadership development programmes are designed to grow students into good citizens in service of the nation.  We also offer an Applied Learning Programme: \'Global Awareness for the 21st Century@BV\' which serves to connect academic knowledge and skills with real world knowledge. Through a structured provision of opportunities, students will be exposed to a range of global issues in view of developing skills of critical thinking, problem solving, communication and collaboration. The school focuses on student-centric programmes to nurture the whole child through quality teaching and learning. These include academic enrichment programmes such as Public Speaking, Philosophy and programmes designed to meet the learning needs of segments of students like the \'Improve Confidence and Numeracy Skills in Mathematics\' programme, the Applied Theatre Programme (MOE Excel Fest 2013), the Inquiry-Based Learning Programme in Geography (MOE Excel Fest 2014) and the Science Incubation Unit programmes to stretch students\' knowledge and skills. Other holistic development programmes includes Annual Level Camps, Affective Learning in PE, Swimming and Internationalisation Programmes to various countries. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MRS VALERIE PINTO', 'Chinese', 'CO-ED SCHOOL', 'A School Of High Standards, Quality Learning and Holistic Development', 'na', 'To Nurture Students, Transform Lives and Serve the Nation', 'No', 'SINGLE SESSION', 'BEDOK VIEW SECONDARY SCHOOL', 'BEDOK', '6 BEDOK SOUTH AVENUE 3', 'Malay', 'na', 'EAST', '235', 'http://www.bedokviewsec.moe.edu.sg'),
(240, '64583364', 'No', 'Tamil', 'na', '569277', 'GOVERNMENT SCHOOL', 'MDM TAN SHAO MAY', 'MR CHAN WENG CHEONG', 'SECONDARY', 'DEYI_SS@MOE.EDU.SG', 'No', 'NORTH 6', 'na', 'Deyi Secondary School is guided by our philosophy that every child entrusted to our care is a gem and our teachers\' role is to help each child unleash his potential and fulfil his dream. We endeavour to develop our students to become self-directed learners who actively seek out knowledge and make meaning of what they learn for themselves so that they are better prepared for the challenges of the 21st century. We strive to nurture concerned citizens who exercise self-leadership and civic-mindedness, show respect, and perform acts of kindness for the betterment of society. Our students manifest deep-rooted values through gracious thoughts and actions, and display a global outlook by embracing diversity and differing perspectives.', 'ANG MO KIO MRT', '22, 24, 25, 73, 74, 76, , 88, 132, 135, 159, 162, 165, 261, 262, 268, 853', 'na', '64561565', 'No', 'Deyi\'s Applied Learning Programme (ALP) -ACTIVE VOICE BROADCAST JOURNALISM- introduces students to the basics of Broadcasting & Journalism, which develops and strengthens language literacy, critical thinking and communication skills. The ALP covers Mass Communication & Media, ICT in Information Gathering, and Writing & Presenting. Students will have a greater engagement with language learning, thus gaining deeper understanding of the uses, impact and influence of language in becoming competent, confident and effective communicators. Complementing the ALP is our Learning for Life Programme which seeks to nurture gracious contributing citizens through our distinctive ARTS EDUCATION with our signature Dance & Drama-in-curriculum modules. As part of our Talent Development Programme, students with a deeper passion and aptitude in Music/Drama are further developed to receive accreditation from reputable international institutions and are eligible to pursue Drama at the O-Levels. Level Camps (NAVIGATION; SYNERGY; CONQUEST; PINNACLE) are part of our CCE programme that provides authentic experiences to acquire and practise school values, as well as develop physical, social and personal skills. Our YOUTH SOCIAL ENTREPRENEURSHIP is another exciting collaborative platform engaging students with social issues and problem-solving skills to help beneficiaries through hands-on community service projects. Along with learning journeys, field trips, experiential learning, and education and career guidance conducted in partnership with the institutes of higher learning, our students are prepared holistically for the 21st century to be ACTIVE Learners and GRACIOUS Citizens. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MRS LIM AI POO', 'Chinese', 'CO-ED SCHOOL', 'Active Learners, Gracious Citizens', 'na', 'Inspiring Lives, Nurturing Talent, Realising Dreams', 'No', 'SINGLE SESSION', 'DEYI SECONDARY SCHOOL', 'ANG MO KIO', '1 ANG MO KIO STREET 42', 'Malay', 'na', 'NORTH', '237', 'http://www.deyisec.moe.edu.sg'),
(241, '64442731', 'No', 'Tamil', 'na', '468980', 'GOVERNMENT SCHOOL', 'MR BANG TEE LIP', 'MR CHEONG HUEI LEONARD', 'SECONDARY', 'pyss@moe.edu.sg', 'No', 'EAST 7', 'na', 'Ping Yi is well-known for its Restorative Practices (RP), where character development and positive relationships are of paramount importance. We believe in the justice of restoration, participatory learning and responsible decision-making. Our teachers engage our students through relational and innovative teaching strategies, and nurture them through their adolescence, better preparing them for life. The team of very dedicated staff believes that creative and fun ways help students learn more effectively. Lessons are crafted in an exciting, experiential, authentic and meaningful way.  By believing in our students, creating opportunities for them to discover their talents, and developing their abilities to the fullest, the teachers give them confidence to dare to dream and the courage to turn their dreams into reality.  This has led to very good educational outcomes over the years.', 'BEDOK MRT', '26,222,222P,2,7,24,25,28,30,30E,32,33,40,67,229,401,854,45,60,87', 'na', '64489580', 'No', 'Design and Aeronautical Engineering @ Ping Yi (our distinctive applied learning programme) provides our students the opportunity to be trained extensively in design protocol, a design process skillset that gives students a structured approach towards enhancing their critical thinking skills in design principles and developing ideas and solutions. They learn the Art and Science of Flight: from Aerodynamics (the theory of flight), to Aeronautics (the movement of planes in the air) and Aircraft Design (flying with style). Design and aeronautical fundamentals have also been integrated into the Maths and Science curriculum to deepen students understanding. In partnership with Polytechnics and industry partners, and through our Young Designer series of authentic learning experiences and workshops, our students experience the challenges of design and production in a fun and dynamic way. Elements of entrepreneurship are introduced to allow students to conduct feasibility and scalability studies, and to communicate their proposals effectively.  Our Leadership through Character and Citizenship Education (our distinctive life-long learning programme) programme provides opportunities for our students to develop desired character traits like resilience, tenacity, initiative, team spirit and an orientation towards excellence. Annual level camps, values in action activities, work experience, local and overseas service learning, the NYAA platform and leadership modules provide ample opportunities for students to further develop their competencies and to serve the community. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR ANG CHEE SENG', 'Chinese', 'CO-ED SCHOOL', 'A School of Distinction in Learning and Service', 'na', 'To nurture and develop our students to be strong and upright in character, passionate about learning', 'No', 'SINGLE SESSION', 'PING YI SECONDARY SCHOOL', 'BEDOK', '61 CHAI CHEE STREET', 'Malay', 'na', 'EAST', '238', 'http://www.pingyisec.moe.edu.sg/');
INSERT INTO `schools` (`schoolId`, `fax_no`, `gifted_ind`, `mothertongue3_code`, `fifth_vp_name`, `postal_code`, `type_code`, `second_vp_name`, `first_vp_name`, `mainlevel_code`, `email_address`, `sap_ind`, `cluster_code`, `telephone_no_2`, `philosophy_culture_ethos`, `mrt_desc`, `bus_desc`, `third_vp_name`, `telephone_no`, `ip_ind`, `special_sdp_offered`, `principal_name`, `mothertongue1_code`, `nature_code`, `visionstatement_desc`, `fourth_vp_name`, `missionstatement_desc`, `autonomous_ind`, `session_code`, `school_name`, `dgp_code`, `address`, `mothertongue2_code`, `fax_no_2`, `zone_code`, `_id`, `url_address`) VALUES
(242, '62830480', 'No', 'Tamil', 'na', '556094', 'GOVERNMENT SCHOOL', 'MISS TAN LI PING', 'MDM CHIN YIH MIN', 'SECONDARY', 'peicai_ss@moe.edu.sg', 'No', 'SOUTH 6', 'na', 'Peicai Secondary (PCSS) develops students to be future ready Peicaians of Character, imbued with the values of Perseverance, Respect, Responsibility, Integrity, Discipline and Empathy. PCSS is committed to provide Peicaians with positive and enriching experiences in a conducive and safe learning environment where they are allowed to learn and grow. Our Instructional, Character and Leadership programmes enrich, enhance and enable our students in the 3 domains of the Head, Heart and Hand. Platforms are provided for Peicaians to contribute to the school, local and global community through student-initiated and teacher-facilitated activities to hone their leadership and 21CC skills, and to make a difference to themselves and the lives of others.', 'SERANGOON MRT', '22, 24, 43, 53, 70, 76, 103, 103W, 109, 116, 147, 156, 315, 317, 853', 'na', '62884159', 'No', 'The school leverages on its Learning for Life Programme (LLP) - Becoming Person for Others; Leadership Through and For the Community - to develop character traits and leadership skills of Peicaians as responsible citizens of the future. Students are empowered to plan and implement charity drives for their financial needy peers, health-enhancing and well-being programmes for senior citizens and other social leadership activities for the wider community. The second distinctive programme for PCSS, the Applied Learning Programme (ALP) in Food, Health and Sports Science aims to expose Peicaians to experiential learning in food processing, food technology, fitness, lifestyle and healthcare. Together with our student leadership framework, we hope to mould Peicaians of Character who truly live up to the school vision of Critical Mind, Compassionate Heart.', 'MR LIM KOK HWA', 'Chinese', 'CO-ED SCHOOL', 'Critical Mind, Compassionate Heart', 'na', 'To nurture critical and independent learners with love for  self, family and society', 'No', 'SINGLE SESSION', 'PEICAI SECONDARY SCHOOL', 'SERANGOON', '10 SERANGOON AVENUE 4', 'Malay', 'na', 'SOUTH', '239', 'http://www.peicaisec.moe.edu.sg'),
(243, '65672547', 'No', 'Tamil', 'na', '609604', 'GOVERNMENT SCHOOL', 'MDM KHOO HENG OI CATHERINE', 'MR CHNG PUAY KEONG', 'SECONDARY', 'SQSS@MOE.EDU.SG', 'No', 'WEST 1', 'na', 'Established in 1925, Shuqun Secondary School has a rich history and tradition. The school focuses on providing all students with a holistic education. In addition to a rigorous academic programme, the school believes in growing men and women of character, and emphasises the need for students to exhibit the school values of Respect, Responsibility, Resilience, Integrity, Care and Harmony in their daily actions. Through building social and emotional competencies, the school seeks to help students form good habits in the 5As, \'Attitude, Attendance, Appearance, Attention and Assignment\'. Students are also developed physically, intellectually, emotionally and socially to realise the five desired attributes of a Shuqunite - \'lifelong learner, diligent, self-motivated student, responsible citizen, socially and emotionally skilled person, and self-disciplined and healthy individual\'.', 'JURONG EAST MRT', '52, 98, 99,105, 160,176, 183, 187, 333, 334, 502, 506', 'MR CHUA PHUAY HIANG', '63029160', 'No', 'Shuqun Secondary School (SQSS) envisions Shuqunites as individuals rooted in character and equipped with relevant skills to contribute to our nation. Underlying all academic and co-curriculum is the Whole School Curriculum with its 5 guiding principles - building Character and Motivation, seeing students as Partners in Learning, Personalising Instruction, providing Real Experiences and Enabling Learning beyond the classroom and school.  The Shuqun Personalised Asynchronous cuRriculum for Collaboration and Self-directed learning (SPARCS) is one of the signature programmes which explores a disruptive model of teaching and learning through the use of technology in the classroom. Through SPARCS, the school aims to improve the quality of teaching & learning experiences and nurture competencies such as Self-Directed and Collaborative Learning among the students. The school\'s \"Tutorial Relationships\" pedagogy is an approach used in the N(T) Mathematics curriculum that encourages problem solving, peer tutoring and metacognitive reflection in students.  Aligned to the school\'s dynamic curriculum that supports its vision, mission and strategic directions, the school\'s STEM Applied Learning Programme, the Coding, Design Thinking & Robotics (CODER) programme,  seeks to cultivate an innovative and design thinking mindset in students where they are able to represent tasks and develop work processes through logics and coding to solve real world problems. The school\'s new integrated CCE and PE programme, Sports and Outdoor Experiences foR Values Education (SERVE), under its Lifelong Learning Programme (LLP) supports the school\'s broader mission of providing a well-rounded and holistic education for the students.  SERVE nurtures character through sports and outdoor experiences and builds positive traits such as teamwork, perseverance and sportsmanship aligned to the school values.', 'MR N SIVARAJAN', 'Chinese', 'CO-ED SCHOOL', 'An Inviting School that Brings Out the Best in Everyone.', 'na', 'Touching Hearts, Inspiring Learning.', 'No', 'SINGLE SESSION', 'SHUQUN SECONDARY SCHOOL', 'JURONG EAST', '450 JURONG EAST STREET 21', 'Malay', 'na', 'WEST', '240', 'http://www.shuqunsec.moe.edu.sg'),
(244, '65010900', 'No', 'Tamil', 'na', '529400', 'GOVERNMENT SCHOOL', 'MDM TAN GEOK LAN', 'MISS SAKINAH BINTE MOHAMED SARIP', 'SECONDARY', 'prss@moe.edu.sg', 'No', 'EAST 6', 'na', 'We believe that every child has the potential to learn and excel. We provide a nurturing environment with many opportunities to bring out the best in our students. We value every student\'s uniqueness and guide them to discover and nurture their individual strengths and talents. Anchored in our school core values, PRIZE (Pride, Responsibility, Integrity, Zeal, Empathy), we develop students holistically in the physical, aesthetic, social & moral, leadership and morale domains. Our students\' successes over the years are due in large part to our caring and dedicated staff, as well as our strong Pasirian DNA - Respect, Collaboration,Innovation, Mindset of Excellence and Lifelong Learning.', 'TAMPINES MRT', '3, 8, 10, 18, 19, 22, 23, 28, 29, 31, 37, 38, 39, 65, 67, 69, 72, 81, 291, 292, 293, 15, 21, 27, 168', 'na', '65010800', 'No', 'We provide learning experiences that are Authentic,Integrated,Independent, Interactive and Reflective (AI3R) to engage all students. We develop critical thinking in our students through the use of the Elements of Thought as a school-wide approach. Our Applied Learning Programme in Humanities and Languages, Project DRIVE!, provide students with Diversity of Humanities subjects, Relevance of learning to real-world situations, Interest in reading and improved literacy, Value in applications using current affairs and career guidance, and the Environment and partnerships with external organisations to support their learning. Our Learning for Life Programme in Music and Performing Arts, SHINE@PRSS, enables Self-discovery of interests and abilities, Heritage and cultural appreciation, Interaction and collaborative learning, eNgagement in community outreach and partnership, and Excellence in artistic expressions. Our values-based Character and Citizenship Education programme serves to develop in students self-mastery (Sec 1), the ability to work with others (Sec 2), servant leadership (Sec 3), and the drive to fulfil their aspirations (Sec 4 and 5). To develop Pasirians into confident leaders, the Pegasus Programme equips them with important leadership skills and knowledge through tiered and progressive training, and multiple opportunities and platforms to perform leadership roles. Other programmes that further provide holistic learning experiences include the CCAs, level camps, learning journeys, overseas trips, Values in Action projects, elective modules, Youth Empowerment for Success (YES!) and Befrienders Mentoring programme.', 'MDM GRACE TAN BEE SIM', 'Chinese', 'CO-ED SCHOOL', 'Independent Learners, Confident Leaders, Caring Citizens', 'na', 'To nurture Pasirians to have sound values, a passion for life and learning, and a global outlook', 'No', 'SINGLE SESSION', 'PASIR RIS SECONDARY SCHOOL', 'TAMPINES', '390 TAMPINES STREET 21', 'Malay', 'na', 'EAST', '241', 'http://www.pasirrissec.moe.edu.sg/'),
(245, '65675502', 'No', 'Tamil', 'na', '658712', 'GOVERNMENT SCHOOL', 'MR KALVINDAR SINGH', 'MR KONG KOK HENG MELVIN', 'SECONDARY', 'yiss@moe.edu.sg', 'No', 'WEST 2', 'na', 'At Yusof Ishak Secondary School, we believe that every child can learn and deserves a holistic education. One of our key strategic thrusts is \'Bringing Out the Best in Every Child\' and to imbue in them our school values of \'Resilience, Responsibility, Respect, Confidence, Compassion and Integrity\'. Our first class team of staff endeavours to nurture our students towards emulating the attributes of our First President, to be \'Scholars, Sportsmen and Statesmen\'.', 'BUKIT BATOK MRT', '61, 66, 77, 106, 157, 174, 178, 506, 852, 963', 'na', '65009800', 'No', 'The school hosts the Centre for Teaching & Learning Excellence, a unique collaboration among the Academy of Singapore Teachers (AST), the National Institute of Education (NIE) and the Ministry of Education (MOE). Master Teachers (MTT) and experts are attached to the Centre where they co-plan and co-teach with our teachers as they conduct in-situ professional development. Our Applied Learning Programme (ALP), PASTEL (Programme for Authentic Science, Technology and Environmental Learning) promotes interest in Science, Technology, Engineering and Mathematics (STEM). Students learn water conservation and water quality analysis methods through fieldwork. They experience programming, use of electronics, building of prototypes and work attachments at post-secondary institutions and industries. Through our Learning for Life Programme (LLP), H2eArts in Tune Programme (History & Heritage through Arts & Music Programme), students are nurtured to develop a keen sense and appreciation of the aesthetics. It comprises exposure to and experiences in the performing arts, music, as well as digital and visual arts. All students learn to play and appreciate three musical instruments, i.e. guzheng, angklung and ukulele. Through the breadth and depth of experience, students develop their strength of character, self-discipline, self-confidence, teamwork and leadership competencies. Students\' learning culminate in a biennial performances-cum-exhibition of art work, a school-based platform in collaboration with the community. The annual Student Conference is a platform for our students to share their knowledge and skills in topics of their passion. Teacher mentors coach students, resulting in confident speakers and quality learning for all. Under the 1:1 Computing Programme, each student, equipped with a Chromebook, is developed as a self-directed and collaborative learner through progressive teaching pedagogies and cyberwellness programme.', 'MDM KOH HOON CHOO JESSIE', 'Chinese', 'CO-ED SCHOOL', 'The First President School, an institution that nurtures Scholars, Sportsmen and Statesmen.', 'na', 'To nurture Curiosity, Creativity and Confidence in Yusoffians so that they will be Life-long Learner', 'No', 'SINGLE SESSION', 'YUSOF ISHAK SECONDARY SCHOOL', 'BUKIT BATOK', '11 BUKIT BATOK STREET 25', 'Malay', 'na', 'WEST', '247', 'http://www.yusofishaksec.moe.edu.sg'),
(246, '67841472', 'No', 'Tamil', 'na', '529177', 'GOVERNMENT SCHOOL', 'MR TEO KOK HONG', 'MR LAN MINGJUN', 'SECONDARY', 'EVSS@MOE.EDU.SG', 'No', 'EAST 6', 'na', 'At East View Secondary, we pride ourselves on understanding our students\' needs, abilities, interests and talents. With this understanding, we strive to nurture our students through a total curriculum comprising academic learning and character development. At the end of four to five years in East View, every student will be developed as a \'Leader of Self\' and a \'Person of Influence\'. Our academic programme centres on providing a disciplined and conducive learning environment that encourages creative teaching and engaged learning. We believe that every student can learn given the right motivation and guidance. Therefore, we combine customised level programmes aimed at imparting study skills and developing independent learning with close monitoring to stretch and support every learner, regardless of their starting points. Our co-curricular programme hinges on imparting the knowledge, skills and values important for every East Viewian to meet the challenges of the future. We want to mould', 'TAMPINES MRT', '4,8,18,19,21,37,38,81', 'MR GOH WAI MIN, JASON', '67840130', 'No', 'Character Education at East View is anchored on the school values of Integrity, Resilience, Responsibility, Respect and Compassion and focuses on developing in students the 7 Habits of Highly Effective Teens and GRIT, which comprises Growth Mindset, Resilience, Initiative and Tenacity. We believe the 7 Habits and GRIT are life skills that will help our students succeed. Through explicit instruction, school-based structures such as target-setting and review, and integration in academic and co-curricular activities, East Viewians have the opportunity to practise the 7 Habits, GRIT and model the school values regularly. Our Learning for Life Programme, Character and Youth Leadership through Service, allows students to experience a structured service learning programme where they contribute meaningfully to school and community. Our Applied Learning Programme, 21st Century Innovators through Health Science, prepares students for the future through the learning and application of skills, concepts and knowledge related to health science.', 'MISS LAU WAN SZE', 'Chinese', 'CO-ED SCHOOL', 'Leader of Self, Person of Influence', 'na', 'To cultivate good, useful citizens and independent learners with a passion for excellence.', 'No', 'SINGLE SESSION', 'EAST VIEW SECONDARY SCHOOL', 'TAMPINES', '3 TAMPINES STREET 42', 'Malay', 'na', 'EAST', '242', 'http://www.eastviewsec.moe.edu.sg'),
(247, '63543108', 'No', 'Tamil', 'na', '579807', 'GOVERNMENT SCHOOL', 'MR ANBALAGAN S/O THANGARAJAH', 'MR FATHUL RAHMAN BIN KAMSANI', 'SECONDARY', 'gyss@moe.edu.sg', 'No', 'SOUTH 7', 'na', 'GYSS aspires to build a community of motivated and committed individuals. It adopts a people-centric approach to bring out the best in students and develop them into Leaders, Thinkers and Advocators. Integral to achieving this objective is the school\'s \'People First\' culture which embraces constructive professional engagement to empower staff, build capacity and create a vibrant, caring and dynamic learning environment. Our students are encouraged to Challenge Convention and Champion their Passion through student-initiated programmes that promote self-directed learning and discovery. Student behaviour is reinforced by the 5As - Attendance, Attention, Attitude, Assignment and Attire - which serve to imbue in our students a sense of discipline and purpose as they take ownership of their learning and responsibility for their development.', 'BISHAN MRT', '410, 13, 56, 57, 59, 88, 93, 157, 163', 'na', '62589781', 'No', 'Both curricular and co-curricular programmes are designed to incorporate constructivist learning with the aim of providing our students with rich and authentic learning experiences. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects. The school conducts specific level-wide programmes that are progressively facilitated to cater to the development of students. These include the Sec 1 Orientation Camp, the Sec 2 Eco-Adventure Camp, the Sec 3 Overseas Trip with a focus on understanding and appreciating rice-planting, and the symbolic Sec 4&5 Walk of Dreams from the school to Marina Barrage. Complementing these programmes is a host of signature programmes that serve to engage students meaningfully and to broaden their learning for the 21st century. These signature programmes include the Applied Learning Programme (ALP) in STEM: Environmental Science for Sustainable Living; the Learning for Life Programme (LLP) in Aesthetics: HeARTbeat - Art for Life; the EXperiential and Authentic Learning Trail (EXALT) @ Bishan-AMK Park which promotes interdisciplinary learning through specially-designed activities conducted at different learning stations; Forensic Science Programme based on the Crime Scene Investigation (CSI) TV series; Thank Goodness It\'s Friday (TGIF) Programme for NT students where the curriculum is customised to provide hands-on learning experiences in and outside school; Living Lit Up Programme at lower secondary that offers students an all-embracing Literature curriculum covering prose, poetry, play and drama; the Experience Sports @ GYSS where students get to experience different sports under the guidance of CCA Sports coaches; and the Sports Climbing course which promotes ruggedness and resilience.', 'MR KWOK CHIN POH BENJAMIN', 'Chinese', 'CO-ED SCHOOL', 'An engaged learner today, a life-long learner tomorrow.', 'na', 'GYSS - A place where learning is an enjoyable and sustainable journey.', 'No', 'SINGLE SESSION', 'GUANGYANG SECONDARY SCHOOL', 'BISHAN', '8 BISHAN STREET 12', 'Malay', 'na', 'SOUTH', '243', 'http://guangyangsec.moe.edu.sg'),
(248, '63683677', 'No', 'Tamil', 'na', '738524', 'GOVERNMENT SCHOOL', 'MR DERICK WONG TECK FATT', 'MR WONG MUN WAH', 'SECONDARY', 'RIVERSIDE_SS@MOE.EDU.SG', 'No', 'NORTH 5', 'na', 'Guided by the school motto \"My Best and More\" and the school values of Passion, Professionalism, Responsibility, Integrity and Team Spirit, Riverside Secondary School seeks to develop Riversidians holistically through the domains of \"Leadership Development\", \"Aesthetics Appreciation\", \"Mental-Cognitive Capacity Building\", \"Moral Values Inculcation\", and the development of \"Physical Capabilities\" and \"Social-Emotional Competencies\". The distinctive features of the school stem from a curriculum strong in academic rigour, leadership and character development, as well as aesthetics excellence. Character and leadership development is a values-based approach which nurtures the students in the self, social, moral, ethical and citizenry domains.', 'WOODLANDS MRT', '858, 900, 911, 913, 964, 962, 965, 969, 169, 903', 'MR JAYAKUMAR S/O NAVARETNAM', '62699631', 'No', 'To provide a holistic learning experience to the students, Riverside Secondary School adopts an all-round approach, considering their interests and talents, and providing for diverse opportunities within and beyond the classroom. In nurturing motivated thinkers and inventive leaders, the school has customised its instructional curriculum to \'engage\' students through creative approaches, \'enhance\' their learning through differentiated teaching, \'empower\' them to direct their own learning, \'enrich\' their learning through our distinctive programmes and \'evaluate\' their performance using multi-modal assessment. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects. A range of pedagogies such as Multiple Intelligences, Problem-based Learning and Socratic Questioning are employed. Students also embark on engaging experiential learning activities such as field-based learning and investigative project work. Our Applied Learning Programme (ALP) - \'Global Citizenship Education through Critical Social Inquiry\' - aims to nurture ethical leaders with a strong sense of purpose, discernment, compassion and empathy to create a better world for all. This programme includes customised lessons as well as activities for students to sharpen their innate sense of citizenry and develop a global identity, such as social debates, work-attachment and internationalisation programmes. \'Arts for Life,\' our Learning for Life Programme (LLP) provides opportunities for our students to appreciate and experience local and global art-forms, cultures and traditions, and to develop a sensitivity to and respect for the world around them. We want them to be creative individuals with perceptual abilities and a wider repertoire of self-expression.', 'MDM SHANTI DEVI D/O THAMBUSAMY', 'Chinese', 'CO-ED SCHOOL', 'A caring community in a challenging learning environment', 'na', 'To nurture all round individuals of integrity and grace, ready to face global challenges', 'No', 'SINGLE SESSION', 'RIVERSIDE SECONDARY SCHOOL', 'WOODLANDS', '3 WOODLANDS STREET 81', 'Malay', 'na', 'NORTH', '244', 'http://www.riversidesec.moe.edu.sg/'),
(249, '62823472', 'No', 'na', 'na', '556123', 'GOVERNMENT SCHOOL', 'MDM NEO LAY PIN', 'MDM HENG EU LIN', 'SECONDARY', 'ZHONGHUA_SS@MOE.EDU.SG', 'No', 'SOUTH 6', 'na', 'At Zhonghua, a culture of care permeates the whole school.  Guided by our time-tested motto Li Yi Lian Chi  (Courteous, Righteous, Edified, Dignified) and anchored on our core values of Responsibility, Integrity, Care and Excellence, the school is committed to preserving our rich centennial heritage and positive school culture as we evolve and grow with the times. Our future-ready curriculum and signature programmes equip our students with 21st Century skills and competencies to prepare them to be scholars and leaders of the future with a heart and will to lead and serve the community.', 'SERANGOON MRT', '22, 43, 45, 53, 58, 70, 81,  82, 100,  101,  103, 105, 107, 109, 133,  135, 147, 153, 158,  315,  31', 'na', '62824339', 'No', 'Zhonghua is the South Zone Centre of Excellence for Science. As part of our Science and Technology Research Education, all our lower secondary students go through Design Thinking to equip every child with a problem-solving mindset, to come up with innovative solutions in the design of products to meet human-centric needs. At the higher levels, students are challenged in our Science Research Programme to solve real-life issues and problems under the mentorship of researchers from Nanyang Polytechnic. Riding on the push for STEM education, our Robotics and Computing Programme has been integrated into our lower-secondary science and mathematics curricula for enhancing programming and creative problem-solving skills. GCE \'O\' Computing and Music will be offered in 2017 to cater to the varied interests and aptitudes of our students. Our Environmental and Sustainability Education prepares our students to be future-ready leaders who reflect and research on the challenges that the world faces through experiential and collaborative learning experiences that take them beyond the classroom to explore the use of clean and green technology. The Student Leadership Programme nurtures forward-looking leaders with integrity and commitment to serve the school, the community and the nation and provides tiered leadership training and experiences to all students to level up their leadership competencies with an emphasis on empathy and compassion. Our MOE Art Elective Programme (AEP) adopts the Lincoln Centre Education approach that develops students\' capacities for imagination and enables them to realise their artistic potential through a rigorous 4-year programme. Complementing this, the Glocal Perspective Education nurtures students to be cultured, caring and global citizens with a \'think-global-act-local\' education by providing them with a plethora of opportunities to engage in a range of cultural activities and global immersion opportunities.', 'MR LOH LEONG BENG', 'Chinese', 'CO-ED SCHOOL', 'Scholars o Leaders', 'na', 'Nurturing Zhonghuarians to be passionate learners in pursuit of excellence; dynamic and resilient le', 'Yes', 'SINGLE SESSION', 'ZHONGHUA SECONDARY SCHOOL', 'SERANGOON', '13 SERANGOON AVENUE 3', 'Malay', 'na', 'SOUTH', '245', 'http://www.zhonghuasec.moe.edu.sg/'),
(250, '65693028', 'No', 'Tamil', 'na', '659322', 'GOVERNMENT SCHOOL', 'MR CHAN CHEE WEI', 'MR HOI WENG KIT DERRICK', 'SECONDARY', 'SCSS@MOE.EDU.SG', 'No', 'WEST 2', 'na', 'In Swiss Cottage, our students learn to be Thoughtful Leaders who are principled, efficacious and transformational. They become leaders who are equipped with ethical thinking, managerial competencies, global and local awareness. Most importantly, they develop a heart to care and serve and are grounded in intellectual and character excellence. Swiss staff believes in a Character First Education that provides opportunities for all students to learn and achieve. We see ourselves as nurturers, role models and mentors. We lead, care and inspire each other. We seek to engage and collaborate with our partners for the benefit of our students. With these core beliefs, we care for every staff and student. We ensure that every lesson is a good lesson, and that every learning activity is purposeful. We encourage every staff and student to reflect and learn from every opportunity and from each other. Anchored on the Swiss Spirit of Going Far, Going Together, we forge a strong culture of care, learn', 'BUKIT GOMBAK MRT', '945,187', 'na', '65637173', 'No', 'Swiss Cottage delivers a Total Curriculum covering a comprehensive Student Development Programme, a rigorous Instructional Programme and two Distinctive Programmes: Swiss Thoughtful Leadership Programme (TLP) and Applied Sciences for Sustainable Development Programme. The TLP integrates Student Leadership, Values in-Action (VIA), and our newly-developed Glocal (global and local) Perspectives programmes. It provides our students with the knowledge, skills and values to explore and embark on possible VIA or social action projects. The Applied Sciences for Sustainable Development Programme aims to equip our students with specialised scientific skills and knowledge through the curriculum and authentic learning platforms such as VIA and research projects, attachment opportunities and mentoring by our teachers or industry/academia partners. The Student Development Programme includes the core CCE and student well-being programmes, a wide range of CCAs, enrichment and talent development programmes to broaden our students\' world view and hone their unique strengths. The Instructional Programme provides a broad-based and rigorous foundation for post-secondary education. We implement academic enrichment programmes across to develop students\' 21st century competencies. These include the Horizons Programme (overseas cultural immersion trip), Future Problem Solving Programme, Maths Olympiad and Science Talent Development programmes. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR HENG YEW SENG', 'Chinese', 'CO-ED SCHOOL', 'Thoughtful Leaders', 'na', 'We nurture students to Think, Care and Lead with PRIDE.', 'No', 'SINGLE SESSION', 'SWISS COTTAGE SECONDARY SCHOOL', 'BUKIT BATOK', '3 BUKIT BATOK STREET 34', 'Malay', 'na', 'WEST', '246', 'http://www.swisscottagesec.moe.edu.sg'),
(251, '67346518', 'No', 'Tamil', 'na', '227988', 'GOVERNMENT-AIDED SCH', 'MR MORGAN ZHOU YOU QIN', 'MRS LIM- FOO BOON CHING', 'PRIMARY', 'acjs@moe.edu.sg', 'No', 'SOUTH 5', '67337912', 'na', 'Newton MRT Station', '5, 54 , 124 , 128 , 143 ,162 , 162M , 167 , 171 , 700 and 700A.', 'na', '67337911', 'No', 'Learning Support Programme, ENABLE, Life Skills Enrichment Programme, Character Development Programme Gymnastics and Swimming Programme for P3', 'MRS CHAILLAN MUI TUAN', 'Chinese', 'BOYS\' SCHOOL', 'Every ACSian, a young gentleman of character ready for the future to lead and to serve.', 'na', 'To nurture our pupils with a quality, holistic education, rooted in Christian values, that allows ea', 'No', 'SINGLE SESSION', 'ANGLO-CHINESE SCHOOL (JUNIOR)', 'CENTRAL', '16 WINSTEDT ROAD', 'Malay', 'na', 'SOUTH', '275', 'www.acsj.moe.edu.sg'),
(252, '67868481', 'No', 'Tamil', 'na', '529894', 'GOVERNMENT SCHOOL', 'MDM LIM WEI YIN SELINA', 'MR PANG CHIN KEAT, KEVIN', 'SECONDARY', 'CHANGKATCHGI@MOE.EDU.SG', 'No', 'EAST 4', 'na', 'At Changkat Changi Secondary School, our vision is for every child to learn with passion, serve with humility, and succeed with integrity. We are committed to engaging minds, enriching character, and empowering lives. We firmly believe in providing ample opportunities for every child to do well in life. Our students have done well in the academic and non-academic domains, and they are well-supported by a team of caring and dedicated staff. Anchored in the school values of R3ICH - Respect, Resilience, Responsibility, Integrity, Care and Harmony, we work closely with all stakeholders to develop each child into a citizen who is a collaborative learner, an effective communicator, a self-directed individual and a service-leader.', 'SIMEI MRT', '5, 9, 20, 38', 'na', '67859790', 'No', 'The school is committed to developing learners with passion and adopts innovative pedagogies to engage our students towards lifelong learning. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects. In addition, we offer a Talent Development Programme in Science, Maths & Humanities to stretch our students\' potential. The school\'s Applied Learning Programme (ALP) is in the area of Aviation and Aerospace titled S.O.A.R (Student-centered Opportunities for AeRospace Industry) and aims to develop deep knowledge and skills in Science, Technology, Engineering and Mathematics (STEM). Under ALP, students will develop 21st Century Skills, learn to collaborate in projects, apply critical thinking and communication skills. Students take up workshops on aero-modelling, visit aviation management industries and take elective modules related to aerospace and aviation. The school\'s Learning For Life Programme (LLP), Service & Leadership Through School to Nation, aims to nurture Changkateers with a heart to serve, through a 3-tiered programme designed to impart skills necessary to initiate and carry out community service projects. Our leadership development modules provide many opportunities to develop holistic student leadership competencies. Our twinning programmes with China and other overseas trips help our students prepare for a future in a globalised world, while programmes like Breakfast with Form Teacher foster strong teacher-student relationships as we guide them towards success with integrity. Finally, the school offers an After School Engagement Programme (ASE). Held at a purpose built ASE room, students can engage in self-study, consult teachers or participate in recreational activities after curriculum hours.', 'MDM SHARMA POONAM KUMARI', 'Chinese', 'CO-ED SCHOOL', 'Engaging Minds, Enriching Character, Empowering Lives', 'na', 'Learn with Passion, Serve with Humility, Succeed with Integrity', 'No', 'SINGLE SESSION', 'CHANGKAT CHANGI SECONDARY SCHOOL', 'TAMPINES', '23 SIMEI ST 3', 'Malay', 'na', 'EAST', '248', 'www.changkatchangisec.moe.edu.sg'),
(253, '67630487', 'No', 'Tamil', 'na', '688848', 'GOVERNMENT SCHOOL', 'MISS DIANA GOH BOON LANG', 'MISS TAN MING MING', 'SECONDARY', 'TWSS@MOE.EDU.SG', 'No', 'WEST 5', 'na', 'Established in 1966, Teck Whye Secondary School has been providing a nurturing environment for generations of students to be resilient, possess strong integrity and value teamwork. At Teck Whye Secondary, there is a healthy emphasis on learning and development in both curricular and co-curricular areas. We adopt a student-centric approach in designing pedagogies for learning, inculcate higher-order thinking skills through our strengths in using the design-thinking approach as well as provide many opportunities for Teck Whyeans to learn collaboratively. The development of strength of character, mindset of excellence, commitment to teamwork, leadership potential and other 21st century skills and dispositions develop our Teck Whyeans to be responsible members of the society with empathy and compassion, and gracious citizens of the world.', 'CHUA CHU KANG MRT, PHOENIX LRT', '975,985,190,307', 'na', '67691386', 'No', 'Teck Whye Secondary School offers the Applied Learning Programme (ALP) which provides opportunities for students to learn interesting STEM (Science Technology Engineering Mathematics) applications in the area of Material Sciences and Engineering.  Students will learn more about material properties, integration with Robotics and applications in the context of Defence Science. The emphasis is on the design thinking, connecting knowledge from across disciplines, stretching the imagination and applying these in authentic settings and real world contexts. In the area of Co-Curriculum, excellent platforms are provided for our students to develop strength of character, values and inculcate the Growth Mindset to overcome challenges that come their way in life. It is with this that we have structured our Learning for Life Programme (LLP) for our students - the Sports Experience, the Sports Development and Sports Excellence. In particular, our strong Hockey programme - \"Nurturing Sports Stars of Tomorrow through Hockey\" seeks to further develop the skills of our students in the sport to lead and contribute at the national levels. Throughout these programmes, our students participate in and develop their passion and aptitude in the respective sports and activities. Sportsmanship values, character and attitudes are constantly emphasised.  Other key programmes offered include Leadership Development Programme, Dance Programme, Sec 3 Adventure and Leadership Camp and Talent Development Programme. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR CHAN YEW HENG EDWIN', 'Chinese', 'CO-ED SCHOOL', 'A Community of Future-Ready Learners who Lead, Serve and Achieve', 'na', 'Empowering Lives, Transforming Our Future', 'No', 'SINGLE SESSION', 'TECK WHYE SECONDARY SCHOOL', 'CHOA CHU KANG', '31 TECK WHYE CRESCENT', 'Malay', 'na', 'WEST', '249', 'http://www.teckwhyesec.moe.edu.sg'),
(254, '65668650 (Secondary)', 'No', 'Tamil', 'na', '619522', 'GOVERNMENT SCHOOL', 'MRS TAY CHEN LAI', 'MRS SHANTHIMALAR SOMASUNDRAM', 'SECONDARY', 'DUNEARN_SS@MOE.EDU.SG', 'No', 'WEST 2', 'na', 'Dunearn Secondary School provides a holistic education for all its students. We believe that all students have the potential to learn and that, through determination and discipline, they will achieve optimum growth in a challenging yet supportive and caring environment. We develop our students to be self-directed learners through the strategies of differentiated instruction and collaborative learning, with emphasis on building good character.', 'BOON LAY MRT', '30, 154, 157, 172, 174, 174E, 178, 180, 187, 198', 'na', '65653692 (Secondary)', 'No', 'In line with developing 21st Century Competencies, students engage in Collaborative and Self-Directed Learning. Alternative assessment modes include coursework, journalling and skills-based investigations. The school has Talent Development programmes for high achievers, including its Future Problem Solving and Science Ambassadors programmes. Elective Modules constitute enrichment for NT students, providing opportunities for real-world learning. The school\'s Applied Learning Programme in Food Science and Technology seeks to develop students\' creativity, confidence and interest in Science and Technology. The school works with external organisations to design customised programmes such as Timeout and Enhanced Step-Up programmes, and Transition workshops. Character and Citizenship Education lessons integrate the teaching of school values with the teaching of Social-Emotional Competencies.  The Dunearn Character Development Profile is a formative assessment tool to help students take ownership of their character development.  Pupil Teacher Relational Time is dedicated time for Form Teachers and co-Form Teachers to conduct structured dialogues with students. The school emphasises the internalisation of values and putting them into action through its differentiated Values in Action (VIA) programme. Students are involved in environmental awareness, school and local community awareness, fund-raising and Overseas Service Learning. Education and Career Guidance is implemented through Values Education lessons (which include ecareers.sg), visits to post-secondary institutions, and the school\'s Higher Institutions and Career Week. The school\'s Learning for Life Programme focuses on Community Youth Leadership  which seeks to permeate a culture of school-wide community youth leadership development. It is the school\'s vision that all students will acquire the necessary knowledge, skills and values to be a personal leader, a team leader, a community leader, and a global leader.', 'MDM TAN MIAO LING', 'Chinese', 'CO-ED SCHOOL', 'Lifelong Learners, Caring Leaders', 'na', 'Nurturing Dunearnites to learn with passion and lead with purpose', 'No', 'SINGLE SESSION', 'DUNEARN SECONDARY SCHOOL', 'BUKIT BATOK', '247 JALAN BOON LAY', 'Malay', 'na', 'WEST', '250', 'http://www.dunearnsec.moe.edu.sg'),
(255, '67752310', 'No', 'Tamil', 'na', '139657', 'GOVERNMENT SCHOOL', 'MR YONG KEK SHOONG', 'MDM TEO TING TING', 'SECONDARY', 'ntss@moe.edu.sg', 'No', 'WEST 1', 'na', 'Guided by our school philosophy, \'Students Our Core\', the school seeks to nurture all-rounded students by offering a holistic education which integrates learning in the Cognitive, Aesthetics, Moral, Physical and Social domains (iCAMPS). At the heart of iCAMPS are the school values; Care & Concern, Self-discipline, Integrity, Resilience and Resourcefulness. Through holistic education, we hope to develop resilient learners, compassionate citizens and confident leaders and paves the way for our students to realise our school motto \'To Forge a Better Life\', not only for themselves but also for others.', 'DOVER MRT, CLEMENTI MRT', '33, 96, 151, 196, 183', 'na', '67754140', 'No', 'The School Distinctive Programmes consist of the 2 key programmes: Learning For Life programme (LLP) and Applied Learning Programme (ALP). To strengthen our efforts to develop all-rounded students and prepare students for the challenges of tomorrow, our school has embarked on the Learning For Life programme (LLP) which focuses on character and leadership development. Through training in specific skills and involvement in customised projects and activities, students acquire leadership skills and life-skills such as collaborating effectively with one another. To equip our students with critical and inventive thinking skills so as to prepare them for the opportunities in a fast-changing world, the school has embarked on the Applied Learning Programme (ALP) through Visual Communication which allow them to explore various possibilities of visual representations to bring across their intended message. The ALP aims to develop visual expression and language as well as stimulate their creativity through photography. Starting from 2017, the school will offer our Special Talent Programme, the Enhanced Art Programme (EAP) which develops talents and enhance experience in Art through exposing our students to new medium and providing them opportunities to learn and work alongside with art professionals and communities. To enhance the development of our students, the school partners with University Town (NUS) to implement the U-Town Mentoring Programme and University Scholars Writing Programme. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MDM TAN SIEW HONG (MRS SNG)', 'Chinese', 'CO-ED SCHOOL', 'Nurturing Talents, Sharing Success', 'na', 'A school of excellence which nurtures the youths of today for the challenges of tomorrow', 'No', 'SINGLE SESSION', 'NEW TOWN SECONDARY SCHOOL', 'QUEENSTOWN', '1020 DOVER ROAD', 'Malay', 'na', 'WEST', '251', 'http://www.newtownsec.moe.edu.sg'),
(256, '64741295', 'No', 'Tamil', 'na', '148800', 'GOVERNMENT SCHOOL', 'MISS WEE MEI YEN JANICE', 'MR ONG KAH HUI VICTOR', 'SECONDARY', 'qtss@moe.edu.sg', 'No', 'SOUTH 4', 'na', 'We believe in the unique worth of the individual, the enhancement of his well-being and the symbiotic relation between him and society. This philosophy is built on the foundation, \'Every Child Worthy and Every Teacher Transformational\', anchored in our 4 core values of \"Resilience\", \"Integrity\", \"Service\" and \"Excellence\".', 'REDHILL MRT, QUEENSTOWN MRT', '33,51,64,111,120,139,145,186,970', 'na', '64741055', 'No', 'The school sets out to prepare our students to be Future-Ready by equipping them with the skill-sets and mind-sets to navigate the uncertainties ahead. With this in mind, the school embarked on an Applied Learning Programme (ALP) which focuses on cultivating Disciplined and Synthesising Minds (based on Howard Gardner\'s 5 Minds for the Future) through investigative thinking. The emphasis is on the application of thinking skills, connecting knowledge across subject disciplines and applying these skills in authentic settings. The ALP lays a strong foundation in our students so that they will gain a competitive edge in the future. In line with the school\'s motto \'Dare to Serve\', the school\'s Learning for Life Programme (LLP) focuses on Community Youth Leadership. The LLP aims to grow our students to be leaders who are aware of the needs of the community, championing and advocating for them. Through school programmes, such as the annual Quest Learning Festival, leadership development programmes and overseas immersion programmes, students are provided with meaningful learning experiences for them to grow as a Community Youth Leader. The school leverages on the National Youth Achievement Award (NYAA) to achieve its mission to nurture a leader in EVERY learner.  The programme develops self-reliance, perseverance, personal responsibility and responsibility to society and nation. With strong processes in place, the school was recognised for the 1000th NYAA awardee in 2013 and affirmed by our Minister for Education. The school is also implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects. Our other accolades include the sustained LOTUS Award for our pervasive Green Efforts and the sustained achievements of our various CCA Groups.', 'MDM RASIDAH BTE RAHIM', 'Chinese', 'CO-ED SCHOOL', 'A Premier School of Choice, Nurturing a Leader in Every Learner.', 'na', 'To nurture every learner to become a leader with desirable values, actively contributing to the comm', 'No', 'SINGLE SESSION', 'QUEENSTOWN SECONDARY SCHOOL', 'QUEENSTOWN', '1 STRATHMORE ROAD', 'Malay', 'na', 'SOUTH', '252', 'http://www.queenstownsec.moe.edu.sg/'),
(257, '62888695', 'No', 'Tamil', 'na', '555889', 'GOVERNMENT SCHOOL', 'MDM LEE HWEE PING', 'MISS FOO SIEW YONG', 'SECONDARY', 'sgss@moe.edu.sg', 'No', 'SOUTH 1', 'na', 'Since 1959, Serangoon Garden Secondary School (SGS) has been enjoying the trust and confidence of the community and alumni over the last 57 years.  The SGS brand of education is known and valued for growing our students in the culture of care, learning and excellence. The culture of care is evident in the school as our students grow and develop in a safe and nurturing environment, marked by respect for teachers and peers. A few of the alumni have returned to their alma mater to serve the school as teaching staff and this helps to ensure that the good ethos of the school is preserved. Anchored on the culture of learning, the vision of the school is based upon our commitment to educate our students to their fullest potential. One of our key beliefs is that all our students are able to learn. As such, we have in place systems and processes to stretch the talent of our higher ability students; at the same time, we also have a range of student-centric intervention programmes to help the wea', 'SERANGOON MRT, ANG MO KIO MRT', '25, 55, 55A, 73, 74, 76, 76A, 132, 165, 315', 'na', '62889227', 'No', 'All students enrolling in SGS are emplaced on our signature Applied Learning Programme (ALP), \'Researching Society Using Media Communication\', which provides students with opportunities to apply higher order thinking skills in real-life contexts, making learning to be relevant and meaningful to the students. Our Learning for Life Programme (LLP) focuses on \'Nurturing Confident and Compassionate Leaders\', provides students with the opportunities to hone their leadership skills and develop into confident leaders.  Students in the Express Course enjoy course attachments with Nanyang Polytechnics as part of our extensive ECG collaborations, while students in the Normal Course will benefit from student-centred programmes which are acknowledged by MOE through the Lee Hsien Loong Award for Innovations in the Normal Course that inculcate 21st century competencies and skills to prepare them for life. In addition, SGS offers the Academic and Character Excellence (ACE) Scholarship, sponsored by our School Advisory Committee (SAC). Express students with at least 225 points, NA students with at least 185 points and N(T) students with at least 150 points from the PSLE, who apply for our school as their first choice, will be considered. These students must have at least a \'Good\' Conduct Grade. They will be involved in our signature programmes to stretch and prepare them to be future ready:  Sec 1 Science Research Programme to open the minds of our young students to the world of Science and discovery through Inquiry and Research. Sec 2 Cultural Immersion Programme to encourage talented students to participate in a 2-week immersion programme with our twinning schools in Xi\'an, China. This programme is also opened to non-Chinese students. Sec 3 ALP Programme to provide a platform for students to facilitate learning for peers and members of the public, while giving back to the community.  Sec 4/5 Job Attachment Programme for our students to experience the real-world of work.', 'MR TAY GHIM CHIEW STEPHEN', 'Chinese', 'CO-ED SCHOOL', 'A Caring, Learning Community', 'na', 'Love to Learn, Learn to Care', 'No', 'SINGLE SESSION', 'SERANGOON GARDEN SECONDARY SCHOOL', 'SERANGOON', '21 SERANGOON NORTH AVENUE 1', 'Malay', 'na', 'SOUTH', '253', 'http://www.sgs.edu.sg');
INSERT INTO `schools` (`schoolId`, `fax_no`, `gifted_ind`, `mothertongue3_code`, `fifth_vp_name`, `postal_code`, `type_code`, `second_vp_name`, `first_vp_name`, `mainlevel_code`, `email_address`, `sap_ind`, `cluster_code`, `telephone_no_2`, `philosophy_culture_ethos`, `mrt_desc`, `bus_desc`, `third_vp_name`, `telephone_no`, `ip_ind`, `special_sdp_offered`, `principal_name`, `mothertongue1_code`, `nature_code`, `visionstatement_desc`, `fourth_vp_name`, `missionstatement_desc`, `autonomous_ind`, `session_code`, `school_name`, `dgp_code`, `address`, `mothertongue2_code`, `fax_no_2`, `zone_code`, `_id`, `url_address`) VALUES
(258, '67734457', 'No', 'Tamil', 'na', '127391', 'GOVERNMENT SCHOOL', 'MR CHEEN HSIEN HONG', 'MDM LEE KEE CHIN', 'SECONDARY', 'tanglin_ss@moe.edu.sg', 'No', 'WEST 1', 'na', 'Guided by our philosophy, \'Everyone Is Unique, All Can Succeed\', and the vision of developing our students to become \'Leaders of the Future, Pride of the Community\', we are committed to delivering an innovative and engaging curriculum that equips students with the 21st Century skills of lifelong learning and values of R3IC2 (Respect, Responsibility, Resilience, Integrity, Care, Curiosity to Learn) to succeed in a changing world. TSS aims to nurture students to be confident thinkers and communicators with the capacity to solve authentic problems, positively influence others and demonstrate care for the community.', 'CLEMENTI MRT', '30, 51, 78, 285, 143, 176', 'na', '64248200', 'No', 'Leveraging on our strong partnerships with the polytechnics and our tradition of providing an engineering-based education, we provide our students the opportunity to pursue applied subjects such as Electronics, as well as Elective and Advanced Elective Modules. Students of different abilities also have the opportunity to offer subjects such as Additional Mathematics and Literature (English), on top of the Pure Sciences. Through our Applied Learning Programme (ALP), Tanglin P.L.U.S (Perspectives and Literacies to Understand Society), we aim to establish a distinctive programme in the Humanities. Tanglin P.L.U.S aims to complement the school\'s existing strengths in Mathematics, Science and Applied Subjects by equipping students with a deeper understanding of national and global issues that will ensure our students receive a well-rounded education which equally values skills of empathy, perspective-taking, diplomacy and public relations. For Lifelong Learning Programme (LLP), TSS leverages on its strengths in the Aesthetics to enable it to launch an enhanced Arts education programme for its students, S4 Through the Arts @ TSS Programme. S4 Through the Arts @ TSS Programme offers our students a 3-year programme that introduces the four arts forms (Music, Art, Drama and Dance) through General Music Programme (GMP), General Art Programme (GAP), Print-to-Screen-to-Stage Programme and a structured Aesthetics Education Programme (AEP) that includes dance and the learning of a musical instrument. For those with passion and interest in the arts, they can also join the Performing Arts Co-Curricular Activities, or opt for Elective Module (EM) and Advanced Elective Module (AEM) in the performing arts. Our customised four-year Student Leadership Development Programme ensures that our students are equipped with the leadership skills and competencies so that they become compassionate leaders who are ready to serve society.', 'MDM NG NGOING KENG', 'Chinese', 'CO-ED SCHOOL', 'Leaders of the Future, Pride of the Community', 'na', 'A caring school with an innovative and engaging curriculum, TSS equips our students with the skills ', 'No', 'SINGLE SESSION', 'TANGLIN SECONDARY SCHOOL', 'CLEMENTI', '301 WEST COAST ROAD', 'Malay', 'na', 'WEST', '254', 'http://www.tanglinsec.moe.edu.sg/'),
(259, '64409624', 'No', 'Tamil', 'na', '438796', 'GOVERNMENT SCHOOL', 'MDM MAH PATSY', 'MR KOH TONG SEAH', 'SECONDARY', 'tkss@moe.edu.sg', 'No', 'EAST 5', 'na', 'Since 1956, the TKSS motto \'Diligentia, Ingenium, Dexteritas\' has inspired generations of TK-sians in pioneering new pathways and actively shaping the community they live and work in. At TK, students are our pride. TKsians love their school.  From the moment they join TK, each student is immersed in the distinctive TK experience - an enriched, rigorous and balanced curriculum that makes a discernible difference in nurturing young people who believe in their ability to succeed, and are guided by sound values to positively contribute towards the well-being of others.  Learning experiences at TK nurture intellectual depth and thinking, flexibility, and the ability to deal with complexity in problem-solving.  Students acquire skills for self-directed learning and develop a sense of wonder and curiosity, even as they form a strong social conscience and make a commitment to serve others. Teachers at TK take pride in our caring culture and strong record of providing an all-rounded education t', 'PAYA LEBAR MRT, DAKOTA MRT', '10, 16, 31, 32, 33, 40, 76, 135, 197', 'na', '63443471', 'No', 'Signature programmes: Attributes of Learners in the 21st Century (ALiCe) programme, Project Work and Student Research which develop 21st century communication, collaboration and information skills, while sharpening critical and inventive thinking via applied learning opportunities; Principal\'s Honours List Programme; TK Current Affairs which builds general knowledge and discernment; SKILLS Programme which develops in students skills for self-directed learning; Project Serve which emphasizes giving back to society as an important dimension of success; TK Student Leadership programme; Outdoor Education at TK that stretches students mentally, physically and emotionally while instilling firm belief and confidence in their own ability to succeed; Twinning programmes with schools in China, Thailand, Malaysia, and Vietnam, that broaden students\' global outlook and increase cultural quotient. Programmes to deepen disciplinary understanding include the Mathematics and Chemistry Olympiads and the Australian Mathematics Competition and the EMAS Programme. Students also participate in Debating Competitions and the CB Paul Science Quiz. TKSS is renowned for its vibrancy and excellent CCAs in sports, the performing arts and uniformed groups. TeamTK\'s sportsmen and sportswomen have excelled in various sports such as Netball, Floorball and Soccer. The Uniformed Groups have a proven track record and have continuously excelled in national competitions. TKSS is the East Zone Centre of Excellence (COE) for Character and Citizenship Education as well as Design Education. As a COE, TK leads in the teaching and learning and supports collaboration in these areas for East Zone schools.', 'MRS DOLLY ONG KIM LENG', 'Chinese', 'CO-ED SCHOOL', 'Excellence Abounds, Aspirations Nurtured', 'na', 'Your Potential, Our Purpose - To nurture our students to their fullest potential, developing in them', 'Yes', 'SINGLE SESSION', 'TANJONG KATONG SECONDARY SCHOOL', 'MARINE PARADE', '130 HAIG ROAD', 'Malay', 'na', 'EAST', '255', 'http://www.tanjongkatongsec.moe.edu.sg'),
(260, '63643713', 'No', 'Tamil', 'na', '738239', 'GOVERNMENT SCHOOL', 'MDM KOMATHI D/O P KESAVAN', 'MDM NUR HIDAYANI IBRAHIM', 'SECONDARY', 'wrss@moe.edu.sg', 'No', 'NORTH 8', 'na', 'We believe that each student is unique and whose potential can be maximised so as to contribute selflessly to society. In line with its culture of learning, the school focusses on holistic, values-driven, student development programmes to engage the hearts and minds of its learners. The school is committed to providing its students with a safe and conducive learning environment to pursue their interests and strive for excellence. Staff and students are encouraged to live out the school motto: Work hard and smart, Rise to every challenge, Serve the school and community.', 'ADMIRALTY MRT', '912', 'na', '63643712', 'No', 'Character and Citizenship Education is the common thread that binds both the core and co-curriculum programmes in WRS.  The school\'s Applied Learning Programme - Robotics Education - ensures that every student is put through a Robotics-infused Design & Technology curriculum at lower secondary. Robotics Education instils in students a curiosity to learn through experimentation, questioning, problem-solving and risk-taking. It provides integration of learning across disciplines which include Science, Technology, Engineering and Mathematics (STEM), and develops in students the ability to make connections with real-life problems. As an extension of their learning and to provide our students early exposure to possible post-secondary courses of study and future work opportunities, the school will be offering an ITE-Applied Subject Mobile Robotics to our Secondary 3NT students in 2017. A Drama-in-Curriculum programme is introduced for lower secondary students to develop oracy and self-confidence through creative expression of their ideas and imagination. One special feature in the co-curriculum is Outdoor Education. Secondary 2 students attend a CCE camp during which they are given opportunities to demonstrate their understanding of the six NE messages and hone their social emotional competencies. Secondary 3 students learn more about resilience during a four-day camp by Outward Bound Singapore on Pulau Ubin. The school\'s Learning for Life Programme - Student Leadership Development through Involvement in the Community - aims to instil in students the purpose of caring for and leading others in the community through their involvement in community outreach activities. By working with partners, both locally and overseas, the programme is designed to help students better appreciate what they have and live out the school values of \'Responsibility, Respect & Resilience\' and motto \'Serve the School and Community\'.', 'MDM NG SIEW BEE', 'Chinese', 'CO-ED SCHOOL', 'Every WRS Student is Worthy, Resilient and Selfless', 'na', 'Nurturing Responsible, Caring and Self-Directed Learners', 'No', 'SINGLE SESSION', 'WOODLANDS RING SECONDARY SCHOOL', 'WOODLANDS', '10 WOODLANDS RING ROAD', 'Malay', 'na', 'NORTH', '256', 'http://www.woodlandsringsec.moe.edu.sg'),
(261, '67588770', 'No', 'Tamil', 'na', '768454', 'GOVERNMENT SCHOOL', 'MR LAM YUI- P\'NG', 'MDM TEO MEI LIN YVONNE', 'SECONDARY', 'opss@moe.edu.sg', 'No', 'NORTH 6', 'na', 'Every child matters at OPSS.The school\'s philosophy of the \'6 Everys\' guides the thinking and actions of all staff in providing quality school experiences through our school-based curriculum:Every Student of OPSS deserves to be my Student;Every Student of OPSS deserves my Best;Every Student of OPSS deserves to be given opportunities;Every Second a Teaching Moment;Every Inch a Learning Space;Every Interaction an Edifying Experience.We aspire to grow and nurture our students into wholesome,contributing and thinking individuals with robust character and a quest for knowledge and learning.As such,there is a strong focus on the holistic development of the whole child, in the different domains encapsulated in the PIES-MA(Physical,Intellectual,Emotional,Social,Moral and Aesthetics).Underpinning the school\'s efforts in holistic education is the building of strong Teacher-Student Relationships and the \"Discipline with Care\" approach.The 4As(Attendance,Appearance,Assignment,Attentiveness) are em', 'KHATIB MRT', '811', 'na', '67598547', 'No', 'OPSS offers a diverse range of programmes to cater to the development of our students.Some key school-wide programmes offered include:a whole-school approach to the learning of EL,Sec 1 Sci Camp,Sec 2 Speech & Drama lessons,3-tier Student Empowerment Programme,PE Outdoor Learning(through kayaking,dragon-boating,expeditions and student-initiated interest groups),Service Learning,interdisciplinary learning,school-based Normal curriculum,including puppetry and sailing and overseas immersion.OPSS delivers its LLP through Community OutReach Education(CORE),which works towards building student leadership,particularly through community leadership.CORE seeks to raise OPSS youths into confident and contributing individuals who will continue to serve and lead others through life.Aligned with our vision to develop our students into gracious and cultured individuals,our ALP,ARTopIA equips students with artistic and critical thinking skills through the infusion of studio habits in the curriculum design,and enriches their learning experiences in Visual Arts and Design through exploration of different art forms.An Enhanced Art Programme(EAP) school since 2016,the school is working very closely with Arts Education Branch to design a school-based Art Curriculum to more richly develop art passions and talents in our school.2 pieces of enhanced infrastructure are the newly set-up Ceramics Corner and Digital Printing Laboratory.The school is implementing greater flexibility in subject offering at lower secondary levels.Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1,based on their PSLE results.Beyond the start of Secondary 1,students can also do so if they do well in those subjects.', 'MR SHAWAL BIN HUSSIN', 'Chinese', 'CO-ED SCHOOL', 'The pupils of Orchid Park shall blossom into resourceful individuals with a positive outlook,prepare', 'na', 'We are committed to providing a holistic education to bring out the best in our pupils.', 'No', 'SINGLE SESSION', 'ORCHID PARK SECONDARY SCHOOL', 'YISHUN', '10 YISHUN STREET 81', 'Malay', 'na', 'NORTH', '257', 'http://www.orchidparksec.moe.edu.sg/'),
(262, '67585380', 'No', 'Tamil', 'na', '757704', 'GOVERNMENT SCHOOL', 'MR GOH KEE YONG @ GOH CHONG HENG', 'MR LEE KAH SIONG JIMMY', 'SECONDARY', 'SEMBAWANG_SS@MOE.EDU.SG', 'No', 'NORTH 8', 'na', 'Sembawang Secondary School strives to nurture a community of inspiring leaders who epitomise the spirit of \'to lead to serve, and to serve to lead\'.  We believe that every student can lead. Leadership starts with taking ownership and initiative at a personal level, and it extends to working in teams to achieve shared goals.  Inspiring leadership is about possessing sound values and ethics, demonstrating care and empathy, confidence with integrity, and innovation in problem solving. Sembawang Secondary School strives to create a culture of innovation where its members are engaged in improving the well-being of valued individuals and the community as a whole.  Innovation transforms dreams into reality through the synergistic combination of imagination, knowledge, inventiveness and critical thinking.  Most importantly, we provide the opportunities for students to exercise drive and achieve desired outcomes.  Sembawang Secondary School strives to engage our students in the acquisition of k', 'SEMBAWANG MRT', '859, 962', 'na', '67566760', 'No', 'The school\'s APPLIED LEARNING PROGRAMME (ALP) - CRITICAL AND INVENTIVE THINKING THROUGH MEDIA LITERACY, focuses on developing students\' critical and inventing thinking (CIT) skills through Media Literacy. Media literacy anchored in History and Geography curriculum seeks to develop students as critical consumers and producers of media information. Through this distinctive programme, students develop the skills to analyse sources of information presented in different media types and acquire an array of media related skills that culminate in the presentation and production of media products such as video clips and infographic set in an authentic context. This programme is also well supported by the English Language Department and the Craft and Technology Department.  To nurture every student as an inspiring leader and active contributor, the school\'s LEARNING FOR LIFE PROGRAMME (LLP) - DEVELOPING COMMUNITY LEADERS THROUGH VIA AND OUTDOOR EDUCATION, premised on values inculcation and service orientation, seeks to develop Community Leaders who are innovative, confident and caring. To achieve this, Values-in- Action Projects (ranging from service learning to social advocacy) at each level enable students to become change makers who lead and serve at school, community, national and regional level. Outdoor Education (OE) offers students the opportunity to strengthen leadership development, resilience and ruggedness. Both VIA and OE collectively allow students to acquire and demonstrate the school values of excellence, commitment, integrity, teamwork and empathy.', 'MR JASWANT SINGH', 'Chinese', 'CO-ED SCHOOL', 'Inspiring Leaders, Active Contributors', 'na', 'To nurture responsible, innovative and concerned citizens in a caring and dynamic learning environme', 'No', 'SINGLE SESSION', 'SEMBAWANG SECONDARY SCHOOL', 'SEMBAWANG', '30 SEMBAWANG CRESCENT', 'Malay', 'na', 'NORTH', '258', 'http://www.sembawangsec.moe.edu.sg'),
(263, '63887254', 'No', 'Tamil', 'na', '545090', 'GOVERNMENT SCHOOL', 'MR NG CHOR YAM', 'MR TAN TECK TIAN', 'SECONDARY', 'skss@moe.edu.sg', 'No', 'NORTH 1', 'na', 'Seng Kang Secondary School strives to provide a Student-Centric, Values-Driven (SVE) education that nurtures every student to his/her fullest potential with the belief that every child matters and can learn. Inculcation of values coupled with the development of an excellence mind-set for learning undergird the wide range of opportunities and programmes for students to develop 21st century competencies and skills to prepare them for the future. Through a holistic curriculum delivered within and beyond the classroom, the school provides authentic experiences for students to enjoy learning and to discover their talents and strengths. In tandem with the school\'s commitment to nurture leaders with resilience and gracious citizens with a caring heart to serve, curricular and co-curricular programmes are designed to engage students as active contributors in their teams to lead and serve for the betterment of others. The school has a team of dedicated and committed teachers who expect the best', 'SENG KANG MRT, RANGGUNG LRT', '27, 80, 85, 86, 87, 89, 89E, 163, 163M, 372', 'na', '63887258', 'No', 'Our Learning for Life Programme is Building Character through Physical Education & Sports. We believe that Physical Education and Sports Education are natural platforms for Character Building and our programme seeks to develop active and healthy students with mental toughness, empathy and character that will enables them to act as role models to promote a healthy lifestyle to their peers, family and the community.  Our Applied Learning Programme is on Health Science and Technology which aims to ignite student interests in the field of electronic through hands-on learning that builds bridge between textbook knowledge and real-world applications. Working in team or individually, students learn about coding skills and microprocessor programming and how it can be applied in the area of health sciences.  Character Development: Appreciation Night, Career Fair, Character Building Level Camps, Character & Citizenship Education/Values Inculcation Programme, Life Skills Enrichment Programme, Overseas Cultural Immersion Programme, Sports Leaders Programme, Values-in-Action Learning Programme. Curriculum-based Enrichment: Advanced Elective Modules, Arts Festival, Ceramics Art Programme, Elective Modules, English Drama Enrichment Programme, Environment Sustainability Science Curriculum, Guitar Music Programme, Inquiry-Based Learning, Life Science Programme, Mathematics Problem-Based Learning, Team-Based Learning, VIA Project Work, Whole-school Reading Programme, Youth Showcase Leadership Development: National Youth Achievement Award (NYAA), Student Leadership Development Programme. Cyber Wellness Ambassadors Programme.', 'MR KOH YIAK KHENG', 'Chinese', 'CO-ED SCHOOL', 'The Choice School for Character Development and Learning', 'na', 'To Nurture Lifelong Learners, Gracious Citizens and Resilient Leaders', 'No', 'SINGLE SESSION', 'SENG KANG SECONDARY SCHOOL', 'SENG KANG', '10 COMPASSVALE LANE', 'Malay', 'na', 'NORTH', '259', 'http://www.sengkangsec.moe.edu.sg/'),
(264, '65873682', 'No', 'Tamil', 'na', '528933', 'GOVERNMENT SCHOOL', 'MDM TAN MAY LIN SELINA', 'MR NG CHENG KEONG', 'SECONDARY', 'JUNYUAN_SS@MOE.EDU.SG', 'No', 'EAST 3', 'na', 'Junyuan is the nurturing ground (\'Yuan\') for developing our young Ladies and Gentlemen into knowledgeable persons with the values of justice (\'Jun\'). Our mission calls for all Junyuanites \'To Lead, To Serve and To Excel\', leveraging on the values of Innovation, Excellence, Respect, Responsibility and Resilience to ensure that every Junyuanite becomes better persons for others. The Junyuan community shares the responsibility of providing positive learning experiences within a culture of care to enable each Junyuanite to leave its gates with keys to open many doors. Our committed and compassionate staff facilitates the growth, inspires the belief and nurtures the hope that every Junyuanite will fulfil their potential.', 'TAMPINES MRT', '69, 291, 293', 'MR DANNY CHEW POH HUAT', '65873683', 'No', 'a) The Applied Learning Programme (ALP) offered at Lower Secondary levels integrates Food Science into the formal curriculum and extends students\' learning in Food and Consumer Education classes. Students carry out hands-on activities on food related investigation and learn science process skills in contextualised settings. Students then gain a broader perspective of integrated learning where skills are transferrable across subjects. b) The Learning for Life Programme provides level-wide innovation and social entrepreneurship training, and also engages students in push-cart businesses with social enterprises via their CCA. This develops their leadership in service learning so that they become active contributors and concerned citizens. c) Common School Experiences inculcate values, hone leadership skills, enhance future-readiness and nurture sense of belonging. These include lower secondary adventure programmes, elective modules in upper secondary and motivational and personal effectiveness programmes in Sec 4. d) Sports Education to develop the physical domain, partnerships with Keppel Nights and platforms to perform on Stage@JY to enhance aesthetics appreciation, and overseas internationalisation experiences to develop global and civic awareness, complete the holistic Junyuan educational experience. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR MOHAMED RAZALI B ABDUL HAMED', 'Chinese', 'CO-ED SCHOOL', 'Champions for the Community', 'na', 'To nurture and empower every Junyuan Champ to lead, to serve and to excel.', 'No', 'SINGLE SESSION', 'JUNYUAN SECONDARY SCHOOL', 'TAMPINES', '11 TAMPINES STREET 84', 'Malay', 'na', 'EAST', '260', 'www.junyuansec.moe.edu.sg'),
(265, '65873804', 'No', 'Tamil', 'na', '529231', 'GOVERNMENT SCHOOL', 'MR ANG JOHNNY', 'MRS MOHINDER SINGH (MDM PREGASS KAUR)', 'SECONDARY', 'esss@moe.edu.sg', 'No', 'EAST 3', 'na', 'East Spring Secondary have a nurturing, synergistic and innovative staff culture. Teachers exercise the duty of care and professionalism in teaching and learning to develop students to their fullest potential. Our staff are collegial and collaborative, working collectively and interdependently towards common goals for continuous improvement and excellence. With the focus on developing staff capacity to enhance professional competencies, we journeyed into Professional Learning Teams as an avenue for teacher collaboration to meet the learning needs of students and improve student outcomes. Teachers enhance their pedagogical capacity and instructional competency through teacher training in instructional strategies and reflective practices. The Instructional Programme (IP) Departments are empowered to experiment with practices that will promote more engaged learning. East Spring Secondary strives to develop every student\'s ability and talent to the fullest to benefit the self, community an', 'TAMPINES MRT', '3, 4, 9, 12, 17, 19, 21, 28, 29, 37, 59, 81, 291', 'na', '65873805', 'No', 'The school\'s Holistic Education, Character and Citizenship Education (HDCCE) framework is designed based on 21st century learner competencies and the desired student outcomes of a confident person, self-directed learner, concerned citizen, and active contributor to society. The Global Thinkers Programme nurtures East Springians to be globally-conscious about international issues, develop a cosmopolitan mindset through experiencing the rich diversity of cultures, and gain cross-cultural competencies to prepare them for a globalised economy. The school\'s Applied Learning Programme (ALP) on Harnessing Energy for Real Life Application, focuses on acquisition and application of scientific knowledge of Energy and Skills to real life situations in work, recreation and living. This unique programme allow students to acquire and apply critical thinking skills and develop dispositions of an inquiring mind. The school also seeks to develop student leadership skills through our Distinctive Programme, named Community Youth Leadership (CYL) under the Learning for Life Programme (LLP). The programme is designed for students to lead, inspire and remain centred on core values. The tiered approach equips student with fundamental and differentiated leadership skills through formal training and experiential learning opportunities, delve deeper into honing higher-order leadership demands and sharpen students\' capacity to be effective all-round leaders.  The school offers Direct School Admission(DSA) for our Distinctive Programme CYL.', 'MR TEOH TEIK HOE', 'Chinese', 'CO-ED SCHOOL', 'Creative Learners  Upright Citizens Global Thinkers', 'na', 'To nurture East Springians to be confident, vibrant, compassionate and responsible adults who are ab', 'No', 'SINGLE SESSION', 'EAST SPRING SECONDARY SCHOOL', 'TAMPINES', '30 TAMPINES STREET 34', 'Malay', 'na', 'EAST', '261', 'http://www.eastspringsec.moe.edu.sg/'),
(266, '67654189', 'No', 'Tamil', 'na', '689143', 'GOVERNMENT SCHOOL', 'MR DANIEL ONG POH SOON', 'MR LAU KHEE PHENG', 'SECONDARY', 'UNITY_SS@MOE.EDU.SG', 'No', 'WEST 2', 'na', 'The school places the needs of its students at the centre of its key decision-making and strongly believes that every student has his or her intrinsic worth, and can be developed to his or her fullest potential and as a leader of self and of others. The school believes that both academic and character development are important. Through various programmes anchored on the school values of respect, compassion, perseverance, commitment and integrity, all teachers in Unity are committed to empowering students to develop to their fullest potential and to eventually contribute to society. To achieve this, the school believes in providing a joyful, caring and nurturing environment to promote personal, social and intellectual growth of students at all levels.', 'YEW TEE MRT', '307', 'MR MOHAMAD AMRAN SHAH BIN ABD RAHIM', '67671070', 'No', 'Our school is committed to nurturing Unitians with the passion to learn, drive to excel and commitment to serve. Key programmes such as the Young Gifted Scientists Programme and Social Scientists and Entrepreneurship Programme integrate learning and stretch the potential of our students in their academic learning.  The school conducts an Applied Learning Programme (ALP) for all its students to develop in them a scientific mindset of innovation and enterprise. The Programme focuses on real-world problem-solving through the application of science and problem-solving processes such as design thinking, scientific methods and research skills. The ALP is conducted in collaboration with tertiary institutions and research agencies. Through the school\'s Character and Leadership Development curriculum, all students are provided with a variety of platforms and opportunities to hone their character and leadership skills.  In addition, the school conducts a Learning for Life Programme (LLP) to provide opportunities for all students to develop their leadership potential progressively at each level through outdoor and sporting adventure activities.  These include 1 Star Kayaking Certification, Adventure Camps, Camp-craft skills challenges, sports and games modules, recreational sports competition delivered through PE lessons and CCAs. The school administers the DSA-Sec Scheme which admits students competent in Basketball into Secondary 1. Through the scheme, we aim to develop and maximise the potential and talent of our students based on the principles of good sportsmanship and anchored on our school values. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MDM AINI BTE MAAROF', 'Chinese', 'CO-ED SCHOOL', 'A school where students and staff have the Passion to Learn, Drive to Excel and Commitment to Serve', 'na', 'To empower our students to develop themselves to their fullest potential and contribute to society', 'No', 'SINGLE SESSION', 'UNITY SECONDARY SCHOOL', 'CHOA CHU KANG', '20 CHOA CHU KANG STREET 62', 'Malay', 'na', 'WEST', '262', 'http://www.unitysec.moe.edu.sg'),
(267, '67566110', 'No', 'Tamil', 'na', '768692', 'GOVERNMENT SCHOOL', 'MR ADAM BIN AHMAD', 'MRS VENKATRAMAN CHITHRA', 'SECONDARY', 'NORTHBROOKS@MOE.EDU.SG', 'No', 'NORTH 6', 'na', 'Northbrooks\' name in Chinese is derived from the meaningful Chinese proverb \'yin shui si yuan\' to always remember our roots and be grateful to our family, teachers, friends and country for the success we achieve in life. The school motto: VOLATILIS TAMEN RADICALIS (SOARING YET ROOTED) challenges our students to SOAR to greater heights whilst staying ROOTED in strong values; motivated to excel, to lead, and to serve.  The school values acronym, \"G.I.F.T.E.D.\", is formed by the six values: Graciousness, Integrity, Fortitude, Teamwork, Empathy and Discipline. The school is committed to providing engaging learning experiences that allow them to practise the G.I.F.T.E.D. values. In the belief that students must put their values and citizenship education into action, the school partners various community organisations to offer Service-Learning opportunities for our students to contribute to the community.', 'YISHUN MRT, KHATIB MRT', '804, 806, 860', 'na', '67524311', 'No', 'The school\'s distinctive Applied Learning Programme (ALP) in Aerospace opens a pathway for our students to make a career choice in the rapidly growing aerospace industry by giving them an edge when applying for aerospace-related courses in ITE and the Polytechnics. All Lower Secondary students are equipped with basic knowledge in general aerospace topics and requisite ICT skills. Students found to be passionate in this area would be sent to participate in external related competitions and programmes. Our Learning for Life Programme (LLP) in Outdoor Education (Adventure, Character, Environment) aims to inculcate values, develop character and build leadership skills of all students through a three-tiered programme using nature and the outdoors. Through programmes such as orienteering, rockwall climbing and Values-In-Action (VIA) activities, we hope to cultivate in students a love for the outdoors and a heart for the environment they live in. Annual camps that emphasise experiential learning, values education and self-leadership are held concurrently for each level. A variety of enrichment programmes are also provided by the school to widen the exposure of students in the cognitive, physical and aesthetics domains. For example, the Stained Glass Art Programme is used as a tool to express creativity and to develop the spirit of Innovation and Enterprise. As the making of stained glass artwork requires intricate skill and patience, students working in teams develop fortitude, resilience and learn to value each other\'s strengths. The Whole School Approach to Effective Communication (WSA-EC) aims to build students\' competencies in communicating in English and incorporates learning activities in various subject disciplines, all designed to raise students\' interest and motivation in reading and speaking good English.', 'MR CHAN CHOON LOONG', 'Chinese', 'CO-ED SCHOOL', 'Every Brooksian a Champion, Impacting the Community', 'na', 'To empower Brooksians to develop a passion for learning, strong moral values and a keen sense of dut', 'No', 'SINGLE SESSION', 'NORTHBROOKS SECONDARY SCHOOL', 'YISHUN', '585 YISHUN RING ROAD', 'Malay', 'na', 'NORTH', '263', 'http://www.northbrookssec.moe.edu.sg/'),
(268, '65813226', 'No', 'Tamil', 'na', '518934', 'GOVERNMENT SCHOOL', 'MR ADRIAN LEOW LIP BOON', 'MDM LEONG SOOK HING', 'SECONDARY', 'prcss@moe.edu.sg', 'No', 'EAST 1', 'na', 'Pasir Ris Crest Secondary School is committed to helping our students achieve academic success and develop good character and values. We strive to give our students a quality learning experience that is steeped in the learning of values as well as knowledge and skills needed for the 21st Century. We develop Crestians to be active and engaged learners, innovative problem-solvers, effective communicators, self-disciplined and responsible leaders and active and concerned citizens with global awareness. Our emphasis on quality teaching and the belief that all Crestians can learn and achieve have guided us in developing good teaching and learning programmes that have yielded positive outcomes. Through character education and student leadership development, we aim to inculcate in our students sound values and nurture Crestian Overcomers with strength of character to overcome challenges in life.', 'PASIR RIS MRT', '358, 17, 81, 12, 3', 'na', '65811655', 'No', 'The school\'s Applied Learning Programme (ALP), Crestian Communicators of the 21st Century, aims to develop Crestians to be confident and effective communicators. All students learn effective oral and written communication through its NICE and SPICE programme and Spontaneous and Critical Writing Programme. Students also apply the skills learnt through storytelling, news reporting, broadcasting, drama and persuasive communication. Our public speaking programme trains our students to think on their feet and present lucid and sound arguments. These skills are important in today\'s globalised world. The school is the Music Satellite of East Zone Centre of Excellence for Creative Arts and Nurturing Crestian Learners of Tomorrow through Music and the Performing Arts is its Learning for Life Programme (LLP). The school offers Music at O and NT Level, as well as develops students\' potential in music through its customised General Music Programme. All our students learn instrumental, ensemble and music arranging skills and play at least 3 musical instruments. They also get opportunities to showcase their talents such as at recess concerts and Crestians Got Talent Competition. Through the school\'s NYAA programme, our students undergo fencing training in which they learn basic footwork, offensive and defensive strategies. They also learn to play the guitar/uklele, and participate in a 3-day 2-night camp where they learn 21st Century Competencies such as critical and inventive thinking, and communication skills.  As part of their service to the community, students plan and execute a Values-in-Action project to raise awareness and funds for a charitable organisation. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR TAN SHUN LOONG', 'Chinese', 'CO-ED SCHOOL', 'A Choice School, A Caring Home', 'na', 'Nurturing TOMORROW\'s learners, who are the pride of their family, society and nation, TODAY.', 'No', 'SINGLE SESSION', 'PASIR RIS CREST SECONDARY SCHOOL', 'PASIR RIS', '11 PASIR RIS STREET 41', 'Malay', 'na', 'EAST', '264', 'http://www.prcss.moe.edu.sg'),
(269, '65634379', 'No', 'Tamil', 'na', '649410', 'GOVERNMENT SCHOOL', 'MDM YIP SUN YEE', 'MR QUAH SIEW KIN', 'SECONDARY', 'FHSS@MOE.EDU.SG', 'No', 'WEST 7', 'na', 'Fuhua Secondary School was established in the year 2000. We are committed to nurturing the whole Fuhuanite, who is Outstanding, Upstanding and Ready for the Future (OUR Fuhuanites). To this end, the school provides opportunities for all students through a rigorous academic curriculum as well as a broad suite of co-curricular programmes - delivered and facilitated by caring teachers who actively promote our school RISE values (Respect, Integrity, Service and Excellence) and character-building. Fuhua aims to grow a positive school culture based on Values, Collaboration and Learning, and within this context seeks to develop thinking and thoughtful Fuhuanites who are prepared for the tests of life.', 'CHINESE GARDEN MRT, LAKESIDE MRT', '49, 98, 99, 157, 180, 185, 187, 198, 334, 335, 502', 'na', '65633067', 'No', 'To cultivate confident and self-directed learners with 21st Century Competencies, the school offers a rigorous and enriched academic curriculum. Special programmes include IGNIS (EL Talent Development Programme), Financial Literacy in Mathematics and Olympiad training in Mathematics and the Sciences, learning journeys and field trips (Humanities), Mother Tongue Fortnight and ICT Skills Modules, among others. The school has also established an Applied Learning Programme (ALP) in Forensic Science which offers experiential learning to help students develop an investigative mindset, a curious outlook and critical thinking skills. Fuhua Robotics Club offers another platform to promote these skills through self-directed problem-based learning. Through research and experiments, the club helps students to learn about robotic engineering and applications. To develop concerned citizens and active contributors, we deliver a robust Character and Citizenship Education (CCE) through our CCAs and formal CCE curriculum. These are integrated with a suite of programmes including leadership development, national education and Values In Action programmes. The school is embarking on our \"Values-In-Action, Leadership Through Service\" programme to provide opportunities to develop our Fuhuanites\' leadership potential through service. Our Uniformed Groups also serve as a premier vehicle to drive leadership and character development. UG cadets are given opportunities to lead and excel through service and community engagement, locally and overseas.', 'MISS FOONG LAI LEONG', 'Chinese', 'CO-ED SCHOOL', 'Premier School, Serving Community', 'na', 'Nurturing The Whole Fuhuanite', 'No', 'SINGLE SESSION', 'FUHUA SECONDARY SCHOOL', 'JURONG WEST', '5 JURONG WEST STREET 41', 'Malay', 'na', 'WEST', '265', 'http://www.fuhuasec.moe.edu.sg/'),
(270, '68946156', 'No', 'Tamil', 'na', '739110', 'GOVERNMENT SCHOOL', 'MR TAY KIM SENG', 'MDM KOH TYNG YUANN FIONA', 'SECONDARY', 'MARSILING_SS@MOE.EDU.SG', 'No', 'NORTH 5', 'na', 'At Marsiling Secondary, we pride ourselves on providing a holistic education that develop our students into respectful, responsible and resilient individuals. The school seeks to develop students who care for self and others, take ownership of their own growth and make full use of their talents, and persevere in the face of challenges. We adopt a whole school approach towards student development with every educator, a character builder and a discipline teacher. The staff subscribes to the mantra of High Care and High Expectations to govern the daily interactions between students and staff. This translates into teaching techniques and programmes that cater to students\' diverse learning styles and interests so that deep learning can take place to optimise the potential of each student. It also seeks to instil in students self-regulation in the areas of attendance, appearance and attentiveness during activities, so that students can experience achievement in both the core and co-curriculu', 'Marsiling MRT', 'TIBS 913(front gate) and 911(rear gate)', 'MR TAN TONG AIK', '68941413', 'No', 'Developing future problem solvers: The school was awarded the MOE Niche Programme in Environment education in 2010.  This programme was refreshed to become the school\'s Applied Learning Programme (ALP) - Eco-sustainability through Inquiry-based Learning in 2015. It offers a robust interdisciplinary curriculum for students to see the vital connections between text-book knowledge and personal skills to solve problems and arrive at useful outcomes. This three-year programme provides students the opportunity to engage in inquiry and research to apply science, technology, engineering, and mathematics in real time and real situations. The partnerships with Community College, a school in Ann Arbor, Michigan, USA, Singapore Science Centre, local companies and the offering of Advanced Elective Modules will excite and stimulate the students\' interest and thinking through hands-on projects, first hand observations at industrial visits and field investigations.  Building life skills for the workplace and society: Living Values through the Arts, the school\'s Learning for Life Programme (LLP), seeks to provide students with a unique blend of socio-emotional and aesthetic domains of learning to empower students with the knowledge, social and emotional skills and values to thrive for life. All students will acquire music and dance skills and have the opportunity to apply project management skills to the creation and development of performances for social causes. The school will delve into working with relevant examination boards to grant  accreditation to  students who have secured high levels of proficiency in the arts.  Other special programmes: All students are given opportunities to attain the National Youth Achievement Award (Bronze) through participation in Outdoor Adventure Camps and local and overseas Values-in-Education (VIA) programmes.', 'MR GOH AIK CHOON', 'Chinese', 'CO-ED SCHOOL', 'Self-Directed Learners . Caring Individuals The school aims to seed the skills and dispositions of s', 'na', 'To provide quality learning and nurture the spirit of caring to achieve the vision.', 'No', 'SINGLE SESSION', 'MARSILING SECONDARY SCHOOL', 'WOODLANDS', '12 MARSILING ROAD', 'Malay', 'na', 'NORTH', '266', 'http://www.marsilingsec.moe.edu.sg'),
(271, '68934458', 'No', 'Tamil', 'na', '738990', 'GOVERNMENT SCHOOL', 'MR TAN BOON CHENG', 'MS TAN POH LING, AUDREY', 'SECONDARY', 'woodgrove_ss@moe.edu.sg', 'No', 'NORTH 7', 'na', 'At the heart of WGS Education is the intent for students to have a wide range of learning opportunities in the cognitive, aesthetics and physical domains so as to realise their talents and broaden their interests. Students are developed to be logical and analytical thinkers as well as creative, imaginative and artistic individuals. The school\'s strengths in design, environmental education and the performing arts, provide students with a strong foundation to pursue their individual pathways. A spirit of innovation and entrepreneurship is fostered within the school and students are taught to value teamwork, question assumptions and to respect differing views. The school also strives to engage the hearts of its students, developing in them a passion to serve. Partnerships are forged to connect students to the local community so as to nurture civic responsibility. Internships with external organisations prepare and equip students to deal with future challenges with confidence and determina', 'WOODLANDS MRT', '900, 901', 'na', '68932564', 'No', 'The school has two distinctive programmes to provide holistic development of students: Learning for Life Programme (LLP) - \'Community Youth Leadership\' and Applied Learning Programme (ALP) - \'Material Science for Sustainable Living\'. The \'Community Youth Leadership\' programme aims to develop student leaders to attain the 3A qualities of Awareness, Affection and Ability to Act while the \'Material Science for Sustainable Living\' programme aims to nurture students to be self-directed and become dynamic learners with a keen interest in STEM-related domains such as materials science.  The school also offers the following programmes and learning experiences: Autodesk Inventor Programme, Design & Innovation Programme, Elective Modules and Advanced Elective Modules [AEM] in collaboration with Polytechnics, Environmental Education [EE], Experiential Learning, Inter-disciplinary Mobile Learning Experience, Overseas Learning Experience and Student Work Attachment. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR CHEE CHIT YENG', 'Chinese', 'CO-ED SCHOOL', 'A School of Choice. A Community of Dynamic Learners.', 'na', 'At Woodgrove... We will Shape Character, Ignite Passion, Promote Innovation   to prepare citizens of', 'No', 'SINGLE SESSION', 'WOODGROVE SECONDARY SCHOOL', 'WOODLANDS', '3 WOODLANDS AVENUE 6', 'Malay', 'na', 'NORTH', '267', 'http://www.woodgrovesec.moe.edu.sg/'),
(272, '67633577', 'No', 'Tamil', 'na', '677741', 'GOVERNMENT SCHOOL', 'MR PHOR HOAY GUAN', 'MDM HARTATI BTE OSMAN', 'SECONDARY', 'ZHENGHUA_SS@MOE.EDU.SG', 'No', 'WEST 6', 'na', 'Strong fundamental skills and values are at the centre of Zhenghua Secondary\'s endeavours. The school establishes a firm foundation for future learning by teaching core learning skills and instilling in our students a strong moral compass to face challenges with resilience and integrity. In academic learning, students are encouraged to take responsibility for their learning and be independent in the pursuit of knowledge. Problem-based and inquiry-based learning continue to be key teaching strategies to promote critical, creative and independent thinking. These efforts have yielded value-added outcomes.  We have a caring environment in which students and teachers have strong rapport. Our strong emphasis on holistic development is reflected in our unique Outdoor Education and Leadership programmes. We have an Adventure and Leadership Training Centre with facilities such as the high elements challenge ropes course and the outdoor and indoor rock walls. Outdoor education is infused in our ', 'JELAPANG LRT', '920, 922', 'na', '67639455', 'No', 'Learning for Life Programme (Outdoor Education), Applied Learning Programme (Game Design & Simulation), Talent Development Programmes in Math (Math Olympiad), Science (Research), English (Debate), Developing Confidence in Public Speaking Programme and Mother Tongue Languages (Higher Mother Tongue), Problem & Inquiry Based Learning, Geography Field Studies, Conversational Mother Tongue, ICT Project Work, Lower Secondary Science Project, Character, Leadership & Citizenship  Programme, Normal Technical Achievers Programme, Normal Academic Excellence Programme, Reading Programme, and Overseas Exchanges. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR LIN YUCHENG EUGENE', 'Chinese', 'CO-ED SCHOOL', 'School of Choice, Opportunities and Repute for Excellence.', 'na', 'To prepare every student to better meet the challenges of the future by building the student\'s emoti', 'No', 'SINGLE SESSION', 'ZHENGHUA SECONDARY SCHOOL', 'BUKIT PANJANG', '91 SENJA ROAD', 'Malay', 'na', 'WEST', '268', 'http://www.zhenghuasec.moe.edu.sg');
INSERT INTO `schools` (`schoolId`, `fax_no`, `gifted_ind`, `mothertongue3_code`, `fifth_vp_name`, `postal_code`, `type_code`, `second_vp_name`, `first_vp_name`, `mainlevel_code`, `email_address`, `sap_ind`, `cluster_code`, `telephone_no_2`, `philosophy_culture_ethos`, `mrt_desc`, `bus_desc`, `third_vp_name`, `telephone_no`, `ip_ind`, `special_sdp_offered`, `principal_name`, `mothertongue1_code`, `nature_code`, `visionstatement_desc`, `fourth_vp_name`, `missionstatement_desc`, `autonomous_ind`, `session_code`, `school_name`, `dgp_code`, `address`, `mothertongue2_code`, `fax_no_2`, `zone_code`, `_id`, `url_address`) VALUES
(273, '67653413', 'No', 'Tamil', 'na', '689621', 'GOVERNMENT SCHOOL', 'MRS TANG HUAY JIUAN PATRINE', 'MDM PUSHPARANI D/O K NADARAJAH', 'SECONDARY', 'REGENT_SS@MOE.EDU.SG', 'No', 'WEST 8', 'na', 'At Regent, we strive to develop everyone into a learner and a leader. With Respect, Empathy, Determination and Integrity, the school community inspires students to maximise their strengths. Our programmes nurture students into curious, self-directed and reflective learners. We provide challenges for our students to grow into leaders who inspire others to lead change. In living the vision of a Learner and Leader, the school strives to develop a positive environment in which staff is motivated to innovate through capacity building. The school establishes meaningful partnerships with internal stakeholders and external organisations to enrich students\' learning experiences and inculcate school values in them. In our quest to blaze forth to glory, we embrace the 3C Culture: Cherish the star in everyone, Care for all and a Commitment to excellence.', 'YEW TEE MRT, CHOA CHU KANG MRT', '307, 301, 302, 160, 170, 178, 925, 927, 960, 983, 961', 'na', '67653828', 'No', 'The Instructional Programme provides an inclusive, collaborative and experiential curriculum for all students. The customised music curriculum exposes students to various art forms like film music, dance and choreography. Underlying these programmes is the use of Assessment for Learning to build dispositions for lifelong learning. The school\'s Applied Learning Programme (ALP)-\'Learn, Do, Grow\', which integrates Project Work and ICT learning, is offered to all Lower Secondary students. The ALP exposes students to the world of Engineering through the use of Underwater Robotics as an exciting real-world application to their learning. Through our Learning for Life Programme (LLP), we will empower every Regenite to be responsible and confident leader who is committed to excellence. Our fundamental belief is that every individual can be developed as a leader and every student is given the opportunity to hold  a leadership position in his/her four/five years with us. Our Advanced Elective Modules(3 Express) include Introduction of Food Innovation and Everyday Chemistry. Our Elective Modules (3NA,3NT) include  Colour Pencil Rendering, Baking Principles, Papercut & Quiling and Small Business Operations. The Aspiration Programme focuses on a developmental plan from Secondary 1 to 5 using the Discover, Decide, Develop and Dream framework. Guided by \'To Begin With The End In Mind\', students are motivated to work hard to realise their potential. Through the Talent Development Programme, the school is committed to help all Regenites realise their potential. Programmes like the Maths & Science Olympiad, Writers-in-Residence and the Youth Arts Incubation allow students to excel in their innate abilities. The Cohort Camps have provided positive experiences to many students through a thematic approach and enabled them to live the school values and hone their leadership skills.', 'MR LEONG KOK KEE', 'Chinese', 'CO-ED SCHOOL', 'A Learner and Leader - Responsible, Confident and Committed to Excellence', 'na', 'Realising Our Potential', 'No', 'SINGLE SESSION', 'REGENT SECONDARY SCHOOL', 'CHOA CHU KANG', '50 CHOA CHU KANG NORTH 5', 'Malay', 'na', 'WEST', '269', 'http://www.regentsec.moe.edu.sg'),
(274, '67735119', 'No', 'na', 'na', '127368', 'GOVERNMENT SCHOOL', 'MR SHERWIN CHENG SAN SHIAN', 'MRS SIEW- TSAI JUNE WAH', 'SECONDARY', 'KRSS@MOE.EDU.SG', 'No', 'SOUTH 2', 'na', 'The hallmark of an education at Kent Ridge is the culture of care and excellence. Guided by our philosophy that \'Every Student Counts\', our passionate and dedicated staff place our students at the centre of all that we do and spare no effort to instil the right values in them. This commitment to excellence has been recognised at the national level by the awarding of the President\'s Award for Teachers in 2013, the nation\'s highest award for teachers and the Caring Teacher Award in 2011. Our holistic curriculum has also been recognised by the awarding of the Best Practice (Student All Round Development) in 2015. Kent Ridge is proud of what we have achieved in nurturing our students to be exemplary individuals who have the Heart of a Saint, Passion of an Inventor and Will of an Olympian. We look forward to scaling greater heights as we continue to go \'Beyond Frontiers\'. Kent Ridge offers many opportunities for our students to learn and grow through our rich array of programmes such as KR ', 'CLEMENTI MRT, HAW PAR VILLA MRT', '30, 51, 143, 175, 176, 201, 282', 'na', '67731127', 'No', 'At Kent Ridge, we are committed to providing a holistic education for all our students anchored on our school values of Fitness of Mind and Body; Integrity in Word and Deed; Respect for Self, Community and Environment and Excellence in All Our Endeavours. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects. Students will also have opportunities to take part in key programmes including: Character and Citizenship Education with a focus on personal and social life-skills; Learning for Life Programme (Sports and Outdoor Education); Applied Learning Programme (Robotics); Values-in-Action Programme; National Education; Student Leadership Development; Elective Modules; Advanced Elective Modules; Career Guidance; Internationalisation Programme; Subject-based Enrichment Modules; Family Matters! programmes; after school engagement programmes.', 'MDM S SAROJA', 'Chinese', 'CO-ED SCHOOL', 'A Kent Ridgean has the Heart of a Saint, the Passion of an Inventor, and the Will of an Olympian.', 'na', 'Kent Ridge Secondary nurtures the heart, ignites the passion and strengthens the will of all Kent Ri', 'No', 'SINGLE SESSION', 'KENT RIDGE SECONDARY SCHOOL', 'CLEMENTI', '147 WEST COAST ROAD', 'Malay', 'na', 'SOUTH', '270', 'http://www.kentridgesec.moe.edu.sg/'),
(275, '67929738', 'No', 'Tamil', 'na', '648350', 'GOVERNMENT SCHOOL', 'MR KONG CHEE CHIEW', 'MR GANESAN S/O RAMAN', 'SECONDARY', 'WESTWOOD_SS@MOE.EDU.SG', 'No', 'WEST 3', 'na', 'In Westwood, we believe that all students are unique individuals with different talents and abilities, who can learn and grow, and eventually, make a difference to society. As such, the school has the responsibility to develop each student holistically and to his best ability. This will be done through the provision of equal access to developmental opportunities, and, regardless of level or stream, talents and interests, all students will be ensured of a strong foundation in the knowledge, skills and competencies required for success in life in the 21st Century. Even more importantly, all students will be imbued with strong moral values and a sense of social responsibility, so that they may continue to serve and contribute to their community even after they leave Westwood.', 'BOON LAY MRT', '172, 181, 185, 199', 'na', '67929737', 'No', 'Westwood offers two distinctive programmes. Through our Applied Learning Programme on Innovation and Social Entrepreneurship (ISE), students will develop specialised knowledge of innovation and entrepreneurship that will enable them to make effective contributions to the community. The ISE curriculum is integrated in both the Academic and Co-Curriculum so that students are able to make connections and apply the knowledge and skills learnt in different contexts. In addition, students will be engaged in \"Arts for Life!\", our Learning for Life Programme where they are exposed to Visual Arts and Design, Music and Performing Arts.  Both distinctive programmes will provide extensive platforms for our students to ideate, experiment and explore as well as hone their 21st century skills and competencies where they will have opportunities to apply these skills in authentic contexts. Westwood also offers a Talent Development Programme (TDP) for students who are stronger in their academic studies. These students will be provided with ample opportunities to hone their communication & presentation skills, as well as stimulate their intellectual curiosity and develop greater awareness of international issues and their impact through participation in conferences/seminars/forums/projects and build a personal portfolio in the process.', 'MR ABDUL HARRIS B SUMARDI', 'Chinese', 'CO-ED SCHOOL', 'Rooted in Character & Skills to Soar for the Nation.', 'na', 'Nurturing Westwoodians to be anchored in sound values, to have the necessary knowledge and skills to', 'No', 'SINGLE SESSION', 'WESTWOOD SECONDARY SCHOOL', 'JURONG WEST', '11 JURONG WEST STREET 25', 'Malay', 'na', 'WEST', '271', 'http://www.westwoodsec.moe.edu.sg'),
(276, '67583110', 'No', 'Tamil', 'na', '757699', 'GOVERNMENT SCHOOL', 'MR SNG CHIN SENG', 'MR MUHAMMAD SHAHARI B ABU BAKAR', 'SECONDARY', 'CANBERRA_SS@MOE.EDU.SG', 'No', 'NORTH 8', 'na', 'Education at Canberra centres on the belief that we provide \"The best for our students\" and expect \"The best from our students.\" Guided by the school\'s three core values of Living with Integrity, Learning with Passion and Serving with Distinction, we aspire to develop our students to their full potential, to inculcate in them the right values and mind-set for excellence, and to nurture them to be responsible and caring citizens. The school provides a beautiful, warm and welcoming physical environment for students to be purposefully engaged in learning amidst a positive climate of care, trust and respect. We have a strong team of caring and competent staff who are committed in helping each and every child realise his potential. Over the years, the school has developed a strong culture of innovation where staff and students alike are constantly engaged in developing new ideas to enhance teaching and learning experiences.', 'SEMBAWANG MRT', '859, 962', 'na', '67585070', 'No', 'The school offers a rigorous academic programme and a comprehensive range of Character and Citizenship Education (CCE) programmes that are well-aligned to MOE\'s Framework for 21st Century Competencies and Student Outcomes. The school has developed two distinctive programmes, namely, Digital Media in Visual Arts and Active Holistic Health Advocates (AHHAs) Championing Efforts towards a Healthier Community. Students are given a headstart in digital media during their lower secondary school years through our structured school-wide Digital Media in Curriculum Programme. The Digital Media in Visual Arts Programme incorporates learning in authentic setting and integrates education and career experiences for the students. The exposure in depth and breadth gives our students the opportunity to identify their aptitudes and interests, build their strengths, and make informed decisions on their education and career choices. A healthy school is a happy one that promotes engaged learning and enhances students\' overall school experience. We adopt a whole-school and integrated approach in developing our students\' holistic health. The school hopes to equip our students with important values, knowledge and skills so that they become responsible and concerned citizens who are morally upright and can effectively take on active roles at home, in school and the community to contribute towards building a more pleasant and healthier environment and society. The school also offers a signature programme - The Global Canberran Programme that aims to provide every student with the opportunity to be engaged in learning beyond the school and local community.', 'MR NG TIONG NAM', 'Chinese', 'CO-ED SCHOOL', 'Every Canberran a Self-directed Learner of Exemplary Character and Responsible Citizen with a Global', 'na', 'To inspire Canberrans to Challenge their Potential, Conquer their Aspirations and Contribute to Soci', 'No', 'SINGLE SESSION', 'CANBERRA SECONDARY SCHOOL', 'SEMBAWANG', '51 SEMBAWANG DRIVE', 'Malay', 'na', 'NORTH', '272', 'http://www.canberrasec.moe.edu.sg'),
(277, '68815998', 'No', 'Tamil', 'na', '545083', 'GOVERNMENT SCHOOL', 'MR SUKHDEV SINGH S/O GURDEEP SINGH', 'MR WONG JIA WANG', 'SECONDARY', 'CVSS@MOE.EDU.SG', 'No', 'NORTH 3', 'na', 'In CVSS, we believe there is a star in all our students and help our students find the compass in their lives and realise the star within.  We want all our students to be like the North Star, shining brightly with good character and excellence in both academic and non-academic domains, as a guiding light for the community and the world.  We aim to foster a vibrant learning community with a nurturing school climate through diverse and engaging school programmes with ample opportunities for student participation and student voice. Our culture and ethos are \'Achieve our Best\' (every student a \'North Star\'); \'Believe in Every Child\' (everyone can achieve and all can succeed); \'Care for Every Child\' (every teacher guides and mentors each \'North Star\' in developing holistically as individuals) and \'Determined to Learn\' (every student comes to school with the right attitude for learning and the mindset of high expectations).', 'SENGKANG MRT, COMPASSVALE LRT', '27,  82,  83,  86,  88,  89, 89E, 136,  161, 371, 965', 'MR PHANG CHEE KHENG', '68815047', 'No', 'Our North Star Education Programme (NSEP) offers a total curriculum that covers all five domains of student development (physical/cognitive/social/moral/aesthetic) and develops 21st century competencies. Our instructional programme is based on i-TEACH Framework for integrated, engaged and assessed learning, and teachers as curriculum innovators, collaborative learners and holistic educators. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.  Our school-wide pedagogies include Assessment for Learning, Thinking Routines, Flipped Classroom and ICT-infused Self-Directed & Collaborative Learning. Our distinctive programmes are (1) Aeronautics Applied Learning Programme (Applications of science and technology in aeronautics industry) and (2) \'Inspired North Stars Inspire Actions\' Learning for Life Programme (Community and youth leadership development for all students including overseas VIA projects). Other key school/level wide programmes include (1) Outdoor Education Programme (Cohort/level-wide adventure/cultural immersion camps, adoption of Sengkang Floating Wetland for Science/Environment Education) (2) Practice-Oriented Curriculum (Elective Modules and Advanced Elective Modules for all Sec 3 students to explore post-secondary educational/career options) (3) North Star Scholars Programme (Talent development). Other school/level-wide departmental signature programmes include EL Speech & Drama modules, MTL Web-based Oral Communications modules, Fun Math Programme, Elementz Science Research Programme, 3D Design/Printing, Ready for the World Educational & Career Guidance Programme, Building Resilience through Outdoor Adventure for Normal Course students etc.', 'MR CHIA CHOR YANN', 'Chinese', 'CO-ED SCHOOL', 'World Ready Youth - Innovative contributors, upright citizens with a global outlook', 'na', 'We develop our students to their fullest potential through a balanced education and instil in them a', 'No', 'SINGLE SESSION', 'COMPASSVALE SECONDARY SCHOOL', 'SENG KANG', '51 COMPASSVALE CRESCENT', 'Malay', 'na', 'NORTH', '273', 'http://www.compassvalesec.moe.edu.sg'),
(278, '63658083', 'No', 'Tamil', 'na', '738489', 'GOVERNMENT SCHOOL', 'MR CHUA TUNG KIAN', 'MR ELANGOVAN S/O V MUTHOO', 'SECONDARY', 'EVERGREEN_SS@MOE.EDU.SG', 'No', 'NORTH 5', 'na', 'Evergreen Secondary School is guided by our Vision, Mission and Values to nurture our students to become Caring Leaders and Thinking Citizens. We believe every student who aspires to do well can succeed if given the right support from teachers and parents. Thus we recognise the importance of forging effective partnerships with our parents in addition to building a team of dedicated and competent teachers. In preparing our students for the challenges of the 21st Century, we believe it is of utmost importance to design a forward-looking curriculum undergirded by sound values. Hence, in our school, we adopt a school-wide approach in which character and citizenship education is integrated into all instructional programmes and CCA programmes.', 'WOODLANDS MRT', '911', 'na', '63656392', 'No', 'The school\'s Applied Learning Programme aims to develop Effective Communicators, Caring Leaders and Inventive Thinkers through a 3-year Communication Skills Programme. In this distinctive programme, students develop thinking skills, collaborative skills and oratorical skills through Storytelling, Critical Reading, Debates and Presentation Skills. There are talent development programmes to take students further in their areas of interest, such as e-Journalism and the Odyssey of the Mind Competition. The Leadership In Action (LIA) Programme nurtures students\' leadership potential by equipping them with social-emotional skills and effective leadership practices through cohort-wide workshops and outdoor camps. Students also hone their leadership skills by assuming different leadership roles. To nurture community engagement, the school has a comprehensive Sec 1-4 Service Learning structure. This helps to build practical life skills among youths. The school offers a structured Science and Technology Research Programme (STRP) to stretch the potential of our students. Under this programme, students are provided with opportunities to work on research projects under the guidance of dedicated teachers. They will also be equipped with research skills, analytical skills and presentation skills as part of the programme. The school has in place a comprehensive Lifelong Learning Programme to develop Resilience and Leadership through Sports Education. This is a 4/5 year programme infused in the curriculum and co-curriculum focusing on the deliberate development of resilience, strength of character and leadership skills through sports education. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MRS LIM CAROL', 'Chinese', 'CO-ED SCHOOL', 'A dynamic school that thinks and cares.', 'na', 'We nurture citizens of character with the passion to contribute and excel.', 'No', 'SINGLE SESSION', 'EVERGREEN SECONDARY SCHOOL', 'WOODLANDS', '11 WOODLANDS STREET 83', 'Malay', 'na', 'NORTH', '274', 'http://www.evergreensec.moe.edu.sg'),
