(317, '67731433', 'Yes', 'Tamil', 'MDM YONG LEE HAR', '139650', 'INDEPENDENT SCHOOL', 'MRS TEO LAI CHENG JUDY-HO', 'MR SOO MUN KEONG PATRICK', 'MIXED LEVEL', 'ACIS@MOE.EDU.SG', 'No', 'SOUTH 2', 'na', 'Founded in 1886, our school\'s core purpose is to nurture our students to be catalysts for change with Godly values and robust character, equipped and willing to serve and lead in the family, nation and the global community. A Methodist institution, the school places a strong focus on all-round, values-centric development, anchored in a school environment of family and community. Every Year 1-4 student participates in 2 CCAs (a Uniformed Group and either a Sports, Club/Society or Performing Arts Group).', 'DOVER MRT, BUONA VISTA MRT, ONE-NORTH MRT', '14,33,74,166,196', 'MISS THIRUNALAN MIRUNALINI', '67731633', 'Yes', 'ACS(I) is a centre for various MOE programmes such as the School-Based Gifted Education Programme, Music Elective Programme, Regional Studies Programme and Humanities Scholarship Programme. In addition, school-based programmes such as ACE21 Communications Programme, Accelerated Class for Science, Mathematics and Science Olympiads and the Dr Goh Keng Swee Nation Building series nurture students holistically.', 'MR WINSTON JAMES HODGE', 'Chinese', 'CO-ED SCHOOL', 'Years 1-4: A Scholar, Officer and Gentleman ; Catalyst for Change, for God and Humanity.  Years 5 -6', 'MISS CHOCK SIEW HWA', 'To be a beacon of truth and light, a world-class institution through the holistic development of our', 'No', 'SINGLE SESSION', 'ANGLO-CHINESE SCHOOL (INDEPENDENT)', 'QUEENSTOWN', '121 DOVER ROAD', 'Malay', 'na', 'SOUTH', '317', 'http://www.acsindep.moe.edu.sg'),
(318, '67636560', 'No', 'Tamil', 'na', '678117', 'GOVERNMENT-AIDED SCH', 'MR QUEK SER HIANG', 'MR TANG HSIN WEI', 'SECONDARY', 'AES@MOE.EDU.SG', 'No', 'WEST 6', 'na', 'Assumption English School is a government-aided school founded by the Montfort Brothers of St. Gabriel. The school is one of the seven Gabrielite institutions in Singapore and many others in 33 countries worldwide. The school subscribes to the Montfortian Education Charter which serves as a guide to \'form enlightened and harmonious persons committed to a just and fraternal world\'. Thus the school\'s  philosophy is that \'We believe that Education is a journey of Self Discovery where students discover their talents, clarify their values & form their moral compass.\' The school creates an ethos that cares and challenges our students to become confident and able leaders who embody the Assumption Spirit of Excellence in Character & Learning. The school motto, Labor Omnia Vincit, sums it up clearly - our students will, through work, achieve success.', 'CASHEW MRT', '67, 75, 170, 171, 176, 178, 184, 961, 963, 970', 'na', '65729100', 'No', 'To realise the school\'s vision to produce \'Men and Women of Character and Learning, in the service of God and Community\', the school\'s Montfortian Achievers\' Programme and range of Co-Curricular Activities provide valuable opportunities for students to develop self-confidence, self-discipline and social-emotional competencies through experiential learning and Values-in-Action projects in the school and community. Students look forward to annual camps and overseas learning journeys as they provide opportunities to build team spirit, discover their latent strengths, build cultural awareness and start friendships which will last a life-time. The school\'s Applied Learning Programme (ALP), SPEAK (SPeak English with grAce and Knowledge), aims to develop a love and appreciation for the English Language, and hone students\' language ability so that they are effective and proficient users of the language. Through the ALP, students at the lower secondary levels will experience a range of language genres such as poetry and drama, with the chance to showcase their talents through competitions and events. At upper secondary, students will gain mastery of the language through specialised training such as debate, drama and public speaking, with opportunities to apply their skills through competitions, events and attachments.  The school\'s Learning for Life Programme (LLP) aims to nurture and inspire students who are committed to serve their communities with empathy. Students will be exposed to authentic experiences of community issues and needs and empowered to make positive differences to the lives of others. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MRS MABEL LEONG', 'Chinese', 'CO-ED SCHOOL', 'Men and Women of Character and Learning, in the Service of God and Community', 'na', 'To educate the whole person in the Montfortian spirit of charity and love where effective academic p', 'No', 'SINGLE SESSION', 'ASSUMPTION ENGLISH SCHOOL', 'BUKIT PANJANG', '622 UPPER BUKIT TIMAH ROAD', 'Malay', 'na', 'WEST', '318', 'http://www.assumptionenglish.moe.edu.sg/'),
(319, '63544573', 'No', 'Tamil', 'na', '319764', 'GOVERNMENT-AIDED SCH', 'MISS TEO GEOK SIAN', 'MISS CANDICE YVETTE SEET SIEW YAN', 'SECONDARY', 'CHIJTPSS@MOE.EDU.SG', 'No', 'SOUTH 3', 'na', 'CHIJ Secondary stands as the second oldest girls school in Singapore. Every IJ Girl shares the vision of being A Woman of Distinction, who is a Thinker, Leader, Communicator, confident with humility, principled with compassion and cultured with grace. At CHIJ Secondary, we believe that every IJ Girl matters. As such, we customise our curriculum to meet their needs and talents. With a strong foundation in character and values-education, CHIJ nurtures our girls through a holistic education, with the support of a competent and forward-looking staff. Our strong partnerships with key stakeholders also enable the school to build a strong network of support. We remain, through the years, Simple in Virtue, Steadfast in Duty.', 'TOA PAYOH MRT', '59, 231', 'MR HONG HENG YAN', '63534972', 'No', 'A choice school, CHIJ Secondary is progressive in its approach whilst remaining steeped in tradition. The IJ Education and Experience is undergirded by the 3Ls@IJ approach which encompasses both the academic and affective domains and focuses on developing students holistically through Learning, Living and Leading. In CHIJ, all lower secondary students experience our in-house drama programme which enable students to realise their creative talents and develop their artistic vision. Our Affective Programmes focus on character development and include the Developmental Leadership Programme, the Values-in-Action programme, self-awareness camps, work attachment programme, and adventure camps. As the South Zone Centre of Excellence for Language and the Arts, CHIJ is home to many strong performing arts groups. At the same time, CHIJ\'s sports CCA groups have experienced success on the school scene. Our signature IJ Goes Global Programme aims to equip IJ students with a more global perspective and includes Immersion and Twinning Programmes with overseas schools, and the IJ Beacon Programme which focuses on serving the disadvantaged in neighbouring countries.', 'MRS KAREN TAY', 'Chinese', 'GIRLS\' SCHOOL', 'A Woman of Distinction', 'na', 'The mission of an Infant Jesus Convent is the creation of a Christ-centred school community where al', 'Yes', 'SINGLE SESSION', 'CHIJ SECONDARY (TOA PAYOH)', 'TOA PAYOH', '626 LORONG 1 TOA PAYOH', 'Malay', 'na', 'SOUTH', '319', 'http://www.chijsec.edu.sg'),
(320, '67477317', 'No', 'Tamil', 'na', '389705', 'GOVERNMENT-AIDED SCH', 'MDM TEO YVONNE', 'MR EKA TANU', 'SECONDARY', 'gmss@moe.edu.sg', 'No', 'EAST 5', 'na', 'We strive to inculcate \'integrity, compassion and the desire to learn and bless others\' as we build an engaging school to develop all-round students through an empowered staff. Our approach to Character Development is anchored in \'Knowing\', \'Doing\' and \'Being\', and we aim to equip every student with social and emotional competencies and root them in moral values. The school is guided by the principle of \'Building Character through Building Relationships\' as we believe that a strong student-teacher bond is pivotal to sound character formation. We encourage our students to be in the position of choice i.e. to be of good character, succeeding in both academic and affective areas, so that more life opportunities would be opened to them. We do this by offering choices to our students, because we value and acknowledge that each individual has different talents and needs. The school\'s academic programmes are therefore customised to meet students\' needs and abilities, stimulate thinking and in', 'ALJUNIED MRT', '40,62,63,80,100,125,134,153,155,158,180', 'MDM TAN SOR LENG', '67466503', 'No', 'The school nurtures students\' talents, interests, character and leadership qualities via a vibrant CCE curriculum and distinctive programmes, including a 4/5-years progressive Values-in-Action Learning for Life Programme (LLP) with local and overseas service learning experiences, an Applied Learning Programme (ALP) in Environmental Science and Sustainable Living, a vibrant CCA programme spanning 20 CCAs, the Music, Art, Dance and Drama (MADD) enrichment programme, oral communications, varied leadership development opportunities and level camps for all students. Through these, we develop all-round students who strive to contribute to the school and the community.The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR WEE TAT CHUEN', 'Chinese', 'CO-ED SCHOOL', 'Passionate Learners. Courageous Leaders. Caring Citizens.', 'na', 'With God\'s help, to be a beacon of light by connecting, nurturing and inspiring GEMS to make a diffe', 'No', 'SINGLE SESSION', 'GEYLANG METHODIST SCHOOL (SECONDARY)', 'GEYLANG', '2 GEYLANG EAST CENTRAL', 'Malay', 'na', 'EAST', '320', 'http://www.geylangmethodistsec.moe.edu.sg'),
(321, '64494405', 'No', 'Tamil', 'na', '339626', 'GOVERNMENT-AIDED SCH', 'MR CHEAH KOK KEONG, GEORGE', 'MDM ONG BEE HOON', 'SECONDARY', 'chijktcs@moe.edu.sg', 'No', 'EAST 7', 'na', 'The CHIJ Katong Convent (KC) brand of education is anchored in building character and developing the whole person. We grow our student leadership, character and citizenship education programmes through meaningful learning experiences from long-term partnerships established with local and overseas organisations. We are committed to striving for excellence in all that we do, stretching academic potential, inculcating strong moral values and nurturing all-round confident and gracious young ladies with hearts of compassion and a keen sense of duty to the community. Our KC Graduate will choose to live a life that matters, guided by our IJ Mission and Motto, growing to become ladies with values and of value to their community and our nation. She is a compassionate servant leader, effective communicator, innovative problem-solver and discerning citizen of the world.', 'Potong Pasir, Kallang', '26, 61, 107, 107M, 546, 853.  Express Service : 23, 966', 'na', '64486433', 'No', 'The school provides a broad-based student-centric, values-driven curriculum to equip students with the knowledge, skills and attributes to face the challenges of the future. Based on the school\'s E3 approach, programmes are conceptualised from a differentiated perspective: a good school Experience for all students; Enrichment programmes in line with our school\'s niche area in Art, Drama and Music at \'O\' level for students with interest and aptitude for the subject; and Extended opportunities for the higher ability students to Excel in their area of talent. Our key programmes include Literature for All; Speech and Drama; Enhanced Art Programme; Student Leadership Development; Book and Music Week; Evening of Music, Dance & Drama; Arts Education; Study and Exam Skills Seminar; Level Camps; Level Retreats; Overseas Exchange; Service Learning; Information Literacy; ITE Elective Modules; Polytechnic Advanced Elective Modules; Work Experience and Environment Projects.', 'MDM CHAN GEK SAN PATRICIA', 'Chinese', 'GIRLS\' SCHOOL', 'A Caring School That Excels.', 'na', 'The mission of an IJ Convent is the creation of a Christ-centred school community where all work tog', 'Yes', 'SINGLE SESSION', 'CHIJ KATONG CONVENT', 'MARINE PARADE', '3 GEYLANG BAHRU LANE', 'Malay', 'na', 'EAST', '321', 'http://www.chijkatongconvent.moe.edu.sg'),
(322, '63862804', 'No', 'Tamil', 'na', '538785', 'GOVERNMENT-AIDED SCH', 'MR KOH LIP KANG', 'MR GOH KENG TENG GORDON', 'SECONDARY', 'contact@montfortsec.edu.sg', 'No', 'NORTH 4', 'na', 'Montfort Secondary, established in 1916, is a Government Aided School of the Montfort Brothers of St Gabriel under the Catholic Archdiocese of Singapore.  As a Catholic school, we espouse the Universal Gospel Values and are committed to providing an inclusive, safe and dynamic environment for all our boys regardless of faith and background.  We also believe that there is a place for an all-boys education and we develop and cater our programmes to the needs of boys - giving them the needed structure and discipline as well as the space to grow and discover their leadership, talents and strengths. Our School Motto \"Age Quod Agis\" translates to \"Do Well in Whatever you Do\".  It reminds our boys of the dignity of work and that the work they do is important and represents who they are.  Therefore, they need to take pride in their assigned tasks and do them to the best of their abilities.  Our School Values are Compassion, Humility, Respect, Integrity, Service, Team Spirit & Excellence - toge', 'HOUGANG MRT', '74,74E,88,101,147, 147A, 161', 'MR CHEONG WING FOOK MELVIN', '65107070', 'No', 'Underlying Montfort Secondary\'s teaching and learning approach is the belief that boys learn better when we adopt Boy-Centric Teaching (BCT) strategies. Translated into classroom delivery, this would mean that teachers now incorporate novelty, movement and relevance into their lessons. The Applied Learning Programme (ALP) in Information Systems Technology & Design that was recently introduced aims to provide our students with foundational skills in this frontier learning domain. The development of leadership and character is another vital part of our Montfortian Education.  We do this through our flagship Montfort Values Plus (MVP) programme that is aligned to MOE\'s CCE curriculum and supported by a tiered Values-in-Action Programme for our boys from Secondary 1 through 5. Montfort\'s Learning for Life Programme (LLP) is centred on Leadership Development through Sports (Badminton, Softball & Football) & Outdoor Education, where our boys hone their leadership skills through various class, CCA and school activities, embarking on community and school projects based on the Kouzes & Posner Leadership Challenge Model. For our Catholic Boys, we have programmes catered for them including Religious & Moral Education lessons, regular masses and an annual retreat.  The school also provides opportunities for the students to appreciate the Arts through our 3 \"E\" Approach (Exposure, Expression & Excellence). All Secondary 1 students can look forward to participating in arts, music and theatre workshops organised by the Performing Arts CCAs. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR MARK GERARD MINJOOT', 'Chinese', 'BOYS\' SCHOOL', 'A Man for Others - a Scholar, Sportsman, Gentleman and Leader', 'na', 'Montfort is a Catholic School. Guided by our Montfortian values and spirituality, we nurture each in', 'No', 'SINGLE SESSION', 'MONTFORT SECONDARY SCHOOL', 'HOUGANG', '50 HOUGANG AVENUE 8', 'Malay', 'na', 'NORTH', '322', 'http://www.montfortsec.moe.edu.sg/'),
(323, '62523076', 'No', 'Tamil', 'na', '309437', 'INDEPENDENT SCHOOL', 'na', 'MRS SHERMAINE TANG', 'SECONDARY', 'SCGSS@MOE.EDU.SG', 'No', 'NORTH 2', 'na', 'The SCGS education philosophy stems from our strong belief in providing a holistic and balanced education founded on a bedrock of timeless values and rich heritage. Our environment which offers the warmth and stability of a strong family fosters excellence and achievement based on every pupil\'s personal needs, interests and aptitude. We add colour, character and richness to the learning experience.', 'STEVENS MRT', '48, 66, 67, 105, 132, 151, 153, 154, 156, 170, 171, 186, 190, 700, 700A, 960, 971E, 972', 'na', '62527966', 'Yes', 'SCGS offers both the Integrated Programme (IP) and the O-Level Programme. The SCGS IP provides an exceptional blend of excellence in academic and leadership development. It focuses on cultivating intellectual resilience and ethical leadership while facilitating the pursuit of possibilities. Our vibrant and collaborative learning community prepares students to meet challenges and inspires them to be Principled Leaders of Tomorrow. It comprises four key components: Core Academic, World Readiness and Character & Leadership Excellence Programmes and Passion Pursuit. We also offer a Bicultural Studies Programme which nurtures our girls\' bicultural awareness and enhances their mastery of the Chinese Language. IP students will spend their first 4 years in SCGS before progressing to Eunoia Junior College to complete the IP. Students in the O-Level Programme enjoy an enriched experience that nurtures world-ready leaders of character and relevance. The Talent Development Programme provides opportunities for students to achieve excellence in their areas of interest, for example, through local/ overseas field trips, enhanced project work and mentorship programmes with local scientists. The Character and Leadership Excellence Programme covers World Readiness, Social Entrepreneurship and Environmental Responsibility through platforms such as Outdoor Education Camps, Overseas Trips, SC Model United Nations and Leading Youths in Research & Inquiry into Community & Society.', 'MDM TAN YUNCHIN EUGENIA', 'Chinese', 'GIRLS\' SCHOOL', 'To be an asset to the country by developing capable women of character and relevance.', 'na', 'To develop each pupil\'s character and abilities to her fullest potential according to her individual', 'No', 'SINGLE SESSION', 'SINGAPORE CHINESE GIRLS\' SCHOOL', 'NOVENA', '190 DUNEARN ROAD', 'Malay', 'na', 'NORTH', '323', 'http://www.scgs.moe.edu.sg'),
(324, '63823779', 'No', 'Tamil', 'na', '359342', 'GOVERNMENT-AIDED SCH', 'MR TEO HAN WOON, DENNIS', 'MRS TAN CHENG NEO MARION', 'SECONDARY', 'sass@moe.edu.sg', 'No', 'SOUTH 5', 'na', 'As a mission school, it is our responsibility to provide a holistic and values-based education where Saints become men who are servant leaders, upholding the WISE and TRUE values that define who we are and how we serve as St Andrew\'s Village. It is our belief that no one comes to our school by chance. Growing boys to become men requires a constant focus on our three strategic thrusts: Empowering Learning:Building self-directed learners, we ignite the boys\' determination to excel in their academic pursuits. Serving and Belonging:Leveraging a strong sense of belonging, we develop boys\' desire and ability to serve the community and nation through servant leadership. Every Boy Aspiring:We strongly believe in the camaraderie and social learning that comes with playing together especially, but not exclusively, through sports. We encourage all boys to aspire to be excellent in every CCA.', 'POTONG PASIR MRT', '13,133,147,107,853 142,853,8,26,31,90,90A', 'MR SHASHIDARAN S/O KANESON', '62851944', 'No', 'Our school offers customised programmes to cater to students with varied interests and strengths.  The RKS Adams Programme nurtures servant leadership in and stretches strong students. Jacob\'s Ladder focuses on engaging students in the Normal (Academic) stream to build a strong learning disposition. The Marshall Plan develops students in the Normal (Technical) stream with the lifeskills to leverage their potential. Our Engineering Design Programme will grow Saints with the depth of insight to address real world problems by utilising the Engineering Design Process.  Saints will identify themselves as engineers with creative energies to produce innovative products, systems or solutions to meet human needs. At the lower secondary level, Saints will be equipped with 21st Century Competencies and grounded in our WISE and TRUE values via three key programmes: Saints Millennium Race, the Young Scientist Programme and the Oral History Project. Saints learn about real world contexts and delve deep into understanding the underlying issues behind each problem, consider the ethical and practical aspects of each possible solution before they make decisions. In Upper Secondary, Saints will embark on project-based learning via the Elective subjects they pursue. This encourages discovery, exploratory learning and problem solving so that our Saints can better understand how the various subjects help them make sense of their world and prepare for their future careers. Our distinctive programme in Rugby for Life leverages the school\'s 80 year tradition in this rugged and disciplined sport.  Saints will undertake a variety of Values-in Action projects (both local and overseas) to serve the community around them and beyond often with a sports or outdoor education dimension.', 'MRS TOH LUCY', 'Chinese', 'BOYS\' SCHOOL', 'St Andrew\'s Village: Home of Servant Leaders who bring life to the nations', 'na', 'Making Lives, Waking Hearts To Serve the Coming Days Family   Society   Eternity', 'No', 'SINGLE SESSION', 'ST. ANDREW\'S SECONDARY SCHOOL', 'TOA PAYOH', '15 FRANCIS THOMAS DRIVE', 'Malay', 'na', 'SOUTH', '324', 'http://www.standrewssec.moe.edu.sg/'),
(325, '64490162', 'No', 'Tamil', 'na', '469700', 'GOVERNMENT-AIDED SCH', 'MDM YEE WHOY CHONG', 'MDM NG MEOW LENG NANCY', 'SECONDARY', 'sacss@moe.edu.sg', 'No', 'EAST 4', 'na', 'The \'Formation of the Heart\' is central to our education programme. We focus on the holistic development of students to enable them to reach their full potential and, at the same time, develop the attitudes and habits that will make them good women committed to God, compassionate to all and cheerful in service to others. Also central to a Canossian Education is the person-centeredness of the teacher and learner. The teachers and students respect the dignity of each person - irrespective of their intellectual, emotional, social and cultural background. We believe in nurturing our students in an atmosphere of warmth and affection, yet showing firmness when necessary, so that they will grow in self-discipline and experience joy in learning and growing. Brain-Based Learning has been deployed as a whole-school approach to teaching and learning as we believe that learning should be in accordance with the way the brain is naturally designed to learn.', 'BEDOK MRT', '17', 'MISS CHEW PING PING GRACE', '64490616', 'No', 'Performing Arts Education, which is delivered as part of the lower secondary curriculum for all students, aims to develop students with a good foundation in music and drama, as well as to promote an appreciation for the arts and aesthetics. Through this programme, students develop problem-solving abilities and thinking skills like analysing, synthesising and evaluating. This helps them identify, appreciate and deepen their understanding of the art forms of our different ethnic and other national communities. Different modes of assessment have been used to measure the level of cognitive and affective development in the subject. Various platforms, such as the Performing Arts Showcases and Arts Alive! Concerts, have also been organised for students to display their talents by performing to the school community and stakeholders. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MDM MAK LAI YING', 'Chinese', 'GIRLS\' SCHOOL', 'A passionate learning community that embraces innovation and excellence within a culture of compassi', 'na', 'To nurture and empower Canossians through a holistic curriculum to be persons of integrity committed', 'Yes', 'SINGLE SESSION', 'ST. ANTHONY\'S CANOSSIAN SECONDARY SCHOOL', 'BEDOK', '1600 BEDOK NORTH AVENUE 4', 'Malay', 'na', 'EAST', '325', 'http://www.stanthonyscanossiansec.moe.edu.sg'),
(326, '62898615', 'No', 'Tamil', 'na', '556140', 'GOVERNMENT-AIDED SCH', 'MR CHIA SENG CHIANG AARON', 'MISS CHENG LI NGOH JACKIE', 'SECONDARY', 'STGSS@MOE.EDU.SG', 'No', 'SOUTH 6', 'na', 'Founded in 1953, our Catholic, all boys school is an institution of the Montfort Brothers of St. Gabriel. Our mission is to shape the lives of Gabrielites who will serve the community as Servant Leaders, who are  Lifelong Learners and Gracious Citizens. Our philosophy of education is guided by the Montfortian Education Charter, formed by an understanding and study of the life and works of St. Louis Marie de Montfort. We design our programmes and curriculum to develop Gabrielites grounded in the values  of Respect, Resilience, Responsibility and Care. We emphasize and respect the need for personal spiritual growth and sustain it through daily reflections and actions. Our motto, Labour Omnia Vincit (Labour Conquers All), rallies Gabrielites to persevere in all endeavours with tenacity and determination. In our Gabrielite community, there is a strong culture of care amongst staff as well as students. This care is extended to the larger community, putting our values into action through ser', 'SERANGOON MRT', '158', 'na', '62889470', 'No', 'Gabrielites are developed in their Cognitive, Leadership, Aesthetics, Physical, Social and Moral domains so as to grow into STAR (Special, Transformed, Active and Ready) Gabrielites, equipped and prepared for future challenges with 21st Century competencies, anchored in the core values of Respect, Resilience, Responsibility and Care. Our Community and Youth Leadership (LLP-CYL) Programme nurtures Gabrielites into leaders of character and service. The 4-year programme provides learning opportunities integrating Service Learning, Student Leadership and Outdoor Education. In their junior years, Gabrielities grow as Learners and Leaders who are Self-Directed and Collaborative. In their senior years, they become Active and Effective Learners and Leaders through their self-initiated service to the community, advocating for the causes they serve. In their growth and development to become Servant Leaders, Gabrielites acquire skills, attitudes and values through experiential activities in STAR Camp, Applied Design Service Learning, Project Work Service Learning, Digital Media Arts, Elective Modules, Environmental Education Program, Heritage Trial, Mission Day, iCarnival and Applied Learning Programme in Flight and Aerospace.', 'MR STEPHEN CHIN', 'Chinese', 'BOYS\' SCHOOL', 'The Gabrielite...Servant Leader, Lifelong Learner, Gracious Citizen', 'na', 'Shaping lives for Service to God and Nation', 'No', 'SINGLE SESSION', 'ST. GABRIEL\'S SECONDARY SCHOOL', 'SERANGOON', '24 SERANGOON AVENUE 1', 'Malay', 'na', 'SOUTH', '326', 'http://www.stgabrielssec.moe.edu.sg'),
(327, '64897589', 'No', 'Tamil', 'na', '548595', 'GOVERNMENT-AIDED SCH', 'MDM SARAWATHY D/O VARADARAJU', 'MISS TAN KIM BERLINA', 'SECONDARY', 'CHIJSJCS@MOE.EDU.SG', 'No', 'NORTH 1', 'na', 'We believe our students possess talents and will experience success. SJC is where we develop our girls\' moral character (values-driven) and performance character (value-adding). Our goal is for our girls to embody the values of Love, Integrity and Freedom, and to grow as Engaged and Empowered learners, Effective leaders, and Eloquent individuals with strong Ethics (LIFE4). We provide a vibrant Aesthetics curriculum, an extensive Differentiated Leadership Programme for all our students.', 'SENGKANG MRT', '50, 82, 86, 88, 119,136', 'na', '64897580', 'No', 'Our Applied Learning Programme (ALP), \'The Art of Communication through Theatre and Debates\', uses a values-centred approach to deepen our girls\' creativity, reflective-thinking and communication skills via a layered curriculum that integrates the arts, the languages and the humanities.  Through the analysis of social issues and the validation of aesthetics skills, this ALP supports our aim to nurture articulate and confident students who are women of integrity.  Our Learning for Life Programme (LLP), Thinking for Life Using the Future Problem Solving Model (FPSM), aims to broaden students\' critical and creative thinking skills through the active discussion and engagement of the community in issues and problems that students have identified.  This approach seeks to deepen students\' perspective-taking skills, empathy and social entrepreneurship to prepare them for active, engaged citizenship in a global world.  In line with SJC\'s emphasis on Performance and Moral Character-Building, SJC\'s Differentiated Leadership Programme is adapted from the Kouzes and Posner\'s Leadership Challenge Model and MacGregor\'s Everyday Leadership Model to ensure that every SJCian has extensive opportunities to develop her leadership skills to develop strong moral values. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MISS HO SUSIE', 'Chinese', 'GIRLS\' SCHOOL', 'WOMEN OF INTEGRITY WITH THE PASSION TO PURSUE EXCELLENCE', 'na', 'The mission of an Infant Jesus Convent is the creation of a Christ-centred school community where al', 'No', 'SINGLE SESSION', 'CHIJ ST. JOSEPH\'S CONVENT', 'SENG KANG', '62 SENGKANG EAST WAY', 'Malay', 'na', 'NORTH', '327', 'http://www.chijstjosephsconvent.moe.edu.sg'),
(328, '62533640', 'No', 'Tamil', 'na', '579781', 'INDEPENDENT SCHOOL', 'MR DOMINIC ANG SWEE KENG', 'MDM GOH POH KENN', 'MIXED LEVEL', 'contact@sji.edu.sg', 'No', 'SOUTH 5', 'na', 'Lasallian Core Values Faith, our foundation Service, our way and Community, our support. School Slogan/Brand Statement Nurturing Men & Women of Integrity and Men & Women for Others. A Lasallian community nurturing persons of integrity and persons for others. At SJI, we pride ourselves on producing young people of integrity with a strong desire to serve others, especially the poor. Character and faith formation are central to an SJI education.', 'BISHAN MRT', '53, 410', 'MRS LOH YOON LIN', '62500022', 'Yes', 'SJI offers both the 4-year \'O\'-level programme and a 6-year Integrated Programme (IP) leading to the International Baccalaureate (IB) Diploma at the end of the 6-year programme.  An SJI education aims to educate the whole person by providing a broad-based academic curriculum that is integrated with a comprehensive student development curriculum with a strong emphasis on character and leadership development.  The SJI Education adopts a framework with 3-levels of Learning. Academic Foundations in Level 1 lays the foundations in core subjects such as English Language, Mother Tongue Languages, Humanities, Sciences, Mathematics and the Arts. Academic Extensions in Level 2 provides opportunities for students to further explore their areas of interest in specific subjects/topics. At Level 3 - Sustained Inquiry and Thinking, students will delve deeper into specific areas through a sustained project or in innovative thinking programmes such as ArtScience (in collaboration with Harvard University), Design Thinking and World and Me, a multi-disciplinary programme developed by SJI.  Character and leadership development is nurtured throughout the curriculum, along with SJI\'s unique Religious, Moral and Social Education programme, co-curricular activities, leadership development opportunities, physical and outdoors education, international experience and overseas residential programmes.', 'FR ADRIAN AUGUSTUS DANKER', 'Chinese', 'CO-ED SCHOOL', 'A mission school of choice, recognised for values-centred education and learning driven by passion, ', 'na', 'Enabling youth in a Lasallian community to learn how to learn and to learn how to live; empowering t', 'No', 'SINGLE SESSION', 'ST. JOSEPH\'S INSTITUTION', 'NOVENA', '21 BISHAN STREET 14', 'Malay', 'na', 'SOUTH', '328', 'http://www.sji.edu.sg'),
(329, '64666709', 'No', 'Tamil', 'na', '259240', 'GOVERNMENT-AIDED SCH', 'MISS LIM HUI KHENG LINDA', 'MR TAN KING MING', 'SECONDARY', 'stmargaretss@moe.edu.sg', 'No', 'SOUTH 6', 'na', 'Founded in 1842, St. Margaret\'s Secondary School is an autonomous mission school that strives to develop every girl to her fullest potential by equipping her with the skills, knowledge and attributes to become a confident, creative and caring young lady with sound values. We provide a value-added education with emphasis on the cognitive, character and aesthetics development of each girl. Our enriching curriculum and co-curriculum have brought about many value-added outcomes in student learning and development.', 'FARRER ROAD MRT', '48, 93, 153, 165, 174, 186, 855, 961', 'na', '64664525', 'No', 'An Autonomous School, St. Margaret\'s delivers an all-round education and has distinctive Cognitive, Arts, Sports and Student Leadership programmes to develop and hone student talents. With a rich heritage as the oldest girls\' school in the Far East, we receive strong support from the stakeholder community. Our partners\' contributions range from securing established professionals and volunteering themselves for the Professional Guidance Day and Assembly Speaker Series to inspire our students and provide them with career guidance, to offering them placements for their Work Attachment Programme. Our students achieve academic excellence through a rigorous curriculum that adopts a pedagogical framework utilising elements of Understanding by Design and Critical Thinking to deepen student understanding and encourage inventive thinking; online platforms and school-developed mobile apps further enhance the learning experience. All students are developed in leadership skills and dispositions through a tiered leadership programme and are coached by their teachers to guide their growth. As the S6 Cluster Centre of Excellence for Visual & Performing Arts, we are well-resourced with facilities such as an Art Studio & Gallery and Performing Arts Studio. Our engaging arts programme exposes students to varied art forms and experiences; they may also pursue the arts through the upper secondary Art, Drama or Enhanced Music programmes. Our students undergo a progressive PE programme that equips them with skills in sports & games and leverages on dance education to build physical conditioning and movement fundamentals. Through a vibrant Character and Citizenship Education programme that actively involves our students in serving the community, the integration of values in the curriculum & co-curriculum, the daily sharing of values and the Ethical Choices (EtCh) Programme, our students hone their socio-emotional competencies, imbibe sound values and learn to make ethical choices in life.', 'MDM LEE LIN YEE', 'Chinese', 'GIRLS\' SCHOOL', 'A Community of Learners Growing and Glowing for God.', 'na', 'To provide an All-Round Education in a Christ-centred Environment to nurture Confident, Creative and', 'Yes', 'SINGLE SESSION', 'ST. MARGARET\'S SECONDARY SCHOOL', 'BUKIT TIMAH', '111 FARRER ROAD', 'Malay', 'na', 'SOUTH', '329', 'http://www.stmargaretssec.moe.edu.sg'),
(330, '63445152', 'No', 'Tamil', 'na', '429058', 'GOVERNMENT-AIDED SCH', 'MR PETERSON JOSEPH STANLEY', 'MR YONG KIM SENG ALOYSIUS', 'SECONDARY', 'stpatricksch@moe.edu.sg', 'No', 'EAST 7', '63441429', 'As a Lasallian institution, St. Patrick\'s School seeks to imbue in its students the values of faith, service, community, honesty, humility and humanity. Patricians are constantly challenged to live the school values at all times in their pursuit of excellence in the academic and co-curricular areas. The school works closely with parents and other stakeholders to ensure that every student has a sound moral compass. The school motto \"Potest Qui Vult\", meaning \"He who wills, can\", is instilled in all students to enable them to respond with resilience in the face of challenges and adversity. The school also has a strong culture of care for all students and staff. It is within this caring environment that Patricians grow and develop to become mature and self-confident leaders who are always ready to serve society. These attributes make St. Patrick\'s School stand out as a \'School of Life\'.', 'KEMBANGAN MRT', '10,12,13,14,16,31,32,36,40,48,55,76,155,135,196,197', 'na', '63440929', 'No', 'The school offers Health and Sports  Science as its Applied Learning Programme (ALP). The ALP aims to equip students with a better understanding of their physical well-being and Sports Science. Topics such as Biomechanics, Physiology and Motor Control are covered so that they would be more ready for a career in the Health or Sports industry. For its Life Long Learning Programme (LLP) the school offers a unique programme in Music. The LLP develops students in their understanding of music as well as develop their character through the pursuit of excellence in music. The students learn discipline, team work, commitment and resilience as they play and work together in producing beautiful music enjoyed by all. In St. Patrick\'s School, students are developed as leaders through a whole-school approach comprising of level camps and leadership camps as well as leadership development programmes. In addition, numerous opportunities are provided for students to exercise and develop their leadership skills. The school also has a Scholars Development Programme for its higher ability students. The scholars class has been set up to provide a suitable learning environment that caters to the learning needs of these higher ability students. The students in the scholars class will go through a scholars development programme to better equip them with the right skills and mindset to help them in their all-round development.  The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR TAN CHIN ENG ADOLPHUS', 'Chinese', 'BOYS\' SCHOOL', 'A Lasallian Institution that nurtures Patricians to be worthy of God and man.', 'na', 'Touch hearts. Engage minds. Transform lives.', 'No', 'SINGLE SESSION', 'ST. PATRICK\'S SCHOOL', 'BEDOK', '490 EAST COAST ROAD', 'Malay', 'na', 'EAST', '330', 'http://www.stpatricks.moe.edu.sg'),
(331, '64775700', 'No', 'Tamil', 'na', '99138', 'GOVERNMENT-AIDED SCH', 'MDM ONG LEE LEE', 'MISS WONG KER SIN', 'SECONDARY', 'CHIJSTCS@MOE.EDU.SG', 'No', 'SOUTH 4', 'na', 'CHIJ St. Theresa\'s Convent is a Catholic mission school started in 1933 in response to an urgent need to provide an education for the daughters of poor workers at the Harbour, Hospital and Railway in the Tanjong Pagar area.  Today, the school remains true to its mission to provide a quality education for all, with special reference to persons who are disadvantaged in any way.  The Theresian Brand of education seeks to equip our girls with knowledge, skills and values for life, not just for examinations.  We believe that education must develop the Theresian student to go beyond self to serve others in the community.  The design and delivery of our curriculum is therefore guided by the Integral Pedagogy Process which starts with the Context of the learner, taking her through Experience and Reflection to Action and Evaluation.  It is only in action that the Theresian demonstrates learning and service to others.', 'HARBOURFRONT MRT, TIONG BAHRU MRT', '65, 121, 123, 123M, 124, 131, 131M, 195, 195A, 272, 855', 'na', '64775777', 'No', 'The curriculum is tailored to aid our students in discovering their potential, with the view of transforming them into positive change agents in the community.  Our programmes are grounded in the school\'s belief in holistic education through experiential learning.  Unique to CHIJ St. Theresa\'s Convent are our two Distinctive Programmes, \"Education for Life (EFL):  Developing Portable Skills through and for Real World Problem Solving\" and \"Developing Self-Directed, Confident and Resilient Leaders, Learners and Ladies through Sports and Hockey\".  We have customised our Values Education curriculum to align to the school\'s mission, vision and values and MOE\'s CCE learning outcomes.  The school employs school-wide teaching strategies to address the different learning needs of students, with the aim of heightening engagement during lessons.  Amongst the many approaches used are Integral Pedagogy Process, Cooperative Learning, Inquiry-Based Learning and Problem-Based Learning. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MRS PAULINE WONG', 'Chinese', 'GIRLS\' SCHOOL', 'We are a community of Leaders and Learners for God and for Others.', 'na', 'To create a Christ-centred school community where all work together for the promotion of truth, just', 'No', 'SINGLE SESSION', 'CHIJ ST. THERESA\'S CONVENT', 'BUKIT MERAH', '160 LOWER DELTA ROAD', 'Malay', 'na', 'SOUTH', '331', 'http://www.chijsttheresasconvent.moe.edu.sg'),
(332, '63449686', 'No', 'na', 'na', '439012', 'GOVERNMENT-AIDED SCH', 'DR ONG CHUN GHEE', 'MDM TAN LAY GIN', 'SECONDARY', 'CCHMS@MOE.EDU.SG', 'Yes', 'EAST 4', 'na', 'Guided by the school\'s philosophy \"Excellence in Education for All\", Chung Cheng High School (Main) is committed to the development of our students and the nurturing of 21st century leaders and intellectuals through a holistic learning experience.  As the East Zone Centre of Excellence (Chinese), the school seeks to promote good practices in the teaching and learning of Chinese and Chinese Culture.  A SAP school since 1979, we are committed to deliver an effective bilingual and values-based education. Through comprehensive bi-cultural programmes and various overseas immersion programmes, the school aims to nurture bi-cultural Chung Cheng scholars who are grounded in values, global in outlook and equipped with cross-cultural literacy. The school\'s rich tradition in the Culture and the Arts saw many renowned talents nurtured in the cultural, literary and arts scene amongst our graduates. The Chung Cheng Education Framework, premised on Professor Howard Gardner\'s \"Five Minds for the Futur', 'DAKOTA MRT', '10,12,14,16,30,31,32,33,40,43,76,135,196,197', 'MR BOH HONG JIK', '63441393', 'No', '(1) Special Assistance Plan (SAP) School: Bi-cultural Programme which includes Calligraphy & Chinese Painting, Tea Art Appreciation, Bi-cultural Camp, etc. (2) Talent Development Programme in the areas of Chinese & Culture, Mathematics, Music and Science. (3) Special Interest Programme: Heritage Docent Programmes (Sun Yat Sen Nanyang Memorial Hall, Malay Heritage Centre), Media Production Programme, Translation Programme. (4) Overseas Learning Programme: Overseas Community Involvement Programme, Overseas School Immersion Programme (Chongqing, Shanghai, Suzhou), Overseas Leadership Development Programme.', 'MR CHAN YING YIN', 'Chinese', 'CO-ED SCHOOL', 'Institution of Eminence, Generations of Leaders; Grounded in Values, Global in Outlook', 'na', 'The school is committed to Building Character, Enhancing Confidence and Nurturing Talents.', 'Yes', 'SINGLE SESSION', 'CHUNG CHENG HIGH SCHOOL (MAIN)', 'MARINE PARADE', '50 GOODMAN ROAD', 'na', 'na', 'EAST', '342', 'http://www.chungchenghighmain.moe.edu.sg/');
INSERT INTO `schools` (`schoolId`, `fax_no`, `gifted_ind`, `mothertongue3_code`, `fifth_vp_name`, `postal_code`, `type_code`, `second_vp_name`, `first_vp_name`, `mainlevel_code`, `email_address`, `sap_ind`, `cluster_code`, `telephone_no_2`, `philosophy_culture_ethos`, `mrt_desc`, `bus_desc`, `third_vp_name`, `telephone_no`, `ip_ind`, `special_sdp_offered`, `principal_name`, `mothertongue1_code`, `nature_code`, `visionstatement_desc`, `fourth_vp_name`, `missionstatement_desc`, `autonomous_ind`, `session_code`, `school_name`, `dgp_code`, `address`, `mothertongue2_code`, `fax_no_2`, `zone_code`, `_id`, `url_address`) VALUES
(333, '68932789', 'No', 'Tamil', 'na', '737924', 'GOVERNMENT-AIDED SCH', 'MR JEROMY NGIAN KUN CHUAN', 'MRS ANNE CHAN', 'SECONDARY', 'ccss@moe.edu.sg', 'No', 'NORTH 7', 'na', 'Education is for life. It helps to prepare our youths for responsibilities and successes in their journey of continuous learning. At Christ Church Secondary School (CHR), we strongly believe that our primary role is to nurture the whole child, and we endeavour to reflect this in every interaction with our students. Holding fast to our philosophy that each child has worth and must be nurtured to reach his/her fullest potential, the school aims to provide a holistic and integrated education for all students through our CHR AOP curriculum where the three components - Academic (A), Outdoor Education (O) and Pupil Well-being and Developmental Discipline (P) education ensure our students grow and develop into caring, persevering and forward-looking members of the community. Together with our nurturing team of staff, supportive parents, alumni and key stakeholders, we are dedicated to build the lives of our young charges.', 'WOODLANDS MRT', '901', 'na', '68933297', 'No', 'The school\'s LLP, Developing Social Emotional Learning Competencies through Outdoor Adventure Learning, provides all students with authentic experiences to hone their Social Emotional Competencies and  demonstrate the school core values of Responsibility, Integrity, Care, Perseverance and Forward-Looking. Through exploring their environment, both local and overseas, they not only challenge themselves but also collaborate with one another to achieve their goals. The programme will bring students out of their comfort zones, allowing them to discover their potential to overcome challenges and build their character.  The school\'s ALP, Developing 21st Century Competencies through an Inquiry Approach in Health Science and Technology, provides students with the opportunity to apply academic knowledge learnt across disciplines to authentic situations. Students acquire critical and inventive thinking dispositions and communications skills which prepares them for the complexities and challenges faced in the era of innovation and uncertainty. To develop confident and self-directed learners who take responsibility for their own learning, the school engages its students through a blended learning approach, which allows the thoughtful integration of ICT and a rich array of structured learning opportunities.  Key anchor programmes such as the Chingay Project for English and Humanities, Science Lower Seletar Reservoir Project, and Learning Mother Tongue through Drama and experiential learning journeys help to ignite interest and joy in learning. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR LAU YAN BOON DAVID', 'Chinese', 'CO-ED SCHOOL', 'A Caring, Persevering and Forward-looking community with God as the Enabler.', 'na', 'Empowering our Students to be ready for Service to the Nation.', 'No', 'SINGLE SESSION', 'CHRIST CHURCH SECONDARY SCHOOL', 'WOODLANDS', '20 WOODLANDS DRIVE 17', 'Malay', 'na', 'NORTH', '332', 'http://www.christchurchsec.moe.edu.sg'),
(334, '63820558', 'No', 'Tamil', 'na', '536742', 'GOVERNMENT-AIDED SCH', 'MR TAN YONG LIANG', 'MISS ONG LIANG FUNG', 'SECONDARY', 'plmgss@moe.edu.sg', 'No', 'EAST 5', 'na', 'Founded in 1916, PLMGS(Sec) is a school rich in heritage and tradition. At the heart of an education in PL is holistic education with an emphasis on Character Development. This stems from the school\'s philosophy of developing students cognitively, physically, morally, socially and emotionally. As the school prepares students for life, it seeks to develop them to their fullest potential across the spectrum of talents and abilities. PL aspires to be an outstanding school of choice that produces women of fine character with a passion for life and learning. Sound character development must be grounded in values. PL-Lites are expected to demonstrate these school values as represented in the acronym HEART; Each PL-Lite Honours God, has an Excellence mindset, is Adaptable, Respects others (and is respected) and is always Thankful. PL-Lites will be Enriched for Life, each becoming \"A Confident PL-Lite, A Passionate Learner, An Active Citizen and An Inspiring Leader\".', 'KOVAN MRT, SERANGOON MRT', '45, 53, 53M, 62, 113', 'na', '62816606', 'No', 'The school has developed a differentiated academic curriculum to meet the needs of the students. In the PL21 programme, 21st Century Competencies are taught and developed within the formal curriculum. Students learn to think creatively and critically and develop  the skill sets to collaborate and communicate effectively. For students with talent in specific subjects and the potential for further growth in an interest area, the school has 2 key programmes dedicated to nurture them. The ACcelerated and Enhanced programme (ACE) is designed to nurture those talented in the areas of Mathematics, Science and Music. A more challenging academic and aesthetics curriculum is customised to their learning needs. The Enhanced Enrichment programme offers opportunities for students to excel in Languages, Humanities, Innovation and Leadership. The Global Classroom programme gives  students the opportunity to travel overseas in any of these 4 aspects; Twinning Programme with overseas institutions, Inter-disciplinary Subject-based Overseas trips, opportunities to represent the school and Singapore at Overseas Conferences and Competitions and the Overseas Service Learning (Values-In-Action) Projects. These trips provide students with the opportunities to interact with people from various parts of the world so that they will be more culturally savvy and attuned to the changing global environment. To complement the academic programme, PLMGS (Sec) has a strong Character and Leadership Development programme. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MRS QUEK LI GEK', 'Chinese', 'GIRLS\' SCHOOL', 'An outstanding school of choice producing women of fine character with a passion for life and learni', 'na', 'To nurture every PL-Lite into a whole person who lives in favour with God and Man.', 'Yes', 'SINGLE SESSION', 'PAYA LEBAR METHODIST GIRLS\' SCHOOL (SECONDARY)', 'HOUGANG', '296 LOR AH SOO', 'Malay', 'na', 'EAST', '333', 'http://www.plmgss.moe.edu.sg'),
(335, '62871607', 'No', 'Tamil', 'na', '538884', 'GOVERNMENT-AIDED SCH', 'MDM NIAM HWEE PENG', 'MISS TAN MEI CHANG REBEKAH', 'SECONDARY', 'yuying_ss@moe.edu.sg', 'No', 'SOUTH 1', 'na', 'Yuying Secondary School is a 106 year old government-aided school steeped in Chinese history, culture and tradition. The school embraces the philosophy that all students can be nurtured and their talents cultivated so that they can contribute to society. The school believes in providing a holistic education that anchors its students firmly in the school values of \'Integrity, Resilience, Respect and Responsibility\' (IR3), through its strong Character and Citizenship Education Progamme, and its focus on critical and inventive thinking. As signified by its emblem of a soaring eagle, the school seeks to produce students who are not just academically able but are also wholesome in character, strong and resilient even in the face of adversities and always soaring towards greater heights. It also adopts an active approach in developing students to be leaders in the school and of the community, with a passion to serve.', 'KOVAN MRT', '25,51,53,55,62,87,113,119,151,854', 'na', '62827968', 'No', 'In line with the school\'s vision, \'Enterprising Learners for Excellence\', the school\'s  Applied Learning Programme (ALP) seeks to foster critical and inventive thinking and an entrepreneurial spirit through a comprehensive 3-year structured programme that is offered to all students. Students are taught the fundamental skills and processes of Design Thinking through the Design and Technology curriculum and Project Work. The school is on board the YES! (Young Entrepreneurs Scheme for  Schools)programme, leveraging on its Design and Entrepreneurship Club and adopted by Koufu Pte Ltd and Innervative Learning Pte Ltd under an `Entrepreneur-Adopt-a-School\' initiative to provide entrepreneurship education to her students. The Learning for Life Programme (LLP) `Totally Wholesome Engaged and Empowered Teens\' (TWEETS) is another signature programme offered to all students. It seeks to provide students with a holistic experience through their active involvement in Values in Action (ViA) activities as part of the school\'s Character and Citizenship Education Programme. Through EPIC (Equipping, Planning, Initiating and Closure), students acquire the necessary knowledge and skills to plan, initiate and execute a ViA project. It also provides them with a platform  to practice and live out the school values and to network and collaborate with external organizations. Through its LLP, the school seeks to make community and youth leadership more pervasive and to foster a culture of volunteerism. The school is also on board the `Whole School Approach to Effective Communication\' (WSA-EC) initiative to provide a conducive environment for the  learning of the English Language. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR LO CHEE LIN', 'Chinese', 'CO-ED SCHOOL', 'Enterprising Learners for Excellence', 'na', 'To Nurture Wholesome Individuals with Global Mindset, Passion to Learn  and Spirit to Serve', 'No', 'SINGLE SESSION', 'YUYING SECONDARY SCHOOL', 'HOUGANG', '47 HOUGANG AVENUE 1', 'Malay', 'na', 'SOUTH', '334', 'http://www.yuyingsec.moe.edu.sg'),
(336, '63536535', 'No', 'Tamil', 'na', '579795', 'GOVERNMENT-AIDED SCH', 'MR TAN ENG HONG JONATHAN', 'MR TAN CHE CHUEN TIMOTHY', 'SECONDARY', 'kcpss@moe.edu.sg', 'No', 'SOUTH 7', 'na', 'Kuo Chuan Presbyterian Secondary School seeks to develop servant leaders and community contributors in a nurturing, values-based environment. We offer a curriculum focused on the holistic development of every child with a strong focus on leadership of self for the service of others. The school vision captures our legacy as a school started by Christian ministers to provide education opportunities for the community, as well as the aspiration that KCPians will grow to be leaders who will likewise develop their talents and abilities to be of service to others. The KCPian Servant Leader will be a self-directed learner who displays integrity and resilience in the face of challenge and disappointment. He is a conscientious individual who cares for others, empathises with and responds to the needs around him. The school team of dedicated teachers is supported by active alumni, the Parent Support Group and a School Management Committee that takes a keen interest in the quality of teaching and ', 'BISHAN MRT', '53, 54, 56, 410G, 410W', 'MR TIN CHEE KUANG EDMUND', '62593811', 'No', 'The school offers a Learning for Life programme (LLP) in the area of Community and Youth Leadership (CYL). This is a whole-school approach to develop every KCPian as a servant leader through the progression from leadership of self, to leadership of others at various impact levels. It is designed to evoke empathy and inculcate a spirit of service while developing the 21st century competencies of critical and inventive thinking. The development of 21st century competencies is reinforced through the school\'s  Applied Learning Programme (ALP) in Media Literacy. This programme, which is anchored on the English Language and Literature curriculum, is designed to develop in students\' communication, collaboration and information skills. Students will inquire into how the media and society shape each other, and analyse the benefits and challenges that different media platforms present to society today.', 'MDM ELSIE JEREMIAH', 'Chinese', 'CO-ED SCHOOL', 'Every KCPian a Servant Leader.', 'na', 'We provide a conducive and nurturing Christian environment for the holistic development of every chi', 'No', 'SINGLE SESSION', 'KUO CHUAN PRESBYTERIAN SECONDARY SCHOOL', 'BISHAN', '10 BISHAN STREET 13', 'Malay', 'na', 'SOUTH', '335', 'http://www.kuochuanpresbyteriansec.moe.edu.sg'),
(337, '67865011', 'No', 'Tamil', 'na', '528986', 'GOVERNMENT-AIDED SCH', 'MR PONG WEN LONG', 'MISS TAN YEE LENG', 'SECONDARY', 'SHSS@MOE.EDU.SG', 'No', 'EAST 6', 'na', 'St Hilda\'s Secondary aims to equip students with the attributes and capabilities to be \'Critical,Inventive Thinkers,Reflective & Self-Directed Learners, Caring & Collaborative Contributors\'; desired outcomes that are encapsulated in our Student Distinctive-Every Hildan a Leader: Confident,Caring and Disciplined.The achievement of these outcomes hinges on purposeful programme design and effective delivery via committed teachers,with a culture of care and excellence.The HILDAN experience includes level-specific programmes such as our Learning for Life and Applied Learning Programmes,SOLVE for Innovation, Drama Education Programme, Overseas Integrated Learning Journey and Outward Bound Singapore (OBS) Leadership Camp.Our comprehensive Educational & Career Guidance programme guides and prepares Hildans for Post-Secondary Education.Interested students may tap on our Cultural Immersion programmes with overseas partner schools. The Curriculum is customised to stretch and engage our students i', 'TAMPINES MRT', '22, 293', 'na', '63055277', 'No', 'The school\'s Applied Learning Programme \'iTHink\' integrates the acquisition of Thinking Skills with the learning of the English Language.  Through thinking approaches such as \'Paul\'s Wheel of Reasoning\' and thinking routines like \'See-Think-Wonder\', Hildans will be developed to be Critical & Inventive Thinkers and to be more proficient users of the English Language. The Learning for Life Programme (LLP) aims to nurture the Whole Person through Sports via the 3E (Exposure, Experience & Extension) approach to engage the Head (cognitive), Heart (emotion), Body (psychomotor) and Hands (service).  Hildans will acquire not only physical skills through individual and team sports such as Volleyball (the school has emerged National Champion for many years) but also values of integrity, teamwork and resilience to shape them in character.  One of the highlights of the LLP is the OBS Camp. The school offers Direct School Admission through our Sports CCAs. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR KHOO TSE HORNG', 'Chinese', 'CO-ED SCHOOL', 'An excellent institution recognised for bringing up pupils with a love for God, life and learning.', 'na', 'As an Anglican school, we are committed to providing through education a balanced development of min', 'No', 'SINGLE SESSION', 'ST. HILDA\'S SECONDARY SCHOOL', 'TAMPINES', '2 TAMPINES STREET 82', 'Malay', 'na', 'EAST', '336', 'http://www.sthildassec.moe.edu.sg'),
(338, '64698717', 'No', 'Tamil', 'na', '599986', 'INDEPENDENT SCHOOL', 'MDM TAN P\'ENG DIANA', 'MDM WEE KHENG LIN CORINNE', 'SECONDARY', 'MGSS@MOE.EDU.SG', 'No', 'WEST 3', 'na', 'The MGS identity is reflected in our robust programmes unique to a community grounded in GEL: Godliness - upholding integrity and moral principles; Excellence - pursuing knowledge and meaningful experiences; and Love - establishing needs, taking action and giving to the local and global communities. The school\'s culture of care and concern allows MGS girls to honour self and others and to thrive in an open and positive environment that nurtures the whole child.', 'KING ALBERT PARK MRT', '66,67,74,77,151,154,156,157,170,171,174,563,852,961,961C,970', 'MR SOH BENG KIAN', '64694800', 'Yes', 'MGS is a dual track school with an Integrated Programme leading to the International Baccalaureate Diploma in Anglo-Chinese School (Independent) and the O level track. Programmes include the Music Elective Programme (MEP), Sophia Blackmore Academies (SBA) - an in-house scholastic \'O\' level programme, Ethics-infused Curriculum, 1:1 Learning, Code4Life, STEM, Life Sciences and Science Mentorship Programme. Other school-based programmes include Reality Outside Classrooms (ROCs), local and overseas learning journeys, Regional Youth Conference, Sophia Blackmore Lectures, GEL Curriculum, Community Service and Advocacy, Arts Appreciation, Outdoor Adventure Camp, Sports Mental Skills Training and Leadership Training.', 'MISS NG WUN HAR GRACE', 'Chinese', 'GIRLS\' SCHOOL', 'Godly women of Excellence with a heart of Love.', 'na', 'To educate every girl in a Christian environment in order that she may MASTER, GROW and SERVE in eve', 'No', 'SINGLE SESSION', 'METHODIST GIRLS\' SCHOOL (SECONDARY)', 'BUKIT TIMAH', '11 BLACKMORE DRIVE', 'Malay', 'na', 'WEST', '337', 'http://www.mgs.sch.edu.sg/'),
(339, '65822543', 'No', 'Tamil', 'na', '519421', 'GOVERNMENT-AIDED SCH', 'MR JANSEN JOSEPH MARIAN', 'MR TAN YIT KEE', 'SECONDARY', 'HSHS@MOE.EDU.SG', 'No', 'EAST 1', 'na', 'Hai Sing Catholic School was founded in 1959 by the Franciscan Missionaries of Mary (FMM). It is a 58-year old Catholic School with a proud and distinguished history, a school which believes in developing each HaiSian to his fullest potential, to be truthful and to have compassion for others.  HaiSians walk the Way of Truth through Living for Others.  HaiSians serve the young and the elderly in the community who need comfort and support. Teachers of Hai Sing are exemplary in their love for teaching and in moulding students to be persons of character and resilience. Teachers are role models of learning and life long learning. They employ the latest technology to better engage students in learning while remaining accessible to students who need extra help after school. The school is also recognized for its innovative culture, its teaching methods and emphasis on discipline and values. Together with parents and alumni as partners, Hai Sing Catholic School is poised to meet the challenges ', 'PASIR RIS MRT', '3,  6,  12,  17,  21,  89,  354,  358', 'na', '65827864', 'No', 'The school offers the Applied Learning Programme (ALP)in Robotics and Engineering which nurtures 21st Century Competencies in Critical & Inventive Thinking. The ALP comprises the Robotics Proficiency Programme, the Science Inquiry and Applied Mathematics Modelling Programme, and the Design Engineering Programmes. Students have been recognised internationally for their achievements in Robotics. The school\'s Learning for Life Programme (LLP), Developing Leadership Competencies in Every HaiSian, nurtures the 21st Century Competencies in Communication, Collaboration & Information skills in our students. Students develop their leadership potential through the Community Youth Leadership Programme. The school offers student-centric and values-driven programmes to develop Confident, Independent, Adaptable, and Gracious HaiSians. The HAI Experiential Week, Hai Aesthetics Programme and National Youth Achievement Award (NYAA) Programme, Project I together with the Future Problem Solving and Mathematics Olympiad Programmes, enrich the learning experiences. Overseas trips to China, Japan and Malaysia imbue our students with Civic Literacy, Global Awareness and Cross-Cultural Skills. The School educates HaiSians to protect the environment through its nationally-recognised 3R Programmes like the Hai Mangrove Digital Trail. Supplementary academic programmes provide learning support for students who need special coaching.', 'MR ANG TECK SIANG DANIEL', 'Chinese', 'CO-ED SCHOOL', 'Rooted in Truth and Charity, nurtured for academic, aesthetic, physical, social and moral growth.', 'na', 'With God in our presence, we strive to create a family of compassionate persons imbibed with integri', 'No', 'SINGLE SESSION', 'HAI SING CATHOLIC SCHOOL', 'PASIR RIS', '9 PASIR RIS DRIVE 6', 'Malay', 'na', 'EAST', '338', 'http://www.haisingcatholic.moe.edu.sg/'),
(340, '62561366', 'No', 'Tamil', 'na', '309919', 'GOVERNMENT-AIDED SCH', 'MR TAN WHYE WEE JEFFREY', 'MRS AW MENG YIN', 'SECONDARY', 'acsbr@moe.edu.sg', 'No', 'SOUTH 3', 'na', 'Anglo-Chinese School (Barker Road) belongs to the ACS family of schools. Established in 1994 as a school of Hope for our feeder boys who desired a continued ACS education in a secondary school, we have been consistently moving towards our aspiration to be a school of Excellence. As a Methodist institution, we inculcate the core values of Respect, Integrity, Commitment and Excellence in our students. We believe that our students have the potential to excel and provide opportunities for them to do so through a unique ACS(BR) education that nurtures future-ready leaders.  Our double niche areas are in our Applied Learning Programme \"Developing Effective Communicators through Drama, Debates and Public Speaking\" and Lifelong Learning Programme \"Building Character through Sports and Outdoor Education\".  We offer a holistic and broad-based education that strikes a balance between the academic and non-academic, so that we can provide an environment that is happy, enriching and fulfilling.  Tru', 'NEWTON MRT, STEVENS MRT', '48, 66, 67, 170, 171, 700, 960', 'na', '62561633', 'No', '1:1 Learning Programme, Aesthetics Programme, Applied Learning Programme \"Developing Effective Communicators through Drama, Debates and Public Speaking\", Character Development encompassing Spiritual, Enterprise, Citizenship, Personal & Social Lifeskills and Service Learning, Cyber-wellness Programme, Integrated Values-In-Action programme that culminates in C21@ACS(BR) that incorporates VIA and 21st century competencies, Highly Effective Youth! Programme, Level Camps, Lifelong Learning Programme \"Building Character through Sports & Outdoor Education\", Sports Education Programme, Student mentoring by staff, Swimming and Flippa Ball Programme, Study Skills Modules, Talent Development Programme and Whole school Approach to Effective Communication.', 'MR TAN CHONG TZE, PETER', 'Chinese', 'BOYS\' SCHOOL', 'Generations of educated men who are God-fearing and growing in Grace.', 'na', 'Touch Hearts, Empower Minds, Enrich Souls', 'No', 'SINGLE SESSION', 'ANGLO-CHINESE SCHOOL (BARKER ROAD)', 'NOVENA', '60 BARKER ROAD', 'Malay', 'na', 'SOUTH', '339', 'http://acsbr.net/'),
(341, '64414690', 'No', 'na', 'na', '487012', 'GOVERNMENT-AIDED SCH', 'MR JOHN WU YIFAN', 'MR GOH CHIN WEI', 'SECONDARY', 'AHS@MOE.EDU.SG', 'Yes', 'EAST 4', 'na', 'Anchored on the school philosophy \'Every Child Has Talent, Every Child Can Excel\', the school provides all students with a rich learner-centered, holistic educational experience, with the aim of stretching every student\'s potential in the Cognitive, Leadership, Aesthetics, Moral,  Physical and Social domains. In nurturing the whole child, the school places emphasis on leadership and talent development to build the personal capacity of each child. In addition, students are equipped with life skills to be confident communicators, active collaborators and critical thinkers. As a Special Assistance Plan (SAP) school, the school offers a bicultural learning environment with strong emphasis on the learning of the Chinese language and culture premised on strong values and active citizenry. Besides offering a quality 4-year instructional programme, the school also has a robust and vibrant CCA programme and Student Development Co-curriculum to nurture good character and develop 21st century com', 'TANAH MERAH MRT', '2, 9, 12, 14, 24, 31, 35, 38, 45', 'MR SEAH THIAM SIONG', '62414866', 'No', 'The following programmes are offered to all students: The AHS CHAMPS (Cognitive, Headship, Aesthetics, Moral, Physical and Social) Talent Development Programme is a holistic four-year programme comprising curriculum electives and diverse opportunities for students to develop leadership competencies and specialised skills. The Anglican Critical Thinking Skills (ACTS) Curriculum, Design Thinking Programme, Appreciation of Chinese Culture Programme, Dynamic Science, Innovative Thinkers Self-Directed Learners & Collaborative Researchers (i-ScoRe) Programme, Overseas Learning Programme, Student Leadership Programme, IGNITE Elective Modules, and tiered Arts Education Programme further provide for the holistic development of all students. Learning at AHS is enhanced by the purposeful integration of ICT, tapping on its affordances to develop 21st century competencies in all students.', 'MDM LEE WEE LIN MAUREEN', 'Chinese', 'CO-ED SCHOOL', 'Where Talents Soar: Bicultural Scholars, Accomplished Achievers, Honourable Leaders', 'na', 'To nurture creative thinkers, lifelong learners and compassionate leaders who uphold tradition and a', 'Yes', 'SINGLE SESSION', 'ANGLICAN HIGH SCHOOL', 'BEDOK', '600 UPPER CHANGI ROAD', 'na', 'na', 'EAST', '340', 'http://www.anglicanhigh.moe.edu.sg'),
(342, '64561322 (Secondary)', 'Yes', 'na', 'MR TAN PERRY', '579767', 'GOVERNMENT-AIDED SCH', 'MISS YAP AI LI', 'MRS KOH KWANG HOON NEE TAN', 'MIXED LEVEL', 'chs@moe.edu.sg', 'Yes', 'NORTH 3', '64589869 (Primary)', 'Founded in 1935 by the late Rev. Fr. Edward Becheras, Catholic High School is one of Singapore\'s highly regarded institutions under the auspices of the Catholic Archdiocese. As a Special Assistance Plan (SAP) school, CHS is grounded in the philosophy of bilingualism and biculturalism. As a Catholic mission school, love is the motivation behind all our actions. We ensure there is Joy of Learning in school life, and that students develop a Mindset of Excellence. The school\'s core values underpin every member\'s attitude, actions and aspirations. Our heritage, alumni and parent support group are the strengths that our school draws upon for our model of education, where every student is a Leader, Gentleman and Bilingual Scholar in the making. Offering the unique dual-track model with both the O-Level and Integrated Programmes, the CHS experience offers a curriculum strong in academic distinction, leadership and character development, and sports and aesthetics excellence. Our IP students wil', 'BISHAN MRT', '13, 52, 54, 88, 156, 162, 162M, 410', 'MR LAK YAU HUI', '64582177 (Secondary)', 'Yes', 'CHS\' model of Leader-Gentleman-Bilingual Scholar Curriculum includes development platforms such as :  <1> LEADER --- Student Leadership Development Programme, Sports and Rugged Enrichment Programme, Overseas Immersion Programme, Meet-The-People Attachment, World Readiness Programme.  <2> GENTLEMAN --- Music Elective Programme (MEP), Aesthetics Talent Management Programme, \'A Day in the Making of a Gentleman\' Programme, Passion Pursuits Programme, Student Sports Leaders Award Scheme, Sports Participation Programme, Rugged Outdoor Programme.  <3> BILINGUAL SCHOLAR --- MOE Bicultural Studies Programme, SAP Flagship Programme, Humanities Talent Development Programmes, Singapore Mathematics Olympiad, Mathematical Modelling, Mathematics Research Programme, Science Mentorship Programme, Singapore Seminar.', 'MDM SOH LAI LENG MAGDALEN', 'Chinese', 'BOYS\' SCHOOL', 'The Catholic High student is a leader, gentleman and bilingual scholar of high integrity and robust ', 'MISS HO PING PING', 'To establish Catholic High School as a school of distinction in innovative and challenging programme', 'Yes', 'SINGLE SESSION', 'CATHOLIC HIGH SCHOOL', 'BISHAN', '9 BISHAN STREET 22', 'na', '64593938 (Primary)', 'NORTH', '341', 'http://www.catholichigh.moe.edu.sg/'),
(343, '67587397', 'No', 'Tamil', 'na', '768547', 'GOVERNMENT-AIDED SCH', 'MDM ELSIE TAN SER HONG', 'MRS CHONG LAI PENG NEE YEO', 'SECONDARY', 'cchys@moe.edu.sg', 'No', 'NORTH 2', 'na', 'Chung Cheng High School (Yishun) offers a quality values-driven holistic education that grows our students to be responsible, respectful, courageous and inquiring learners with a mindset for excellence.  Our students are caring individuals who contribute to the local, national and global community.  Displaying the school values \'Knowledge with Responsibility, Humanity with Respect and Courage with Integrity\', students are disciplined and diligent in the pursuit of knowledge.  They are responsible and discerning when seeking to acquire knowledge.  They are keen learners who are ready to deal with 21st century challenges.  Being compassionate, caring and grateful, they proactively contribute to improving the lives of others.  Our students will embrace change, seize opportunities and be willing to take calculated risks so as to overcome challenges with courage and resilience.  Through self-reflection for continuous improvement, they are courageous to stand up for what is right and demonst', 'KHATIB MRT', '85, 811, 812, 851, 852, 853, 854, 855, 858, 965, 969', 'na', '67583912', 'No', 'The school is implementing greater flexibility in subject offering at lower secondary levels.  Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results.  Beyond the start of Secondary 1, students can also do so if they do well in those subjects. The school\'s Learning for Life Programme \'Developing Character by understanding Chinese culture and values through Aesthetics\' imbues in all students a deeper understanding and appreciation of Chinese culture, values and philosophy through music and the arts.  They will develop critical thinking skills and advanced skills in communication, interpretation and perception related to music and the arts.  It complements the school-designed Dizigui curriculum that includes the teaching of Chinese morals and values to all our students. The school\'s Applied Learning Programme \'Developing Analytical, Research, Communication and Interpersonal Skills through Food Science and Technology\' equips our students with the scientific knowledge and skills, as well as 21st century competencies, to develop an interest in the area of food processing, security and safety, focusing on developing scientific literacy in our students.', 'MR YAP THIAM CHUAN', 'Chinese', 'CO-ED SCHOOL', 'A Premier And Prestigious School', 'na', 'To instill desired values in our students and develop their potential so that they will achieve exce', 'No', 'SINGLE SESSION', 'CHUNG CHENG HIGH SCHOOL (YISHUN)', 'YISHUN', '11 YISHUN STREET 61', 'Malay', 'na', 'NORTH', '343', 'http://www.chungchenghighyishun.moe.edu.sg'),
(344, '62831737', 'No', 'Tamil', 'na', '534786', 'GOVERNMENT-AIDED SCH', 'MR NG CHENG SONG JEREMY', 'MR CHUA PUAY WEE ERIC', 'SECONDARY', 'HIHS@MOE.EDU.SG', 'No', 'SOUTH 1', 'na', 'A Catholic mission school with more than 120 years of history, we provide a holistic educational experience, centred on developing performance, ethic and service characters. Our students thrive in a culture of care and excellence in a God-centred environment, supported by strong teacher-student relationships. We believe in bringing out the leader in every child in preparation for service to the home, school, nation and world. Staff and students are guided by the school values of Humility, Integrity, Respect and Love.', 'HOUGANG MRT', '27, 72, 74, 80, 87, 89, 101, 107, 113, 116, 119, 132, 136, 147, 153, 161, 165, 324, 325', 'MISS KOH PIA CHIN ELIZABETH', '62833381', 'No', 'We offer the Applied Learning Programme in \'Journalism & Broadcasting\' in Chinese and English to develop critical thinking skills, communication skills,and global and social awareness. Through their voices, our students can influence society and build a nation that is compassionate, caring and forward-looking. The programme further provides a good foundation for those interested in pursuing a career in the media industry. The school also offers a Learning for Life Programme (Good Samaritan Programme) which focuses on community and youth leadership development. We believe our students are able to lead by example, and can lead others in both actions and thoughts. The Good Samaritan Programme is slanted towards providing service to the community in the form of Values In Action projects across levels. Students also have opportunities to work with external agencies in planning for community projects, and organising the school\'s Teens Conference. Students can build their strengths through other academic and co-curricular programmes: the Science Research Programme, Mathematics Olympiad, Advanced Elective Modules, Elective Modules for Normal Academic and Normal Technical students, NTerprise Programme, Religious & Moral Education, Overseas Values In Action Programme, Level Camps, Sports Carnival, Road Run, Level Games, etc. The school is implementing greater flexibility in subject offering at lower secondary levels. Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR YAP WAI MENG', 'Chinese', 'CO-ED SCHOOL', 'A community with Courage to Lead, Compassion to Serve.', 'na', 'To nurture students to be compassionate and morally upright citizens committed to serving God and so', 'No', 'SINGLE SESSION', 'HOLY INNOCENTS\' HIGH SCHOOL', 'HOUGANG', '1191 UPPER SERANGOON ROAD', 'Malay', 'na', 'SOUTH', '344', 'http://www.holyinnocentshigh.moe.edu.sg'),
(345, '62886905 (Sec)', 'No', 'na', 'MR KUEK JOO LENG', '368051', 'GOVERNMENT-AIDED SCH', 'MR TAN CHING HUAT', 'MR EDWIN ONG YOKE YAM', 'MIXED LEVEL', 'msh@moe.edu.sg', 'Yes', 'NORTH 4', '62827743 (Pri)', 'Maris Stella High School is an autonomous all-boys Catholic school committed to educating Marists holistically and anchored in the Marist values.  As one of the first SAP schools in Singapore,  we seek to educate Marists to have bicultural sensitivity, steep in traditional Chinese values with a global outlook, ready for the future.  As an all-boys school, we adopt a boy-centred approach focussing on sports, outdoor education, the Sciences and ICT in our school-wide programmes, whilst supporting individual interests of Marists, to bring out the best in them. We further inculcate the School Values of Diligence, Determination, Loyalty and Dedication, and Courage in Marists so that they are equipped with the attitudes and competencies to become contributing members of society. Caring teachers and strong programmes geared towards building school spirit anchor the learning experiences of Marists.', 'BARTLEY MRT', '28, 93, 100, 135, 155, 158', 'MRS MARIA KOH', '62803880 (Sec)', 'No', '1-to-1 Learning Programme; Life-Science Research Programme; Singapore Mathematics Olympiad; Inter-disciplinary Project Work; Public Speaking Programme; School Ambassadors to develop Effective Communicators; Digital Video Production; Scratch Programming; Leadership Development Programme; Chinese Cultural Appreciation (local and overseas); Student Immersion in Twinning Schools in Xi\'An; Values & Life-skills Education Programme; Sec 1 Orientation Camp; Sec 2 Adventure Camp; Sec 3 Team Building Camp; Outdoor Expeditions including Kayaking, Rock-climbing; Rigorous CCA training.', 'MRS WOO SOO MIN', 'Chinese', 'BOYS\' SCHOOL', 'Aspiring Learners, Inspiring Leaders and Educators, Quality Systems, Dynamic Environment', 'MR TAN KIM KOON', 'The holistic development of each Marist that blends faith, culture and life with respect to his huma', 'Yes', 'SINGLE SESSION', 'MARIS STELLA HIGH SCHOOL', 'TOA PAYOH', '25 MOUNT VERNON ROAD', 'na', '62827905 (Pri)', 'NORTH', '345', 'http://www.marisstellahigh.moe.edu.sg/'),
(346, '64897970', 'No', 'na', 'na', '545079', 'GOVERNMENT-AIDED SCH', 'MDM CHOW NYET YOON', 'MR TAY HIANG SOON', 'SECONDARY', 'NCHS@MOE.EDU.SG', 'Yes', 'NORTH 4', 'na', 'In NCHS, we believe that every student has unique talents and abilities that can be developed and he/she can learn and achieve if emotional and physical needs are met. We seek to provide a quality school experience to enable every student to develop their character and stretch their potential. Focussed on student-centred learning, our Teaching & Learning Framework harnesses ICT to enhance learning and equip our students with 21st century life skills and competencies. We offer a conducive and caring environment, and have committed and nurturing teachers who believe in setting high expectations, providing authentic and experiential learning experiences, and inspiring our students to excel in their academic performance, character and leadership development, and CCAs. Over the years, our students have done well in both the academic and non-academic domains. Their success has affirmed our continuous effort in striving for excellence to provide a quality holistic education for all our studen', 'SENGKANG MRT, RENJONG LRT, TONGKANG LRT', '43, 83, 85, 109, 156, 159, 161, 163, 372', 'na', '64897971', 'No', 'Our SAP Bicultural & Flagship Programme is designed with the theoretical underpinning of Howard Gardner\'s \"Five Minds for the Future\", with an additional unique sixth mind, the \'Bicultural Mind\'. The programme aims to groom future leaders who are bilingual and well versed in the Chinese language and culture, and have a deep appreciation of other cultures so that they are able to make strong and meaningful connections with the World. These objectives are also strengthened by our Global Classroom Programme which broadens our students\' minds through the 4 domains: Bicultural Learning, Talent Development, Service Learning and Immersion & Exchange. NCzens are thus groomed to be world-ready, and to possess the meritorious Cultural Intelligence. The Learning for Life Programme (LLP) provides a unique cognitive-aesthetic domain of learning through Drama-in-Education, Public Speaking, Debate, Puppetry and Creative Lyrical Composition. The Programme encourages students\' self-expression, nurtures their aesthetics appreciation and allows them to learn to embrace cultural diversity. In the Applied Learning Programme (ALP), students explore using Arduino Microcontroller in health Science and technology. Students also learn Science research skills to deepen their Disciplined Mind in Science.The school-wide Service Learning Programme provides opportunities for NCzens to learn to lead, serve and inspire others.', 'MR TAN YEE KAN', 'Chinese', 'CO-ED SCHOOL', 'A Distinctive Institution of World-Ready Thinkers and Leaders', 'na', 'To broaden the minds of NCzens, nurturing bicultural learners who lead, serve and inspire', 'No', 'SINGLE SESSION', 'NAN CHIAU HIGH SCHOOL', 'SENG KANG', '20 ANCHORVALE LINK', 'na', 'na', 'NORTH', '346', 'http://www.nanchiauhigh.moe.edu.sg'),
(347, '64667564', 'Yes', 'na', 'na', '288683', 'INDEPENDENT SCHOOL', 'MRS WHANG AI LEE', 'MRS CHEK-LIM LAM ENG', 'SECONDARY', 'NYGHS@MOE.EDU.SG', 'Yes', 'WEST 6', 'na', 'Nanyang Girls\' High School is a school with a rich tradition and illustrious history. The school was founded in 1917, with the belief that girls deserve to be educated and that, with education, they can make the world a better place for others. This belief is espoused through our school vision, mission and values.   We have a forward-looking, personalised and connected curriculum anchored in values that seek to develop our students to be reflective, responsive and responsible learners, equipped with the knowledge, skills and attributes for the 21st century.  The Nanyang experience engages our students in authentic and relevant learning that allows them to create meaningful, useful and shared outcomes.  The curriculum is personalised, allowing students to exercise choice according to their interest and ability.  Students will be able to make meaningful connections within and between disciplines, and develop a heart for the community by paying forward through active service.   We also ke', 'SIXTH AVENUE MRT, TAN KAH KEE MRT', '66, 67, 74, 151, 154, 156, 157, 170, 171, 174, 852, 961', 'na', '64663275', 'Yes', 'Nanyang Seal of Excellence Talent Development Programme  - Four-Tier Chinese Language and Culture Programme which includes Bicultural Studies (Chinese) and Chinese Language Elective Programme . Humanities Programme . Science and Mathematics Talent Programme . Leadership Development . Art Elective Programme (AEP) . Higher Music Programme (HMP)  Other programmes that further enrich the students\' holistic learning experience include: . The Connected Curriculum . The Personalised Curriculum . Global Classroom Programme . Work Experience Programme . Extended Classroom Programme . Boarding School Experience . Conversational Malay . Community Education and Community Leadership Programme . Philosophical Inquiry . Research Programme . Translation . Drama . Conversational Malay  Third Language - NYGH offers Malay Special Programme', 'MDM HENG BOEY HONG', 'Chinese', 'GIRLS\' SCHOOL', 'Every Nanyang Girl a Respected Member of Society', 'na', 'We nurture women of character in a bilingual bicultural environment anchored in values on which our ', 'No', 'SINGLE SESSION', 'NANYANG GIRLS\' HIGH SCHOOL', 'BUKIT TIMAH', '2 LINDEN DRIVE', 'na', 'na', 'WEST', '347', 'http://www.nygh.moe.edu.sg/'),
(348, '68992668', 'No', 'Tamil', 'na', '609561', 'SPECIALISED SCHOOL', 'MR HO KUM FAI', 'MR SUBASH LAZAR', 'SECONDARY', 'info@crestsec.edu.sg', 'No', 'WEST 8', 'na', 'Crest Secondary School\'s vision underscores our firm belief in our students\' potential to succeed in their areas of strength and passion, and to realise their aspirations. As a Specialised School for Normal (Technical) students, we offer a customised four-year curriculum that integrates both academic learning and vocational training. Learning is practice-oriented, with an emphasis on skills development to prepare our students for progression to the Institute of Technical Education (ITE) for post-secondary learning and for future employment. Industrial attachment is an important component of the holistic learning experience. In addition, our teachers deploy innovative pedagogies to strengthen students\' literacy and numeracy skills through real-world, ICT-enriched learning contexts. The school adopts a multi-faceted approach to develop our students as well-rounded individuals, anchored in good character and equipped with the skills and social-emotional competencies to succeed in life. Th', 'BUKIT BATOK MRT, JURONG EAST MRT', '52, 98, 98M, 105, 176, 183, 187, 188, 188R, 333, 502,', 'MR MICHAEL JOHN PETER LAU CHONG LUM', '68992779', 'No', 'Vocational Taster Modules (TMs) and ISC Subjects conducted in authentic industry learning spaces; Work Experience Programme (in collaboration with industry partners); NTUC Income OrangeAid CREST Quest Student Development to strengthen social and emotional competencies; holistic development programmes e.g. Guitar, Dance & Movement, Graffiti Art, Inline Skating, Drama and Communication, Photography and Videography, Media Production; Local and Overseas Team-Bonding and Adventure Camps; Local and Overseas VIA; Overseas School Twinning Programme.', 'MR YEO KOK PENG FREDERICK', 'Chinese', 'CO-ED SCHOOL', 'Advocating a Promising Future for Every Student.', 'na', 'We are committed to providing a caring and creative learning environment that customises authentic l', 'No', 'SINGLE SESSION', 'CREST SECONDARY SCHOOL', 'JURONG EAST', '561 JURONG EAST STREET 24', 'Malay', 'na', 'WEST', '360', 'http://www.crestsec.edu.sg'),
(349, '64511335 (Secondary)', 'No', 'na', 'MR THAM WAI KONG', '569405', 'GOVERNMENT-AIDED SCH', 'MRS EUNICE LIM', 'MISS YEO TECK WOON', 'MIXED LEVEL', 'chijsng_sec@moe.edu.sg', 'Yes', 'NORTH 6', '64549698 (Primary)', 'CHIJ St. Nicholas Girls\' School has a long history with fine traditions and a strong school culture and ethos. Our students are given opportunities to develop holistically and hone their leadership competencies while being grounded in the IJ values of Truth, Justice, Freedom and Love. We emphasise character building, the pursuit of excellence, a strong family spirit, sisterly love and a bilingual culture, as embodied in our vision. Our girls are imbued with respect for individuals, dignity, humility, gratitude and compassion. The school strives to provide a unique and rigorous education to maximise the potential of each student. Besides excelling in academia, we embrace culture, the arts, music, sports and other pursuits that refine our girls into all-rounded women with the finest sensibilities. We strive to make the years a child spends in our school times to remember, and incorporate helping others and giving back to society into the very fabric of our education. Under the nurturing ', 'ANG MO KIO MRT, YIO CHU KANG MRT', '76, 265, 268, 269', 'MR LOH CHIH HUI', '63541839 (Secondary)', 'Yes', 'Our Joint Integrated Programme, developed collaboratively with Catholic High School and Singapore Chinese Girls\' School, aims to nurture a community of leaders who exhibit the highest levels of distinction in their acquisition and mastery of 21st century competencies. It is our vision that they will grow into young leaders of principle, integrity and discernment, who zealously seek to impact lives in positive and ethical ways. IP students will spend their first 4 years in CHIJ St. Nicholas Girls\' School before progressing to Eunoia Junior College to complete the IP. As a Special Assistance Plan (SAP) school, we also offer bilingual and bicultural learning opportunities including a Translation Programme and the Bicultural Studies Programme (Chinese) [BSP(C)], which nurture our girls\' bicultural awareness and enhance their mastery of the Chinese language. Other programmes offered include the Music Elective Programme (MEP), Student Leadership Programme, Talent Development Programmes, Job Attachment Programme, Cultural Intelligence for Teens, Life Sciences Programme, Science Mentorship Programme, Chemistry & Physics Olympiads and Mathematics Olympiad Programme.', 'MDM FIONA YEO SU LING', 'Chinese', 'GIRLS\' SCHOOL', 'Girls of Grace, Women of Strength, Leaders with Heart', 'MS BAEY EE-LYN', 'The creation of a Christ-centred school community where all work together for the promotion of truth', 'Yes', 'SINGLE SESSION', 'CHIJ ST. NICHOLAS GIRLS\' SCHOOL', 'ANG MO KIO', '501 ANG MO KIO STREET 13', 'na', '64566169 (Primary)', 'NORTH', '348', 'http://www.chijstnicholasgirls.moe.edu.sg'),
(350, '62543080', 'No', 'Tamil', 'na', '319759', 'GOVERNMENT-AIDED SCH', 'MDM LEE SWEE MEI CHERYL', 'MDM LYNETTE FERNANDEZ', 'PRIMARY', 'MMCS@MOE.EDU.SG', 'No', 'SOUTH 3', '62566532', 'na', 'Braddell MRT Station or  Caldecott MRT Station', '141, 235', 'MDM CHRISTINA TEE SIEW PING', '62566701', 'No', 'Character and Citizenship Education (CCE)Programme  Programme to Excite, Experience and Enrich (PE3 Programme)  Arts Programme  Rhythmic Gymnastics Programme', 'MRS ALLISON LIM', 'Chinese', 'GIRLS\' SCHOOL', 'Ladies of compassion, eloquence and intellect with GOD as our shepherd', 'na', 'We are committed to reaching out with compassion and respect and empowering each person to develop h', 'No', 'SINGLE SESSION', 'MARYMOUNT CONVENT SCHOOL', 'TOA PAYOH', '430 LORONG 1 TOA PAYOH', 'Malay', 'na', 'SOUTH', '349', 'HTTP://WWW.MARYMOUNTCONVENT.MOE.EDU.SG');
