(351, '67454492', 'No', 'na', 'na', '408940', 'GOVERNMENT-AIDED SCH', 'MR HO MINGDA', 'MDM HENG WEI SHAN', 'SECONDARY', 'manjusri_ss@moe.edu.sg', 'No', 'EAST 7', 'na', 'We nurture all Manjusrians to be confident, independent and empathetic persons who are committed to life-long learning and have the moral courage and dedication to serve the community and the nation. We achieve this by ensuring that Manjusrians, as learners and leaders, are able to make decisions based on sound fundamental beliefs and principles. We aspire for them to understand and appreciate the importance and impact of worldwide interconnectedness while remaining rooted to Singapore. Guided by our school motto \'Wisdom, Conduct, Benevolence, Aspiration\', we pride ourselves in providing a customised, holistic curriculum to foster both excellence and ethics, and to imbue in our staff and students the values of Respect, Integrity, Care and Excellence. We adapted Building Learning Power to systematically cultivate habits and attitudes in our students so that they become better learners and are able to face difficulty and uncertainty calmly and confidently.', 'EUNOS MRT, MACPHERSON MRT', '5, 8, 15, 22, 25, 45, 51, 55, 59, 61, 63, 65, 66, 93, 94, 854', 'na', '68424558', 'No', 'Since 2014, the school initiated the Building Learning Power approach to integrate character education and academic learning. Through the direct instruction of learning dispositions, students acquire good habits and values. This enables the students to learn better and instil good character in them, preparing them to face difficulty and uncertainty calmly and confidently in the future. Our Applied Learning Programme (ALP) - \"Building a Smart Home with a Big Heart\" aims for students to learn about the science of SMART Technologies, and understand its application in a SMART home system. Students will be required to propose innovative ways on how the safety and security of the elderly can be monitored and improved. This exemplifies the values-driven education of our school to enable students to promote a keen interest in the nation\'s development towards a more vibrant and caring society for generations to come. Our Learning for Life Programme (LLP) - \"Learning Through the Arts\" aims to develop students\' appreciation for various art forms. Students will have opportunities to experience arts as audience and participants and develop an interest and appreciation for the arts. The school started a Taipei Exchange Programme in 2015 to develop students global awareness and cross-cultural skills. There is also Reading Programme to inculcate good reading habits. With these programmes in place, our students are developed holistically and ready to take on challenges in life.', 'MR SIM CHONG BOON', 'Chinese', 'CO-ED SCHOOL', 'Passionate Learners, Compassionate Leaders', 'na', 'Nurturing Manjusrians who are anchored in values whilst global in perspective', 'No', 'SINGLE SESSION', 'MANJUSRI SECONDARY SCHOOL', 'GEYLANG', '20 UBI AVENUE 1', 'Malay', 'na', 'EAST', '350', 'http://www.manjusrisec.moe.edu.sg'),
(352, '64543430', 'No', 'Tamil', 'na', '569845', 'GOVERNMENT-AIDED SCH', 'MR LOH KOK NIAM VINCENT', 'MISS YEW MEI FOONG SARAH', 'SECONDARY', 'presbyterian@moe.edu.sg', 'No', 'NORTH 6', 'na', 'The school\'s vision is to develop our students to be Promise-Keepers, Hope-Builders and Servant-Leaders. To this intent, the school places emphasis on nurturing and developing good character as well as harness the leadership potential in every child; inculcating in them a sense of gratitude and responsibility to the community and nation. To achieve our mission to develop \"A Total Person Worthy of God and Man\", the school provides a  holistic education that seeks to engage students to participate fully in CCA and Student Leadership programmes. The school provides a Christian environment where there is a strong culture of teamwork, learning, excellence, care and self-discipline in the school.', 'YIO CHU KANG MRT', '45, 70, 76, 86, 128, 529, 668, 733, 825, 851, 852, 853', 'MDM POH LYE IMM', '64543722', 'No', 'The school leverages on its Learning for Life Programme (LLP) to support its vision to develop students to be \'Promise-Keepers, Hope-Builders and Servant-Leaders\'. All students will undergo customised LLP modules which are based on the Servant-Leadership model by Robert Greenleaf. In tandem with the school\'s Character First Programme, PHS seeks to harness the potential in every student to be the best that he/she can be. For Community Youth Leadership (CYL), the focus is on providing students with opportunities to be leaders of empathy as they lead in serving the community with a purpose. These programmes collectively develop the mental, physical and emotional wellness to give our students a firm foundation from which they can optimise their performance in their academic pursuit, CCAs and other school activities. The school\'s Applied Learning Programme (ALP) in Forensic & Pharmaceutical Science seeks to engage and excite our students in the learning of Science and enable students to experience how Science is applied in real life.  Through forensic science, the ALP taps on students\' interest in learning the Science behind crime scene processing, through an array of hands-on activities.  Students will also be taught to appreciate the ethics behind forensic science. The school is implementing greater flexibility in subject offering at lower secondary levels.  Eligible N(A) and N(T) students can take some subjects at a higher level starting from Secondary 1, based on their PSLE results. Beyond the start of Secondary 1, students can also do so if they do well in those subjects.', 'MR OWYONG TUCK SING VICTOR', 'Chinese', 'CO-ED SCHOOL', 'PHS honours GOD in mentoring Promise - Keepers, Hope - Builders and Servant - Leaders to bless their', 'na', 'Our mission is to inculcate Christian values in every individual and develop his potential as a tota', 'No', 'SINGLE SESSION', 'PRESBYTERIAN HIGH SCHOOL', 'ANG MO KIO', '5209 ANG MO KIO AVENUE 6', 'Malay', 'na', 'NORTH', '351', 'http://www.presbyterian.moe.edu.sg'),
(353, '67797482', 'No', 'Tamil', 'na', '139649', 'GOVERNMENT-AIDED SCH', 'MR LIM YONG CHAI ALAN', 'MR LIM SIN HENG', 'SECONDARY', 'FMSS@MOE.EDU.SG', 'No', 'SOUTH 2', 'na', 'Fairfield is a Methodist school built on the foundation of God\'s love. Founded in 1888 by a missionary, Miss Sophia Blackmore, the school provides a holistic education based on Christian values. We believe that God places students in our school for a special reason. Hence we are committed to helping all students develop their talents to the full, and nurture the four Fairsian Outcomes of wisdom, personhood, commitment to community and heart of service. The Fairfield curriculum is undergirded by the WHEEL philosophy to provide Fairsians with holistic, enriched and experiential learning. We strongly believe that education should go beyond the boundaries of the syllabuses and that students should be given a chance to explore beyond the classroom. We also believe that students should be engaged in meaningful and authentic experiences so that deep learning can occur when they reflect, connect the dots and seek to apply what they have learned in a real world context. The Fairfield curriculum', 'BUONA VISTA MRT, ONE-NORTH MRT', '33,14,74,166,196', 'MR KOH HOW THIM', '67788702', 'No', 'Aligned with the WHEEL philosophy, one signature programme of the school is the Fairfield Learning Experience (FLEX) week which is set aside for students to learn outside the classroom. During this week, the different levels of students are exposed to various aspects of holistic education: Aesthetics and Culture in Sec 1, Outdoor Education in Sec 2, Values-in Action in Sec 3 and Educational and Career Guidance in Sec 4. Other key programmes include:- Learner-Centric Academic Programme: Create and Construct using IT (Lower Sec), Life Science Programme, Inter-disciplinary River Study Project, Community Problem-Solving Project; Character & Citizenship Education Programme: Values Education (Chapel and Devotion), Lifeskills, Make-me-a-Blessing Projects, Advanced Leadership Training, Trips for International Experience; Aesthetics Education Programme: Arts Assembly, Talent Showcase, Watch-a-Play, Cultural and Aesthetics Learning Journeys;  Physical and Outdoor Education Programme: Fairfield Games Day, Outdoor Adventure Camp.', 'MISS CHEN LI YING AUDREY', 'Chinese', 'CO-ED SCHOOL', 'A Vibrant Community of Active Lifelong Learners and Influential Leaders', 'na', 'To provide a holistic education in a Christian environment to nurture leaders of good character who ', 'Yes', 'SINGLE SESSION', 'FAIRFIELD METHODIST SCHOOL (SECONDARY)', 'QUEENSTOWN', '102 DOVER ROAD', 'Malay', 'na', 'SOUTH', '352', 'http://www.fairfieldsec.org'),
(354, '67840453', 'No', 'Tamil', 'na', '529283', 'GOVERNMENT-AIDED SCH', 'MR TAN KOCK LEONG', 'MR LEONG TSHUN KHONG PAUL', 'SECONDARY', 'nass@moe.edu.sg', 'No', 'EAST 6', 'na', 'Ngee Ann Secondary is committed to be an Excellent School of the Future that develops Future Ready NASians. Students are developed to be Thinkers with Vision, Leaders of Character, and Citizens who Serve. We inculcate in students the values of Respect, Responsibility, Resilience, Care, Commitment and Integrity. As the student is the focus in Ngee Ann Secondary, programmes, activities and events are designed to be Extraordinary Experiences to meet the needs and interests of all our students. As a leading school in the use of ICT for teaching and learning, our teachers are at the forefront of pedagogical innovations, and engage students in learning through the innovative and effective use of ICT. The success of our school is largely attributed to the strong support from our parents, alumni and partners, as well as the commitment of all staff - together, we believe in doing our utmost for our students.', 'TAMPINES MRT, SIMEI MRT', '3, 4, 8, 9, 12, 17, 18, 19, 21, 28, 34, 37, 38, 39, 81, 291, 291P, 293, 293P, 518, 552', 'na', '67844583', 'No', 'Ngee Ann Secondary offers a plethora of learning experiences to develop our students to be global citizens of the future. To encourage self-directed learning, our school offers 1-to-1 computing where students bring a personal learning device for lessons. Our SPARKS Talent Development Programme stretches students with potential in Mathematics and Science. Students who have a flair for the English Language are challenged and developed through our Humanities (CHAMPS) Programme. As a school offering the Enhanced Art Programme, we develop in students a love for and mastery of art and design. Other unique student experiences offered by the school include learning about Social Etiquette & Fine Dining, Programming, Innovation & Entrepreneurship Training, and Traditional Chinese Medicine. Our students acquire leadership skills through local and overseas Adventure Camps and Leadership Training Camps. Students also have opportunities to participate in overseas exchanges and cultural programmes for global exposure, as well as international competitions. We provide a range of platforms for students to discover their talents in sports and the performing arts, including lunchtime concerts and NASlympics.', 'MR LIM TSUN KHEE ALBERT', 'Chinese', 'CO-ED SCHOOL', 'An Icon of Excellence and the Pride of the Community.', 'na', 'Building Character, Expanding Minds, Shaping Lives.', 'Yes', 'SINGLE SESSION', 'NGEE ANN SECONDARY SCHOOL', 'TAMPINES', '1 TAMPINES STREET 32', 'Malay', 'na', 'EAST', '353', 'http://www.ngeeannsec.moe.edu.sg'),
(355, '67662100', 'No', 'Tamil', 'na', '737913', 'SPECIALISED INDEPENDENT SCHOOL', 'MR HO BENG KIAT', 'MR. CHUA CHOON SENG', 'MIXED LEVEL', 'enquire@sportsschool.edu.sg', 'No', 'NORTH 8', 'na', 'The Singapore Sports School provides an athlete-friendly environment for youth athletes to pursue sports at the highest level and undertake a flexible and rigorous academic programme concurrently. Our sports development programme is committed to the principles of Long-Term Athlete Development and aims to optimise the potential of our student-athletes as well as encourage their life-long involvement in sports. The programme is based on an athlete-centric, coach-directed and sport science-supported approach. The extended through-train academic pathways which are uninterrupted by national examinations allow talented student-athletes to fully develop in their sports.', 'Woodlands MRT', '900A, 901', 'MISS LOW YING XIU', '67660100', 'No', 'Academy sports: Badminton, Bowling, Fencing, Football, Golf, Netball, Shooting, Swimming, Table Tennis and Track and Field   Other sports currently offered: Archery, Equestrian, Gymnastic, Sailing, Silat, Synchromised Swimming, Tennis and Triathlon', 'MR TAN TECK HOCK', 'Chinese', 'CO-ED SCHOOL', 'Nurturing Learned Champions With Character', 'na', 'Every student-athlete a Champion', 'No', 'FULL DAY', 'SINGAPORE SPORTS SCHOOL', 'WOODLANDS', '1 CHAMPIONS WAY', 'Malay', 'na', 'NORTH', '354', 'http://www.sportsschool.edu.sg'),
(356, '67756910', 'No', 'Tamil', 'na', '129957', 'SPECIALISED INDEPENDENT SCHOOL', 'MR CHANG WENG FATT', 'MR GOH HOCK LEONG', 'MIXED LEVEL', 'einstein@highsch.nus.edu.sg', 'No', 'WEST 1', 'na', 'na', 'Nearest MRT Stations - Clementi and Dover', '96, 97, 151, 183, 188, 196, 197, 198', 'MISS LIM HUI WEN', '65161709', 'Yes', 'Boarding Da Vinci Einstein + (NUS High School Talent Development Programme) Internationalisation Socrates Aesthetic Appreciation Student Leadership', 'MRS LEE BEE YANN', 'Chinese', 'CO-ED SCHOOL', 'To be a Wellspring of Inspiration for Math & Science Education and Research.', 'na', 'The NUS High School will nurture well-rounded and world-ready scientific minds to make distinguished', 'No', 'FULL DAY', 'NUS HIGH SCHOOL OF MATHEMATICS AND SCIENCE', 'CLEMENTI', '20 CLEMENTI AVENUE 1', 'Malay', 'na', 'WEST', '355', 'www.nushigh.edu.sg'),
(357, '6338 9763', 'No', 'Tamil', 'na', '227968', 'SPECIALISED INDEPENDENT SCHOOL', 'na', 'MR KOH KAI HONG', 'MIXED LEVEL', 'enquiries@sota.edu.sg', 'No', 'SOUTH 5', '6342 5857', 'na', 'Dhoby Ghaut', '7, 14, 16, 36, 64, 65, 77, 106, 111, 124, 128, 131, 147, 162, 166, 167, 171, 174, 175, 190, 502, 518', 'na', '6338 9663', 'No', 'na', 'MDM LIM GEOK CHENG', 'Chinese', 'CO-ED SCHOOL', 'Shaping and impacting society through education in the arts.', 'na', 'To create a vibrant environment for learning that is uniquely anchored in the arts, celebrating expe', 'No', 'SINGLE SESSION', 'SCHOOL OF THE ARTS, SINGAPORE', 'CENTRAL', '1 ZUBIR SAID DRIVE', 'Malay', 'na', 'SOUTH', '356', 'http://www.sota.edu.sg/'),
(358, '+ 65 62912423', 'No', 'Tamil', 'na', '327830', 'SPECIALISED SCHOOL', 'MISS AMANDA LOH', 'MDM SOH BENG MUI', 'SECONDARY', 'NorthLight@ite.edu.sg', 'No', 'SOUTH 4', 'na', 'na', 'Boon Keng (NE9)', '21,125,130,139,145,13,23,31,64,65,133,147,857,985', 'na', '+65 65806490', 'No', 'NorthLight Programme, Sports & Wellness Programme, Arts Appreciation Programme,Language & Literacy Programme, \'Math Works for Us!\' Programme, ICT Literacy Programme, Vocational Training Programme, Industrial Attachment Programme, Pre-employment Skills Training Programme', 'MR MARTIN TAN SIEW KIN', 'Chinese', 'CO-ED SCHOOL', 'A choice school of youth prepared for life and living.', 'na', 'To provide an engaging career-oriented and values-focused education for youth in preparing them for ', 'No', 'FULL DAY', 'NORTHLIGHT SCHOOL', 'MARINE PARADE', '151 TOWNER ROAD', 'Malay', 'na', 'SOUTH', '357', 'http://www.nls.edu.sg/'),
(359, '67622857', 'No', 'Tamil', 'na', '679697', 'SPECIALISED SCHOOL', 'WONG MUN FEI ALVIN', 'MDM LER SIAH WOON JULIA', 'SECONDARY', 'aps@ite.edu.sg', 'No', 'WEST 6', 'na', 'Connecting Lives, Nurturing Individualised Growth, Flourishing Through Opportunities', 'Downtown Line 2, Cashew mrt', 'SBS Transit No 170    SMRT No 67, 75, 171, 176, 178, 184, 961, 963 & 970', 'na', '68793900', 'No', 'Montfort Development Programme, iStay (Residential Programme), Physical Education, Performing Arts, Visual Arts, English Language, Mathematics, ICT, Vocational Training Programme, I-LEAP (Industrial Attachment), SIP (Skills Induction Programme)', 'MR LEONG YEW HON ERIC', 'Chinese', 'CO-ED SCHOOL', 'Every student a CARER achieving personal success', 'na', 'Assumption Pathway School is a Catholic educational institution transforming and empowering students', 'No', 'SINGLE SESSION', 'ASSUMPTION PATHWAY SCHOOL', 'BUKIT PANJANG', '30 CASHEW ROAD', 'Malay', 'na', 'WEST', '358', 'http://www.aps.edu.sg'),
(360, '(65) 68720856', 'No', 'Tamil', 'na', '138572', 'SPECIALISED INDEPENDENT SCHOOL', 'MR TAN BOON TIONG VINCENT', 'MRS CHEW EU JIN NEE LIM WAI LEE', 'SECONDARY', 'contactus@sst.edu.sg', 'No', 'WEST 5', 'na', 'The School of Science and Technology, Singapore (SST) is a Specialised Independent School that offers a distinctive 4-year GCE O-Level programme with an integrated approach to applied learning. Learning in SST is multi-faceted as students gain a strong foundation of key academic concepts in Science, Technology, Art, Engineering and Mathematics (STEM). The school-wide leverage on Information Communication Technology (ICT) greatly enhances the learning environment and provides the extended learning resources and networks that the digital natives have come to expect. As a FutureSchool, SST aims to be a forerunner in using ICT to support educational programmes and enhance the delivery of its specialised curriculum.  SST caters to students who learn best in an active applied learning environment, where conceptual understandings and transference of disciplinary content knowledge and skills are fostered through cognitively demanding hands-on applications set in real world situations. Sound af', 'Dover', '14, 74, 105, 106, 147, 166', 'na', '(65) 65717200', 'No', 'The SST Student Development Programme envisions all its students to be lifelong learners of character who are active local and global citizens and dynamic leaders in service of humanity.  A range of character, leadership and citizenship education programmes and activities are offered to complement and support the rigorous academic programme at SST for a well balanced and holistic education for all. The experiences will be presented through infusion in academic lessons, through Sports and Wellness lesson and co-curricular activity, specially organised service-learning programme such as the Youth Service Programme, Global Citizenship Programme, Interdisciplinary Research Studies, Innovation and Entrepreneurship, as well as leadership platforms such as class executive committees, class committees, Student Council and Peer Support Board.', 'MRS LINDA CHAN', 'Chinese', 'CO-ED SCHOOL', 'A global leader in transforming learning', 'na', 'To nurture passionate innovators who improve society through real-world applications of science and ', 'No', 'FULL DAY', 'SCHOOL OF SCIENCE AND TECHNOLOGY, SINGAPORE', 'CLEMENTI', '1 TECHNOLOGY DRIVE', 'Malay', 'na', 'WEST', '359', 'http://www.sst.edu.sg'),
(361, '64623928', 'No', 'Tamil', 'na', '737758', 'SPECIALISED SCHOOL', 'MR HOW PUI SENG', 'MS LIM CHENG LIAN', 'SECONDARY', 'info@spectra.edu.sg', 'No', 'NORTH 8', 'na', 'Our school\'s name, Spectra, represents the school\'s philosophy of recognising the spectrum of talents and strengths of our students. It signifies our belief that every child is different and unique. It is our goal to expand the potential of our students. We provide multiple platforms to help every student shine to the brightest. We envision a caring school culture that is affirmative and leverages the strengths of our students. There will be room for students to make mistakes, learn from them and grow, and to become special persons who make a difference to the lives of others. Our school motto, \"Together We Can\", exemplifies the \"kampung\" spirit of togetherness and collective effort. It signals our commitment to working with parents and partners to nurture and develop our students. Hence, we envision our school to be a close-knit community. We see ourselves becoming a self-sustaining and nurturing eco-system that brings out the best in those who work, study and play here.', 'ADMIRALTY MRT', '587, 904, 912, 913, 962, 964, 965, 969', 'MR LAU KHAI MENG', '64660775', 'No', 'The school\'s customised Instructional Curriculum is supported by a 1-to-1 computing programme.  Additionally the school offers Vocational Taster Modules (Retail, Hospitality, Mechanical Servicing, Facility Services) in the lower secondary curriculum.  The students specialise in one of these modules and attain the ITE Skills Certificate (ISC) as part of their upper secondary curriculum.  The ISC Programmes provide opportunities for industry experiential attachments.  There is a strong emphasis on Character Development of students in the school.  \"I Believe\" is a four-year character development programme which aims to build students\' confidence and social-emotional competencies.  Milestone programmes include Equine-Assisted Learning (EQUAL), Garden-Based Service Learning Programme, Bonding Camp (Sec 1), Adventure Camp (Sec 2), Outward Bound (Sec 3) and Cohort Overseas Cultural Immersion Programmes (Thailand/Vietnam).', 'MR KRISHNAN ARAVINTHAN', 'Chinese', 'CO-ED SCHOOL', 'Every student equipped to lead a fulfilling life.', 'na', 'A community committed to provide an engaging learning experience in a safe and caring environment so', 'No', 'SINGLE SESSION', 'SPECTRA SECONDARY SCHOOL', 'WOODLANDS', '1 WOODLANDS DRIVE 64', 'Malay', 'na', 'NORTH', '361', 'www.spectra.edu.sg');
